INSERT INTO `ntic_appointment` (`appointment_id`, `appointment`, `hour`, `atendimento`, `doctor_id`, `patient_id`, `patient_name`, `point_type`, `location_id`, `deleted`) VALUES
(16, '2014-08-04', '17:00:00', 'Fechamento de teste', 'Leticia', '715', 'Maria  Ligia Ricardo Peretto', 0, 1, 1),
(5, '2014-07-10', '15:00:00', 'Paciente veio com queixa de não estar escutando nada, receptor estava entupido de cera nos dois AASI, feito troca de cerustop. Paciente com rolha de cera bilateral, avisado que precisa remover a cera no ORL.', 'Leticia  Souza Koerich', '146', 'Aneide  Maria Ramos', 0, 1, 1),
(6, '2014-07-10', '14:30:00', 'RETIROU AASI QUE ESTAVA EM CONSERTO OS 1718, E AUMENTEI FREQ. FALA.', 'Leticia  Souza Koerich', '573', 'Teresa Gassen Ferth', 0, 1, 1),
(7, '2014-07-10', '17:00:00', 'Paciente veio com indicação do Dr. Kowalski, já tinha audiometria, PA neurossensorial de grau leve a  moderado bilateralmente. Expliquei toda a importância de utilizar agora enquanto a perda não está tão grave, pois a paciente se preocupa com estética.Teste domiciliar com Audéo S Smart III valor oferecido R$10.000,00 em 10x e à  vista daria desconto. Retorno dia 16/07/2014.', 'Leticia  Souza Koerich', '581', 'Maura  Da Luz Farias', 0, 1, 1),
(8, '2014-07-11', '09:00:00', 'Paciente ligou falando que o aparelho esta muito alto, mas não tem possibilidade de vir até a loja, perguntou se poderíamos atende-la em casa. Duarte disse que somente segunda ou terá a feira pois a Bruna estaria na loja do estreito.', 'Leticia  Souza Koerich', '581', 'Maura  Da Luz Farias', 0, 1, 1),
(9, '2014-07-11', '11:00:00', 'Liguei para seu Athayr para informar que o aparelho já está consertado e pode retirá-lo.', 'Leticia  Souza Koerich', '188', 'Athayr  JoÃo De Almeida', 0, 1, 1),
(12, '2014-07-30', '10:30:00', 'regulagem\nlkasjdfishudifugsiugf\nsdgdasfga', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(10, '2014-07-18', '10:00:00', 'Paciente veio para teste de aparelhos por causa do OPEN falei da importância de um aparelho mais sofisticado, mas preferiu testar primeiro o básico. Foi pra casa em teste com par de Naída SCRT III, orçamento de R$10.000,00. Retorna segunda feira para novas regulagens.', 'Leticia  Souza Koerich', '125', 'Valter  De Lima Coelho', 0, 1, 1),
(11, '2014-07-21', '10:00:00', 'Paciente veio para regulagem de teste, referiu que tem dificuldade para colocar o aparelho, mas esta otimista, ouviu melhor no telefone, acha que a voz das pessoas ainda está um pouco alta. Diminui o volume da fala e deixei mais inteligível. Retorna quarta feira para ver o que preferiu de volume.\nPaciente fechou a compra com par de naída scrt III no valor de R$8.500,00 open house.', 'Leticia  Souza Koerich', '125', 'Valter  De Lima Coelho', 0, 1, 1),
(17, '2014-08-04', '08:00:00', 'consulta\n---------------------------------------\n04/08/2014 - 08:00HS - PACIENTE ESTEVE NA LOJA PARA LIMPEZA DE APARELHOS E REGULAGEM DO SOM, ESTÁ GOSTANDO MUITO DOS APARELHOS.', 'Leticia  Souza Koerich', '11', 'Antônio Jonas Gerber', 0, 1, 1),
(18, '2014-08-05', '15:00:00', 'Programa de Acompanhamento.\n------------------------------------------------------------------------------------\nPaciente esteve na loja para pegar produtos do PAA - entregue 8 cartelas de pilha 312, 20 pastilhas de limpeza, 10 cápsulas desumidificadoras e 02 kit cerustop.', 'Leticia  Souza Koerich', '573', 'Teresa Gassen Ferth', 0, 1, 1),
(19, '2014-08-19', '10:00:00', 'Consulta\n--------------------------------------------------\n', 'Leticia  Souza Koerich', '458', 'José Jorge Moyses', 0, 1, 1),
(20, '2014-08-05', '10:00:00', 'Paciente referiu incomodo com sons muito graves, diminui os graves e mantive as curvas mais próximas pois referiu muito voz robótica. Disse que escutava constantemente um barulho e que achava que poderia ser o aparelho, quando removeu do ouvido percebeu que o mesmo permanecia, disse que ele estava com zumbido e ele disse que parecia com uma cigarra.\nDeixou o aparelho da orelha esquerda para que seja confeccionada nova caixa pois a mesma esta solta no ouvido gerando microfonia. Feito novo pré molde.', 'Leticia  Souza Koerich', '417', 'JoÃo  Carlos Straub', 0, 1, 1),
(21, '2014-08-05', '16:00:00', 'Teste com audiometria para sua avó. Telefone de contato: 91135886\n--------------------------------------------------------------\npaciente esteve na loja acompanhado da avó Ledy, para teste com prótese, paciente estava com rolha de cera bilateralmente, vai remover e voltar para fazer audiometria.', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(22, '2014-08-06', '10:00:00', 'Teste com audiometria. 9148-3597\n-----------------------------------------------------------------------\n05/08/2014 - paciente realizou teste com naida scrt III retorna no dia 13/08. passado orçamento de R$10.000,00', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(23, '2014-08-18', '13:30:00', 'Programa de Atendimento\núltima entrega de material do PAA. 6 CARTELAS PANASONIC 675, 10 CÁPSULAS, 20 PASTILHAS.\nMandou fazer molde novo modelo concha escavada sem ventilação OD. Valor R$80,00 vai pagar quando retirar.', 'Leticia  Souza Koerich', '138', 'Andreza  Alaide Zeferino', 0, 1, 1),
(24, '2014-08-06', '14:00:00', 'Regulagem\n-------------------------------\nPaciente relatou muito zumbido, falei da linha nova que tem a tecnologia tinnitus balance, aumentei nível de ganho para 80%, saiu satisfeito.', 'Leticia  Souza Koerich', '417', 'JoÃo  Carlos Straub', 0, 1, 1),
(25, '2014-08-06', '15:00:00', 'Consulta', 'Leticia  Souza Koerich', '15', 'Abrahao Salum Netto', 0, 1, 1),
(26, '2014-08-18', '13:30:00', '', 'Leticia  Souza Koerich', '15', 'Abrahao Salum Netto', 0, 1, 1),
(27, '2014-08-18', '14:00:00', 'PAA', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum Andressa', 0, 1, 1),
(28, '2014-08-12', '09:30:00', '(TESTE C/ AASI) 3348-5492 / 32400272\n', 'LETICIA KOERICH', '1', 'Não é Paciente Cliente Comum Maria de Lurdes ', 0, 1, 1),
(29, '2014-08-11', '09:00:00', 'Teste c/ aasi 32264558 Promoção dia dos Pais\n--------------------------\nPaciente recebeu folder referente à  promoção de dia dos pais, fez audiometria apresentando perda de neurossensorial de grau moderado bilateralmente. Paciente resistente a usar aparelho auditivo. Fez teste com naída scrt retorna dia 18/08/2014. Orçado valor de R$10.000,00. Usuário do SUS.', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(30, '2014-08-11', '10:00:00', ' (Regulagem) 9960-1447 Promoção dia dos Pais\n---------------------------------\nOsmar veio a loja com problema no aparelho direito, ofereci linha nova mas não quer prefere arrumar o direito, deixou pra orçamento. Falei do lyric ficou interessado, disse que vai estudar a respeito, dei fôlder sobre lyric.', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(31, '2014-08-12', '10:30:00', 'Teste c/ aasi 30121007/96840876 Promoção dia dos Pais\n-------------------------\nPaciente do SUS, reclama que não usa aparelho porque gota de usar o cabelo molhado e não pode ficar em contato com aparelho. Ministra aula da assembléia de Deus e não escuta o que os alunos perguntam. Indiquei cic, nano ou lyric. Disse que não tem condições pra pagar agora e que ia ver com o gerente do banco do brasil que era amigo dele.', 'Leticia  Souza Koerich', '6', 'Carlos Alberto Dos Santos', 0, 1, 1),
(32, '2014-08-12', '09:30:00', '', '', '15', 'Abrahao Salum Netto', 0, 1, 1),
(33, '2014-08-12', '09:30:00', ' (TESTE C/ AASI) 3348-5492 / 32400272\n-----------------------------------\nPaciente fez teste com Audéo S Smart III bilateralmente, paciente gostou dos aparelhos orçado em R$10.000,00 em 10x e R$9.200,00 à vista. Retorna dia 19/08.', 'Leticia  Souza Koerich', '723', 'Maria  De Lourdes Bezerra', 0, 1, 1),
(34, '2014-08-11', '09:00:00', 'Paciente do SUS usa aparelho há 10 anos e nunca esteve satisfeito, diz que não faz diferença estar ou não com aparelhos. Recebeu carta do dia dos pais, teste com naída scrt orçado no valor de R$10.000,00. Retorna dia 18/08/2014.', 'Leticia  Souza Koerich', '722', 'Cassiliano  Manoel De Siqueira', 0, 1, 1),
(35, '2014-08-11', '10:00:00', 'PAA E REGULAGEM\n----------------------------\nPaciente está reclamando de ruído no aparelho direito, precisa ficar para orçamento. Ofereci aparelho novo e disse que não quer no momento. Falei do Lyric e se interessou disse que vai ler sobre, entreguei panfleto do mesmo.', 'Leticia  Souza Koerich', '590', 'Osmar Gelsleichter', 0, 1, 1),
(36, '2014-08-12', '07:00:00', 'HORÁRIO 08:30HS - 09:30HS', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum TREINAMENTO LYIC', 0, 1, 1),
(37, '2014-08-11', '16:00:00', 'REGULAGEM\n--------------------------\nPACIENTE SE QUEIXOU DE NÃO ESTAR COMPREENDENDO DIREITO AS PESSOAS E A TELEVISÃO, MUDEI PRESCRIÇÃO PARA DSL ADULTO E MANTIVE VOLUME EM 90%, REFERIU MUITA MELHORA.', 'Leticia  Souza Koerich', '621', 'Maria  De Lourdes Carneiro', 0, 1, 1),
(38, '2014-08-11', '17:00:00', 'LIMPEZA DE AASI\n------------\nPaciente veio para limpeza de molde e aparelho, não gosta de fazer em casa tem medo de estragar. Aumentei ganho pois refere estar um pouco baixo.', 'Leticia  Souza Koerich', '226', 'Elvira Pacheco De Andrade', 0, 1, 1),
(39, '2014-08-15', '08:30:00', '', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum REUNIÃO LYRIC', 0, 1, 1),
(40, '2014-08-15', '09:00:00', '', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum REUNIÃO LYRIC', 0, 1, 1),
(41, '2014-08-15', '09:30:00', '', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum REUNIÃO LYRIC', 0, 1, 1),
(42, '2014-08-12', '15:00:00', 'REGULAGEM\n------------------------------------\nSeu Nabor reclama de microfonia nos dois aparelhos, diminui agudos, aparelhos já estão na potência máxima, fiz audiometria in situ e teve uma queda de aproximadamente 30 dB. Expliquei pra ele e marcou otorrino.', 'Leticia  Souza Koerich', '725', 'Nabor Schlichting', 0, 1, 1),
(43, '2014-08-12', '17:00:00', 'REGULAGEM\n------------------\nPaciente se queixou de oclusao, troquei oliva e melhorou.', 'Leticia  Souza Koerich', '632', 'Maria  Gorete Alves', 0, 1, 1),
(44, '2014-08-13', '09:00:00', 'PA\n------------------------------\nPaciente veio para PAA, recebeu 20 pastilhas de limpeza, 10 cápsulas desumidificadoras, 6 cartelas de pilha 312 e 2 kit de cerustop. Próximo retorno em fevereiro de 2015.', 'Leticia  Souza Koerich', '572', 'Odorico  Orsi', 0, 1, 1),
(45, '2014-08-13', '15:00:00', 'TESTE C/ AUDIO\n-------\nremarcou para segunda feira.', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum', 0, 1, 1),
(46, '2014-08-13', '09:00:00', 'Nora do paciente veio com queixa de que cerustop entope a cada dois dias, comuniquei que paciente precisa fazer limpeza no ouvido, caso contrário vai continuar entupindo, marcou para amanhã para fazer limpeza.', 'Leticia  Souza Koerich', '459', 'JosÉ  Lino Gorges', 0, 1, 1),
(47, '2014-08-14', '08:30:00', 'Regulagem', 'Leticia  Souza Koerich', '509', 'Mara  Lucia Bedin', 0, 1, 1),
(48, '2014-08-14', '15:00:00', 'REGULAGEM\n---------------------------\nPaciente veio buscar aparelhos que estavam em OS. Molde está muito antigo, solicitei que fizesse novo, porém ouvido está com rolha de cera. Irá no orl e depois retorna para confecção de molde novo.', 'Leticia  Souza Koerich', '370', 'HipÓlito  Pedro Da Silva', 0, 1, 1),
(49, '2014-08-15', '15:00:00', '(TESTE C/ ASSI )32431228 DR KOWALSKI\nPerda Profunda, quis fazer somente par de molde.', 'Leticia  Souza Koerich', '727', 'Sabrina  Silva Coelho', 0, 1, 1),
(50, '2014-08-18', '10:30:00', 'retorno de teste', 'Leticia  Souza Koerich', '1', 'Não é Paciente Cliente Comum Elizabeth', 0, 1, 1),
