(164, '2014-10-20', '15:30:00', 'REGULAGEM\nPaciente veio pegar caixa cshel da compra de aparelhos. \nFeito nova regulagem diminui ganho pois a paciente se queixou de muito barulho.', 'Leticia  Souza Koerich', '754', 'Aracely Odete Pereira', 0, 1, 1),
(165, '2014-10-24', '10:30:00', 'Retorno de teste\nPaciente fechou compra adorou aparelho.\nColocado Naida SCRT V pois não temos mais III.\nValor R$ 6.962,00\nEntrada: R$2.088,60\n9x no carnê com promissória \nvalor da parcela de R$541,50 todo dia 30 de cada mês.\n01 ANO DE GARANTIA\n01 ANO DE PILHAS', 'Leticia  Souza Koerich', '776', 'Alaide  Cardoso Silva', 0, 1, 1),
(166, '2014-10-21', '10:00:00', 'REGULAGEM\nPaciente retirou caixa cshel que veio de OS regulei aparelho, paciente sempre reclama que a regulagem não segura, escutei e o som estava limpo. regulei novamente e saiu satisfeito.', 'Leticia  Souza Koerich', '458', 'José Jorge Moyses', 0, 1, 1),
(167, '2014-10-20', '10:00:00', 'Regulagem\nPaciente se queixou que o volume do aparelho vai diminuindo durante o dia.\nDesativei botão de volume pois pode alterar com facilidade e aumentei um pouco o ganho. Orientei que caso continue com a mesma queixa o aparelho deverá ir para o laboratório.', 'Bruna Bortolotto Gava', '586', 'Osvaldina Rosa Macedo', 0, 1, 1),
