(174, '2014-10-22', '14:00:00', 'Revisão\nPaciente esteve para regulagem pois o aparelho está apitando muito. Fiz teste de microfonia, apresentei a linha Quest, a filha ficou interessada na linha nova pela quantidade de regulagem que aumentou. Dona Ana não quer trocar de aparelho agora disse que quer aguardar, em novembro retorna e falarei novamente, Entreguei folder dos aparelhos para lerem a respeito.', 'Leticia  Souza Koerich', '121', 'Ana  Rech Ghisi', 0, 1, 1),
(175, '2014-10-27', '08:00:00', 'Revisão\nPaciente esteve na loja pois recebeu a ligação de revisão gratuita e queria saber o que precisava arrumar em seu aparelho. Colocação de puxador nos dois e base de ferro para retenção do cerustop.\nApresentei linha nova e se interessou por Virto Q50-312, passei valor de tabela R$9.960,00 disse que vai se programar com o décimo terceiro.', 'Leticia  Souza Koerich', '128', 'André Da Rosa Ferreira', 0, 1, 1),
(176, '2014-10-23', '14:30:00', 'Revisão e conhecer nova linha phonak.\nVeio fazer revisão visual gratuita ligação da Lidiane e conhecer linha nova, apresentei TOP da linha Spice mostrei todos beneficios pois tem linha básico da  CORE por R$12.000,00 e Nano da Quest por R$10.500,00, disse que agora não pode vai esperar mais um pouco, não quis nem testar.', 'Leticia  Souza Koerich', '151', 'Anita  Vitoreti Gonçalves', 0, 1, 1),
