(237, '2014-11-04', '15:30:00', 'Teste \nPaciente veio por insistência da ligação para conhecer linha nova.\nCachorro comeu o aparelho há aproximadamente dois anos e desistiu de usar. Diz que a dificuldade que sente não é tanta para comprar outro aparelho.\nApresentei linha nova, nano e lyric, ficou interessado no lyric apesar de achar caro o contrato anual. Levou folder de linhas, não quis testar disse que começou a repensar na possibilidade de usar agora mas não quer investir tanto.', 'Leticia  Souza Koerich', '95', 'Aloisio  Iankoski', 0, 1, 1),
