(351, '2014-12-16', '15:00:00', 'retirada de molde e pagar aparelho\nDeixou mais R$350,00 e terça feira dia 23/12 vai deixar mais R$350,00 completando o valor da entrada de R$1.050,00\ne parcelará o valor de R$2.450,00 em 9x no carnê com promissória.', 'Leticia  Souza Koerich', '825', 'Dilnei Joaquim', 0, 1, 1),
(352, '2014-12-16', '12:00:00', 'Consulta\nPaciente comprou aparelho para OD Audéo III  Linha CORE valor R$2.500,00\nDEU ENTRADA DE R$1.000,00 NO DÉBITO E PARCELOU 1.500,00 EM 09X DE R$166NO CARNÊ COM PROMISSÓRIA.', 'Leticia  Souza Koerich', '802', 'Valter  Franzoni', 0, 1, 1),
(353, '2014-12-15', '10:00:00', 'Consulta\nPaciente comprou par de tampão vermelho para a filha Priscila.\nComprou par de aparelhos Naída SCRT III, mas foi vendido o último par de IX da linha Spice.\nValor oferecido foi de R$7.000,00 e Bruna autorizou a venda por R$6.500,00 à vista.\nRealizado transferência bancária no mesmo dia pela manhã a paciente trouxe a via de transferência N° do DOC 11.386.000.023.005', 'Leticia  Souza Koerich', '149', 'Angela  Cristina Shappo', 0, 1, 1),
(354, '2014-12-15', '09:30:00', 'Retorno de teste\nPaciente devolveu aparelho, disse que no momento não tem condições de comprar, os filhos querem comprar para o pai mas ele não quer. Disse que em fevereiro vai poder comprar parcelado. Diz que não sente tanta dificuldade para usar aparelho e pode esperar.', 'Leticia  Souza Koerich', '838', 'Jairo João Gonçalves', 0, 1, 1),
