(380, '2014-12-30', '14:30:00', 'retorno de teste\nComprou aparelho AMBRA MH20 para o filho Gabriel com 01 ano de garantia.\nValor R$7.000,00 à vista no cheque \nJunto levou o desumidificador elétrico D-DRY\nValor R$600,00 à vista no cheque.\nEntregue 01 cheque com o valor total da compra R$7.600,00\nPara pagamento à vista ofereci 03 anos de pilha.\nCF 9153\n', 'Leticia  Souza Koerich', '848', 'Vanessa Lehmkuhl Pedro', 0, 1, 1),
(381, '2014-12-29', '11:00:00', 'Mãe do paciente quer comprar par de aparelhos novos pois um estragou e o outro está muito antigo. Negociei par de Virto na promoção da Phonak 30% de desconto na compra do segundo R$8.500,00 + 2 anos de garantia e PAA. Entrada de R$850,00 + 10X R$765,00 no cartão. Vai vir de tarde para conversarmos.', 'Leticia  Souza Koerich', '128', 'André Da Rosa Ferreira', 0, 1, 1),
