(385, '2014-12-29', '13:30:00', 'Paciente veio porque aparelho não estava funcionando. Troquei cerustop e orientei novamente quanto à limpeza e manutenção.\nEntregue 2 cartelas de pilha.', 'Leticia  Souza Koerich', '12', 'Albertina Maria Da Silva', 0, 1, 1),
(386, '2015-01-05', '10:30:00', 'Paciente veio com queixa de que AASI da OE está com folga no ouvido, quando movimenta a cabeça ou a boca ele faz ruídos e microfonia.\nRetirado novo pré molde e notei diferença no tamanho do conduto. Enviado para fábrica para fazer cápsula nova.\nEmprestei AUDÉO Q90 ativado o tinnitus balance para que conheça nova linha, pois o mesmo vem sofrendo com zumbido e não havia sentido vontade de testar nova tecnologia.', 'Leticia  Souza Koerich', '417', 'João  Carlos Straub', 0, 1, 1),
(387, '2015-01-06', '10:00:00', 'pré molde p/ ponto eletrônico', 'Leticia  Souza Koerich', '1', 'Eduardo', 0, 1, 1),
