(15, 'FRANCINE', '0', '', '', '27/02/2012 - REALIZOU TESTE COM APARELHO AUDITIVO AUDÉO SMART.\n09/03/2013 - Fiz contato telefônico e conversei com a esposa do paciente, pois o mesmo não se encontra em casa. Informei que estamos em promoção de aparelhos auditivos e para o paciente vir na loja para repetir o exame para ver se não houve piora. A esposa flou q piorou bastante, mas que ele não aceita. Falei pra ela trazer ele aqui que aqui conversamos com ele. Vai passar o recado e agradeceu a ligação. Fez teste com a Tanara em 2012 (pocurar na pastinha de 2012)', 0, '', '', '2012-07-27'),
(16, 'Hansaton', 'Leticia ', '', 'não toma café', '27/05/2014 - Entregou dois aparelhos da Hansaton para orçamento de conserto.\n09/06/2014 - Aparelho não possui peça para conserto, entrei em contato com paciente e comuniquei.', 0, '', '', '2009-01-05'),
