(20, '', '0', '', '', '10/12/2010 - COMPROU AUDÉO YES V BILATERAL PILHA 312 VALOR R$13.000,00 ENTRADA R$5.000,00 + 2X R$4.000,00\n\n---------------------------------------------------------\nData: 13/12/2010\nHora: 13:12:42\nFono: Tanara\nAssunto: Paciente veio para colocarmos os aparelhos definitivos, sendo Audeo V bilateral. Deu um cheque de R$: 5.000,00 mais 4x de 2.000,00 e falou que pagará o restante com depósito, sendo que janeiro dará mais uns 2.000,00. Total da venda R$: 13.000,00.\n---------------------------------------------------------\nData: 27/12/2010\nHora: 10:00:26\nFono: Tanara\nAssunto: Paciente veio para o retorno 1 visita. Entregue os brindes, mas falou o kit de manutenção que será entregue na 2 visita. Feito um recibo de 8.000,00 pois fez depósito. Assim não deve mais nada dos aparelhos. Marcado dia: 14/03/2011 o retorno a 2 visita.\n---------------------------------------------------------\nData: 05/01/2011\nHora: 11:34:42\nFono: Tanara\nAssunto: Paciente veio buscar o kit de manutenção ok.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 13:46:29\nFono: Tanara\nAssunto: Paciente veio com seu aparelho com o protetor de cer quebrado. Orientei para não mexer no protetor de cera até março quando explicar o uso. Usar somente a escovinha ok.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 13:22:44\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregue os brindes e marcado a próxima visita.\n---------------------------------------------------------\nData: 22/03/2011\nHora: 13:15:29\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD esta saindo da orelha. Colocado o receptor Power ok. Feito diminuição do ganho geral.\n---------------------------------------------------------\nData: 10/06/2011\nHora: 13:57:28\nFono: Tanara\nAssunto: Paciente veio com o aparelho da OD mudo. Era receptor. Feito a troca na garantia. Fiz uma nova regulagem ok.\n---------------------------------------------------------\nData: 09/12/2011\nHora: 11:58:28\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Entregue os brindes e feito uma nova audiometria e uma nova regulagem. Paciente saio bem satisfeito pois o aparelho estava baixo e tinha queimado o receptor com o cigarro. Orientei que da próxima vez terá custo.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 16:50:15\nAssunto: Suzan - Telefone desligado. Passar promoção de aparelhos novos.\n\n', 0, '', '', '0102-12-20'),
(21, '', '0', '', '', 'COMPROU AP MAGNATONE ITC 312 EM 30/12/04\n2.300,00\n4X. 625,00\n', 0, '', '', '2004-12-30'),
(22, 'OTOVIDA', '0', '', '', '12/11/2012 - COMPROU 1 APARELHO AUDÉO S SMART III VALOR R$3.800,00 ENTRADA R$1.000,00 + 10X R$280,00\nTROCOU PARA CÁSSIA 312 \n\nData: 20/07/2009\nTHAIS: ENDEREÇO ATUALIZADO. PACIENTE FICOU DE LIGAR PARA MARCAR UMA AVALIAÇÃO.\n---------------------------------------------------------\nData: 14/09/2009\nDébora: Deixou ap. mudo para conserto da garantia. Enviado pra fábrica.\n---------------------------------------------------------\nData: 23/09/2009\nDébora: Ap. veio da fábrica. Estava entupido com cera.\n---------------------------------------------------------\nData: 29/09/2009\nDébora: Paciente pegou aparelho.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 17:08:36\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 26/07/2012\nHora: 16:52:12\nMirella: Sua neta trouxe o aasi em pedaços,Orçamento R$ 1.200,00 Solo 22 OE 01081057 aprovado, já efetuou o pgto de R$ 150,00 como garantia.\n---------------------------------------------------------\nData: 27/07/2012\nHora: 11:10:59\nAssunto: Zelha Maria da Rosa veio buscar o valor pago da entrada do conserto (R$150,00) pois resolveu não arrumar mais o aparelho.\n---------------------------------------------------------\nData: 04/12/2012\nHora: 09:32:27\nAssunto: Francine - Comprou Audeo S Smart III com Duarte, não se adaptou. Retirada de pré-moldagem para aparelho intra.\n---------------------------------------------------------\nData: 17/12/2012\nHora: 17:43:38\nFRANCINE: avisei a filha (Cristiane) que o Aparelho Cassia chegou. Vai passar aqui amanhã com a sua mãe.\n05/08/2013 - Paciente hospitalizada, acompanhante veio buscar pilhas, entregue 3 cartelas de 312.\n----------------------------------------------------------------------\n21.10.14\nLidiane: Tentei contato para open porém os doi telefones que estão no cadastro não existem.', 0, '', '', '0102-12-20'),
(23, '', '0', '', 'CONGREGAÇÃO DAS IRMÃS FRANCISCANAS DE SÃO JOSÉ', '14/03/2014 - COMPROU DOIS APARELHOS AUDEO S SMART III NS: 1345X0WLP/ 1336X21HV NO VALOR DE R$8.000,00, POSSUI 03 ANOS DE PAA, 01 ANO DE GARANTIA E 01 ANO DE SEGURO.', 0, '', '', '2014-03-14'),
(24, 'HU', '0', '', 'oi', 'USA APARELHO ARGOSY SOLO 22 OD.\n\n---------------------------------------------------------\nData: 21/07/2011\nHora: 13:08:11\nFono: Tanara \nAssunto: Paciente veio para fazer troca da caixa intra pois esta toda rachada. Feito pré-molde da OD e vai pagar R$: 290,00. Falei de aparelho novo na OE. Falou que vai comprar aqui com a gente depois de pagar a prestação do Solo 22. Pagou pelo Solo 22 OD R$: 2.400,00 em outro lugar. Vem amanhã buscar e pagar.\n---------------------------------------------------------\nData: 22/07/2011\nHora: 09:59:25\nMichelle: Paciente retirou aparelho pagou 290,00 reais troca da caixa+ revisão e limpeza.\n---------------------------------------------------------\nData: 23/01/2012\nHora: 11:59:58\nMichelle: Paciente deixou aparelho para orçamento pois o mesmo esta mudo modelo solo 22 (os audiozoom 2302)\n---------------------------------------------------------\nData: 27/01/2012\nHora: 14:44:46\nFono: Tanara\nAssunto: Passei o valor do conserto R$: 624,00. Paciente autorizou o conserto e vai fazer em 3x de 208,00. Fiz um novo pré-molde. Fazer o conserto e troca da caixa intra.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 14:19:58\nAssunto: Suzan - Nuca consigo falar com Sr. Adão. Fico esperando a transferencia da ligação e ele nunca atende. E celular desligado sempre.\n', 0, '', '', '2012-01-02'),
