(27, 'HU', '0', '', '', 'USUÁRIO DE ARGOSY SOLO T+ 311 NS: 095X13878\nData: 05/06/2012\nHora: 14:36:10\nFono: Tanara\nAssunto: Liguei e falei com a secretaria de saúde. Passei o valor do conserto R$: 624,00. Vai falar com a familia e retornará a ligação.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 15:49:44\nMirella: Secretária da saúde ligou informando o depósito, Cida verificou na conta ok, R$ 624,00\n---------------------------------------------------------\nData: 27/06/2012\nHora: 15:15:10\nAssunto: Suzan - Motorista autorizou o conserto do aparelho. Trouxe comprovante de deposito. Encaminhei para Tanara.\n---------------------------------------------------------\nData: 10/07/2012\nHora: 11:22:01\nFono: Tanara\nAssunto: Liguei e deixei o recado com a secretaria de saúde que o aparelho já chegou de S.P. Já esta pago desde o dia: 11/06/2012. Paciente vem retirar amanhã.\n---------------------------------------------------------\nData: 11/02/2013\nHora: 15:16:03\nAssunto:cida. motorista veio retirar o aparelho argossy solo t+ 311 nº095x13878. conserto valor 624,00 reais.(deposito)\n', 0, '', '', '0101-09-20'),
