(30, '', '0', '', '', '13/01/2011 - TESTE COM APARELHOData: 13/01/2011Hora: 13:55:48Fono: TanaraAssunto: Paciente indicado pelo pai do Duarte, veio saber preços de aparelho na OD. Usa um Intra na OE. Primeiramente fiz uma audiometria e teste com Naída III SP. Falei que dava pra colocar Intra 33 também, mas paciente achou caro e falou que vem no mês de maio quando não tiver mais dívidas do carro.---------------------------------------------------------Data: 29/05/2012Hora: 15:37:25Assunto:Suzan - Confirmado endereço para mandar open.', 0, '', '', '2011-01-13'),
(31, '', '0', '', '', '12/03/2008  PILHA 312  COMPROU APARELHO ARGOSY MAXX 22 n  ................  OD/OEVALOR R$ 5.300,00 ENTRADA DE R$ 3.000,00 + 10 X DE R$ 230,002 ANOS De GARANTIAData: 17/08/2009Débora: Paciente esteve na clínica e deixou ap. maxx 22 OE com baixa amplificação para revisão da garantia.---------------------------------------------------------Data: 19/11/2009Débora: aciente pegou aparelho.---------------------------------------------------------Data: 17/3/2010Hora: 16:22:01Michelle: Paciente trouxe aparelho ARGOSY MAXX 22 OE está mudo (OS AUDIOZOOM 139 GARANTIA).---------------------------------------------------------Data: 15/04/2010Débora: Ap. veio da fábrica. Feito troca de receptor,microfone, VC, hibrido, gaveta depilha e faceplate.---------------------------------------------------------Data: 18/03/2011Hora: 16:41:03Michelle: Paciente deixou aparelho pois um esta mudo e o outro esta com chiado jaimar ouvio aparelhos modelo maxx(os audiozoom 1539).---------------------------------------------------------Data: 25/03/2011Hora: 12:40:25Fono: TanaraAssunto: Liguei e passei o valor do conserto. Sendo o aparelho da OE 100,00 revisão e limpeza mais 480,00 da OD vai para a fábrica. Autorizou e ligaremos quando chegar o aparelho.---------------------------------------------------------Data: 11/04/2011Hora: 09:23:29Fono: TanaraAssunto: Liguei e avisei que o aparelho já chegou da fábrica. Terá um custo de R$: 580,00 e vai fazer em 2x.---------------------------------------------------------Data: 11/04/2011Hora: 15:03:17Michelle: Paciente retirou aparelho pago 580,00 em 2x no cheque.---------------------------------------------------------Data: 18/04/2011Hora: 16:03:41Fono: TanaraMichelle: Paciente deixou aparelho pois esta com defeito intermitente Tanara verificou o mesmo modelo maxx 22(os audiozoom 1581). Jaimar fez revisão e limpeza e paciente pagou R$: 100,00. Liguei e expliquei para a esposa Ana que vai para S.P e terá um custo de R$: 480,00. Como ele já pagou R$: 100,00. Vai pagar somente R$: 380,00 quando chegar o aparelho.---------------------------------------------------------Data: 29/04/2011Hora: 15:57:19Fono: TanaraAssunto: Liguei para o paciente avisando que o aparelho já chegou da fábrica. Vem na segunda buscar. Vai pagar a diferença de R$: 380,00, pois já pagou R$: 100,00.---------------------------------------------------------Data: 05/05/2011Hora: 12:10:31Fono: TanaraMichelle: Paciente retirou aparelho feito troca do receptor pago 380,00 reais garantia de 6 meses Adilson Adão Borges retirou sem canhoto pois o mesmo extraviou. Pediu para aumentar o ganho da orelha direita. Feito regulagem ok.---------------------------------------------------------Data: 11/05/2012Hora: 14:59:09Assunto: Suzan - Não atende. Cai direto na secretária eletrônica.', 0, '', '', '2010-01-04'),
