(57, '', '0', '', '', 'DIA: 25/03/2011 COMPRA AUDÉO MINI V BILATERAL PILHA 10\nOD: 1049X0ARH RECEPTOR 3\nOE: 1049X0ARN\nNF: 349.988 DATA: 16/02/2011\nR$: 13.700,00 A VISTA NO CHEQUE\n02 ANOS DE GARANTIA\n\nData: 22/03/2011\nHora: 11:36:33\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo Dr. Kowalski para fazer audiometria e teste com aparelhos. Diz que retirou muita cera e tem dificuldade de ouvir. Feito teste com Audeo Mini V bilateral. Paciente gostou bastante e passei o valor de R$: 13.800,00 a vista. Levou para a casa e vai no Dr. Kowalski na quinta para o retorno.\n---------------------------------------------------------\nData: 25/03/2011\nHora: 12:04:34\nFono: Tanara\nAssunto: Paciente veio e fechou a venda a vista R$: 13.700,00 em cheque. Marcado retorno dia: 08/04 para a 1 visita. Diz que esta escutando bem.\n---------------------------------------------------------\nData: 28/03/2011\nHora: 16:59:33\nFono: Tanara\nAssunto: Paciente veio para colocar os selinhos que identificam o lado direito e esquerdo. Esta bem feliz com os aparelhos.\n---------------------------------------------------------\nData: 11/04/2011\nHora: 13:20:27\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Expliquei o Kit de manutenção e marquei retorno em 15 dias dia: 25/04, pois paciente estava usando pilhas velhas e protetor de cera entupido.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 12:06:53\nFono: Tanara\nAssunto: Paciente veio para um retorno extra. Veirifquei as pilhas e aumentei um pouco mais os aparelhos. paciente diz que estáótimo e mais adaptado. Voltará agora para a 2 visita que será em junho.\n---------------------------------------------------------\nData: 23/09/2011\nHora: 13:13:46\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e apciente diz que usa pouco os aparelhos pois não consegue colocar o lado esquerdo. Expliquei que precisa sempre alguem colocar pra ele e orientei vir na Audiozoom 1 vez por mês. Pois os protetores de cera estavam entupidos de cera e falou que não consegue limpar pois não enxerga. Assim dia 21 de outubro virá para fazermos a troca dos protetores.\n---------------------------------------------------------\nData: 23/01/2012\nHora: 08:10:04\nFono: Tanara\nAssunto: Paciente veio para o retono mensal. Tem muitas dificuldades para trocar o protetor de cera. Fiz a troca e limpei bem as olivas. Marquei dentro de 1 mês o retorno.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 14:53:54\nAssunto:Suzan - Marquei consulta para manutenção e apresentar promoções. Para o dia 30/06 as 09:00.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:26:49\nAssunto: Suzan - Ligar mais tarde.', 0, '', '', '2012-01-02'),
