(64, 'DANIEL', '0', '', 'PACIENTE FALECEU\nPILHA 13\nRECEPTOR POWER FIO 3 L/R', 'MICRO-POWER\nN: 0902X1NV\nN: 0902X1NXF\nNF: 270872 DATA: 29/05/2009\n02 ANOS \nDIA: 07/05/2012 COMPROU AUDÉO SMART V BILATERAL\nOD: 1120X097T\nOE: 1123X0KUD\nNF: 392.117 DATA: 29/11/2011\nR$: 11.000,00 À VISTA EM CHQUE\n01 ANO DE GARANTIA\n\nData: 10/06/2010\nDébora: Paciente esteve na clínica e deixou ap. Phonak micropower nº0902x1nxv para revisão e limpeza. Está com Audeo III emprestado.\nApresentou a carta da Phonak e ganhou uma cartela de pilhas 312.\n---------------------------------------------------------\nData: 23/06/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 24/06/2010\nHora: 09:31:07\nMichelle: Paciente retirou aparelho feito revisão e limpeza nº0902x1nxv (OS AUDIOZOOM 1207)\n---------------------------------------------------------\nData: 24/06/2010\nDébora: Deixou 01 ap. Phonak micropower V nº0902X1NXF para revisão da garantia.\n---------------------------------------------------------\nData: 13/07/2010\nDébora: Ap. veio da fábrica. Feito revisão e troca de receptor.\n---------------------------------------------------------\nData: 15/7/2010\nDébora: Esteve na clínica para retirar o ap. Feito pré-molde OD/OE para confecção de micro-caixa.\n---------------------------------------------------------\nData: 20/7/2010\nDébora: Retornou à clínica para adaptação da micro-caixa. R$380,00.\n---------------------------------------------------------\nData: 14/05/2012\nHora: 10:39:28\nFono: Tanara\nAssunto: Paciente comprou Audéo Smart V bilateral e tirei os pré-moldes para a confecção das micro-caixas com ventilação V.A.O.\n---------------------------------------------------------\nData: 30/05/2012\nHora: 09:41:12\nFono: Tanara\nAssunto: Paciente veio buscar as micro caixas ok.\n---------------------------------------------------------\nData: 22/02/2013\nHora: 09:29:27\njoice: PROGRAMA DE ACOMANHAMENTO T