(66, '', '0', '', '', 'DIA: 19/05/2008 COMPROU CLASSICA PP-C-P OE PILHA 675\nOE: 074H16167\n: R$ 2.500,00\n02 anos de garantia até 19/05/2010\nEntregue um ano de pilhas e um desumidificador\nData: 20/05/2009\nDébora: Paciente esteve na clínica com a queixa de que seu molde estava machucando a orelha. Foi lixado no local que estava machucando e a a mesma referiu melhora. Comprou um desumidificador e 6 pastilhas para higienização de molde. R$35,00.\n---------------------------------------------------------\nData: 08/02/2010\nHora: 14:47:57\nCris: paciente retirou aparelho - revisão da garantia\n---------------------------------------------------------\nData: 18/04/2011\nHora: 13:46:28\nFono: Tanara\nAssunto: Paciente veio com sua filha e neta Mariana relatando que o aparelho esta com a gaveta de pilha quebrada. Duarte irá fazer uma revisão e limpeza e troca da gaveta e irá cobrar R$: 135,00. Motorista ve buscar amanhã. Feito uma audiometria e orientei colocar aparelho também na outra orelha. Porém a paciente não tem condições no momento de comprar outro aparelho.\n---------------------------------------------------------\nData: 20/04/2011\nHora: 10:58:51\nMichelle:Motorista retirou aparelho Tanara colocou na os que já esta pago.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 15:33:19\nAssunto: Suzan - Cadastro atualizado. Falei com filha da Sra. Alaide.\n---------------------------------------------------------\n\nData: 02/07/2012\nHora: 14:13:19\nMirella: Seu genro trouxe aasi Phonak Clasisca PP SC, ORÇAMENTO ÂNGULO QUEBRADO.\n---------------------------------------------------------\nData: 03/07/2012\nBruna: Aparelho está funcionando normalmente, motorista falou que o ângulo está solto, coloquei outro ângulo e ficou OK. Passar orçmento de R$ 50,00 se quiser trocar só o ângulo, ou dar a opção de mandar pra SP, para ser trocadas algumas peças analisadas que estão com um pouco de oxidação e cobrar R$ 1040,00. OK\n---------------------------------------------------------\nData: 04/07/2012\nBruna: Quno vierem buscar trocar apenas a mangueirinha. R$ 5,00. OK\n---------------------------------------------------------\nData: 06/07/2012\nHora: 14:52:59\nAssunto:mirella.marido da paciente veio retirar o aparelho phonak nº074H16167. FOI FEITO TROCA DE ANGULO E MANGUEIRINHA . VALOR PAGO 55,00 REIS.', 0, '', '', '2012-01-02'),
(67, 'OTOVIDA', '0', '', '', 'DIA: 08/08/2012 FEZ TESTE COM AUDÉO SMART S III BILATERAL\nData: 08/08/2012\nHora: 17:38:49\nFono: Tanara\nAssunto: Paciente veio com a neta Priscila para fazer teste com aparelhos. Trouxe a audiometria que foi feita na Otovida. Nunca usou aparelhos. Feito teste com Audéo Smart S III bilateral. Levou para a casa o orçamento para passar para os filhos. R$: 9.200,00, sendo R$: 4.600,00 cada. Ligará na semana que vem quando o filho chegar de viagem.\n---------------------------------------------------------\nData: 14/08/2012\nHora: 16:39:26\nFono: Tanara\nAssunto: Liguei e falei com a paciente. falou que agora vai resolver o problema do olho e mais tarde comprará os aparelhos.\n---------------------------------------------------------\nData: 02/10/2012\nHora: 11:02:55\nAssunto: Suzan - CONFIRMADO ENDEREÇO DO OPEN.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:44:27\nAssunto: Suzan - Vai tentar vir no Open, dia 06/11 as 09:00h.\n---------------------------------------------------------\nData: 06/11/2012\nHora: 17:06:48\nAssunto: Suzan - Sra. Alaides não esta em casa, ligar amanha as 10:00h.\n15/05/2013Conversei com D. Alaides que me informou que comrpou aparelho na Vitasons. Falou que é um aparelho muito grande. Falei do nosso pequeno e relatou que estava muito caro. Falei da promoção e do financiamento pelo BB. Vai vir dia 17/5 as 14:00 para testar e conversar.', 0, '', '', '2012-01-02'),
(68, '', '0', '', '', 'DIA: 13/12/2010 COMPROU NAÍDA III SP OE \nOE: 1021X0PV3\nR$: 5.852,00 ENT. 1.000,00 MAIS 10X 485,20\nNF: 323038 DATA: 11/08/2010\nDIA: 14/11/2011 COMPROU NAÍDA III SP OD\nOD: 1045X12AV\nNF: 355.407 DATA: 29/03/2011\nR$: 5.852,00 ENT. 585,20 MAIS 9X 585,2\nData: 12/03/2009\nDeixou aparelho para revisão e limpeza. Enviado para fábrica.\n---------------------------------------------------------\nData: 14/05/2009\nVeio buscar aparelho. Troca da caixa, angulo e cjto de soquete e trimpot. Sem custo. Garantia.\n---------------------------------------------------------\nData: 10/08/2009\nDébora: Motorista deixou ap. com inteferência no som para conserto da garantia. SoloT+ 311 nº077X14904 enviado pra fábrica. Feito troca de receptor e caixa completa.\n---------------------------------------------------------\nData: 22/10/2010\nHora: 11:13:09\nAssunto:cliente eteve na loja dixou para orçamento. aparelho argosy t+ 311 nª077x14904 /aparelho audifone nªLE2312199.\n---------------------------------------------------------\nData: 29/10/2010\nDébora: Orçamento: Argosy SoloT+ 311 nº077x14904- R$1080,00 / Audifone nºLE2312199- s/ peça pra reposição.\n---------------------------------------------------------\nData: 29/11/2010\nHora: 09:44:48\nMichelle: Motorista retirou os aparelhos.\n---------------------------------------------------------\nData: 13/12/2010\nCOMPROU APARELHO EM 05/09/2007 ARGOSY SOLOT+ 311 DWDRC Nº 077X14904\nNF 15617 2 anos de garantia\n---------------------------------------------------------\nData: 14/04/2011\nHora: 13:35:33\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes e Duarte autorizou o paciente levar o outro aparelho e continuar pagando as prestações no carne ou depósito. Sendo que em novembro de 2011 será a primeira prestação no valor de R$: 585,20. Paciente ficou muito feliz pois agora esta ouvindo bem nos dois ouvidos. Levou o carne.\n---------------------------------------------------------\nData: 12/07/2011\nHora: 09:59:1\nMichelle: Paciente deixou aparelho para fazer orçamento modelo solot+ 311dwdrc 077x14904 / 077x14787(os audiozoom 2028). Deixou mais o Naída III SP OE número 1021X0PV3 na garantia.\n---------------------------------------------------------\nData: 15/07/2011\nHora: 14:48:47\nFono: Tanara\nAssunto: Liguei e passei o valor do conserto R$: 1.600,00, sendo 800,00 cada. Paciente falou que não vai consertar quer somente o orçamento.\n---------------------------------------------------------\nData: 29/08/2011\nHora: 11:16:01\nMichelle: Paciente retirou aparelho os 2028 e 1642\n---------------------------------------------------------\nData: 25/05/2012\nHora: 11:15:15\nMirella:Pct deixou aasi ( Naida III SP 1021X0PV3, 1045X12AU, para revisão Duarte autorizou mesmo estando fora da garantia)\n---------------------------------------------------------\nData: 08/06/2012\nHora: 16:09:16\nFono: Tanara\nAssunto: Liguei e falei com a esposa Marlene. Avisei que os aparelhos já chegaram. Passará o recado.\n---------------------------------------------------------\nData: 12/06/2012\nHora: 09:46:33\nMirella: Motorista veio buscar o aasi.\n---------------------------------------------------------\nData: 03/09/2012\nHora: 10:08:40\nMirella:Pct veio trocar o protetor do aasi, Tanara trocou,  pct trouxe os comprovantes de pagamento.\n---------------------------------------------------------\nData: 10/12/2012\nHora: 09:41:03\nFRANCINE - Prog. de acompanhamento - 3ª visita - Troca filtro microfone, mangueirinha e dei 6 cartelas pilha 13 (6 meses)\n22/05/2013-Motorista deixou aparelho para conserto,. e junto os moldes para trocar a mangueirinha. A Secretaria da saúde vai ligar para saber o valor e vai depositar para posteriormente trocar as mangueirinhas.\n25/06/2013- MOTORISTA RETIROU O APARELHO PHONAK NAIDA II SP N° 1021XOPV3-1045X12AV, CONVERSOU COM A FRANCINE FORMA DE PAGAMENTO.', 0, '', '', '2012-01-02'),
(69, 'HU', '0', '', '', 'AP. PHONAK EXT 211 AZ OD: 210920X0CDO E OE: 210920X0CDO\nNF: 276045  DATA EMISSAO: 20/07/2009 GARANTIA 1 ANO (20/07/2010)\n20/08/2013PACIENTE DEIXOU APARELHO PARA ORÇAMENTO MODELO EXTRA 211 AZ N° SÉRIE 0920X0CD0 (OS AUDIOZOOM 3015)\n20/08/2013-PACIENTE VEIO PARA DEIXAR O APARELHO E JÁ FEZ ORÇAMENTO DE APARELHO AUDITIVO. PASSEI VALORES DE TABELA E FALEI DO DESCONTO DE 20% DE DIA DOS PAIS SOMENTE NESSE MES. PACIENTE ESTÁ PARA RECEBER UM DINHEIRO E RETORNARÁ AINDA ESSA SEMANA PARA TESTAR E NEGOCIAR.\n11/09/2013- PACIENTE RETIROU SEM CONSERTO CANHOTO FOI EXTRAVIADO.', 0, '', '', '2012-01-02'),
(70, 'HU', '0', '', '', 'DIA: 06/03/2012 FEZ ORÇAMENTO DE R$: 2.800,00\n29/05/2012 Aparelho do HU.\nData: 28/05/2012\nHora: 17:15:32\nAssunto: Suzan - Não atende, verificar se ja fechou orçamento.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 14:11:44\nAssunto: Suzan - Falei com esposa.Cadastro atualizado para mandar carta do open. Mas paciente ganhou aparelho do HU.', 0, '', '', '2012-01-02'),
(71, 'OTOVIDA', '0', '', '', 'USUÁRIO DE ARGOSY SOLO 22 OD PILHA 312\nR05081073.\nData: 28/05/2012\nHora: 17:21:20\nAssunto: Suzan - Sr. Alcides ganhou aparelho do governo. Falei de aparelhos novos e promoções. Esposa disse que ano que vem ele quer comprar um aparelho bom. Endereço atualizado.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 16:48:48\nAssunto: Suzan - Falei com esposa. Verificar se vem no Open.\n----------------------------------------------------------------------------------------------\n21.10.14\nLidiane: Entrei em contato com o paciente porém ele não tem condições de pagar, foi ofereciddo aparelho de R$ 2000, porém o mesmo disse não ter condições de pagar.', 0, '', '', '2012-01-02'),
(72, 'HU', '0', '', '', 'USA APARELHO PHONAK NF 371323 06/07/2011 ATÉ 06/07/2012\nMODELO ELEVA 211 DAZ\nOE 211114X0MR8 / OD 211115X0P13\nPilha 13.\nData: 26/12/2011\nHora: 15:21:26\nMichelle: Dixou aparelho pois o mesmo esta mudo MODELO ELEVA 211 DAZ\nOE 211114X0MR8(os audiozoom 2236)\n---------------------------------------------------------\nData: 06/01/2012\nHora: 11:30:31\nFono: Tanara\nAssunto: Paciente retirou o aparelho na garantia ok.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 17:25:47\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 21/06/2012\nHora: 14:31:16\nMirella: Pct deixou aasi para revisão e limpeza ( Eleva 211 DAZ 1115X0P13, 1114X0MRS, Garantia)\n---------------------------------------------------------\nData: 29/06/2012\nHora: 13:33:44\nMirella: AASI ficou pronto, só esperando o paciente vir buscar.\n---------------------------------------------------------\nData: 11/02/2013\nHora: 11:03:40\nMirella: Pct veio buscar aasi, Tanra entregou o aasi para ele e vendeu 2 cartelas de pilhas 13.', 0, '', '', '2012-01-02'),
