(76, '', '0', '', 'IRMÃO ALENOIR QUE USA APARELHO', '30/8/2012 Pct comprou Naida PARA O SEU IRMÃO ALENOIR R$ 3.000,00 (R$ 1.000,00 no dinheiro + 10x R$ 200,00 no carnê)\nData: 30/08/2012\nHora: 15:36:30\nMirella: Pct eftuou o pgto da 1ª parcela (entrada) R$ 1.000,00.\n---------------------------------------------------------\nData: 11/09/2012\nHora: 14:10:36\nAssunto:cida. paciente esteve na loja e pagou a parcela do aparelho auditivo (07/10/2012)valor 200,00 reais em dinheiro.\n------------------------------------------------------------------------------------------------------\n21.10.14\nLidiane: Entrei em contato com o paciente para vir para open porém paciente foi roubado, e diz que não quer mais usar.', 0, '', '', '2012-01-02'),
