(74, '', '0', '', '', '02/05/2013 - COMPROU NAIDA S CRT III PARA OD: 1214H040X - PILHA 13 - RECEPTOR XSP Nº 2-R COM CAIXA C-SHELL - NF 452.219 - GARANTIA ATÉ 02/05/2013 - 3 ANOS PROG. DE ACOMPANHAMENTO\n----------------------------------------------------------------------------\n25/03/2013 PACIENTE TESTOU POR 7 DIAS AUDEO S SMART III COM RECEPTOR POWER. NÃO TEVE GANHO ESPERADO. MANDEI FAZER RECEPTOR UP COM CAIXA. PACIENTE VAI CONSULTAR COM DR. ROBERTO DE VINCENZI DIA 4 DE ABRIL E RETORNARÁ AQUI APÓS A CONSULTA. TESTAR MAIS 7 DIAS COM RECEPTOR UP.\n-------------------------------------------------------------------------\n24/06/2013 Paciente veio fazer regulagem de seu aparelho NAIDA S CRTIII.', 0, '', '', '0000-00-00');
