(82, '', '0', '', '', 'DIA: 03/05/2010 COMPROU AUDÉO III BILATERAL PILHA 312\nOD: 0933X0FPY \nOE: 0919X0MNR\nNF: 292441 DATA: 11//12/2009\nR$: 5.800,00 À VISTA\n01 ANO DE GARANTIA.\nData: 22/10/2009\nDébora: Paciente esteve na clínica e deixou ap. para orçamento de conserto. Referiu que tentou tirar o protetor de cera com a agulha e puxou a flange junto. Após fechar a gaveta de pilha o ap. fica ligado durante alguns segundos e em seguida fica mudo. Enviado para fábrica. EXTRA 33P R09073371.\n---------------------------------------------------------\nData: 29/10/2009\nThais: Paciente esteve na clinica e pagou metade do conserto do aparelho. R$360,00.\n---------------------------------------------------------\nData: 9/11/2009\nDébora: Ap. veio da fábrica. Feito troca de microfone, receptor e controle de volume. R$720,00. Já pagou R$360,00.\n---------------------------------------------------------\nData: 10/11/2009\nDébora: Paciente retornou à clínica para buscar aparelho. Pagou o restante que faltava R$360,00.\n---------------------------------------------------------\nData: 15/04/2010\nHora: 13:50:32\nMichelle:Paciente deixou 02 aparelhos EXTRA 33P R/L 09073371\npois não esta funcionando (os audiozoom 173). OD- só chiado / OE- s/ amplificação.\n---------------------------------------------------------\nData: 20/04/2010\nDébora: Orçamento: OD- microfone R$290,00 / OE- bloco- R$1130,00.\n---------------------------------------------------------\nData: 03/05/2010\nGANHOU AP. EXTRA 33P R/L 09073371\nAP. NÃO ESTÁ NA GARANTIA\n---------------------------------------------------------\nData: 22/12/2010\nHora: 13:51:47\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho da OE não estava funcioando. Era receptor. Feito a troca pois estava na garantia. Virá dia: 03/05 para retorno de 1 ano.\n---------------------------------------------------------\nData: 03/05/2011\nHora: 16:59:42\nFono: Tanara\nAssunto: Paciente veio com a nora para a 4 visita de 1 ano. Deixou os aparelhos para a revisão e limpeza que será feito na fábrica. Deixei 1 aparelho de empréstimo na OD. Entregarei as pilhas quando vir retirar os aparelhos.\n---------------------------------------------------------\nData: 27/05/2011\nHora: 09:11:33\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram da fábrica. Vem na segunda retirar.\n---------------------------------------------------------\nData: 30/05/2011\nHora: 17:25:45\nFono: Tanara\nAssunto: Paciente veio com a nora Terezinha buscar os aparelhos. Feito uma audiometria e nova regulagem ok. Orientei retirar a cera bilateral. Virá me novembro para o programa de acompanhamento.\n---------------------------------------------------------\nData: 14/09/2011\nHora: 15:01:43\nFono: Tanara\nAssunto: Paciente veio para buscar mais protetor de cera. Estava com os 2 aparelhos entupidos. Mas no conduto não tinha mais cera. Entregue 1 kit de cerustop e novembro virá para o programa de acompanhamento.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 09:27:24\nFono: Tanara\nAssunto: Paciente veio com o aparelho da OD mudo deixou para o conserto. Autorizou R$: 480,00. Já pagou R$: 200,00 e vai pagar mais R$: 280,00 quando chegar o aparelho. Porém quando a paciente foi embora percebi que era pilha. Vamos deixar o aparelho aqui e vamos dar 06 meses de garantia. Audéo III OD 0933X0FPY. Duarte autorizou falando que o aparelho não irá para a fábrica e vamos dar 6 meses de garantia.\n---------------------------------------------------------\nData: 14/05/2012\nHora: 10:32:13\nFono: Tanara\nAssunto: Paciente veio retirar e pagou os resto R$: 280,00. Demos 06 meses de garantia.\n07/06/2013 - paciente veio pois não estava conseguindo trocar o cerustop em casa. Quebrou a ponta dentro do receptor. Troquei e ficou tudo ok. ', 0, '', '', '2012-01-02'),
