(88, '', '0', '', '', '---------------------------------------------------------\nData: 25/05/2010\n26/03/2009 Comprou ap. Argosy microEterna nº OD- 0844X1RTA / OE- 0844X1RTS\nValor total R$ 14.500,00 à vista\nComprou controle remoto WatchPilot R$ 1.500,00\nEntregue 2 anos de garantia + 60 pilhas\n---------------------------------------------------------\nData: 14/10/2010\nDébora: Paciente esteve na clínica com a queixa de que a bateria do iCom está durando apenas um dia e que está perdendo a conectividade com o celular após curto tempo pareado. Foi emprestado um iCom nosso pra ele, pois o dele foi enviado pra fábrica.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 13:12:26\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD esta mudo. Era receptor porém vamos mandar para a fábrica fazer revisão na garantia. Emprestamos 2 Audeo Smart para teste. Ligaremos quando chegar os aparelhos.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 11:08:46\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram da fábrica. Virá buscar na semana que vem e devolver os que estão de empréstimo Audeo Smart, pois falou que agora não vai gastar com novos aparelho. Duarte vai conversar com ele.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 15:32:03\nFono: Tanara\nAssunto: Paciente veio buscar os aparelhos e devolveu os de empréstimo. Falou que são ótimos mas vai ficar com os deles.\n---------------------------------------------------------\nData: 18/03/2011\nHora: 12:35:32\nFono: Tanara\nAssunto: Paciente veio com sua esposa Isaura trazendo a audiometria para regular seus aparelhos. Feito regulagem e virá na segunda falar se ficou bom. Sua esposa aproveitou e fez um tampão de silicone de cor Rosa bilateral. Duarte fez por R$: 104,00.\n---------------------------------------------------------\nData: 12/04/2011\nHora: 13:12:50\nFono: Tanara\nAssunto: Paciente veio para deixar o i-com pois esta a bateria esta durante somente 1 dia. Vai para a fábrica e emprestamos outro.\n---------------------------------------------------------\nData: 27/04/2011\nHora: 13:40:10\nFono: Tanara\nAssunto: Paciente veio buscar o i-com e fiz tudo pareamento novamente. Tudo estava funcionando, celular, voiss. O telefone estava muito alto. Diminui e ficou ótimo.\n---------------------------------------------------------\nData: 19/10/2011\nHora: 11:36:15\nFono: Tanara\nAssunto: Paciente veio relatando que não esta escutando o celular tocar com I-com. Veirifquei que o aparelho da OE estava sem amplificação, esta mudo. Vai para a fábrica. Audéo Yes IX OE 0951H08UL.\n---------------------------------------------------------\nData: 07/11/2011\nHora: 16:21:12\nFona: Tanara\nAssunto: Liguei e avisei a esposa que o I-com já chegou de S.P.\n---------------------------------------------------------\nData: 16/11/2011\nHora: 11:08:52\nFono: Tanara\nAssunto: Paciente veio retirar o I-com e deixou o outro aparelho para o conserto, esta com baixo ganho. Audéo Yes IX 0951H08UA. Deixamos emprestado 2 Audéo Yes III.\nMichelle: Paciente retirou o I-com e pagou 480,00 reais\n---------------------------------------------------------\nData: 28/11/2011\nHora: 15:36:44\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram. Virá na quarta as 8 hs.\n---------------------------------------------------------\nData: 30/11/2011\nHora: 09:10:39\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos. Feito regulagem e pareamento com I-com, Voiss e My Pilot ok.\n---------------------------------------------------------\nData: 24/01/2013\nHora: 15:51:16\nFRANCINE: Entrei em contato telefonico para agendar teste com Lyric. Paciente esta viajando e conversei com sua esposa. a mesma relatou que o S. Valdemar não esta usando pois não esta suprindo as necessidades do paiente. Fiquei de retornat amanhã para conversar melhor.\n---------------------------------------------------------\n26/03/2013- iz contato telefônico com o paciente para informar do lançamento do lyric. Ficou bem interessado e falou que final de abril vem aqui para conversarmos.\n------------------------------------------------------------\n27/03/2013 - PACIENTE TROUXE APARELHO ICOM 0929F2HAK, MYPILOT,OD 0951H08UA,OE 0951H08UL PARA REVISÕ POIS NAO UTILIZA A BASTANTE TEMPO.\n--- Aparelho da OD não está funcionando e da OE está com pouca amplificação. Deu orçamento de 4º ano de uso - R$1040,00 cada. Paciente autorizou o conserto. Emprestei Audeo S Smart IX e Com-pilot enquanto AASIs estão em SP.------------------------------------------------------------------------------\n03/07/2013 - Aparelho da OD não está funcionando e da OE está com pouca amplificação. Deu orçamento de 4º ano de uso - R$1040,00 cada. Paciente autorizou o conserto. Emprestei Audeo S Smart IX e Com-pilot enquanto AASIs estão em SP.', 0, '', '', '0000-00-00'),
(89, 'HU', '0', '', '', 'PHONAK EXTRA 22 NF 293979 28/12/2009 ATÉ 28/12/2010\nOD: 12096552\nDIA: 07/06/2011 COMPRA CERTENA 22 MAIS I-COM\nOD: P11G0184R \nOE: P11G0185L\nR$: 10.500,00 ENT. 5.000,00 MAIS 10X DE 550,00 NO CRÉDITO\nNF: 372269 DATA: 13/07/2011\n01 ANO DE GARANTIA\nData: 03/05/2010\nHora: 10:23:32\nMichelle:Paciente trouxe aparelho pois Flange esta solta(os audiozoom 171).\n---------------------------------------------------------\nData: 29/03/2011\nHora: 15:47:16\nMichelle: Paciente deixou aparelho pois aparelho liga e desliga fica mudo verificado Duarte modelo extra 22d R12096552(os audiozoom 1561).\n---------------------------------------------------------\nData: 30/03/2011\nHora: 15:35:45\nFono: Tanara\nAssunto: Liguei para a paciente e passei o valor de R$: 280,00. Vai para a fábrica. Autorizado.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 11:54:42\nFono: Tanara\nAssunto: Liguei e deixei recado que o aparelho já chegou da fábrica. Vem buscar amanhã. Vai pagar R$: 280,00.\n---------------------------------------------------------\nData: 15/04/2011\nHora: 16:21:57\nCida: Paciente retirou sem os pois extraviou a mesma Alices Carminat rg 1159846\n---------------------------------------------------------\nData: 07/06/2011\nHora: 14:28:11\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto, esta na garantia de conserto. Vai para a fábrica. Feito audiometria e teste com Audéo Smar III bilateral mais I-com. Paciente adorou e fechou a venda \nR$: 10.500,00, sendo R$: 5.000,00 de entrada em depósito hoje a tarde mais 10x de R$: 550,00 no cartão de crédito. Vem na quinta para entregar o kit de venda, contrato e 2 cartelas de pilhas.\n---------------------------------------------------------\nData: 09/06/2011\nHora: 13:12:25\nFono: Tanara\nAssunto: Paciente veio para buscar o kit de compra e falou que esta dando muito coseira principalmente na orelha esquerda. Feito pré-molde bilateral para a confecção de micro-caixa. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 13/06/2011\nHora: 17:31:34\nFono: Tanara\nAssunto: Paciente veio super triste pois perdeu o aparelho da OE. Vai acionar o seguro por R$: 1.800,00. Vai fazer em 4x. Retirou o aparelho Intra. Ligarei quando chegar a caixinha dela.\n---------------------------------------------------------\nData: 21/06/2011\nHora: 16:48:09\nFono: Tanara\nAssunto: Paciente veio retirar a micro-caixa bilateral ok. Feito também a 1 visita. Entregue os brindes e marcado a 2 visita dia: 12/09 as 15 hs. Ficou preocupada sobre os R$: 1.800,00 Duarte conversou e falou para ficar tranquila quando ela puder ela paga.\n---------------------------------------------------------\nData: 18/07/2011\nHora: 17:12:46\nFono: Tanara\nAssunto: Paciente veio para a adaptação dos Certenas 22. ok diz que ficou ótimo e esta usando o I-com. Desta vez não esta saindo da orelha. Vai trazer os 2 Audéo Smart III e o BO que falta R$: 1.800,00 para pagar.\n---------------------------------------------------------\nData: 25/07/2011\nHora: 12:18:21\nFono: Tanara\nAssunto: Paciente veio para o retorno dos Certenas 22. Falou que esta adorando mas sente muita mudança de programas. Fiz uma regulagem e ficoi ok. Falou que vai fazer o B.O e vai trazer pra nós. Vai pagar R$: 1.800,00. Retornará em outubro.\n---------------------------------------------------------\nData: 19/08/2011\nHora: 13:59:28\nFono: Tanara\nAssunto: Paciente veio relatando que as pilahs duram pouco e que as vezes da um barulho quando fala ao telefone. Feito gerenciador de microfonia ok. Retorno em outubro.\n---------------------------------------------------------\nData: 18/10/2011\nHora: 11:00:01\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OE não esta funcionando. Veirifquei que estava sem amplificação. Vai para a fábrica e ligaremos quando voltar. Certena 22 OE P11GO185L. Esta na garantia.\n---------------------------------------------------------\nData: 26/10/2011\nHora: 15:18:39\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá buscar amanhã.\n---------------------------------------------------------\nData: 12/01/2012\nHora: 08:52:29\nFono: Tanara\nAssunto: Paciente veio e deixou o aparelho com o faceplate descolado. Vai para S.P Certena ITC P11GO185L.\n---------------------------------------------------------\nData: 25/01/2012\nHora: 09:40:37\nFono: Tanara\nAssunto: Liguei e avisei a paciente que o aparelho já chegou. Virá buscar na segunda.\n---------------------------------------------------------\nData: 30/01/2012\nHora: 16:35:16\nFono: Tanara\nAssunto: Paciente veio para buscar o aparelho da OD e deixar o da OE pois também esta com o faceplate descolado. Paciente diz que molhou sem querer e depois passou o secador. Certena 22 OE P11GO185L.\n---------------------------------------------------------\nData: 01/06/2012\nHora: 09:46:26\nFono: Tanara\nAssunto: Paciente veio deixar os aparelhos para o onserto. OE esta na garantia e descolou o face plate Certena 22 OE P11GO185L e o aparelho da OD estava dentro do bolso da calça e a calça dentro da máquina de lavar roupa. A fábrica não cobre a garantia Será cobrado R$: 364,00. OD P11GO185R.\n---------------------------------------------------------\nData: 27/06/2012\nHora: 14:22:37\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram. Virá buscar e vai pagar R$: 364,00 pelo da OD que entrou na máquina de lavar roupa. Início da tarde paciente veio para retirar os aparelho. Feito regulagem ok. Pagou R$: 364,00 no cartão de crédito.\n---------------------------------------------------------\nData: 18/02/2013\nHora: 10:18:16\nAssunto: Suzan - Deixou aparelho para conserto. OS: 2775. Total do valor do conserto do aparelho R$ 624,00 ja efetuou pagamento de R$300,00. Falta pagar R$324,00.\n---------------------------------------------------------\nData: 04/03/2013\nHora: 15:22:50\nAssunto: Suzan - Pegou 2 cartelas 312 do programa de acompanhamento.\n---------------------------------------------------------\nData: 04/03/2013\nHora: 15:27:29\nAssunto: Suzan - Veio buscar aparelho OS: 2775. E efetuou o resto do pagamento que faltava R$ 324,00. O total do conserto foi R$ 624,00.\n14/06/2013-Marido veio buscar os brindes do programa de acompanahmento. Entreguei 6 cartelas de pilhas 312 + 1 cerustop. Não trouxe livreto. Não entregar a proxima se não trouxer o livreto.\n03/07/2013-PACIENTE DEIXXOU APARELHO PHONAK CERTENA P11GG0184R PARA ORÇAMENTO PRAZO DE TRES DIAS.OS 2959\n05/07/2013-PACIENTE AUTORIZOU O ORÇAMENTO DE R$364,00 PARA CONSERTAR APARELHO AUDITIVO. FALOU QUE EU COLOQUEI UM PAPEL QUE CONSTA QUE A GARANTIA VAI ATÉ JULHO. PORÉM A GARANTIA FOI ATPE JULHO DE 2012. NÃO SEI O QUE EU FIZ DE ERRADO, PORÉM DA MESMA FORMA, A PACIENTE AUTORIZOU O VALOR. ENVIAR PARA SP.\n31/07/2013-PACIENTE RETIROU APARELHO PHONAK CERTENA N° P11G0184R PAGOU O VALOR DE R$ 364,00 e deixou aparelho certena P11G0184R COM URGENCIA POIS PACIENTE VAI VIAJAR E PRECISA.OS 2959\n28/04/2014- ACABOU PROGRAMA DE ACOMPANHAMENTO LETICIA ENTREGOU TODOS OS MATERIAIS', 0, '', '', '2012-01-02'),
