(98, '', '0', '', '', 'DIA: 21/11/2011 COMPROU NAIDA III SP OD \nOD: 1122X0T4L\nNF: 384.143 DATA: 30/09/2011\nR$: 4.500,00 ENT. 1.000,00 MAIS 7X DE 428,00 NO CARNÊ\n01 ANO DE GARANTIA.\nData: 09/11/2011\nHora: 15:43:56\nFono: Tanara\nAssunto: Paciente veio com sua irmã Cleusa para fazer teste e orçamento de aparelho auditivo. Já tinha audio e coloquei Naída III SP bilateral. Paciente se emocionou ao voltar ouvir. Passei o preço de R$: 9.000,00 bilateral em 10x sem juros. Virá na sexta para o retorno de teste e no fim de semana vai ter uma reunião com a familia para comprar o aparelho.\n---------------------------------------------------------\nData: 23/11/2011\nHora: 10:35:19\nFono: Tanara\nAssunto: Paciente comprou o aparelho R$: 4.500,00. Deu uma entrada de R$: 1.500,00 e o resto parcelou em 7x de R$: 428,00 no carnê. Retirou o molde de acrílico.\n---------------------------------------------------------\nData: 08/12/2011\nHora: 13:29:04\nFono: Tanara\nAssunto: Paceinte veio para a 1 visita. Trocamos a caixa do aparelho e entreguei os brindes. Marquei a 2 visita.\n(Cida) CLIENTE ESTEVE NA LOJA E PAGOU Á 1ª PARCELA DO APARELHO AUDITIVO VALOR 428,00 REAIS 353,00 EM DINHEIRO E 75,00 EM CHEQUE.\n---------------------------------------------------------\nData: 11/01/2012\nHora: 12:23:00\nFono: Tanara\nAssunto: Paciente veio relatando que não esta escutando muito bem. Verifiquei que seu ouvido esta inflamado e orientei procurar o Otorrino.\n---------------------------------------------------------\nData: 02/05/2012\nHora: 14:07:06\nAssunto:mirella. paciente steve na loja e pagou a 6º parcela do aparelho auditivo valor 428,00 reais (dinheiro).\n---------------------------------------------------------\nData: 03/08/2012\nHora: 10:00:58\nFono: Tanara\nAssunto: Paciente veio para trocar a manguerinha. Fez também tampão bilateral de silicone dor verde com puxador. R$: 150,00, pagou R$: 50,00 vai pagar os outros R$: 100,00 em 2x. Entreguei 2 cartelas de pilha número 13.\n----