(109, '', '0', '', '', 'DIA: 08/05/2012 COMPROU AUDÉO SMART V BILATERAL PILHA 312\nOD: 1123X10D4 \nOE: 1120X096N NF: 392.117 DATA: 29/11/2011\nR$: 10.000,00 ENT. 1.000,00 MAIS 9X DE 1.000,00 NO CHEQUE\n01 ANO DE GARANTIA.\n--------------------------------------------------------\nData: 15/06/2012\nHora: 14:50:26\nMirella: Pct veio com o aasi mudo, Duarte trocou o cerustop, aasi voltou a funcionar normalmente, pct aproveitou para entrgar o último cheque da negociação referente a compra do par de aasi - banco 001 ag. 5211, c/c 006420-3, cheque n° 000020 R$ 1.000,00 bom para 09/2/2013.Duarte entregou um kit cerustop + 5 cartelasde pilhas 312.\n---------------------------------------------------------\nData: 15/08/2012\nHora: 16:03:45\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Diz que esta escutando muito bem. Só troquei as olivas fechadas por abertas. Marquei retorno dia: 08/11/2012. Entreguei o cupom fiscal no valor de R$: 10.000,00.\n---------------------------------------------------------\n27/06/2013 - PACIENTE DEIXOU SEU PARELHO PHONAK AUDEO SMART 112X096N,1123X10D4 PRA CONSERTO, FALOU COM A FONO FRANCINE. OS 2951.\n----------------------------------------------------------------------------\n17/07/2013 - Paciente retirou brindes 6 pilhas 312, 8 cerustop.\n-------------------------------------------------------------------------------\n28/03/2014 - paciente esteve na loja e deixou o aparelho phonak audéo nª 1123x1004 para conserto. ( enviado para são paulo dia 28/03/2014. OS 1375.', 0, '', '', '0000-00-00'),
