(112, 'DANIEL', '0', '', 'APARELHO CÁSSIA 10 PETITE FEITO TROCA DE CAIXA P/ NOVO PACIENTE S/ NÚMERO DE SÉRIE', 'DIA: 07/12/2010 COMPROU MAXX 22 BILATERAL PILHA 312\nOD/OE: 03119594\nR$: 7.000,00 À VISTA\n01 ANO DE GARANTIA\nDIA: 18/04/2011 TROCA DOS AUDÉOS POR MAXX 22 BILATERAL\nData: 22/06/2010\nHora: 14:31:54\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza MODELO EXTRA L11061434 R 11061434 (os audiozoom 1165)\n---------------------------------------------------------\nData: 23/06/2010\nHora: 15:57:58\nMichelle:Paciente retirou aparelho feito revisão e limpeza MODELO EXTRA L11061434 R 11061434 (os audiozoom 1165)\n---------------------------------------------------------\nData: 03/12/2010\nHora: 16:13:10\nMichelle: Paciente deixou aparelho para fazer revisão e limpeza MODELO EXTRA L11061434 R11061434 (os audiozoom).\n---------------------------------------------------------\nData: 08/12/2010\nDébora: Retirou os aparelhos. Pago R$200,00.\n---------------------------------------------------------\nData: 22/12/2010\nHora: 15:33:49\nFono: Tanara\nAssunto: Paciente veio para o retorno. Feito um recebido de R$: 7.000,00 que já havia pago. Feito a 1 visita, entregue os brindes. Marcado a 2 visita dia: 24/12/2011.\n---------------------------------------------------------\nData: 28/12/2010\nHora: 10:43:17\nFono: Tanara\nAssunto: Ligado para a paciente avisando que as caixinhas já chegaram. Virá a tarde. A tarde paciente veio e falou que ficou bem melhor. Exliquei como faz a limpeza e março virá para a 2 visita.\n---------------------------------------------------------\nData: 24/03/2011\nHora: 11:41:23\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Diz que esta muito triste pois não consegue se adaptar com os aparelhos. Diz que sempre usou Intra e gostaria muito de saber se tem como fazer a troca. Falei com o Duarte e ele autorizou fazer troca dos aparelhos. Será os Maxx 22 do Diogo. Virá na segunda.\n---------------------------------------------------------\nData: 28/03/2011\nHora: 16:56:19\nFono: Tanara\nAssunto: Paciente veio para fazer os moldes pois vamos trocar os aparelho delas pelos Intra Maxx 22. Será feito na fábrica e será cobrado 560,00, sendo 290,00 cada cápsula. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 18/04/2011\nHora: 11:25:02\nFono: Tanara\nAssunto: Paciente veio buscar os aparelhos. Pagou R$: 580,00 e devolveu os Audéo Yes III bilateral. Gostou muito da troca e agradeceu. Paciente continua com o programa de acompanhamento, mas agora com Maxx 22.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 12:11:16\nFono: Tanara\nAssunto: Paciente veio para o retorno dos Maxx 22 bilatera. Falou que precisa ser mais alto na OD. Feito aumento de ganho geral ok.\n---------------------------------------------------------\nData: 11/05/2011\nHora: 08:17:35\nFono: Tanara\nAssunto: Paciente veio para o retorno. Colocado o fio de naylon e expliquei a troca do protetor de cera smart ok. Expliquei também o botão do controle de volume.\n---------------------------------------------------------\nData: 26/10/2011\nHora: 18:28:48\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho Mudo para o conserto. Esta na garantia, porém para a Audiozoom não. Maxx 22 OD 03119594. Será verifiado na fábrica.\n---------------------------------------------------------\nData: 14/11/2011\nHora: 14:21:51\nMichelle: Paciente retirou aparelho\n---------------------------------------------------------\nData: 09/12/2011\nHora: 12:06:32\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Entregue os brindes e marquei a 5 visita.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 15:10:33\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 17/10/2012\nHora: 08:48:26\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho estava mudo. Verifiquei e esta funcionando bem, porém precisava trocar os protetores de cera. Falei de aparelhos novos Ambra ITC por R$: 14.000,00 bilateral promoção. O Duarte faz em 7x de R$: 2.000,00. Vai falar com o filho e ligará.\n---------------------------------------------------------\nData: 29/11/2012\nHora: 08:33:23\nAssunto: Suzan - Sra. Ana deixou aparelho para revisão OS: 2746. Não esta na garantia. R$ 280,00.\n---------------------------------------------------------\nData: 18/12/2012\nHora: 08:48:11\nAssunto: Suzan - Sra. Ana veio buscar o aparelho. OS: 2746. Efetuou o pagamento. R$280,00. Entregue 2 cartelas de pilhas 312 e 2 capsulas do programa de acompanhamento.\n---------------------------------------------------------\nData: 28/01/2013\nHora: 15:48:18\nFRAN - prog. de acompanahmento. entregue brindes. Deixou aasi OE para revisão. Aprovou R$280,00 de orçamento.\n---------------------------------------------------------\nData: 14/02/2013\nHora: 15:24:28\nAssunto: Suzan - Sra. Ana veio buscar aparelho OS:2772. EFETUOU PAGAMENTO. R$ 280,00 DO CONSERTO DO APARELHO.\n---------------------------------------------------------\nData: 26/02/2013\nHora: 15:02:17\nAssunto: Suzan - Deixou aparelho para conserto. Esta na garantia do conserto de 6 meses. ARGOSY MAX22. OS: 2830.\n---------------------------------------------------------\nData: 12/03/2013\nHora: 13:58:36\nAssunto: Suzan - Veio buscar aparelho que estava com baixa amplificação. OS: 2830. Estava na garantia. ARGOSY MAX 22.\n---------------------------------------------------------\nData: 12/03/2013\nHora: 16:42:22\nFRANCINE: REGULAGEM AASI - ESTAVA MUITO FRACO. FICOU BOM.\n-------------------\n06/10/2014 - Zana\nPcte compareceu para revisão e conserto da OE.\nOfereci novo teste e acabou adquirindo novos aparelhos.\nCassia 10 em AO. Fiz moldagens para mandarmos para confecção em laboratório. \nPgto à vista via transferência BB - valor total R$ 7.000,00.\nNora Gisela acompanhou o atendimento. Passadas instruções e orientações qto ao modelo, cuidados, manuseio, pilha etc...\nFicamos com aparelho Maxx 22 OE e troquei sem custo filtro das OD.\n--------------------------------------\n21.10.14\nLidiane: Entrei e contato com a paciente porém paciente comprou conosco a 15 dias só está esperando chegar.ok', 0, '', '', '2012-01-02'),
