(120, '', '0', '', '', '20/05/09 Comprou 01 aparelho Bernafon Neo 102 OE n  102783     pilha 13\n1 ano de garantia\nValor Total R$ 1.000,00 Entr. R$500,00 + 2x de 250,00\n---------------------------------------------------------------------\nData: 27/01/2009\nCLIENTE ESTEVE NA CLINICA FOI FEITO REVISÃO E TROCADO ÂNGULO AP.,MAIS APARELHO CONTINUOU APITANDO,\n---------------------------------------------------------\nData: 12/02/2009\nDébora: Revisão e troca de ângulo. R$100,00.\n---------------------------------------------------------\nData: 13/02/2009\nDébora: Paciente veio buscar aparelho BTE Beltone sem conserto. Foi orientado a levar o aparelho na loja da Beltone.\n---------------------------------------------------------\nData: 20/12/2010\nHora: 08:28:59\nFono: Tanara\nAssunto: Paciente ligou interessado no Mini Audeo pois recebeu o quebrando o silêncio. Expliquei e convidei para um teste falou que virá assim que der. Ligarei em Janeiro.\n---------------------------------------------------------\nData: 14/02/2011\nHora: 13:56:44\nFono: Tanara\nAssunto: Liguei e conversei com o paciente a respeito dos lançamentos que havia ligado. paciente falou que vem trazer o aparelho para fazer uma revisão e limpeza e vamos conversar a respeito. porém falou que não vai mais gastar com aaprelhos auditivos.\n', 0, '', '', '0000-11-30'),
(121, '', '0', '', '', 'DIA: 09/04/2012 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1146X0MM4\nOE: 1146X0MMA\nNF: 400.523 DATA: 31/01/2012\nR$: 9.000,00 ENT. 1.800,00 MAIS 4X DE 1.800,00 NO CRÉDITO\n01 ANO DE GARANTIA.\nData: 02/04/2012\nHora: 11:47:32\nFono: Tanara\nAssunto: Paciente veio com a filha Maria encaminha pelo Dr. Gustavo Fasolo para fazer teste com aparelhos. Feito teste com Audéo Smart IX. Levou para casa, mas se assustou com o preço. Duarte passou R$: 15.000,00.\n---------------------------------------------------------\nData: 04/04/2012\nHora: 11:49:46\nFono: Tanara\nAssunto: paciente voltou querendo colocar o mais barato. Audéo Smart III bilateral por R$: 9.000,00. Levou para casa e retornará dia: 09/04/2012.\n---------------------------------------------------------\nData: 09/04/2012\nHora: 11:50:39\nFono: Tanara\nAssunto: Paciente adorou os aparelhos e fechou a venda em R$: 9.000,00 em 5x de R$: 1.800,00 no cartão de crédito.\nPACIENTE DEIXOU APARELHO POIS O MESMO FOI DANIFICADO PELO CACHORRO. MODELO AUDÉO SMART III OE 1146X0MMA(OS AUDIOZOOM 1300)', 0, '', '', '2012-01-02'),
(122, '', '0', '', '', 'DIA: 21/06/2012 COMPROU NAÍDA III SP OD PILHA 13\nOD: 1120X0PCP\nNF: 392.117 DATA: 29/11/2011\nR$: 4.100,00 ENT. 410,00 MAIS 9X DE 410,00 NO CHEQUE\n01 ANO DE GARANTIA.\n------------------------------------------------------------------------\nData: 20/07/2011\nHora: 14:33:00\nFono: Tanara\nAssunto: Feito pré-molde dentro do carro da OD para a confecção do molde de silicone concha escavada com 1mm de ventilação.\nMichelle: Paciente já deixou pago 65,00 reias ref: a 1 molde.\n---------------------------------------------------------\nData: 22/07/2011\nHora: 11:07:28\nAssunto:cida. nesta data paciente retirou o molde de silicone. obs. o molde foi pago no dia 20/07/2011 quando foi feito o pré -molde.\n---------------------------------------------------------\n23/04/2014 - marido da paciente trouxe o aprelho phonak naida nº1120XOPCP para orçamento.\n--------------------------------------------------------------\n25/04/2014 - esposo da paciente esteve na loja e deu o valor de 300,00 reais para autorizaçao do conserto do aparelho.\n--------------------------------------------------------------------------------\n12/05/2014 - marido da pct veio na loja e retirou o aparelho phonak naida III nº 1120x00pcp . obs. valor do conserto 600,00 reais deu uma entrada de 300,00 reais e um cheque no valor de 300,00 reais para 6 de junho.', 0, '', '', '0000-11-30'),
