(125, '', 'Leticia ', '', '', 'DDIA: 25/05/2012 TESTE COM AUDÉO SMART S V BILATERAL R$: 15.000,00 OU R$: 13.000,00 A VISTA\n\n----------------------------------------------------------------\nData: 25/05/2012\nHora: 15:21:57\nFono: Tanara\nAssunto: Paciente veio encaminhado por um pintor veio com a audiometria. Feito teste com Audéo smart V e levou para casa.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 15:23:47\nFono: Tanara\nAssunto: Paciente devolveu relatando que agora não poderá comprar nenhum aparelho. Mas voltará quando der.\n---------------------------------------------------------\nData: 13/9/2012\nHora: 15:23:27\nAssunto: Suzan  - Quem atendeu o telefone foi extremamente grossa e não deixou falar com o Sr. Valter.\n---------------------------------------------------------\nPACIENTE COMPROU APARELHOS NAÍDA SCRT III NO VALOR DE R$ 8.500,00 1+10X CARTÃO E NO CHEQUE.\nNF: 543.759   DTNF: 30/05/2014 ', 0, '', '', '2014-07-24'),
