(129, '', '0', '', '', 'ata: 15/03/2011\nHora: 14:51:08\nFono: Tanara\nAssunto: Paciente veio relatando que foi no Dr. Kowalski por causa da garganta. O médico solicitou uma audiometria. Feito o exame e apresentou perda somento nas frequencias de 6 e 8 Hz. Orientei fazer a audiometria 1 fez por ano para fazer acompanhamento.\n----------------------------------------', 0, '', '', '0000-00-00'),
(128, '', '0', '', '', 'DIA: 20/12/2011 COMPROU CERTENA CIC BILATERAL PILHA 10\nOD: P11L1011R\nOE: P11L101OL\nNF: 395993  DATA: 26/12/2011\nR$: 7.800,00 ENT. 5.000,00 MAIS 5X DE 560,00 NO CHEQUE\n01 ANO DE AGRANTIA.\nData: 21/07/2011\nHora: 13:56:05\nFono: Tanara\nAssunto: Paciente veio para saber preços de aparelhos novos. Já é usuário e quer comprar aparelhos novos. Expliquei as técnologias e recursos de cada aparelho. Paciente ficou mais de 1 hora perguntando coisas sobre os aparelhos. Passei os valores e falou que ia pensar.\n---------------------------------------------------------\nData: 06/12/2011\nHora: 10:06:04\nFono: Tanara\nAssunto: Paciente veio para fazer teste com aparelhos. Mostrei o Audéo Smart III bilateral e fiz teste com I-com. Gostou e levou paraa a casa. Voltará na quinta ou sexta para fazer o pagamento. Diz que vai pagar R$: 5.000,00 de entrada.\n---------------------------------------------------------\nData: 20/12/2011\nHora: 09:49:30\nFono: Tanara\nAssunto: Paciente veio e fechou a venda do Certena CIC bilateral. Deu a entrada de R$: 5.000,00 em cheque e quando chegar os aparelhos dará mais 5 cheques de 560,00 cada. Feito pré-molde bilateral.\n---------------------------------------------------------\nData: 28/12/2011\nThaisa: Liguei para avisar que aparelho chegou. Virá buscar amanhã, as 10h. Ok\n---------------------------------------------------------\nData: 09/01/2012\nHora: 08:58:05\nFono: Tanara\nAssunto: Paciente veio para a 1 visita, porém quem atendeu foi a Thaisa pois esta doente. Ela entregou os brindes e marcou a 2 visita.\n---------------------------------------------------------\nData: 19/11/2012\nHora: 14:04:29\nMirella: Pct deixou aasi para revisão com Suzan (Certena ART P11L1011R, P11L1010L), GARANTIA.\n---------------------------------------------------------\nData: 27/11/2012\nHora: 17:59:18\nMirella: Pct veio retirar os aasi, trouxe canhoto.\n---------------------------------------------------------\nData: 10/12/2012\nHora: 08:54:44\nFRANCINE: 4ª vista programa de acompanhamento. Relata que a pilha esta durando 4 dias. Fiz orientações. Levou 10 cartelas pilha 10.\n12/04/2013 - Paciente veio dia 8 - segunda, para pegar mais pilhas do prog. de acompanhamento. Porem já havia recebido 12 cartelas em janeiro. Aparelho ficou em teste para verificar se não estava com alto consumo de pilha. Ficou 70 horas ligado - tudo ok. Paciente veio hoje e retirou o aparelho e vai comprar se faltar pilha.', 0, '', '', '2012-01-01'),
