(138, '', '0', '', '', 'DIA: 24/10/2011 COMPROU NAÍDA III UP OD PILHA 675\nOD: 1120X0MCK\nR$: 4.100,00 ENT. 1.000,00 MAIS 1X 600,00 MAIS 1X 1.700,00 MAIS 1X 150,00 MAIS 5X 130,00 NO CARNÊ\nNF: 370.632 DATA: 30/06/2011\n01 ANO DE GARANTIA.\nData: 18/10/2011\nHora: 11:29:23\nFono: Tanara\nAssunto: Paciente veio com sua mãe Alaide encaminhado pelo Dr. Kowalski para realizar uma audiometria e teste com aparelho. Sempre usou aparelho analógico que ganhou do SUS, porém nunca gostou e usou 1 vez digital que também gostou e adorou só que esta estragado. Feito audio perda profunda e usa somente na OD pois OE não gosta. Testamos Naída III UP e paciente adorou. Levou para casa e voltará na semana que vem.\n---------------------------------------------------------\nData: 24/10/2011\nHora: 11:31:28\nFono: Tanara\nAssunto: Paciente veio com sua mãe e fechou a venda. Duarte fechou em R$: 4.100,00, sendo R$: 1.000,00 de entrada mais R$: 500,00 quando receber o decissimo terceiro e os outro R$: 2.600,00 vai tentar empréstimo pelo banco até dezembro no máximo janeiro. Pagou hoje 1.000,00. Virá para pegar o molde de silicone concha escavada sem ventilação e a cor que irá escolher.\n---------------------------------------------------------\nData: 01/11/2011\nHora: 17:06:37\nFono: Tanara\nAssunto: Duarte atendeu a paciente e marcou dia: 16/11/2011 o retorno do 1 visita. Entregar o kit de compra e os brindes da 1 visita.\n---------------------------------------------------------\nData: 09/05/2012\nHora: 13:30:27\nMirella: Pct efetuou o pgto da parcela de Abril e Maio, totalizando R$ 260,00.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 15:27:33\nAssunto:cida Aendreza esteve na loja e fez o pagamento  da 6ª parcela do aparelho auditivo valor 130,00 reais.\n---------------------------------------------------------\nData: 11/02/2013\nHora: 17:12:51\nAssunto: Suzan - Paciente pagou a ultima parcela do aparelho. R$ 130,00.\n-------------------------------