(146, '', '0', '', 'PILHA 312', 'DIA: 12/04/2011 COMPROU APARELHO AUDÉO MINI III OE\nOE: 1046X1Y0K\nR$: 3.700,00 A VISTA\nNF: 349.988 DATA: 16/02/2011\nDIA: 02/08/2012 COMPROU AUDÉO SMART III OE PILHA 312\nOE: 1151X0TLV\nNF: 426.279 DATA: 17/07/2012\nR$: 2.500,00 \n01 ANO DE GARANTIA\nData: 12/04/2011\nHora: 13:20:38\nFono: Tanara\nAssunto: Paciente veio com sua sobrinha Denise indicada pelo paciente Rogério Luckmann. Feito audiometria e teste com Audéo Mini III bilateral. Paciente só tinha condições de comprar 1 aparelho OE e fechou a vista R$: 3.700,00 pois quem emprestou o dinheiro foi a sobrinha. Marcados retorno dia: 19/04.\n---------------------------------------------------------\nData: 19/04/2011\nHora: 13:08:07\nFono: Tanara\nAssunto: Paciente veio com a Denise sua sobrinha. Diz que melhorou bastante e passamos para o nivel 2 da aclimatização. Marcado retorno na semana que vem para a 1 visita.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 12:49:15\nFono: Tanara\nAssunto: paciente veio para a 1 visita. Entregue os brindes e falou que agora esta ouvindo bem melhor. Expliquei que vai melhorando aos poucos. Esta bem contente com o resultado. Marcado a 2 visita e marquei em maio um retorno extra.\n---------------------------------------------------------\nData: 02/08/2012\nHora: 17:12:03\nFono: Tanara\nAssunto: O sobrinho Jorge veio para comprar um novo aparelho para sua tia. Ele perdeu ao trazer para a revisão. Comprou por R$: 2.500,00 a vista o Audéo Smart III OE. Pagou em dinheiro. Vou dia: 16/08/2012 no azilo para fazer a 1 visita.\n---------------------------------------------------------\nData: 16/08/2012\nHora: 16:00:19\nFono: Tanara\nAssunto: Fiz o atendimento domiciliar para a paciente. Levei o aparelho Audéo Smart III e devolveu o Audéo S Smart III. Farei mais uma visita daqui 15 dias.\n19/12/2013 - PACIENTE AUTORIZOU CONSERTO VAI FAZER O DEPOSITO DE 182,00 E VAI LIGAR PARA CONFIRMAR(OS AUDIOZOOM 3099)\n09/01/2014-PACIENTE DEU 182,00 REAIS PARA CONSERTO DO APARELHO EM SÃO PAULO\n---------------------------------------------------------\n26/06/2014 - paciente realizou exame de audiometria, e comprou aparelho para orelha direita Audéo S Smart III NS: 1334X1JTY NF: 515.376 DATA: 27/12/2013, 01 ANO DE GARANTIA E 03 ANOS DE PILHA. MANDADO FAZER CAIXA CSHEL FIO 2R RECEPTOR SUPER POWER PLUS, SEM VENTILAÇÃO.', 0, 'PERDA AUDITIVA NEUROSENSSORIAL SEVERA', 'PERDA AUDITIVA NEUROSENSSORIAL SEVERA À PROFUNDA ', '2014-06-26'),
