(149, 'HU', '0', '', 'PCTE COMPROU PAR DE NAIDA SCRT III (VENDIDO ÚLTIMO PAR DE IX)\nVALOR DE R$6.500,00 À VISTA AUTORIZADO PELA GERENTE BRUNA\n1 ANO DE GARANTIA\n1 ANO DE PAA\nNS 1303X0WRT/ 1303X0WRN\nNF: 466.508 DT: 25/03/2013', 'USA AP. PHONAK EXTRA 211 AZ  N  OD- 0920X0P6E / OE- 0920X0P6A\nNF 278674 GARANTIA 11/08/09 ATÉ 11/08/2010\nData: 05/05/2010\nHora: 11:53:11\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza  OD- 0920X0P6E / OE- 0920X0P6A (os audiozoom 1105).\n---------------------------------------------------------\nData: 14/5/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.', 0, 'NEUROSSENSORIAL DE GRAU LEVE À SEVERO', 'NEUROSSENSORIAL DE GRAU LEVE À SEVERO', '2012-05-02'),
(150, '', '0', '', 'REALIZA TROCA DO LYRIC COM A BRUNA.', 'DIA: 10/04/2012 COMPROU AUDÉO SMART IX BILATERAL PILHA 312\nOD: 1127H03DK / OE: 1127H03DY\nNF: 392.117 DATA: 29/11/2011 - R$: 15.000,00 À VISTA EM DINHEIRO\n03 ANOS DE GARANTIA \nI-COM - TV LINK - MY PILOT                                                                                           01/04/2013 - COMPROU 2 LYRIC. PLANO DE 3 ANOS. VALOR R$24000,00 A VISTA.\nData: 04/07/2012\nBruna: Veio para parear o ICOM com seu novo celular. Ofereci NANO. R$ 35.000,00. OK\n---------------------------------------------------------\nData: 20/12/2012\nHora: 15:19:32\nFRANCINE: AGENDADO PARA TESTE DE LYRIC DIA 29/01/2013 AS 14:00. LIGAR 2 DIAS ANTES PARA CONFIRMAR.\n---------------------------------------------------------\nData: 24/01/2013\nHora: 11:42:07\nAssunto: FRANCINE: liguei para confirmar horário. Pcte falou que foi na Igreja ontem e que a pastora fez o milagre e curou ele da perda de audição. Falei para vir as 13:30 para fazer audiometria antes de colocar o lyric.\n---------------------------------------------------------\nData: 01/02/2013\nHora: 08:53:21\nAssunto: FRANCINE: Paciente colocou Lyric dia 29/01 para teste por 15 dias. No dia Tudo OK. Liguei hoje e paciente relata que de vez em quando sente uma dor leve na OE, mas que passa, e não chega a ter necessidade de analgésico. Com OD tudo OK. Dei orientações sobre a dor e ficou de retornar.\n---------------------------------------------------------\nData: 11/03/2013\nHora: 08:53:50\nFRANCINE - CONTATO TELEFÔNICO. S. ANGELINO RELATOU QUE NÃO PODERÁ VIR HOJE E AMANHÃ, PORÉM VEM NA 4ª FEIRA PARA FECHAR O CONTRATO. FALEI QUE A FABRICA ESTA EXIGINDO O CONTRATO E QUE NÃO CONSEGUIMOS MAIS ADIAR. PACIENTE RELATOU QUE TEM ALGUNS PROBLEMAS E QUE ESTA SE ADAPTANDO AINDA. FALEI QUE O TESTE É POR 15 DIAS PRA VER SE GOSTA DO APARELHO E A QUESTÃO DA DOR, MAS A ADAPTAÇÃO LEVA MAIS TEMPO.\n---------------------------------------------------------\nData: 18/03/2013\nHora: 08:36:37\nFRAN - DIA 13/03/2013 COMPROU LYRIC BILATERAL PARA USO DE 3 ANOS. VAI PAGAR ENTRE OS DIAS 18 E 22 DE MARÇO R$25000,00 A VISTA. TUDO OK.\n---------------------------------------------------------\nData: 01/04/2013\nHora: 16:09:43\nFRAN - PACIENTE VEIO TROCAR PELA 3ª VEZ O LYRIC OE POIS PARA DE FUNCIONAR. ORELHA ESTA COM MUITA SECREÇÃO. VAMOS ESPERAR 1 SEMANA PARA COLOCAR NOVAMENTE.', 0, '', '', '2012-01-02'),
(151, '', '0', '', '', 'DIA: 07/04/2011 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1102X0D1U\nOE: 1102X0D1J\nNF: 355.407 DATA: 29/03/2011\nR$: 8.200,00 ENT. 820,00 MAIS 9X DE 820,00.\n01 ANO DE GARANTIA\nData: 06/04/2011\nHora: 13:36:20\nFono: Tanara\nAssunto: Paciente veio para testar aparelhos e ver preços. Já trouxe a audiometria feita no ano passado. Feito teste com Audéos Smart III bilateral. Paciente gostou bastante e passei valores. Duarte autorizou fazer em 10x sem juros, sendo R$: 820,00 cada parcela. Vai fazer no cartão ou carne. Diz que vem amanhã as 14:00 horas para comprar.\n---------------------------------------------------------\nData: 07/04/2011\nHora: 13:42:26\nFono: Tanara\nAssunto: Paciente veio com seu genro Marcelo para comprar os aparelhos. Pagou em 10x, sendo a entrada em dinheiro R$: 820,00 o resto no cartão de crédito em 9x. Marquei retorno em 1 semana.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 13:40:38\nFono: Tanara\nAssunto: Paciente veio para o retorno. Diz que esta escutando melhor. Passamos para o nivel 2 da aclimatização. Marcado a primeira visita dia: 20/04.\n---------------------------------------------------------\nData: 20/04/2011\nHora: 13:21:57\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Diz que não consegue escutar ao telefone e o aparelho da OE esta dando interferencia e OD não ouve nada. Verifiquei protetor de cera entupido e expliquei como faz a troca. Aumentei para o nivel 3 da aclimatização. Entreguei os brindes e expliquei como faz para falar ao telefone ok. Marquei a 2 visita dia: 07/07. Caso precise vai ligar.\n---------------------------------------------------------\nData: 05/10/2012\nHora: 10:23:10\nFono: Tanara\nAssunto: Paciente veio para a 5 visita. Tudo certo. Entreguei os brindes e marquei a 6 visita para dia: 05/04/2013 as 10:00 h.', 0, '', '', '2012-01-02'),
(152, 'OTOVIDA', '0', '', '', 'APARELHO ARGOSY MAXX 311 Forte N : 074X10586\nDIA: 22/05/2012 COMPROU NAÍDA S CRT III BILATERAL PILHA 13\nOD: 1207H0GE0\nOE: 1207H0GD9\nNF: 415.102 DATA: 08/05/2012\nR$: 9.200,00 ENT. 1.500,00 MAIS 10X DE 770,00 NO CHEQUE E CARTÃO\n01 ANO DE GARANTIA.\nData: 05/10/2009\nDébora: Deixou ap. com chiado para orçamento Argosy Maxx 311 Forte nº074X10586.\n---------------------------------------------------------\nData: 15/10/2009\nDébora: Troca de caixa completa; ângulo e assistência técnica R$311,00.\n---------------------------------------------------------\nData: 6/11/2009\nDébora: Paciente esteve na clínica para buscar aparelho. Pago R$311,00.\n---------------------------------------------------------\nData: 08/02/2011\nHora: 11:14:01\nMichelle:Mtorista deixou aparelho esta mudo para fazer orçamento modelo maxx 311 forte n° 074x10586(os audiozoom 1479).\n---------------------------------------------------------\nData: 03/03/2011\nHora: 09:33:55\nMichelle:Motorista retirou aparelho feito troca do receptor + microfone pago 280,00\n---------------------------------------------------------\nData: 22/05/2012\nHora: 15:42:25\nMirella: Pct veio testar aasi adorou, já deixou pago R$ 500,00 através de cheque, irá decidir com sua família como irá pagar o restante se será a vista ou parcelado.\n---------------------------------------------------------\nData: 31/05/2012\nHora: 10:13:52\nFono: Tanara\nAssunto: Paciente voltou para fazer o pagamento. Total R$: 9.200,00, sendo que deu mais um cheque de R$: 1.000,00 para o dia: 07/06 e dará mais 10 cheques de 770,00 cada. Levou o kit de compra, contrato. Só faltou os 10 cheques de 770,00 que o motorista irá trazer amanhã. Marquei retorno dia: 05/06/2012 as 10 h (1 visita).\n---------------------------------------------------------\nData: 05/06/2012\nHora: 11:45:08\nFono: Tanara\nAssunto: Paciente veio e tiramos os pré-moldes para a confecção de Micro-Caixa c-Shell com Receptor: Super Power Plus bialteral.\n---------------------------------------------------------\nData: 25/06/2012\nHora: 14:54:30\nFono: Tanara\nAssunto: Liguei e avisei que as micro-caixinhas já estão aqui. Virá essa semana.\n---------------------------------------------------------\nData: 22/08/2012\nHora: 13:52:56\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes e marquei o retorno para dia: 22/11/2012.\n---------------------------------------------------------\nData: 03/12/2012\nHora: 15:52:16\nAssunto: Francine - Compareceu para 3ª visita. Entregue 6 cartelas pilha 13. Queixou da caixa do receptor OE caindo. Retirada pré-moldagem e abertura de OS para nova caixa (com banho soft). Ligar quando chegar o receptor. Pcte vai ligar para agendar próxima visita.\n---------------------------------------------------------\nData: 18/12/2012\nHora: 15:08:08\nFRANCINE: Liguei avisando que chegou a caixa do receptor nova. Agendou para 5ª feira, dia 27 as 10:00.\n03/06/2013-Paciente veio para o programa de acompanhamento e queixou-se que seu aparelho não está funcionando. Escutei e é o receptor. Vou enviar para SP para aproveitar a garantia e a caixa do receptor. Entreguei os brindes. \n21/06/2013-MOTORISTA RETIROU O APARELHO.\n07/05/2014-PACIENTE DEIXOU APARELHO PARA ORÇAMENTO MODELO NAIDA S CRT III / 1207H0GD9 ESTA MUDO (OS AUDIOZOOM 1729)', 0, '', '', '2011-12-26'),
(153, '', '0', '', '', 'DR. KOWALSKI\nData: 16/08/2012\nHora: 14:40:41\nFono: Tanara\nAssunto: Liguei e falei com a esposa Lindaura. O marido não quer fazer a audiometria. Mas expliquei que será muito importante para a saúde dele. Ficou de marcar uma hora.', 0, '', '', '2012-01-02'),
(154, '', '0', '', '', 'Data: 24/01/2013\nHora: 10:31:47\nAssunto: FRAN: PACIENTE VEIO ENCAMINHADO PELO DR. KOWALSKI PARA FAZER AUDIOMETRIA E TESTE DE PRÓTESE. REFERE QUE NO MOMENTO NÃO TEM DINHEIRO MAS QUE ENTRARÁ EM CONTATO EM 2 MESES.\n---------------------------------------------------------\nData: 11/03/2013\nHora: 10:35:45\nFRAN - CONTATO TELEFONICO - FALEI QUE ESTAVAMOS EM PROMOÇÃO, UMA OPORTUNIDADE PARA INVESTIR NA AUDIÇÃO, E PACIENTE RELATA QUE MELHOROU DO ZUMBIDO E QUE AGORA NÃO QUER FAZER DIVIDA. MAS QUE VAI PASSAR AQUI QUALQUER HORA.', 0, '', '', '2012-01-02'),
(155, 'OTICON', '0', '', '', 'PACIENTE GANHO APARELHO DO HU OTICON E NÃO ESTÁ SE SENTINDO BEM. VEIO FZER TESTE.\n27/02/13 - COMPROU AUDEO S SMART V BILATERALMENTE 1206X0K0L/1216X12G9\n\n30/12/2013\nPaciente veio pagar a 2° parcela do aparelho auditivo no valor de R$: 500,00 reais pagou no cartão de débito.\n\nJOICE: VEIO FECHAR COMPRA SOMENTE DA ORELHA ESQUERDA POR 4.000,00 REIAS. DUARTE OFERECEU DA ORELHA DIREITA POR 3.000,00 REIAS COM ENTRADA DE 2.000,00 MAIS 10X DE 500,00 NO CARNÊ. PACIENTE FICOU DE CONVERSAR COM ESPOSO. CONTRATO DE GARANTIA PRENCHIDO PORÉM FALTA DADOS DO AASI. OBS: APARELHO QUE ESTÁ NA ORELHA DA PACIENTE É UM AUDEO S MART V O MESMO DEVERÁ SER TORCADO POR UM AUDEO S MART III.\n---------------------------------------------------------\nData: 27/02/2013\nHora: 15:36:50\njoice: COMPROU AASI POR 7.000,00 MIL, PAGOU 1.000,00 REAIS DE ENTRADA E MAIS 1.500,00 NO PRÓXIMO MÊS. PROXIMA VISITA FICOU AGENDADA PARA 14/03/2013. PACIENTE IRÁ LIGAR  PARA AGENDAR HORÁRIO TEM QUE ENTREGAR KIT MANUTENÇÃO PILHA PARA 3 MESES E MUDAR O APARELHO PARA AUDEO S SMART III E ANOTAR NÚMERO DE SÉRIE NO APALICATIVO E NA PLANILHA.\n---------------------------------------------------------\nData: 12/03/2013\nHora: 16:05:17\nFRANCINE: 1ª VISITA PA - TROQUEI OS AASIS PARA S SMART III -  Nº OD: 1206X0J70 / OE: 1206X0J6W. ENTREGUEI KIT MANUTENÇÃO, CERUSTOP E PILHA E DEI TODAS AS ORIENTAÇÕES.\n---------------------------------------------------------\nData: 30/04/2013\nHora: 10:50:34\nmichelle:Paciente pagou 2° parcela AASI valor de 500,00 reais.\n---------------------------------------------------------\n05/06/2013\nPACIENTE VEIO RETIRAR BRINDES E TIROU ALGUMAS DUVIDAS. ESTA GOSTANDO DE USAR O APARELHO. TUDO OK. ', 0, '', '', '0000-00-00'),
(156, '', '0', '', '', '---------------------------------------------------------\nData: 29/7/2010\nHora: 12:43:47\nMichelle:Paciente deixou aparelho pois está mudo,modelo solot+311dwdrc od 084x13287 (os audiozoom 1250).\n---------------------------------------------------------\nData: 02/08/2010\nHora: 09:12:30\nMichelle:Paciente retirou aparelho,modelo solot+311dwdrc od 084x13287 (os audiozoom 1250).\n---------------------------------------------------------\nData: 02/05/2011\nHora: 09:41:34\nFono: Tanara\nAssunto: Paciente veio fazer pré-molde da OD para a confecção do molde de silicone concha escavada sem ventilação. Vai pagar R$: 65,00 mais 5 da manguerinha que coloquei nova hoje. Vai comprar pilhas também e silica. Vem buscar na quarta.\n---------------------------------------------------------\nData: 04/05/2011\nHora: 09:04:36\nFono: Tanara\nAssunto: Paciente retirou o molde e pagou R$: 70,00.\n---------------------------------------------------------\nData: 03/10/2011\nHora: 15:43:28\nMichelle:Paciente deixou aparelho pois esta com falha no som,modelo solot+311dwdrc od 084x13287 (os audiozoom 1784).\n---------------------------------------------------------\nData: 06/10/2011\nHora: 08:39:48\nFono: Tanara\nAssunto: Pacient eligou e passei o valor do aparelho R$: 624,00. Falou que vai falar com a filha e retornará para autorizar ou não. Quer fazer em 3x no cheque. Autorizado.\n---------------------------------------------------------\nData: 31/10/2011\nHora: 09:06:58\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Pagou R$: 624,00 mais cápsula, pilha e deu um cheque (Mi que atendeu).\n---------------------------------------------------------\nData: 20/04/2012\nHora: 14:10:13\nAssunto: Suzan - Liguei para falar de promoção. Pssei para a sogra dela. Por R$2800,00.\n---------------------------------------------------------\nData: 26/04/2012\nHora: 15:52:33\nAssunto: Suzan - Sra. Bernadete faltou ao retorno marcado para o dia 24/04/12 as 08:00. Tentar