(159, '', '0', '', '', '19/12/2008 Comprou 2 aparelhos Argosy Maxx 11 OD/OE    PILHA 312\nValor total R$ 5.100,00\nEntregues:\n2 anos de garantia\n1 ano de pilhas grátis  19/12/2008 levou trinta pilhas\nData: 17/06/2009\nDébora: Paciente esteve na clínica com queixa de que seu ap. estava mto baixo. trocado protetor de cera e aumentado ganho OE. Deixou ap. OD com pouca amplificação para conserto.\n---------------------------------------------------------\nData: 22/2/2010\nDébora: Ap. maxx 22 OD- Feito vent. de alívio. OE- nova caixa com vent. maior. Pegou aparelho.\n---------------------------------------------------------\nData: 05/10/2010\nDébora: Paciente esteve na clínica com a queixa de que o ap. da OE está machucando a orelha. Fazer revisão e limpeza em ambos aparelhos.\n---------------------------------------------------------\nData: 08/10/2010\nHora: 10:23:41\nMichelle: Paciente retirou aparelho. OD- revisão e limpeza. OE- troca de receptor. GARANTIA!\n---------------------------------------------------------\nData: 20/12/2010\nHora: 10:43:52\nFono: Tanara\nAssunto: Ligado para o paciente e falou que não se adaptou e virá trazer os aparelhos assim que puder.\n---------------------------------------------------------\nData: 28/12/2010\nHora: 08:11:07\nMichelle: Motorista veio devolver os aparelho para fono verificar OD 1030X0N0E OE 1030X0N06 MODELO MICRO EXTRA100AZ.', 0, '', '', '2012-01-02'),
