(161, '', '0', '', '', 'DIA: 09/12/2011 TESTE COM APARELHO AUDÉO SMART III BILATERAL\n---------------------------------------------------------------------------------------\nData: 09/12/2011\nHora: 12:01:00\nFono: Tanara\nAssunto: Paciente veio com a filha Thays com a audiometria feita pela Fga. Deisy no qual indicou alguns centros auditivos inclusive nos. Veio fazer teste com aparelhos e queria saber o aparelho mais barato. Expliquei que nem sempre o mais barato é o ideal para a sua mãe. Feito teste com audéo Smart III bilateral. Paciente diz que gostou bastante. e passei os valores da tabela. Ficou de pensar e dará a resposta semana que vem.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 14:29:32\nAssunto: Suzan - Cadastro atualizado para mandar carta do open.\n', 0, '', '', '0000-00-00'),
