(167, '', '0', '', '', 'DIA: 21/09/2005 COMPRU CLÁSSICA PP-CP PILHA 675 \nR$: 2.300,00 ENT. R$: 2.000,00 MAIS 1X DE R$: 300,00 \n01 ANO DE GARANTIA\nDIA: 14/09/2011 COMPROU NAÍDA III SP OD PILHA 13\nOD: 1122X10KE\nNF: 379.577 DATA: 31/08/2011\nR$: 4.000,00 ÀVISTA EM DEPÓSITO\nData: 17/11/2009\nDébora: Deixou ap. para revisão e limpeza e fez molde acrílico.\n---------------------------------------------------------\nData: 19/11/2009\nDébora: Pegou ap. e molde. Pago R$87,50 teve desconto de 50% no molde apresentou cartão de aniversário.\n---------------------------------------------------------\nData: 18/01/2011\nHora: 08:45:06\nFono: Tanara\nMichelle: Paciente deixou aparelho pois esta com volume muito baixo e com muito chiado (os audiozoom 1426). Emprestei um Naída III SP na OD e fiz pré-molde para fazer molde de acrílico, concha escavada sem ventilação. R$: 55,00.\n---------------------------------------------------------\nData: 27/01/2011\nHora: 15:25:20\nAssunto: cliente esteve na loja e retirou o aparelho auditivo no valor de 480,00 reais pagou 200,00 e irá trazer o restante após esta data.(cida)\n---------------------------------------------------------\nData: 28/01/2011\nMichelle: Paciente pagou 280,00\n---------------------------------------------------------\nData: 12/09/2011\nHora: 11:03:40\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto. Esta sem a tampa do trimpot. Duarte falou que precisa trocar a caixa R$: 250,00. Virá até a clínica para conversar. Clássica PP-CP sem número. Vou falar de aparelho novo.\n---------------------------------------------------------\nData: 13/09/2011\nHora: 17:31:00\nFono: Tanara\nAssunto: Paciente veio e conversamos (eu e Duarte) sobre a compra de um aaprelho novo. Colocamos em teste Naída III UP e ele percebeu que realmente esta escutando melhor. Fechou em R$: 4.000,00 a vista e vai fazer depósito bancário.\n---------------------------------------------------------\nData: 15/09/2011\nHora: 09:16:44\nFono: Tanara\nAssunto: Paciente veio para buscar o aparelho velho sem custo. E colocamos o Naída III SP OD. Feito regulagem entregue o kit de compra e virá na semana que vem para a 1 visita.\n---------------------------------------------------------\nData: 22/09/2011\nHora: 11:01:43\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e marquei a 2 visita dia: 14/12/2011 ok. Pegou o molde de silicone.', 0, '', '', '2012-01-02'),
