(175, 'HU', '0', '', '', 'Ganhou 2 aparelhos Argosy SoloT+ 22 n  OD 07085281 / OE 07085281\nNF n  248437  06/10/2008 até 12/09/2009\nData: 09/02/2009\nDébora: Paciente esteve na clínica com a queixa de que o aparelho da OE estava machucando a orelha. Aparelho enviado para Argosy nº OS A32396.\n---------------------------------------------------------\nData: 19/02/2009\nDébora: Veio à clínica buscar aparelho.\n---------------------------------------------------------\nData: 24/03/2009\nDébora: Paciente deixou aparelho OE OE 07085281 para conserto, pois, continua machucando.\n---------------------------------------------------------\nData: 07/04/2009\nDébora: Retornou à clínica para buscar aparelho. Referiu melhora.\n---------------------------------------------------------\nData: 19/05/2009\nDeixou aparelhos Argosy SoloT+ 22 nº OD 07085281 / OE 07085281 para enviar para fábrica. Queixa de que o aparelho da OE machuca e dá microfonia. OD apenas com microfonia. Enviar para fábrica.\n---------------------------------------------------------\nData: 10/06/2009\nDébora: Ap. retornou da fábrica. Feito troca de caixa.\n---------------------------------------------------------\nData: 07/07/2009\nDébora: Paciente esteve na clínica com a queixa de que seu ap. está mto grande e machuca a orelha. Os ap. serão enviados para fábrica. Argosy SoloT+ 22 nº OD 07085281 / OE 07085281\n---------------------------------------------------------\nData: 16/07/2009\nDébora: Ap. veio da fábrica. Feito troca de caixa.\n---------------------------------------------------------\nData: 31/08/2009\nDébora: Paciente retornou à clínica com a queixa de que seu ap. estava machucando a orelha esquerda. Ap. enviado pra fábrica.\n---------------------------------------------------------\nData: 16/09/2009\nDébora: Ap. veio da fábrica. Feito troca de caixa.\n---------------------------------------------------------\nData: 18/09/2009\nDébora: Paciente esteve na clínica para buscar aparelho. Referiu que o ap. da OD está apita qdo caminha.\n27/06/2013 - PACIENTE TROUXE APARELHO ARGOSY SOLOT22 N° R07085281 PARA ORÇAMENTO, PACIENTE PRECISA DE ORÇAMENTO POR ESCRITO.\n10/07/2013 - Paciente retirou aparelho Argosy Solo t22 n° r07085281 e o orçamento por escrito.', 0, '', '', '2012-01-02'),
