(186, '', '0', '', '', 'DIA: 12/01/2011 COMPRA DO AUDEO YES III OD PILHA 312\nOD: 1024X09H9              RECEPTOR 3\nR$: 3.500,00 ENT. 1.750,00 MAIS 1X 1.750,00\n01 ANO DE GARANTIA.\nNF: 330585    DATA: 29/09/2010\nData: 11/01/2011\nHora: 13:22:34\nFono: Tanara\nAssunto: Paciente veio para fazer teste com aparelhos. Escutou na rádio Guararema. Feito audiometria e teste com Audeo Yes III. Paciente gostou bastante e levou para mostrar para a esposa. Duarte fez a proposta de R$: 7.000,00 a vista ou uma entrada de R$: 3.000,00 mais 10x de 400,00 ou entrada de R$: 2.000,00 mais 9x de 500,00 e a ultima de 800,00. Virá até quinta para fechar.\n---------------------------------------------------------\nData: 12/01/2011\nHora: 13:09:15\nFono: Tanara\nAssunto: Paciente veio com sua esposa e comprou 1 aparelho. Falou que no momento não vai fechar os 2 pois tem despesa com o carro. R$: 3.500,00 em 2x. Retorno marcado dia: 26/01. Levou de brinde 2 tampão de silicone.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 13:50:06\nFono: Tanara\nAssunto: Paciente veio para buscar os tampões e aumentar o aparelho. Passei para o nivel 3 e Jaimar não terminou os tampões virá na semana que vem quando vir fazer a 1 visita.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 13:21:36\nFono: Tanara\nAssunto: Paciente veio retirar o tampão de brinde. Entreguei a nota fiscal.\n---------------------------------------------------------\nData: 28/01/2011\nHora: 13:11:14\nFono: Tanara\nAssunto: Paciente veio e Duarte já tinha feito a 1 visita. Feito aumento da aclimatização para o nivel 4 ok. Também trocou a caixinha do aparelho.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 16:00:55\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho esta franco. Diz que molhou um pouco sem querer. Vai para a fábrica na garantia, pois o som não esta bom.\n---------------------------------------------------------\nData: 16/03/2011\nHora: 16:42:00\nFono: Tanara\nAssunto: Liguei para o paciente e avisei a esposa que o aparelho já chegou da fábrica.\n---------------------------------------------------------\nData: 17/03/2011\nHora: 08:04:43\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 18/04/2011\nHora: 13:53:18\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes e falou que tem horas que não sente diferença. Expliquei que seria melhor ele comprar o outro lado também para assim equilibrar a sua audição. Falou que agora não pode comprar.', 0, '', '', '2012-01-30'),
(187, '', '0', '', '', 'DIA: 03/08/2011 TESTE COM NAÍDA SP BILATERAL\nData: 03/08/2011\nHora: 09:50:56\nMichelle: Paciente deixou aparelho para orçamento  modelo s41-l 0426765300 (os audiozoom 1811)\n---------------------------------------------------------\nData: 09/08/2011\nHora: 09:46:40\nFono: Tanara\nAssunto: Paciente veio retirar os aparlhos, pois não tem conserto. Passei os valores de Solo 311 por R$: 2.000,00 a vista ou em 10x de 250,00 com juros. Falou que não pode pagar, não tem entrada.', 0, '', '', '2012-01-01'),
(188, '', '0', '', '', 'DIA: 07/12/2010 COMPROU ETERNA 311 OE PILHA 13 - OE: 0845X18EW \nR$: 3.900,00 ENT. DE R$: 1.000,00 MAIS 10X DE R$: 290,00\n01 ANO DE GARANTIA. NF: 41277 DATA: 27/05/2009                                                         DIA: 28/08/2013 - COMPROU NAIDA IX UP - OE: 1119H083F - PILHA 675 - NF: 374793 - VALOR: R$3500,00 (ENT. R$1000,00 + 10X R$250,00) - 1 ANO GARANTIA E 3 ANOS P.A.\nData: 10/03/2009\nDébora: Esteve na clínica com o cartão que recebeu de aniversário da audiozoom. Deixou aparelho Oticon Swift 100 para revisão e limpeza. Desconto de 50%.\n---------------------------------------------------------\nData: 01/06/2009\nkellen:pacte deixou aparelho p/ orçamento oticon swift 100 esta sem som so xiaço!\n---------------------------------------------------------\nData: 15/06/2009\nDébora: Veio à clínica buscar ap. Feito troca de microfone R$480,00.\n---------------------------------------------------------\nData: 21/07/2009\nTHAIS: CADASTRO ATUALIZADO. nÃO QUIS MARCAR AVALIAÇÃO.\n---------------------------------------------------------\nData: 21/09/2009\nDia:01/02/08 Comprou 6 pilhas 13 power                                   19/05/2008 FEZ MOLDE SILICONE OE. TEM APARELHO OTICON\n---------------------------------------------------------\nData: 21/09/2009\nDébora: Esteve na clínica para fazer pré-moldagem da OE para confecção de novo molde silicone.\n---------------------------------------------------------\nData: 22/09/2009\nDébora: Retornou à clínica para buscar o molde e fez troca de ângulo do aparelho. R$80,00.\n---------------------------------------------------------\nData: 13/12/2010\nUsa ap. Oticon OE\n---------------------------------------------------------\nData: 07/01/2011\nHora: 08:05:55\nFono: Tanara\nAssunto: Paciente estive na clínica relatando que seu aparelho Eterna 311 OE esta baixo. Verifiquei excesso de cera e orientei procurar o médico Otorrino e depois voltar aqui. Expliquei como aumenta o volume no aparelho.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 13:26:47\nFono: Tanara\nAssunto: Paciente veio para fazer molde na OE. Silicone concha escavada sem ventilação. Vai pagar R$: 65,00.\n---------------------------------------------------------\nData: 09/02/2011\nHora: 15:46:51\nTANARA:PACIENTE ESTEVE NA LOJA E RETIROU O MOLDE DE SILICONE CONCHA ESCAVADA OE.OBS. FEZ O PAGAMENTO QUANDO RETIROU O MESMO PAGOU 65,00.\n---------------------------------------------------------\nData: 07/06/2011\nMichelle:Paciente pagou 7° parcela Aparelho Auditivo valor 290,00\n---------------------------------------------------------\nData: 14/11/2012\nHora: 15:02:25\nMirella: Veio fazer molde Oe R$ 80,00 com a Joice.\nPACIENTE VEIO FAZER MOLDE.PG R$ 40,00 ENTRADA. (LIDI) / RETIRADA DE PRÉ-MOLDE PARA MOLDE EM SILICONE CONCHA ESCAVADA SEM VENTILAÇÃO. (FRAN).\nPACIENTE VEIO PEGAR NOVO, POIS O ANTIGO TINHA FICADO MUITO GRANDE. OK. DIA 28/8 COMPROU NAIDA IX UP - DEI 1 ANO DE GARANTIA, POIS FIZ VALOR DE CATEGORIA III.\nFILHO DO SEU ATHAYR COMPARECEU À LOJA NO DIA 27/01/2014 EFETUANDO O PAGAMENTO REFERENTE À 5ª PARCELA DO APARELHO AUDITIVO NO VALOR DE R$250,00.', 0, '', '', '2012-01-01'),
(185, '', '0', '', '', '---------------------------------------------------------\nData: 13/8/2010\nHora: 10:38:39\nMichelle:Paciente deixou aparelho,pois está sem amplificação modelo una\nL02105527(os audiozoom 1266).\n---------------------------------------------------------\nData: 26/8/2010\nDébora: Ap. veio da fábrica. Feito troca de receptor.\n---------------------------------------------------------\nData: 27/8/2010\nHora: 16:13:03\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 16/02/2011\nHora: 11:17:11\nMichelle: Paciente deixou aparelho para fazer revisão e limpeza na garantia modelo una r02105527(os audiozoom 1503).\n---------------------------------------------------------\nData: 07/03/2011\nHora: 15:57:19\nMichelle: Mãe retirou aparelho e deixou o outro aparelho para revisão e limpeza modelo una 11 oe l02105527 (os audiozoom 1525).\n---------------------------------------------------------\nData: 16/03/2011\nHora: 11:23:13\nFono: Tanara\nAssunto: Ligado para a paciente avisando que seu aparelho chegou da fábrica. Esta na garantia.\n---------------------------------------------------------\nData: 21/03/2011\nHora: 09:10:30\nMichelle: Mãe retirou aparelho.\n---------------------------------------------------------\nData: 20/04/2012\nHora: 15:13:14\nAssunto:Suzan - Falei com Mãe de Camila. Passei promoção para esse mês por R$2800,00. Ela ficou interessada e vai falar com familia para tentar aproveitar a promoção pois o aparelho de Camila esta muito velho.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 09:56:13\nMirella: Pct deixou aasi para orçamento, tem urgência no orçamento, pois tem consulta no HU sexta feira ( Phonak Una R 02105527)\n---------------------------------------------------------\nData: 14/06/2012\nHora: 10:13:55\nFono: Tanara\nAssunto: Liguei e falei com a mãe da paciente. Passei o valor de R$: 624,00. Autorizou e vai fazer em 3x no cartão. Vai pag