(190, 'HU', '0', '', '', '---------------------------------------------------------\nData: 06/08/2009\nDébora: Paciente esteve na clínica e deixou 02 ap. UNA SP AZ OD:210844X1V3T E OE:210844X1V55 para revisão da garantia. Enviados pra fábrica.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 13:37:33\nAssunto:cida. mãe da paciente esteve na loja e deixou ap.phonak una sp az nº0844xiv3t. orçamento.\n---------------------------------------------------------\nData: 14/06/2012\nHora: 10:42:12\nFono: Tanara\nAssunto: Liguei e falei com a mãe. Passei o valor do conserto R$: 800,00 em 3x. Vai retornar a ligação para autorizar ou não.\n---------------------------------------------------------\nData: 15/06/2012\nHora: 17:23:05\nFono: Tanara\nAssunto: Cida falou que a mãe autorizou e vai fazer em 3x R$: 800,00. Vai fazer o depósito de R$: 266,00, sendo a entrada.\n---------------------------------------------------------\nData: 29/06/2012\nHora: 14:59:01\nAssunto:paciente pagou a 1º parcela valor 267,00 reais (deposito 29/06/2012 )\nBruna: Aparelho chegou de Sp hj. Ligar daqui uma semana para avisar que chegou. OK\n---------------------------------------------------------\nData: 19/07/2012\nHora: 09:34:31\nMirella: Pct efetuou o pgto de R$ 533,00 que faltavam dia 13/7/2012.Retirou o aasi foi emitido CF 6444 pois a Pct será reembolsada pela prefeitura.\n', 0, '', '', '0000-00-00'),
