(196, '', '0', '', '', 'DIA: 11/06/2012 COMPROU AUDÉO S SMART III BILATERAL PILHA 312\nOD: 1202X0JH5 NF: 415.738 DATA: 11/05/2012\nOE: 1205X0D12 NF: 415.102 DATA: 08/05/2012\nR$: 8.300,00 À VISTA NO CHEQUE\n01 ANO DE GARANTIA.\nData: 06/08/2012\nHora: 11:35:48\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue o kit de manutenção e 6 cartelas de pilhas número 312. Estava com os protetores de cera entupidos. Troquei e falou que ficou bem melhor. Marquei a 2 visita dia: 11/09/2012.\n---------------------------------------------------------\nData: 08/10/2012\nHora: 14:19:20\nFono: Tanara\nAssunto: Paciente veio com sua esposa para a 2 visita. Entregue os brindes e aumentei um pouco a aclimatização e ativei o botão do volume. Marquei retorno dia: 11/12/2013 as 9:00 h. Passei o horário para a Cida e ela anotou.\n---------------------------------------------------------\nData: 13/03/2013\nHora: 15:53:48\nFRAN - PA - ENTREGUEI BRINDES E FIZ REGULAGEM. TUDO OK.\n', 0, '', '', '2012-01-02'),
