(202, '', '0', '', '', 'USA APARELHO STARKEY 72-05 n  330061\nDIA: 20/05/2011 COMPRA MICRO-ELEVA BILATERAL PILHA 312\nOD: 1001X0N74 / OE: 1018X16P5\nNF: 330585 DATA: 29/09/2010\nR$: 6.000,00 ENT. 600,00 MAIS 9X DE 600,00 NO CRÉDITO - 01 ANO DE GARANTIA\n21/01/2013 - COMPROU CASSIA ITC OD: P13A0976L - PILHA 312. VALOR R$3000,00.\n---------------------------------------------------------\nData: 06/05/2010\nDébora: Esteve na clínica para o open house e deixou o ap. mudo para orçamento. Marca: Starkey 72-05 Número de série: 330061 (os Audiozoom 1108)\n-----------------------------------------------------------\nData: 14/05/2010\nHora: 17:54:34\nAssunto:michelle. esposo tevo na loja e trouxe o ap. para troca de receptor valor 300,00.pago com cartão.\n---------------------------------------------------------\nData: 16/05/2011\nHora: 13:35:18\nFono: Tanara\nAssunto: Paciente veio com seu marido Dilson que também comprou aparelho. Duarte atendeu e vendeu 2 micro-eleva para a paciente. Paciente vem na quarta para fazer aumentria. Vendeu 4 aparelhos por R$: 12.000,00 em 10x.\n---------------------------------------------------------\nData: 18/05/2011\nHora: 13:37:26\nFono: Tanara\nAssunto: Paciente veio com seu marido feito audiometria e regulagem. Levou os aparelhos para a casa e orientei retirar a cera pois estava com excesso.\n---------------------------------------------------------\nData: 20/05/2011\nHora: 13:38:40\nFono: Tanara\nAssunto: Paciente veio com o marido e fechou a venda. Falou que depois que retirou a cera melhou bastante. Feito regulagem e vira em 15 dias. Deu uma entrada de 1.200,00 mais 9x no cheque. Falou que não esta sentindo a diferença pois a TV esta no mesmo volume. Fiz pré-molde bilateral para fazer micro-molde de acrílico com 1 mm de ventilação. Vem buscar dia: 30/05.\n---------------------------------------------------------\nData: 30/05/2011\nHora: 14:49:04\nFono: Tanara\nAssunto: Paciente veio buscar os micro-moldes ficou ótimo. Vem na sexta para a 1 visita.\n---------------------------------------------------------\nData: 03/06/2011\nHora: 14:57:22\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregues os brindes e falou que ficou muito melhor com os micro-moldes. Esta ouvindo bem e diz que a TV esta mais baixa. Marcado a 2 visita.\n---------------------------------------------------------\nData: 20/06/2011\nHora: 20:01:20\nFono: Tanara\nAssunto: Paciente veio para fazer o pré-molde para confeccionar novamente o micro-molde. Virá dia: 30/06 buscar na garantia.\n------------------------------------------------------------ \nData: 30/06/2011\nHora: 17:31:09\nFono: Tanara\nAssunto: Paciente veio retirar o micro-molde de acrílico de reposição ok.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 15:41:08\nAssunto: Suzan - Esposo diz que comprou aparelho recentemente para Sra. Dalva. Falei de promoção por R$2800,00.\n---------------------------------------------------------\nData: 09/01/2013\nHora: 10:27:35\nAssunto: FRAN: levou 2 s smart V para testar. Gostou bastante da qualidade sonora. vai conversar com Duarte sobre valores.\n---------------------------------------------------------\nData: 15/01/2013\nHora: 11:05:55\nAssunto: FRAN: Devolveu 2 aasis. Comprou 2 Cassia ITC bilateral por R$5000,00 o par - C/ Duarte. Retirei pré-molde. - Ficou com somente 1 cassia - da OE. Pagou R$3000,00.\n--------------------------------------', 0, '', '', '2012-01-01'),
(203, 'INDICAÇÃO DE PACIENTE', '0', '', '', '26/03/2013\nEntrei em cotato via telefone para chamar o paciente para fazer um teste. Relatou que ainda não foi no médico para ver o problema da OE e que só vai fazer isso depois que se aposentar. Coloquei a loja a disposição e chamei ele para vir a loja para pelo menos repetir esse exame. Agradeceu o contato e vai nos procurar quando tiver tempo.\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:33:09\nFono: Tanara\nAssunto: Paceinte veio indicado por outro paciente Altair que comprou aparelho. Feito audiometria tem perda somente na OE. Encaminhei para a clínica Dircksen para uma avaliação mais completa e depois virá para fazer a adaptação do aparelho. Vamos verificar primeiro se o Otorrino irá indicar aparelho. Ligarei dentro de 15 dias.\n---------------------------------------------------------\nData: 20/04/2012\nHora: 15:33:46\nAssunto: Suzan - Deixei recado referente a promoção de aparelhos.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 11:08:49\nFono: Tanara\nAssunto: Liguei e conversei com o paciente a respeito do retorno que teria que fazer na clínica Dircksen. Falou que não foi atras disso ainda e que quando for irá ligar para nos.\n---------------------------------------------------------\nData: 11/9/2012\nHora: 14:44:26\nAssunto: Suzan - Ligar sempre no periodo da manhã. Confirmar endereço para o Open.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 15:14:47\nAssunto: Suzan - Confirmado endereço ´para mandar carta do Open.\n---------------------------------------------------------\nData: 24/10/2012\nHora: 11:06:48\nAssunto: Suzan - Sr. Carlos diz que vai tentar aparecer no Open. Não quis marcar horario pq trabalha o dia todo.\n---------------------------------------------------------\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:33:09\nFono: Tanara\nAssunto: Paceinte veio indicado por outro paciente Altair que comprou aparelho. Feito audiometria tem perda somente na OE. Encaminhei para a clínica Dircksen para uma avaliação mais completa e depois virá para fazer a adaptação do aparelho. Vamos verificar primeiro se o Otorrino irá indicar aparelho. Ligarei dentro de 15 dias.\n---------------------------------------------------------\nData: 20/04/2012\nHora: 15:33:46\nAssunto: Suzan - Deixei recado referente a promoção de aparelhos.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 11:08:49\nFono: Tanara\nAssunto: Liguei e conversei com o paciente a respeito do retorno que teria que fazer na clínica Dircksen. Falou que não foi atras disso ainda e que quando for irá ligar para nos.\n---------------------------------------------------------\nData: 11/9/2012\nHora: 14:44:26\nAssunto: Suzan - Ligar sempre no periodo da manhã. Confirmar endereço para o Open.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 15:14:47\nAssunto: Suzan - Confirmado endereço ´para mandar carta do Open.\n---------------------------------------------------------\nData: 24/10/2012\nHora: 11:06:48\nAssunto: Suzan - Sr. Carlos diz que vai tentar aparecer no Open. Não quis marcar horario pq trabalha o dia todo.\n---------------------------------------------------------', 0, '', '', '0000-00-00'),
