(208, '', 'Leticia ', '', 'se mudou para curitiba', 'DIA: 13/02/2012 TESTE COM APARELHOS\nData: 24/04/2012\nHora: 16:07:02\nAssunto: Suzan - Cliente fez orçamento no começo do ano. Comprou em outro lugar a um mês.\n---------------------------------------------------------\nData: 21/08/2012\nHora: 15:27:30\nFono: Tanara\nAssunto: Liguei e atendeu uma mulher falando que a paciente se mudou para Curitiba.\n', 0, '', '', '2012-01-01'),
(206, 'HU', 'Leticia ', '', '', 'USA APARELHO PHONAK NF 331085 01/10/2010 ATÉ 01/10/2011\nMODELO NAIDA III SP\nOE 211027X124H OD 211027X124E\nData: 09/11/2010\nTHAISA: PACIENTE ESTEVE NA CLÍNICA E DEIXOU 1 APARELHO MUDO PARA CONSERTO NA GARANTIA. NAIDA III SP OE 211027X124H.\n---------------------------------------------------------\nData: 16/11/2010\nDébora: Ap. veio da fábrica. Feito troca de módulo completo.\n---------------------------------------------------------\nData: 16/11/2010\nHora: 14:40:30\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 16:04:02\nAssunto: Suzan - Ligar mais tarde para falar com a mãe sobre promoção.\n---------------------------------------------------------\nData: 25/04/2012\nHora: 15:44:28\nAssunto: Suzan - Falei com mãe de Daniela. Passei promoção R$2800,00. Marcamos um retorno para ver se precisa de um novo.', 0, '', '', '2012-01-01'),
(209, '', 'Leticia ', '', '', '03/11/06 COMPROU 1 APARELHO WIN 400 N 4063 OD\nBERNAFON VALOR: R$ 3.400,00 À VISTA   PILHA 10\n18/01/2008 COMPROU AP. BERNAFON - NEO 322 N  4063/ PILHA 312 OE\nVALOR TOTAL  À VISTA : R$ 5.000,00            \nENTREGUE 1 ANO DE PILHAS                                                                           19/09/2013 COMPROU APARELHO S SMART III R$ 3.000,00 A VISTA.\nData: 11/03/2009\nDébora: Paciente esteve na clínica com a queixa de que seu aparelho estava mudo. Evaldo verificou que o aparelho estava com im fio cortado. Foi cobrado revisão e limpeza.\n---------------------------------------------------------\nData: 19/05/2009\nDébora: Esteve na clínica com a queixa de que seus aparelhos estavam mudos. O aparelho WIN 400 N°4063 foi trocado o protetor de cera que estava entupido e o aparelho NEO 322 Nº 4063 estava mudo, deixou para orçamento de conserto. DEVE R$15,00 PROTETOR DE CERA.\n---------------------------------------------------------\nData: 29/05/2009\nDébora: Paciente deixou ap. WIN 400 N°4063 com gaveta de pilha quebrada para conserto.\n---------------------------------------------------------\nData: 07/08/2009\nDébora: Veio buscar ap. Neo 322 feito troca de microfone e receptor. Pago 166,80.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 16:11:17\nAssunto: Suzan - Sr. Danilo diz que esta com 3 aparelhos em casa. Só usa o OD.\n---------------------------------------------------------\npACIENTE DEIXOU 2 APARELHOS BERNAFOM PARA ORÇAMENTO DE CONSERTO. FALEI DAS VANTEGENS DE VER APARELHO NOVO. QUER PRIMEIRO VER O VLOR DO CONSERTO DESSES APARELHOS. \nPACIENTE VEIO BUSCAR AASIS. UM FICOU BOM. PAGOU R$1000,00 NO DÉBITO. A OUTRO O DUARTE MANDOU PARA JARAGUÁ PARA REGULAR. VAI PAGAR QUANDO MAIS R$1000,00 QUANDO CHEGAR O AASI.\n', 0, '', '', '2012-01-01'),
(213, 'OU', 'Leticia ', 'Teste', 'Teste', 'Teste', 0, 'Teste', 'Teste', '1010-10-10'),
(214, '', 'Leticia ', '', '', 'DIA: 10/08/2010 COMPROU AUDÉO YES III OD PILHA 312\nOD: 1010X0CTG\nR$: 3.511,00 ENT. 585,00 MAIS 5X DE R$: 585,00\n01 ANO DE GARANTIA\nRetorno para dia 10/08/2012.\nNF: 308875 DATA: 30/04/2010\nData: 02/08/2010\nHora: 09:58:4\nMichelle:Paciente deixou aparelho para orçamento com gaveta quebrada e pilha presa (os audiozoom 1255).\n---------------------------------------------------------\nData: 11/08/2010\nDébora: Orçamento não autorizado.\n---------------------------------------------------------\nData: 30/03/2011\nHora: 13:27:30\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Estava atrasado. Entreguei os brindes e fiz regulagem no aparelho. Orientei para colocar bo outro lado mas paciente não quer no momento.\n---------------------------------------------------------\nData: 09/01/2012\nHora: 09:04:59\nFono: Tanara\nAssunto: Paciente veio para a 5 visita que seria em fevereiro, porém vai viajar e veio fazer agora. Quem atendeu foi a Thaisa pois eu estava doente. Ela entregou os brindes e marcou a 6 visita para dia: 10/08/2012.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 17:08:19\nAssunto: Suzan - Cliente esta em Brasilia.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(215, '', 'Leticia ', '', '', 'DIA: 16/01/2012 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1129X0UU7\nOE: 1129X0UVE\nNF: 387.974 DATA: 31/10/2011\nR$: 6.000,00 À VISTA EM DINHEIRO\n01 ANO DE GARANTIA.\nData: 12/01/2012\nHora: 11:52:55\nFono: Tanara\nAssunto: Paciente veio com a filha Rosalina para fazer teste com aparelhos. Feito audiometria e paciente tem perda Neurossensorial bilateral. Coloquei Audéo Smart III bilateral e gostou bastante. Duarte autorizou fechar a venda em R$: 6.000,00 a vista devido ao transtorno que deu no dia: 11/01/2012 no qual não puder atender devido ao movimento. Vai trazer o cheque amanhã.\n---------------------------------------------------------\nData: 16/01/2012\nHora: 14:08:07\nFono: Tanara\nAssunto: Paciente veio para fechar a venda. Pagou R$: 6.000,00 a vista em dinheiro. Levou o kit de venda e vem na quinta para a 1 visita. Entregue a nota fiscal. Paciente mora em Porto Alegre e irá fazer o programa de acompanhamento lá.\n---------------------------------------------------------\nData: 19/01/2012\nHora: 13:19:14\nFono: Tanara\nAssunto: Paciente veio com a sua filha Rosalina. Feito a 1 visita e irá para Porto Alegre amanhã.\n', 0, '', '', '2012-01-01'),
(216, 'HU', 'Leticia ', '', 'USA APARELHO PHONAK NF 305914 12/04/2010 ATÉ 12/04/2011\nMODELO SOLO T +411 dSC\nOD 21102X10991\nData: 18/11/2010\nHora: 08:18:25\nMichelle: Motorista deixou aparelho para revisão e limpeza modelo solo t+411 dSC od 21102x10991(OS AUDIOZOOM 1363).\n-------------', '', 0, '', '', '2012-01-01'),
(217, 'PHONAK', 'Leticia ', '', '', '---------------------------------------------------------\nData: 05/07/2012\nBruna: veio regular aqui na audiozoom, pois sabia que eu estava aqui e mora aqui perto. Aumentei nível de experiência, e diminuí ruído. Ficou bem melhor, Marcamos retorno na Luciane dia 18/07 ás 9:30h. OK\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(218, '', 'Leticia ', '', '', 'DIA: 09/12/2011 TESTE COM APARELHO\n--------------------------------------------------------\nData: 09/12/2011\nHora: 12:10:18\nFono: Tanara\nAssunto: Paciente veio com sua filha Tânia para fazer teste com aparelhos.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 17:37:50\nAssunto: Suzan - Falei com filho (Osmar). Disse que comprou aparelho a pouco tempo.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 16:11:44\nAssunto: Suzan - FALEI COM OSMAR (FILHO). CONFIRMADO ENDEREÇO PARA O OPEN.\n---------------------------------------------------------\nData: 19/10/2012\nHora: 16:57:31\nAssunto: Suzan - Nora diz que Sra. Delfina ganhou aparelho.Recebeu carta do Open, mas nao tem interesse em participar.\n', 0, '', '', '2012-01-01'),
