(221, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/07/2009\nDébora: Liguei e o paciente usa AASI de outra marca.\n---------------------------------------------------------\nData: 21/08/2012\nHora: 14:25:33\nMirella: Sua filha veio comprar 18 pilhas 13.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(222, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 06/09/2011\nHora: 13:22:59\nFono: Tanara\nAssunto: Paciente veio com sua filha Jaqueline encaminhado pela Fga. Tânia Coelho para fazer teste com aparelhos. A filha foi bem firme relatando que somente irá comprar os aparelhos se realmente o pai tiver uma boa adaptação. Feito regulagem e orientei que a OD será uma adaptação mais lenta pois é muita perda. Levou para a casa Audéo Smart III bilateral mas o Duarte irá passar o preço do V. Voltará na sexta para o retorno.\n---------------------------------------------------------\nData: 09/09/2011\nHora: 10:06:22\nFono: Tanara\nAssunto: Paciente veio com a filha Jaqueline. Conversamos muito sobre a adaptação e expliquei que temos que ir devagar. Aumentamos um pouco e marcamos para dia: 13/09. Saio ouvindo melhor. Passei os valores de R$: 7.500,00 cada. Ficou assustado.\n---------------------------------------------------------\nData: 13/09/2011\nHora: 10:07:36\nFono: Tanara\nAssunto: A filha Jaqueline veio para devolver os aparelhos pois o pai não quis mais usar. Falou que não se adaptou falando eue não estava ouvindo. Falei que temos aparelhos por R$: 4.100,00. Mas a filha falou que não adianta insistir.\n---------------------------------------------------------\nData: 20/04/2012\nHora: 15:58:20\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 01/06/2012\nHora: 14:20:33\nAssunto: Suzan - Sr. Carlos diz que vem ate a empresa para verificar aparelhos novos.\n---------------------------------------------------------\nData: 09/11/2012\nHora: 15:03:11\nMirella: Pct veio com seu neto, ganhou aasi do HU há um mês, veio fazer a regulaem de 1 mês achou que era aqui, expliquei que ra no Hu e que aqui era apenas a assistência e caso de defeito no aasi.\n\nDIA: 06/09/2011 TESTE COM AUDÉO SMART V BILATERAL\nFGA: TÂNIA REGINA COELHO FERREIRA', 0, '', '', '2011-09-06'),
(223, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/03/2013\nHora: 10:10:20\nJOICE: PROGRAMA DE ACOMPANHAMENTO, DEI 6 CARTELAS DE PILHAS MAIS UMA CAIXA DE DESUMIDIFICADOR.\n---------------------------------------------------------\n\nDIA: 29/02/2012 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1146X1124\nOE: 1146X112E\nNF: 400.523 DATA: 31/01/2012\nR$: 8.200,00 ENT. 4.100,00 MAIS 1X DE 4.100,00 NO CHEQUE\n01 ANO DE GARANTIA', 0, '', '', '2012-02-29'),
(224, '', 'Leticia ', '', '', 'DIA: 03/01/2011 TAMPÃO\n\n---------------------------------------------------------\nData: 03/01/2011\nHora: 09:15:17\nFono: Tanara\nAssunto: Paciente veo reclamando que os tampões estão frouxos e já é a 3 vez que faz. Feito novamente pré-moldes bilateral e vamos fazer sem desgastes na garantia. Reposição, vai buscar no centro. Tampão cor verde, sem puxador.\n---------------------------------------------------------\nData: 28/01/2011\nHora: 16:01:05\nFono: Tanara\nAssunto: Paciente veio mais uma vez para refazer o tampão bilaterla pois entrou água dando fundo nos ouvidos.\n---------------------------------------------------------\nData: 02/02/2011\nHora: 12:04:15\nFono: Tanara\nAssunto: Paciente veio buscar o tampão de reposição.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(225, 'HU', 'Leticia ', '', '', 'USA APARELHO PHONAK - MODELO SOLO T +411 DSC - 07BX11666                               30/04/2013 - GANHOU NAIDA I UP - OD: 211302X0HYL - PILHA 675 - NF: 472676 - GARANTIA ATÉ 30/04/2014.                                                                                             31/05/2013 - GANHOU NAIDA I UP - OE: 211252X0JWC - PILHA 675 - NF: 477697 - GARANTIA ATÉ 31/05/2014.\n---------------------------------------------------------\nData: 01/02/2012\nHora: 12:00:59\nMichelle: Paciente deixou aparelho pois o mesmo esta mudo MODELO SOLO T +411 DSC 07BX11666(os audiozoom 2323)\n---------------------------------------------------------\nPACIENTE DEIXOU APARELHO PARA REVISÃO MODELO NAIDA IUP  N° 1302X0HYL  /XJWC(OS AUDIOZOOM 1328)\nMOTORISTA RETIROU AASI', 0, '', '', '2012-01-01'),
(226, 'widex', '0', '', 'PILHA 675\nPAA 03 ANOS\n01 ANO DE GARANTIA', '11/06/2014 - COMPROU PAR DE NAÍDA IX UP, 01 ANO DE GARANTIA E 03 ANOS DE PILHA, FORMA DE PAGAMENTO ENTRADA R$2.000,00 NO CHEQUE + 5X R$ 1.000,00 NO CARTÃO DE CRÉDITO ATÉ A DATA DE 10/11/2014 + 6 CHEQUES DE R$ 1.000,00 DE 10/12/2014 À 10/04/2015.', 0, 'PERDA AUDITIVA NEUROSENSSORIAL SEVERA À PROFUNDA ', 'PERDA AUDITIVA NEUROSENSSORIAL SEVERA À PROFUNDA ', '2014-06-11'),
(227, 'lista telefonica', 'Leticia ', '', '', 'DIA: 26/01/2011 COMPRA MICRO-EXTRA BILATERAL PILHA 312\nOD: 1030X0N0E TUBO 1\nOE: 1030X0N09\nR$: 5.200,00 A VISTA\n01 ANO DE GARANTIA\nNF: 330585 DATA: 29/09/2010\n\n---------------------------------------------------------\nData: 27/01/2011\nHora: 16:11:45\nFono: Tanara\nAssunto: Paciente veio com seu marido Bruno e filho Altair para comprar aparelho auditivo para dona Cecília. Trouxe uma audiometria feita em novembro de 2010. Feito teste com Micro-Extra bilateral e comprou a vista por R$: 5.200,00. Vem na sexta para o retorno e 1 visita. Paciente é de outra cidade e quando voltar para Floripa virá para a 2 visita.\n---------------------------------------------------------\nData: 28/01/2011\nHora: 13:04:08\nFono: Tanara\nAssunto: Paciente veio com seu filho Altair para o retorno. Feito a 1 e 2 visita pois a paceinte só voltará em julho. Expliquei a limpeza e aumentei para o nivel 3 ok. Entregue a nota fiscal.\n---------------------------------------------------------\nData: 19/07/2011\nHora: 13:27:45\nFono: Tanara\nAssunto: Paciente veio com marido Bruno e seu filho para a 3 visita. Diz que esta escutando bem. Aumentei a aclimatização para o nível 3 e expliquei como faz a limpeza dos aparelhos. Próximo retorno em janeiro 4 visita.\n---------------------------------------------------------\nData: 25/01/2012\nHora: 10:32:16\nFono: Tanara\nAssunto: Paciente veio com o filho Altair para a 4 visita. Amanhã vai fazer 1 ano que comprou os aparelhos e por isso os aparelhos vão para São Paulo na garantia. Micro-Extra OD 1030X0N0E OE 1030X0N09. Marcado a 5 visita em julho.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 15:22:37\nAssunto: Suzan - Falei com Nora da paciente. Passou seu endereço para mandar carta do Open.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 14:20:14\nAssunto: Suzan - Sr. Altair (filho) disse que a Sra. Cecilia mora muito longe. Não podera participar do Open.\n', 0, '', '', '2011-01-26'),
(228, '', '0', '', 'CUNHADO SR. NABOR ', '16/10/2014- Zana\nPcte compareceu para adaptação em AO - Ambra Nano  R101415936/L10141593.\nDeixei em 70% e mesmo assim baixei saída e ganho pois o pcte ainda estava achando alto.\nAchei o pcte bastante negativo, disse q não sabe se vai acostumar com os aparelhos, mas passei todas instruções de uso e manuseio.\nComprou pilhas, sílica.\nPedi retorno em breve para acompanhamento.\nOBS: ganhou AASI´s do Sr Nabor, atendido anteriormente pela fga Letícia que realizou as pré-moldagens e deu encaminhamento para confecção..\n--------------------', 0, '', '', '2012-01-01'),
(229, 'OTOVIDA', 'Leticia ', '', '', '---------------------------------------------------------\nData: 18/07/2012\nHora: 09:04:31\nFono: Tanara\nAssunto: Paciente veio fazer adaptação de aparelho que ganhou do tio dela. Argosy Maxx 211 D OE. Feito molde de acrílico, meia concha, com 1 mm de ventilação. Deixei no nível 1 e terá mais 3 retornos. Pagou R$: 350,00 da adaptação mais o molde.\n---------------------------------------------------------\nData: 06/08/2012\nHora: 17:32:15\nFono: Tanara\nMirella: Pct efetuou o pgto da parcela. Paciente veio para o retorno, porém a Argosy não estava funcionando. Aumentei a ventilação para 2 mm pois relatava que o som estava abafado. Pagou R$: 100,00 que falatava da adaptação, mais a bombinha de R$: 18,00 e R$: 8,00 de pastilhas de moldes. Total R$: 126,00 em dinheiro. Virá quando chegar o audiometria pois vai trazer uma amiga que precisa fazer teste com aparelhos.\n', 0, '', '', '2012-01-01'),
(230, 'TELESOM', 'Leticia ', '', '', 'DIA: 20/05/2011 COMPRA MICRO-ELEVA BILATERAL PILHA 312\nOD: 1018X16N3\nOE: 0945X0WC3\nNF: 330585 DATA: 29/09/2010\n01 ANO DE GARANTIA.\nR$: 6.000,00 ENT. 600,00 MAIS 9X DE 600,00 NO CRÉDITO.\n01 ANO DE GARANTIA.\nData: 16/05/2011\nHora: 08:17:04\nFono: Tanara\nAssunto: Duate atendeu pois estava em treinamento. Paciente veio com sua esposa para saber de preços de aparelho para dono Dalva. Duarte conversou e vendeu para seu marido também. 4 Micro-Elevas. Vem na quarta para fazer audiometria.\n---------------------------------------------------------\nData: 18/05/2011\nHora: 08:18:50\nFono: Tanara\nAssunto: Paciente veio com sua esposa fazer audiometria e fiz a regulagem ok. Levou para a casa e vem na sexta para pagar. Orientei que sua orelha estava com excesso de cera e precisava fazer a limpeza.\n---------------------------------------------------------\nData: 20/05/2011\nHora: 08:22:01\nFono: Tanara\nAssunto: Paciente veio com sua esposa para o retorno. retirou toda a cera e feito uma nova audiometria porém os resultados não mudaram. Fiz aumento da aclimatização e marquei retorno para dia: 30/05.\n---------------------------------------------------------\nData: 30/05/2011\nHora: 14:58:33\nFono: Tanara\nAssunto: Paciente falou que agora esta bem melhor. Esta se acostumando bem. Vem na sexta para a 1 visita.\n---------------------------------------------------------\nData: 03/06/2011\nHora: 14:59:47\nFono: Tanara\nAssunto: Paciente veio com sua esposa Dalva para a 1 visita. Entregue os brindes e relatou que o aparelho da OD não esta funcionando. Estava entupido de cera. Expliquei como faz a limpeza do micro-tubo ok.\n---------------------------------------------------------\nData: 25/07/2011\nHora: 13:33:56\nFono: Tanara\nAssunto: Paciente veio relatando que o aaprelho da OE esta mudo. Virifiquei e era micro-tubo entupido. Fiz a limpeza ok.\n---------------------------------------------------------\nData: 19/10/2011\nHora: 11:08:10\nMichelle: Paciente esteve na loja pegou 4 capsaula + 12 phonak 312\n---------------------------------------------------------\nData: 25/04/2012\nHora: 16:43:17\nAssunto: Suzan - Comprou a pouco tempo.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 14:20:49\nMirella: Pct veio comprar uma cartela de pilha 312.\n---------------------------------------------------------\nData: 02/01/2013\nHora: 15:24:36\nfrancine: troquei oliva, ficou bom... dei pilhas do controle de aocmpanhamento.\n', 0, '', '', '2010-01-01'),
(231, '', 'Leticia ', '', '', 'DIA: 24/01/2011 COMPRA AUDEO SMART III BILATERAL PILHA 312\nOD: 1041X0GHK RECEPTOR 1\nOE: 1041X0GH9\nR$: 9.300,00 ENT. 3.000,00 MAIS 9X DE 700,00 NO CARTÃO\nNF: 342544 DATA: 21/12/2010\nData: 24/01/2011\nHora: 10:00:54\nFono: Tanara\nAssunto: Paciente veio com sua filha Rosimere fazer orçamento de aparelhos auditivos. Falou que esta achando caro e veio aqui para saber se é mais barato. Trouxe a audiometria e fiz teste com Audeo Smart III bilateral. Paciente gostou bastante e fechou a venda R$: 9.300,00 sendo uma entrada de 3.000,00 mais 9x de 700,00. Marcado o retorno dia: 31/02.\n---------------------------------------------------------\nData: 31/01/2011\nHora: 07:43:48\nFono: Tanara\nAssunto: Paciente veio com sua filha e falou que o aparelho da OD não estava funcionando, era cera. Expliquei como limpa e aumentei o nivel da aclimatização para o 2. Falou que esta ótimo ouvindo super bem. Marcado o retorno de 1 visita dia: 07/02.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 13:24:06\nFono: Tanara\nAssunto: Paciente veio com sua filha Rosimere para a 1 visita. Entregue o kit de manutenção, 6 cartelas de pilhas e 2 cerustop. Expliquei como faz a limpeza. Paciente havia trocado de lado os aparelhos. Aumentei para o nivel 3 e tirei pré-moldes para a confecção de micro-molde bilateral. marcado retorno 2 visita dia: 25/04/2011.\n---------------------------------------------------------\nData: 22/02/2011\nHora: 09:27:42\nFono: Tanara\nAssunto: Paciente veio com a filha para adaptação dos micro-moldes ok.\n---------------------------------------------------------\nData: 25/02/2011\nHora: 08:54:17\nFono: Tanara\nAssunto: Paciente veio com a queixa que o volume aumenta sozinho. Feito a sensibilidade da mudança de programação e aumento da aclimatização para o nível 4 ok.\n---------------------------------------------------------\nData: 07/04/2011\nHora: 13:31:21\nFono: Tanara\nAssunto: Paciente veio com sua filha Rosimere relatando que o aparelho da OE não entra o protetor de cera. Jaimar verificou e viu que era saomente a maneira como estava tentando colocar ok. Diz que o som vai e vem. Marquei retorno em 1 semana se não melhorar ligarei para São Paulo.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 13:33:52\nFono: Tanara\nAssunto: Paciente veio relatando que somente a televisão que fica aumentando sozinha. Expliquei que irei para Joinville no treinamento e que quando voltar ligarei para paciente.\n---------------------------------------------------------\nData: 21/06/2011\nHora: 13:03:53\nFono: Tanara\nAssunto: Paciente veio com sua filha para um retorno extra. Fiz as regulagem conforme foi passado no treinamento em Joinville. Paciente diz que se sentiu melhor e qualquer coisa retornará.\n---------------------------------------------------------\nData: 10/01/2012\nHora: 15:20:58\nFono: Tanara\nAssunto: A filha Rosimere veio deixar o aparelho na garantia. Esta mudo. Audéo Smart III OE 1041X0GH9.\n---------------------------------------------------------\nData: 25/01/2012\nHora: 10:36:48\nFono: Tanara\nAssunto: Paciente veio com a filha Rosimere retirar o aparelho ok. Feito também a 4 visita.\n---------------------------------------------------------\nData: 09/05/2013\nHora: 09:44:11\nFRANCINE: PACIENTE VEIO COM A FILHA ROSIMEIRE POIS O APARELHO PAROU DE FUNCIONAR. ESCUTEI E VERIFIQUEI QUE É O RECEPTOR. OFERECI TROCA NA HORA POR R$250,00 OU ENVIAR PARA SP POR R480,00. PACIENTE PREFERIU TROCAR NA LOJA, MESMO CIENTE DA GARANTIA DA PHONAK DE 6 MESES. PAGOU NO DÉBITO R$250,00 PELO RECEPTOR STANDARD 2-L.\n', 0, '', '', '2014-01-01'),
(232, '', 'Leticia ', '', '', 'DIA: 07/03/2011 COMPRA AUDÉO YES III BILATERAL PILHA 312\nOD: 1030X163F NF: 347394 DATA: 31/01/2011\nOE: 1024X09HE NF: 330585 DATA: 29/09/2010\nR$: 6.000,00 ENT. 1.500,00 MAIS 3X DE 1.500,00 NO CHEQUE\n01 ANO DE GARANTIA.\nData: 03/03/2011\nHora: 14:25:51\nFono: Tanara\nAssunto: Paciente veio com seu filho Emerson que achou a Audizoom na internet. Fiz teste com Audeo Yes III bilateral e paciente levou para casa e dará a resposta na quarta.\n---------------------------------------------------------\nData: 07/03/2011\nHora: 13:08:36\nFono: Tanara\nAssunto: Paciente veio e fechou a compra. Deu uma entrada de R$: 1.500,00 mais 3 cheques de 1.500,00 do ex-marido. Marcado retorno dia: 14/03.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 13:29:22\nFono: Tanara\nAssunto: Paciente veio com sua neta Giovana para o retorno. Trocado as caixinhas por colorida. Aumentamos a aclimatização para nível 2. Marcado a 1 visita para dia: 21/03.\n---------------------------------------------------------\nData: 21/03/2011\nHora: 13:10:56\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e troquei as olivas por Power. Aumentei o aparelho para a aclimatização nivel 3 marquei retorno dia: 07/06.\n---------------------------------------------------------\nData: 25/03/2011\nHora: 13:11:41\nFono: Tanara\nAssunto: Paciente veio relatando que os aparelhos não estão funcionando. Era apenas o lado direito Receptor ficou mudo. Feito a troca e expliquei o uso do protetor de cera. Entreguei 2 cerustop que faz parte do programa  de acompanhamento da 2 visita.\n---------------------------------------------------------\nData: 19/05/2011\nHora: 08:15:33\nFono: Tanara\nAssunto: Paciente veio relatando que os aparelhos estão baixos. Fiz aumento de ganho geral ok.\n---------------------------------------------------------\nData: 25/04/2012\nHora: 15:11:10\nAssunto: Suzan - Sra. Dinora não estava em casa, ligar mais tarde.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(233, '', '0', 'GUSTAVO FASOLO', '', 'DIA: 12/03/2009 COMPROU MAXX 22 OD/OE\nR$ 6.000,00 À VISTA\n02 ANOS DE GARANTIA\nDIA: 10/02/2011 COMPRA AUDÉO SMART III BILATERAL PILHA 312\nOD: 1043X0YRH RECEPTOR\nOE: 1042X0JP0\nR$: 5.000,00 A VISTA\nData: 08/05/2009\nGracielle: queixa de que não está ouvindo bem com os aparelhos. Ouve, mas não entende. Aumento do nível de experiência para 3. Aparelhos com bastante cerumen. Dei kit de limpeza.\n---------------------------------------------------------\nData: 04/02/2011\nHora: 11:37:47\nFono: Tanara\nAssunto: Paciente veio relatando que nuca se adaptou com os aparelhos Maxx 22 bilateral. Expliquei que agora já temos aparelhos com uma tecnologia avançada e que irá melhorar a sua audição. Feito teste com Audeo Mini e levou para a casa. Duarte fez uma condições especial a vista R$: 5.000,00 os dois em contra dos deles. Virá na semana que vem.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 08:11:12\nFono: Tanara\nAssunto: Paciente veio relatando que não esta se adaptando, não escuta nada. verifiquei que a pilha estava gasta e com as caixas micro-molde ficou apitando. Troquei os receptores e coloquei pilhas novas. Expliquei novamente como se coloca e voltará na quinta. Diz que quer comprar os aparelhos e até já pegou o dinheiro. Duarte fez 5.000,00 a vista em troca dos maxx 22 bilateral que tinha.\n---------------------------------------------------------\nData: 10/02/2011\nHora: 16:22:17\nFono: Tanara\nAssunto: Paciente veio relatando que esta ouvindo melhor. O dinheiro ficou com a Irmã Valdete que fará o depósito amanhã. Feito também pré-molde bilateral para a confecção dos micro-moldes. Paciente esta tendo do dificuldade para colocar na orelha.\n---------------------------------------------------------\nData: 11/02/2011\nHora: 13:52:01\nFono: Tanara\nAssunto: Paciente veio com os paarelhos trocados. falou que est um pouco chateado pois esses aparelhos dão trabalhos. Orientei a colocação correta e falei que quando chegar as caixinhas vai melhorar. Ligarei na segunda para saber como esta.\n---------------------------------------------------------\nData: 14/02/2011\nHora: 13:53:39\nFono: Tanara\nAssunto: Liguei e conversei com a esposa Maria e falou que seu marido esta indo bem porém tem muitas dificuldades ainda em colocar o aparelho.\n---------------------------------------------------------\nData: 23/02/2011\nHora: 16:55:09\nFono: Tanara\nAssunto: Liguei e falei que as caixnhas já chegaram. Virá amanhã buscar.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 14:57:33\nFono: Tanara\nAssunto: Paciente veio buscar as micro-caixas ok. Entregue o kit de venda mais a 1 visita com kit de manutenção. Marcado a 2 visita pra maio. A nota fiscal também foi entregue.\n---------------------------------------------------------\nData: 18/03/2011\nHora: 13:18:38\nFono: Tanara\nAssunto: Paciente veio relatando que não ficou bom com a caixa. Deixamos novamente as olivas.\n---------------------------------------------------------\nData: 24/06/2011\nHora: 12:48:36\nFono: Tanara\nAssunto: Paciente veio relatando que não estava escutando muito bem. Expliquei que a aclimatização esta muito baixa e precisamos aumentar. Orientei usar o aparelho o dia inteiro para se acostumar. Deixei no nível 4 ok.\n---------------------------------------------------------\nData: 10/08/2011\nHora: 13:52:38\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Feito audiometria e campo livre. Falou que agora esta bem feliz com os aparelhos. Entreguei os brindes e marquei 1 mês para fazer uma regulagem e refazer o campo livre.\n---------------------------------------------------------\nData: 25/04/2012\nHora: 16:50:15\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 21/05/2012\nHora: 15:22:25\nAssunto: Suzan - Confirmado o endereço para mardar carta do Open.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 14:47:36\nAssunto: Suzan - Segundo Duarte cliente não vira para o Open. Retirar da lista.\n-----------------------------------------------------------------------------------------------\n21.10.14\nLidiane:Tentei contato neste telefone (48) 33570090 porém o número não existe.', 0, '', '', '2012-01-01'),
