(235, '', 'Leticia ', '', '', '29/11/2010\nComprou 01 Ap. Phonak Audeo Yes III n  1024X09HC\nValor total R$ 3.900,00 Entr. de R$ 390,00 + 9x de R$ 390,00\n- 01 Programa de acompanhamento\n- 01 ano de garantia\nNF 330585  emissão 29/09/2010\n----------------------------------------------------------------------------\n---------------------------------------------------------\nData: 29/11/2010\nHora: 09:22:22\nMichelle: Paciente fez deposito de 390,00 reais da entrada do aparelho auditivo.\n---------------------------------------------------------\nData: 14/12/2010\nHora: 10:05:08\nFono: Tanara\nAssunto: Paciente veio para a 1 vista, entregue os brindes e passado para o nivel 2 da aclimatização. Marcado retorno dia: 28/02/2011 para a 2 visita.\n---------------------------------------------------------\n', 0, '', '', NULL),
(237, '', 'Leticia ', '', '', 'DIA: 19/04/2012 COMPROU NAÍDA UP III BILATERAL PILHA 675\nOD: 1120X1FGY\nOE: 1121X19YM\nNF: 392.117 DATA: 29/11/2011 \nR$: 7.600,00 ENT. 1.500,00 MAIS 10X DE 610,00 NO CARNÊ\n01 ANO DE GARANTIA. \n--------------------------------------------------------\nData: 06/07/2012\nBruna: Veio pra 2ª visita. Deixou aparelhos 8h submerso na água, estava funcionando perfeitamente, orientei para na próxima visita deixar para mandar para São Paulo, pq vai oxidar a qualquer hora. OK\n---------------------------------------------------------\nData: 25/09/2012\nHora: 09:29:10\nMirella: Tenho efetuado ligações constantes porém nunca consigo contato, desta forma conversei com o Duarte e ele me sugeriu que enviasse um e-mail para o Denissandro para que seja enviado uma carta de cobrança, já enviei o e-mail.\n---------------------------------------------------------\nData: 06/11/2012\nHora: 16:38:12\nAssunto: fez 4 visita falei com sergio filho da dona tereza, o mesmo disse que vem pagar dia 12.11.2012\n---------------------------------------------------------\nData: 13/11/2012\nHora: 08:52:37\nMirella: Duarte ligou para o Sérgio e informou que a data para o pagamento é no máximo até hoje a tarde, caso contrário será acionado o nosso departamento jurídico, sendo assim se caso ele não venha efetuar o pagamento, deveremos entrar em contato com o Denissandro para que o mesmo tome as medidas cabíveis perante a justiça.\n---------------------------------------------------------\nData: 30/11/2012\nHora: 09:18:30\nMirella: Entrei em contato com a clínica Biguaçu, me informaram que o único cadastro que eles tinhasm dela era o telefone: 8408-0709. Liguei o telefone está desligado.\n---------------------------------------------------------\n', 0, '', '', NULL),
(238, '', 'Leticia ', '', '', 'DIA: 07/12/09 COMPROU AUDÉO III BILATERAL PILHA 312 \nOD: 0938X0T4V RECEPTOR 1\nOE: 0938X0T4M\nR$: 5.900,00 ENT. R$: 3.500,00 MAIS 8X DE R$: 300,00\nNF: 290608 DATA: 27/11/09\n1 ano de garantia\nPrograma de acompanhamento Phonak\nData: 11/11/2010\nDébora: Paciente enviou 02 aps.  Audeo III nº OD- 0938X0T4V OE- 0938X0T4M via sedex para revisão da garantia.\n---------------------------------------------------------\nData: 22/11/2010\nDébora: Ap. enviado via sedex.\n---------------------------------------------------------\nData: 17/12/2010\nHora: 08:47:37\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Entregue os brindes e relatou que os aparelhos estavam apitando. Feito a troca de olivas abertas por fechadas ok. Retornará dia: 07/06/2010.\n---------------------------------------------------------\nData: 04/04/2011\nHora: 11:14:55\nMichelle:Paciente deixou aparelho pois esta mudo Tanara verificou o mesmo modelo audéo 0938x0t4v(os audiozoom 1565)\n---------------------------------------------------------\nData: 05/04/2011\nHora: 10:08:29\nFono: Tanara\nAssunto: Liguei e passei o valor de R$: 280,00 vai para a fábrica. Receptor.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 16:19:58\nFono: Tanara\nAssunto: Liguei e avisei a filha que o aparelho já chegou. Marquei para o dia: 05/05 para vir buscar.\n---------------------------------------------------------\nData: 06/05/2011\nHora: 11:57:57\nFono: Tanara\nAssunto: Paciente veio com seu marido Adir e filha Bernadete para buscar o aparelho da OD. Feito uma audiometria e uma nova regulagem ok. Seu marido tinha muita cera orientei retirar e vem na segunda fazer uma audiometria. Pagou R$: 280,00 com garantia de 6 meses pois já saio da garantia os aparelhos. Marcado retorno de 8 visita dia: 07/12/2011.\n---------------------------------------------------------\nData: 17/08/2011\nHora: 13:37:55\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD não estava funcionando bem. veirifquei que a oliva estava muito suja. Coloquei olivas novas ok. Aumentei um pouco o ganho geral da OD. Aparelhos funcionando muito bem.\n---------------------------------------------------------\nData: 11/01/2012\nHora: 16:29:58\nMichelle: Filha Bernadete  pegou 4 cartelas de pilha 312\n---------------------------------------------------------\nData: 10/12/2012\nHora: 08:53:11\nFRANCINE: Ultima consulta do programa de acompanhamento. Levou brinde. Ofereci para renovar, porém relata que não tem condições.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
