(243, '', 'Leticia ', '', '', 'DIA: 10/05/2011 TESTE COM APARELHO\nData: 10/05/2011\nHora: 10:16:12\nFono: Tanara\nAssunto: Paciente veio com seu filho para saber como funciona a avaliação. Expliquei que fazemos sem compromisso a avaliação. Feito audiometria e expliquei a necessidade de usar aparelhos auditivos. Testei Audéo Mini, mas paciente não tem condições. Então passei o valor de R$: 2.800,00 sendo o Una. Vai levar o orçamento pra casa e ver com os filhos o que eles podem ajudar.\n---------------------------------------------------------\nData: 17/06/2011\nHora: 15:43:33\nFono: Tanara\nAssunto: Liguei e conversei com o filho Valetin. Falou que no momento a sua mãe vai fazer uma cirurgia nos olhos da catarata. Falou que depois que ela ficar boa vai trazer ela para negociar o aparelho de R$: 2.800,00.\n---------------------------------------------------------\nData: 11/05/2012\nHora: 16:01:32\nAssunto: Suzan - Telefone desligado. Celular do filho.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 16:23:40\nAssunto: Suzan - Não atende.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(244, 'OTOVIDA', 'Leticia ', '', '', 'USA APARELHO ARGOSY SOLO T+ 311 OD: 097X12717 / OE: 097X12100 - PILHA 13.\nPCIENTE VEIO ACOMPANHADA DO MOTORISTA PARA DEIXAR OS APAREHOS PARA CONSERTO -  MOTIVO: INTERMITENTE - ARGOSY SOLO T+ 311 Nº 097X12717 / 097X12100. ORÇAMENTO: R$1040,00 CADA (4º ANO DE USO) -                    TOTAL: R$2080,00.\nMOTORISTA RETIROU APARELHO.OS 2926', 0, '', '', '2012-01-01'),
