(246, '', 'Leticia ', '', '', 'DIA:14/03/07 COMPROU 2 APARELHOS CIC ANALOGICO BERNAFON N 198806/198906 PILHA 10 ACOMPANHA 1 ANO DE PILHA 10 JA ENTREGUES\n---------------------------------------------------------\nData: 26/04/2012\nHora: 16:39:08\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 16:01:08\nAssunto: Suzan - Não atende. Tentar confirmar endereço para mandar OPEN.\n', 0, '', '', '2012-01-01'),
