(250, '', 'Leticia ', '', '', 'DIA: 26/07/2010 COMPROU MICRO-EXTRA 100 AZ BILATERAL PILHA 312\nOD: 0921X15FR \nOE: 0921X15DM\nR$: 6.320,00 À VISTA \n01 ANO DE GARANTIA\nNF: 280417 DATA: 26/08/2009\nData: 03/03/2011\nHora: 14:38:14\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. ok.\n---------------------------------------------------------\nData: 26/07/2011\nHora: 10:36:14\nFono: Tanara\nAssunto: Paciente veio para deixar os aaprelhos para revisão antes de terminar a garantia em agosto. Vai para S.P e ligaremos quando chegar. Feito e 4 visita.\n---------------------------------------------------------\nData: 02/08/2011\nHora: 11:20:43\nFono: Tanara\nAssunto: Deixei recado que os aparelhos chegaram na garantia. Virá buscar.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 09:47:25\nMichelle:Paciente retirou aparelho.\n---------------------------------------------------------\nData: 10/08/2011\nHora: 13:50:46\nFono: Tanara\nAssunto: Paciente veio para fazer audiometria e campo livre. Verifiquei que precisava regular aumentei e marquei para 1 mês refazer o campo livre.\n---------------------------------------------------------\nData: 27/04/2012\nHora: 15:04:24\nAssunto: Suzan - Não atende.\n', 0, '', '', '2012-01-01'),
(251, '', 'Leticia ', '', '', '15/12/2008 Comprou 1 aparelho Argosy microPower III 300 AZ - OD n  0747H14WA \nPILHA 312    NF 24494    30/04/08\nValor total R$ 6.000,00 à vista\n2 anos de garantia \n2 cartelas de pilhas\nData: 22/11/2010\nDébora: Filha deixou ap. para revisão da garantia. Emprestado o Audeo Yes III.\n---------------------------------------------------------\nData: 06/12/2010\nDébora: Filha esteve na clínica para retirar aparelho e entregar o que havia emprestado.\n---------------------------------------------------------\nData: 27/04/2012\nHora: 15:07:39\nAssunto: Suzan - Filha disse que Sra. Edith esta com o aparelho a 2 anos e vai permanecer com o mesmo. Pois ja esta com 90 anos.\n', 0, '', '', '2012-01-01'),
