(262, 'HU', '0', '', 'Faleceu', 'sra. terezinha é vizinha e cuida do sr. celso                                                                    DIA: 08/06/07 BERNAFON C15  \n2.000,00 \nOE SOLO 311 dWDRC E OD SOLO dSC 411\nOD: 07BX11665\nOE: 07CX14050\nNF: 226653 DATA: 31/01/2008\nDIA: 05/08/2011 COMPROU NÁIDA III SP\nOE: 1111X0JGG\nR$: 3.500,00 À VISTA\nNF: 370.632 DATA: 30/06/2011 \n01 ANO DE G - NÃO TEM PROGRAMA DE ACOMPANHAMENTO.\n---------------------------------------------------------\nData: 02/02/2009\nDébora: Paciente esteve na loja para trocar o caninho do molde e comprou uma cartela de pilhas rayovac 13 R$23,00.\n---------------------------------------------------------\nData: 16/03/2011\nHora: 13:58:51\nFono: Tanara\nAssunto: Paciente veio deixar os aparelhos para o orçamento Phonak, Solo 311 OE e Solo 411 OD. Passar o roçamento até sexta.\n---------------------------------------------------------\nData: 17/03/2011\nHora: 11:33:30\nFono: Tanara\nAssunto: Liguei e passei o orçamento de R$: 780,00, sendo 300 o aparelho da OE troca da caixa, revisão e limpeza e 480,00 da OD que vai para SP. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 19/04/2011\nHora: 10:57:08\nFono: Tanara\nAssunto: Liguei e falei que seu aparelho já chegou da fábrica. Vem retirar dia: 02/05. Custo de R$: 780,00 os dois aparelhos.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 09:07:21\nMichelle: Paciente retirou aparelho pago 780,00 reais Duarte deu 3 cartelas de pilhas para o cliente.\n---------------------------------------------------------\nData: 25/07/2011\nHora: 09:12:47\nFono: Tanara\nAssunto: Michelle: Paciente deixou aparelho pois o mesmo esta mudo modelo solo t+ 311 dwdrc 07cx14050(os audiozoom 2058), esta na garantia de conserto. Tanara fez molde paciente tem que pagar 65,00 reais. Confecção de molde de silicone meia concha escavada sem ventilação.\n---------------------------------------------------------\nData: 27/07/2011\nHora: 08:14:36\nFono: Tanara\nAssunto: Liguei para o paciente e passei o valor de R$: 800,00, sendo que 300,00 já pagou. Paciente precisa pagar mais R$: 500,00 mas não quis. Falou que não gasta mais 1 real com esse aparelho. Vem retirar na segunda.\n---------------------------------------------------------\nData: 01/08/2011\nHora: 13:23:45\nFono: Tanara\nAssunto: Paciente veio pra testar Naída III SP na OE. Duarte vai negociar com o paciente. Feito a audiometria e paciente ouviu muito bem. Voltará na quarta para testar o outro lado. Feito pré-molde da OD para a confecção de molde de silicone transparente concha escavada sem ventilação. Deixou um aparelho pra orçamento Solo 411 dSC 07BX11665.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 09:50:42\nFono: Tanara\nAssunto: Paciente foi atendido pelo Duarte. Retirou o molde e testou aparelho na OD também. Voltará para fazer o pagamento.\n---------------------------------------------------------\nData: 05/08/2011\nHora: 12:03:56\nFono: Tanara\nAssunto: Duarte fechou a venda da OE Naída SP III. R$: 3.500,00 a vista. Voltará dia: 01/09 para o retorno. Deu como parte de pagamento o Solo 411 dLim da OD 07BX11665 e o Solo 311 dWDRC 07CX14050.\n---------------------------------------------------------\nData: 12/01/2012\nHora: 12:07:52\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Feito a 1 e 2 visita. Entregue os brindes e paciente diz que o aparelho está ótimo.\n---------------------------------------------------------\nData: 01/10/2012\nHora: 09:11:45\nAssunto: Suzan - Sr. Celso veio trocar a mangueirinha.\n---------------------------------------------------------\nData: 03/12/2012\nHora: 09:06:40\nAssunto: Francine - Pré modagem para molde em silicone concha fechada vent 1mm. Flex Hook solto, pct esta prendendo com fio de nylon. Não quis deixar aasi para revisão, relatou que voltará em fevereiro para revisão.  Refere que não consegue usar aasi OD.\n---------------------------------------------------------\nData: 04/02/2013\nHora: 15:27:21\nAssunto: Francine: Prog. de acompanhamento - tudo ok - Não entreguei os brindes pois tem tudo em casa. AASI sujo, mas não quis deixar para revisão.\n\nTROCA DE MANGUEIRINHA E ENTREGA DE 3 CARTELAS DE PILHA 13. NÃO TROUXE LIVRETO DO PROGRAMA DE ACOMPANHAMENTO - PRÓXIMA VISITA ANOTAR NO LIVRETO.', 0, '', '', '2011-08-05'),
