(265, '', 'Leticia ', '', '', 'USA ARGOSY MAXX 11 OE 03095552 OD 04098505\nPACIENTE COMPROU OS APARELHOS EM JOINVILLE DIGSOM\nData: 01/02/2011\nHora: 09:33:52\nFono: Tanara\nAssunto: Paciente comprou aparelhos em Joinville e esta morando agora em Floripa. Deixou o Maxx 11 OE para arrumar esta mudo, sem a flange. Jaimar irá arrumar.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 10:12:32\nFono: Tanara\nAssunto: Liguei para o paciente e passei o valor de R$: 280,00. Paciente autorizou. Vai para a fábrica e quando chegar ligaremos.\n---------------------------------------------------------\nData: 22/02/2011\nHora: 16:38:31\nFono: Tanara\nAssunto: Aparelho chegou da fábrica, feio troca do Receptor R$: 280,00. Paciente buscou o aparelho e virá na sexta para fazermos uma audiometria e teste com novo aparelho. Pagou em cheque.\n---------------------------------------------------------\nData: 25/02/2011\nHora: 15:18:15\nFono: Tanara\nAssunto: Paciente veio e deixou o aparelho da OD para arrumar, esta mudo. Emprestei 2 Audeo Mini bilateral até o dele ficar pronto. Ligarei para falar se vai para S.P ou não. A tarde já liguei e avisei que vai para SP. Custo de R$: 280,00. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 17/03/2011\nHora: 15:27:13\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho chegou da fábrica. Vem na segunda.\n---------------------------------------------------------\nData: 21/03/2011\nHora: 16:17:20\nFono: Tanara\nAssunto: Feito regulagem e falou que adorou os novos aparelhos. Irá ficar mais um pouco com os deles e caso estragar novamente irá de certeza comprar os Audéos Mini V. Passei os valores de R$: 7.724,00 cada. Michelle: Paciente retirou aparelho pago 280,00.\n---------------------------------------------------------\nData: 30/04/2012\nHora: 16:42:01\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 15:08:56\nAssunto: Suzan - Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:46:21\nAssunto: Suzan - Sr. Elevy esta no Parana e volta so em Julho. Não ira participar do OPEN. Disse que carta não chegou ate sua residencia. Endereço esta correto.\n', 0, '', '', '2012-01-01'),
