(270, '', 'Leticia ', '', '', 'DIA: 08/10/2009 Fez  teste com audeo V bilateral\nData: 01/06/2010\nDébora: Liguei e o paciente estava viajando, falei com a filha Sônia que irá conversar com o pai para realizar um novo teste.\n---------------------------------------------------------\nData: 23/04/2012\nHora: 17:02:56\nAssunto: Suzan - Telefone é do genro do Sr. Claudio, deixei recado, vai passar para o cliente. Falei de promoção R$2800,00.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 16:00:50\nAssunto: Suzan - Telefone ninguem atende e o celular esta desligado.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 16:16:48\nAssunto:Suzan - Telefone ninguem atende e o celular esta desligado.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
