(272, '', 'Leticia ', '', '', 'DIA: 03/01/2011 TESTE COM APARELHO NAÍDA UP IX\nData: 03/01/2011\nHora: 16:02:16\nFono: Tanara\nAssunto: Paciente veio com sua esposa Anabel para fazer um teste com aparelhos. Tem perda mais de 30 anos e nunca usou aparelhos. Trouxe já a audiometria e foi feito teste com Naída III SP. Feito pré-moldes e buscará amanhã. Vai ficar 1 semana de teste.\n---------------------------------------------------------\nData: 04/01/2011\nHora: 07:53:31\nFono: Tanara\nAssunto: Paciente veio buscar os moldes e relatando que esta dando dor de cabeça quando vai na rua. Fiz o gerenciador de microfonia e diminui a saída máxima. Levou para casa novamente e retornará amanhã.\n---------------------------------------------------------\nData: 05/01/2011\nHora: 11:58:53\nFono: Tanara\nAssunto: Paciente veio com sua esposa, falando que não deu mais dor de cabeça. Diminui um pouco o ganho geral e deixei mais o volume até -30db. Orientei nao usar na rua e voltará na segunda dia: 10 para fechar a venda.\n---------------------------------------------------------\nData: 11/01/2011\nHora: 17:25:10\nFono: Tanara\nAssunto: Paciente veio com sua esposa Anabel e falou que esta escutando um pouco melhor. Fiz aumento da aclimatização e teve uma boa compreensão. Pediu para ficar até quinta com os aparelhos. Passei valores de R$: 11.000,00 bilaterla e a vista R$: 8.800,00.\n---------------------------------------------------------\nData: 13/01/2011\nHora: 08:15:59\nFono: Tanara\nAssunto: Paciente e devolveu os aparelhos, falou que foi o melhor que encontrou mas vai verificar se encontra aparelho melhor ainda. Diz que quer escutar tudo. Expliquei sobre a perda dele e suas limitações. Falou que se não gostar de nenhum vem comprar esse.\n---------------------------------------------------------\nData: 23/04/2012\nHora: 17:22:45\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 15:25:47\nAssunto: Suzan - Não atende, verificar se ganhou aparelho do HU.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 16:03:27\nAssunto: Suzan - Falei com filha ela disse que a Mãe tbm é nossa cliente(Sra. Mirta).E vem com ela dia 30/10 e ja confirma se vem para o Open.\n', 0, '', '', '2012-01-01'),
(273, '', 'Leticia ', '', '', 'Usa ap. Rexton Arena 2p JM51764 / JM51766\nData: 05/10/2012\nHora: 17:31:22\nAssunto: Suzan - Enviado p/ Jaraguá para conserto OS: 2658.\n---------------------------------------------------------\nData: 31/10/2012\nHora: 13:46:06\nFono: Tanara\nAssunto: Liguei e falei que esse aparelho voltou sem conserto. Falei da promoção do Open. Vem fazer teste com aparelhos novos.\n---------------------------------------------------------\nData: 13/11/2012\nHora: 09:06:39\nMirella: Sua mãe veio buscar o aasi sem conserto, levou orçamento de um aasi novo, Naída III SP, R$ 3.000,00 à vista, irá pensar direitinho depois retorna.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
