(280, 'HU', '0', '', 'CADASTRO ATUALIZADO.', 'USA APARELHO PHONAK NF 313042 31/05/2010 ATÉ 31/05/2011\nMODELO NAIDA II UP\nOE 211012X0M80 OD 210918X0ARC\n\n---------------------------------------------------------\nData: 28/08/2009\nDébora: Paciente deixou ap. Rexton Arena 2HP nº AN39227 para orçamento de conserto. Alto consumo de pilha. Enviado pra fábrica.\n---------------------------------------------------------\nData: 28/09/2009\nDébora: Feito revisão e limpeza R$100,00.\n---------------------------------------------------------\nData: 30/09/2009\nDébora: Mãe veio buscar ap. Pago R$100,00.\n---------------------------------------------------------\nData: 11/06/2010\nUsa ap. Rexton Arena 2HP nº AN39227\n---------------------------------------------------------\nData: 17/06/2011\nHora: 09:40\nMichelle: Paciente deixou aparelho pois o mesmo não esta amplificando o som e esta com ângulo quebrado Tanara verificou o mesmo modelo NAIDA II\nUP OD 210918X0ARC (OS AUDIOZOOM 1930)\n---------------------------------------------------------\nData: 20/06/2011\nHora: 17:01:23\nFono: Tanara\nAssunto: Liguei para o paciente e passei o valor de R$: 280,00 vai para a fábrica, pois o Jaimar não conseguiu arrumar. Autorizado ligaremos quando chegar.\n---------------------------------------------------------\nData: 28/06/2011\nHora: 17:09:11\nFono: Tanara\nAssunto: Liguei avisando que seu aparelho já chegou da fábrica. Custo de R$: 280,00. Virá buscar amanhã.\n---------------------------------------------------------\nData: 29/06/2011\nHora: 14:14:56\nMichelle: Paciente retirou aparelho feito troca do modulo + ângulo + assistencia técnica(os audiozoom 1930). Pagou R$: 280,00.\n---------------------------------------------------------\nData: 12/12/2011\nHora: 11:42:36\nMichelle:Paciente deixou aparelho para revisão MODELO NAIDA III SP OD 210918X0ARC(OS AUDIOZOOM 2215)\n---------------------------------------------------------\nData: 05/01/2012\nHora: 14:08:34\nMichelle: Paciente reti