(281, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 09/04/2013\nHora: 16:02:56\nFRANCINE: TESTE COM AUDEO S SMART IX, MAS VAI QUERER O LYRIC. TEM MUITO ZUMBIDO NA OD. AUDIO DEU PA NAS FREQUENCIAS DE 3 A 8KZ NA OD, E LIMIARES NORMAIS NA OE.\n---------------------------------------------------------                                                             PACIENTE DEVOLVEU O APARELHO, REFERE POUCO MELHORA. ESTÁ FAZENDO MAIS INVESTIGAÇÕES PRA VER DAONDE VEM O ZUMBIDO, E DEPOIS DE TUDO FINALIZADO, INCLUSIVE OS TRATAMENTOS, E O ZUMBIDO PERMANECER, VAI NOS PROCURAR PARA FAZER TESTE COM LYRIC.', 0, '', '', NULL),
