(284, 'Widex', 'Leticia ', '', '', 'doc. pai sandro\nusa Widex\n---------------------------------------------------------\nData: 21/07/2009\nFono: Gracielle\nConversei com a mãe (Madalena). Pc usa os mesmo aparelhos (Widex) há 9 anos. Falei do Naída (pc tem perda auditiva severa/profunda). Ficou interessada em testar. Estão de férias e qdo voltarem, irá agendar horário para teste.\n---------------------------------------------------------\nData: 16/05/2012\nHora: 17:43:26\nAssunto: Suzan - Falei com Pai da Fernanda, disse que comprou um aparelho a 3 meses.\n---------------------------------------------------------', 0, '', '', NULL),
(285, '', 'Leticia ', '', '', 'DIA: 17/02/2011 AUDIOMETRIA NORMAL\nRÁDIO GUARAREMA\n\n---------------------------------------------------------\nData: 17/02/2011\nHora: 14:35:03\nFono: Tanara\nAssunto: Paciente veio com a nora Fernanda fazer a audiometria que ganhou da rádio. Não apresentou perda de audição tendo uma audiometria normal bilateral. Orientei procurar o médico Otorrino caso precise.\n---------------------------------------------------------', 0, '', '', '2011-02-17'),
