(290, '', 'Leticia ', '', '', 'Data: 02/05/2012\nHora: 15:09:35\nAssunto: Suzan - Sra. Eliane mandou na segunda feira o aparelho para arrumar. Tanara vai ligar e conversar com cliente.\n---------------------------------------------------------\nData: 02/05/2012\nHora: 17:50:03\nFono: Tanara\nAssunto: Liguei para a paciente para passar o valor do conserto R$: 250,00 o receptor. Paciente mandou pelo correio o aparelho Micro-Power III OD 0924X06KD. Estava com o receptor quebrado. Vai depositar R$: 250,00 na conta do banco do Brasil e Mirella vai colocar no correio de volta.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 13:41:28\nFono: Tanara\nAssunto: Recebi pelo correio o aparelho. Verifiquei que era receptor. Liguei e passei o valor de R$: 250,00. Autorizado e vai fazer o depósito na conta do banco do brasil. Micro-Power III OE 0924X06K8.\n', 0, '', '', '2012-01-01'),
