(292, 'HU', 'Leticia ', '', '', 'USUÁRIO AASI UNA ITC/HS - OD: 01107559 - NF 297969 - 1 ANO DE GARANTIA 02.02.10 À 02.02.11. PILHA 312.\nData: 20/05/2011\nHora: 15:11:55\nMichelle:Motorista deixou aparelho pois esta com caixa rachada não esta amplificando o som UNA ITC/HC OD: 01107559 (OS AUDIOZOOM 1682)\n---------------------------------------------------------\nData: 27/05/2011\nHora: 20:10:02\nFono: Tanara\nAssunto: Paciente veio para fazer o pré-molde da OD para a troca da caixa intra, pois o dele esta rachada. Jaimar irá fazer. vai pagar R$:290.\n-----------------------------------------------------------\nData: 02/06/2011\nHora: 10:32:50\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho esta pronto. Vai pagar R$: 290,00 mais 45,00 do smart guarde. Total R$: 335,00. O motorista virá buscar.\n---------------------------------------------------------\nData: 03/06/2011\nHora: 09:19:11\nMichelle: Motorista retirou aparelho feito troca da caixa+ silica+ smart guard pagou 385,00 reais.\n---------------------------------------------------------\nData: 14/06/2011\nHora: 13:58:11\nFono: Tanara\nAssunto: Paciente veio relatando que esta machucando o ouvido o Jaimar desgastou a cápsula ok.\n---------------------------------------------------------\nData: 02/05/2012\nHora: 15:47:23\nAssunto: Suzan - Numeros inexistentes.\n', 0, '', '', '2012-01-01'),
(293, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/07/2011\nHora: 13:38:58\nFono: Tanara\nAssunto: Paciente veio com sua esposa Isabel para fazer teste e comprar de aparelhos. Foi indicado pela nossa paciente Noemia que usa Audéo Mini V. Feito audiometria e testado Audéo Smart V bilateral. Pciente gostou do aparelho e fez o pagamento de R$: 14.000,00, sendo uma entrada de R$: 2.000,00 no débito mais 8x de R$: 1.500,00 no crédito que sua filha vem na semana que vem passar. Falta entregar o programa de acompanhamento.\n---------------------------------------------------------\nData: 06/07/2011\nHora: 13:38:50\nFono: Tanara\nAssunto: Paciente veio com sua esposa Isabel relatando que esta muito feliz com os aparelhos. Feito aumento da aclimatização e o gerenciador de microfonia. Marcado retorno dia: 15/07 e paciente deu mais 8 cheques no valor de 1.500,00 cada.\n---------------------------------------------------------\nData: 05/08/2011\nHora: 11:05:05\nFono: Tanara\nAssunto: Paciente veio com sua esposa Isabel relatando que o aparelho da OE esta mudo. Verifiquei e era o receptor, feito a troca ok.\n---------------------------------------------------------\nData: 02/09/2011\nHora: 11:53:12\nFono: Tanara\nAssunto: Paciente veio com sua esposa Isabel para um retorno extra. Expliquei que esta tudo certo e aumentei para o nivel 4 a aclimatização. Marcado a 2 visita dia: 30/09.\n---------------------------------------------------------\nData: 30/09/2011\nHora: 11:18:39\nFono: Tanara\nAssunto: Paciente veio com a esposa Isabel para a 2 visita.\n---------------------------------------------------------\nData: 20/01/2012\nHora: 17:29:06\nFono: Tanara\nAssunto: Paciente veio com a esposa Isabel para a 3 visita. Entregue os brindes e coloquei as olivas de fechada por power. Paciente diz que estava escutando bem melhor. Marcamos o retorno dentro de 6 meses.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio para a visita de 1 ano. Entregue pilhas e acessórios. Aparelho da OD está mudo. Mandamos para SP para OS (0044550). OK\n---------------------------------------------------------\nData: 10/07/2012\nHora: 10:27:17\nFono: Tanara\nAssunto: Liguei para avisar que o aparelho já chegou. Virá buscar amanhã.\n---------------------------------------------------------\nData: 12/07/2012\nHora: 11:11:04\nAssunto: Suzan - Sr. Francisco veio buscar o aparelho. Esta na garantia, nada foi cobrado.\n---------------------------------------------------------\nData: 18/12/2012\nHora: 09:42:48\nFRANCINE: Esposa do paciente veio trazer AASI para eu olhar pois refere que não esta funcionando e irão viajar. Fiz limpeza, troca de cerustop e oliva - ficou tudo OK.\n\nPaciente retirou brindes 42 pilhas 312, 1 caixa desumidificadora, 1 cerustop.\n\nDIA: 01/07/2011 COMPRA AUDÉO SMART V BILATERAL PILHA 312\nOD: 1052X04C5 NF: 349.988 DATA: 16/02/2011 RECEPTOR 3\nOE: 1102X0WTA NF: 355.407 DATA: 29/03/2011\nR$: 14.000,00 ENT. 2.000,00 NO DÉBITO MAIS 8X DE 1.500,00 NO CHEQUE\n02 ANOS DE GARANTIA.', 0, '', '', '2011-07-01'),
(294, '', 'Leticia ', '', '', 'COMPROU ANGULO 10/01/2006 25.00 REAIS MAIS 1 CARTELA DE PILHAS\nData: 02/05/2012\nHora: 15:52:17\nAssunto: Suzan - Sra. Elin diz que é o mesmo aparelho de 2006. Diz que faz acompanhamento sempre. E no momento não quer trocar de aparelho.', 0, '', '', '2012-01-01'),
(295, 'HU', 'Leticia ', '', '', 'DIA: 10/05/2011 TESTE COM APARELHO AUDÉO MINI III.\nUSA APARELHO CERTENA ART MICRO BILATERAL PILHA 13\nOD: 1146X05PN\nOE: 1149X0399\nNF: 404.938 DATA: 29/02/2012 ATÉ 28/02/2013\nData: 11/05/2011\nHora: 16:07:31\nFono: Tanara\nAssunto: Paciente veio para fazer um novo teste com aparelhos. Falou que já tinha vindo aqui, mas não tinha gostado muito. Fiz teste com Audéo Mini bilateral. Paciente gostou bastante e vai ser a possibilidade de comprar.\n---------------------------------------------------------\nData: 26/05/2011\nHora: 20:15:02\nFono: Tanara\nAssunto: Paciente veio trazendo a audiometria e conversar sobre a possibilidade de comprar os aparelhos. Pois gostou bastante. Mas achou caro. Pediu um orçamento e ai ver como ia fazer o pagamento.\n---------------------------------------------------------\nData: 31/05/2011\nHora: 14:18:27\nFono: Tanara\nAssunto: Liguei e falei dos aparelhos. Falou que virá aqui ams antes esta vendo aparelhos mais em conta.\n---------------------------------------------------------\nData: 01/06/2011\nHora: 13:12:23\nFono: Tanara\nAssunto: Paciente veio com a sua filha para comprar. Duarte atendeu e passou os preços do Solo retro. Ficaram de voltar.\n---------------------------------------------------------\nData: 02/05/2012\nHora: 16:05:22\nAssunto: Suzan - Marquei retorno para dia 07/05 as 09:00. Vai trazer o aparelho que tem para tentar arrumar.\n---------------------------------------------------------\nData: 2/10/2012\nHora: 16:52:49\nAssunto: Suzan - Confirmado endereço com Sr. ELIO para o Open.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
