(298, '', 'Leticia ', '', '', '25/05/2007 COMPROU BERNAFON ITC  R$: 2.000,00 À VISTA\nDIA: 10/07/2012 COMPROU NAÍDA S CRT III BILATERAL PILHA 13\nOD: 1207H0GDY NF: 415.738 DATA: 11/05/2012\nOE: 1207H0GDV NF: 415.102 DATA: 08/05/2012 CF 3517\nR$: 8.000,00 À VISTA\n01 ANO DE GARAN\n---------------------------------------------------------\nData: 23/01/2009\nDébora: Deixou os dois aparelhos para revisão e limpeza.\n---------------------------------------------------------\nData: 14/10/2009\nDébora: Esteve na clínica para fazer revisão e limpeza dos aparelhos e troca de um protetor de cera. R$145,00.\n---------------------------------------------------------\nData: 26/1/2010\nDébora: Paciente deixou ap. com microfonia interna para orçamento.\n---------------------------------------------------------\nData: 27/02/2010\nDébora: Pegou aparelho. Feito troca de flange. Cortesia.\n---------------------------------------------------------\nData: 29/07/2010\nDébora: Paciente deixou ap. fraco para orçamento.\n---------------------------------------------------------\nData: 30/07/2010\nDébora: Troca de receptor R$390,00. Duarte levou aparelhona casa do paciente. Pago R$200,00.\n---------------------------------------------------------\nData: 08/09/2010\nDébora: Paciente esteve na clínica para pagar R$190,00 que ficou devendo.\n---------------------------------------------------------\nData: 28/12/2011\nThaisa: Pac deixou ap OE para orçamento de conserto, está com microfonia interna. Emprestamos 2 audeos Smart III 1129X0UUR / 1129X0UVG.\n---------------------------------------------------------\nData: 04/01/2012\nHora: 15:18:44\nMichelle: Paciente retirou aparelho pagou 100,00 do conserto feito troca do receptor e revisão e limpeza ficou devendo 280,00 que vai pagar em fevereiro autorizado por Duarte. Devolveu os de empréstimo.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 16:12:04\nAssunto: Suzan - Não atende. Tentar confirmar endereço para mandar carta do Open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 17:09:51\nAssunto: Suzan - Confirmado presença para o Open dia 18/06 as 09:00 com Duarte.\n---------------------------------------------------------\nData: 18/06/2012\nHora: 08:26:04\nAssunto: Suzan - Sr. Francisco desmarcou o Open de hj. Vai tentar vir amanha as 11:00.\n---------------------------------------------------------\nData: 10/07/2012\nHora: 11:02:14\nFono: Tanara\nAssunto: Paciente veio com seu filho para comprar aparelhos. Duarte vendeu Naída S CRT III bilateral por R$: 8.000,00. O filho vai fazer o depósito. Deixou os aparelhos antigos para o Duarte fazer uma revisão e Limpeza. Bernafon intra ITC bialteral OD S/N OE S/N.\n---------------------------------------------------------\nData: 01/08/2012\nHora: 14:34:00\nFono: Tanara\nAssunto: Liguei e conversei com a esposa. Falou que esta super feliz com os aparelhos novos, pois esta ouvindo que é uma beleza. Avisei que os aparelhos antigos já chegaram e buscará na Palhoça.\n---------------------------------------------------------\nData: 06/08/2012\nHora: 13:51:09\nFono: Tanara\nAssunto: Paciente veio com a esposa. Falou que o aparelho da OE não estava funcionando, era o protetor de cera Cerustop entupido ok.\n', 0, '', '', '2007-05-25'),
(299, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 12/7/2010\nHora: 14:19:51\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza (os audiozoom 1184).\n---------------------------------------------------------\nData: 21/7/2010\nDébora: AP. veio da fábrica. 210913X07V0- troca de módulo / 210915X0FMD- troca de módulo e VC.\n---------------------------------------------------------\nData: 23/07/2010\nHora: 09:32:07\nMichelle:Paciente retirou aparelho modelo una sp az oe 210913x07v0 od 210915x0fmd (os audiozoom 1184).\n---------------------------------------------------------\nData: 15/09/2011\nHora: 13:54:35\nFono: Tanara\nAssunto: Paciente veio com o aparelho da OE mudo. Era manguerinha. Feito a troca pagou R$: 5,00. Orientei que trocasse de molde pois o dele esta muito velho. Diz que vem na segunda para fazer o pré-molde.\n---------------------------------------------------------\nData: 25/04/2012\nHora: 16:38:30\nMirella: dia 07/3/2012 Pct retirou o aasi tinha deixado para conserto, valor R$ 480,00, entrada dia 07/3/2012 R$ 180,00 + 2X carnê R$ 182,50 cada, 07/4/2012, 07/5/2012.\n---------------------------------------------------------\nData: 02/08/2012\nHora: 10:26:45\nMirella: Liguei para o paciente e ele informou que virá acertar as parcelas em atraso segunda feira dia 6/8/2012.\nAPARELHO AUDITIVO UNA AP AZ BILATERAL PILHA 13\nOD: 0915X0FMD\nOE: 0913X07V0\nNF: 275449 DATA: 14/07/2009 ATÉ 14/07/2010\n', 0, '', '', '2012-01-01'),
