(302, '', 'Leticia ', '', '', '19/09/07 COMPROU 01 AP.BERNAFON WIN 400 pilha 10 VALOR R$ 3.500,00 ENT. R$ 875,00 + 3X  R$ 875,00\nData: 23/07/2009\nGracielle: liguei para convidar para avaliação. Pc falou que depende da filha para trazê-la. Vai ligar para agendar.\n---------------------------------------------------------\nData: 09/11/2009\nThais: Pc. deixou ap. para fazer revisao, limpeza e troca de protetor de cera. A revisao já esta paga (R$65,00) falta so o protetor de cera (R$15,00).\n---------------------------------------------------------\nData: 10/11/2009\nDébora: Filha esteve na clínica para buscar aparelho. Pagou o protetor de cera.\n---------------------------------------------------------\nData: 3/12/2009\nDébora: Paciente deixou ap. WIN 400 com gaveta de pilha quebrada para orçamento.\n---------------------------------------------------------\nData: 8/12/2009\nDébora: Retornou à clínica para buscar aparelho. Não foi pago Cortesia.\n---------------------------------------------------------\nData: 23/12/2009\nHora: 14:28:14\nCris: Filha retirou aparelho - não foi cobrado\n---------------------------------------------------------\nData: 12/01/2010\nDébora: Filha deixou ap. mudo para orçamento.\n---------------------------------------------------------\nData: 15/01/2010\nHora: 10:52:10\nCris: Filha levou 1 protetor SmartGuard deve R$ 15,00.\n---------------------------------------------------------\nData: 25/1/2010\nHora: 11:21:02\nCris:Filha retirou aparelho, (Microfonia).\n---------------------------------------------------------\nData: 02/05/2012\nHora: 17:45:16\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 14:42:14\nAssunto: Suzan - Sra. Elita esta dormindo. Ligar mais tarde', 0, '', '', '2012-01-01'),
