(305, 'HU', 'Leticia ', '', '', 'USA 02 SOLO T PHONAK PILHAS 312 RAYOVAC\n---------------------------------------------------------\nData: 3/5/2012\nHora: 16:17:37\nAssunto: Suzan - Falei com esposo da Sra. Elma. Disse que um dos seus aparelhos esta quebrado. Marquei retorno para terça feira dia 08/05 as 14:00. Falei de promoção e aparelhos novos. Ele vai trazer o aparelho quebrado para ver se tem como arrumar.\n---------------------------------------------------------\nData: 20/12/2012\nHora: 09:07:07\nFRANCINE: paciente veio para fazer orçamento. Passei orçamento por escrito no valor de R$1200,00 cada aparelho (Solo t22 bilateral, n° OD r07088273 e OE: L07088272)\n', 0, '', '', '2012-01-01'),
(306, 'HU', 'Leticia ', '', '', 'Data: 29/04/2010\nHora: 12:34:29\nMichelle:Paciente deixou aparelho para revisão e limpeza (os audiozoom 194).\n---------------------------------------------------------\nData: 29/4/2010\nHora: 17:49:19\nMichelle: Paciente RETIROU aparelho para revisão e limpeza VALOR 100,00(os audiozoom 194).\n---------------------------------------------------------\nData: 24/8/2010\nHora: 17:45:36\nMichelle: Paciente deixou aparelho, pois está com a a caixa rachada class d 08su475(os audiozoom 1282).\n---------------------------------------------------------\nData: 27/8/2010\nHora: 17:54:32\nMichelle: A caixa foi colada e banho de verniz. Paciente retirou aparelho. pago R$20,00.\n---------------------------------------------------------\nData: 3/5/2012\nHora: 16:31:26\nAssunto: Suzan - Sr. Elmir continua com aparelho antigo. Disse que vem verificar promoção e aparelhos novos.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 16:01:21\nAssunto: Suzan - Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 16:42:23\nAssunto: Suzan - Ligar amanha para celular.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 15:00:11\nAssunto: Suzan - Confirmado presença no OPEN. 18/06 as 09:30.\n---------------------------------------------------------\nData: 20/06/2012\nHora: 16:45:53\nAssunto: Suzan - Sr. Elmir esta viajando. Diz que chega na segunda feira e liga para marcar um retorno para conhecer novos aparelhos.\n', 0, '', '', '2012-01-01'),
(307, '', 'Leticia ', '', 'PCTE DA PALHOÇA', 'DIA: 03/05/2012 TESTE COM NAÍDA III SP BILATERAL.\n---------------------------------------------------------\nData: 10/05/2012\nHora: 09:46:38\nFono: Tanara\nAssunto: A esposa Gilda veio retirar os moldes do paciente e devolveu os Naída que estavam de teste. Diz que esta bem adaptado com os que ele ganhou e não tem a necessidade de gastar com aparelhos novos. Pagou R$: 150,00 e levou de brinde uma caixa de pastilhas de molde.\n-------------------------------------------------------', 0, '', '', '2012-01-01'),
(308, '', 'Leticia ', '', '', 'DIA: 23/05/2012 TESTE COM APARELHOS AUDÉO SMART S V BILATERAL\nData: 23/05/2012\nHora: 15:45:35\nFono: Tanara\nAssunto: Paciente veio encaminhada peloDr. kowalski para realizar uma audiometria e teste com aparelhos. Porém a paciente não quis testar pois achou caro os aparelhos. Queria pagar R$: 5.000,00 pelos 2 aparelhos. Entreguei um orçamento do Audéo Smart III por R$: 7.000,00 a vista.\n---------------------------------------------------------\nData: 30/05/2012\nHora: 15:50:44\nFono: Tanara\nAssunto: Liguei e falei com a paciente que o Duarte fez por R$: 5.000,00 os 2 aparelhos, sendo que será o Audéo V. Ficou de dar a resposta amanhã.\n---------------------------------------------------------\nData: 13/9/2012\nHora: 15:21:32\nAssunto: Suzan - Confirmado endereço para o Open.\n', 0, '', '', '2012-01-01'),
(310, '', 'Leticia ', '', '', 'NÃO É USUÁRIA, MAS VEIO PARA VER PARA DAR DE PRESENTE , FILHA É USUÁRIA.\nData: 14/05/2012\nHora: 16:31:32\nAssunto: Suzan - Sra. Elza diz que filha precisa usar aparelho. Ela tem 25 anos e é advogada. Falei de promoção e aparelhos novos. Vai conversar com a filha e pediu para ligar na segunda feira que vem dia 21/05 as 15:30.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
