(315, '', 'Leticia ', '', '', 'ARGOSY SOLO 311 093X14198\nDIA: 21/09/2011 NAÍDA III SP OE\nOE: 1115X17A9\nNF: 370632 DATA: 30/06/2011\nR$: 4.000,00 À VISTA\n01 ANO DE GARANTIA.\nDIA: 30/03/2012 NÁIDA III SP OD\nData: 12/08/2011\nHora: 09:09:10\nMichelle: Paciente deixou aparelho pois esta mudo MODELO SOLOT + 311 DWDRC 093X14198(os audiozoom 1835)\n---------------------------------------------------------\nData: 15/08/2011\nHora: 17:18:48\nFono: Tanara\nAssunto: Aparelho na garantia. Foi para S.P.\n---------------------------------------------------------\nData: 26/08/2011\nHora: 07:53:23\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 31/08/2011\nHora: 08:26:14\nMichelle: Paciente deixou aparelho pois o mesmo esta mudo MODELO SOLO T + 311DWDRC 093X14198(OS AUDIOZOOM 1889)\n---------------------------------------------------------\nData: 15/09/2011\nHora: 09:04:13\nFono: Tanara\nAssunto: Paciente veio com marido Antonio retirar o aparelho que ganhou da Otovida e falamos de novos aparelhos. Mostrei as técnologias e interessou. Feito audiometria e teste com 2 Naída III SP. Gostou bastante e Duarte vai fazer 1 por R$: 4.000,00 e o segundo dando mais R$: 3.000,00. Vai pensar no segunda. Vai depositar R$: 4.000,00 ou R$: 7.000,00. Na semana que vem virá buscar o programa de acompanhamento. Falou que tem o Padre e um tio que tem interesse por aparelhos. Vai indicar.   \nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 21/09/2011\nHora: 09:51:14\nFono: Tanara\nAssunto: Paciente veio com seu amrido Antonio e comprou 1 Naída III SP OE. Pagou R$: 4.000,00 a vista em cheque. Falou que vai comprar o outro lado no final do ano. Levou o novo molde da OE e o kit de manutenção. Entregue também a 1 visita e marcamos dia: 20/12 as 08:00 hs a 2 visita.\n---------------------------------------------------------\nData: 11/10/2011\nHora: 13:33:10\nAssunto:paciente veio na loja e dixou o ap.argosy solo T dwdrc para conserto encaminhado pela otovida. defeito do aparelho amplificação abafada.(os. 2101)cida.\n---------------------------------------------------------\nData: 20/10/2011\nHora: 11:48:03\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho não consertado e levou junto o orçamento não pagou 21,00. pois comprou aparelho com a gente. Valor do conserto R$: 624,00.\n---------------------------------------------------------\nData: 15/05/2012\nHora: 14:24:23\nAssunto: Suzan - Comprou aparelho mês passado.\n---------------------------------------------------------\nData: 26/12/2012\nHora: 13:37:09\nFRANCINE - PROGRAMA DE ACOMPANAHMENTO - 2ª visita - entregue os brindes. não trouxe o folheto do programa.\n', 0, '', '', '2012-01-01'),
(314, '', 'Leticia ', '', '', 'DIA: 01/06/09 COMPROU SOLO 22 OD- R$: 2.000,00\nDIA: 09/09/2011 COMPROU CERTENA 11 BILATERAL PILHA 10 - OD/OE: 09114508\nNF: 382579 DATA: 20/09/2011 ATÉ 20/09/2012\nR$: 5.000,00 10X DE 500,00 NO CHEQUE - 01 ANO DE GARANTIA                                   18/06/2013 - COMPROU CERTENA ART CIC OE: P13F0175L - PILHA 10. VALOR: R$3500,00 - ENTRADA R$350,00 + 9X 350,00.\n---------------------------------------------------------\nData: 05/02/2009\nDébora: Esteve na clínica com a queixa de que havia molhado o aparelho e o mesmo estava mudo. Foi verificado e o aparelho estava com mto chiado e sem amplificação.\n---------------------------------------------------------\nData: 10/02/2009\nDébora: Veio buscar o aparelho. Foi trocado o microfone. duarte não cobrou.\n---------------------------------------------------------\nData: 18/05/2009\ntroca de bloco R$1.020,00.\n---------------------------------------------------------\nData: 20/05/2009\n28/05/07 COMPROU 1 APARELHO ITC 312 BERNAFON VALOR 2000,00 1 ENT.1000,00 MAIS 2X 500,00\n---------------------------------------------------------\nData: 04/09/2009\nHora: 12:20:59\nAssunto:cida teve na loja retirou os dois cheques.(pagou a ultima parcela do ap. 1.000,00 reais).\n---------------------------------------------------------\nData: 04/01/2011\nHora: 11:58:49\nFono: Tanara\nAssunto: Paciente veio trazendo seu aparelho mudoe descolado, ainda esta na garantia, porém não usa muito. Feito uma audimetria e teste com o Audeo Smart bilateral. Levou para a casa e Jaimar irá consertar o antigo.\n---------------------------------------------------------\nData: 06/01/2011\nHora: 07:53:09\nFono: Tanara\nAssunto: Aparelho ficou pronto, feito a colagem, revisão e limpeza. Ligado para o paciente vir buscar. Tudo na garantia.\n---------------------------------------------------------\nData: 10/01/2011\nHora: 13:47:30\nFono: Tanara\nAssunto: Paciente veio buscar seu parelho que estava na garantia e devolveu o de teste. falou que achou complicado colocar e que vai no médico ver o melhor aparelho para ele. Falei para retornar pois podemos colocar um intra na OE onde nao usa aparelho.\n---------------------------------------------------------\nData: 15/08/2011\nHora: 20:10:02\nFono: Tanara\nAssunto: Paciente veio para comprar 2 intra. Falou que fez pesquisa e conseguiu por R$: 5.000,00 bilateral. Duarte fez pra ele Una 22 bilateral por R$: 5.000,00 em 10x de 500,00. Feito pré-molde bilateral e ligaremos quando chegar os aparelhos. \n---------------------------------------------------------\nData: 29/08/2011\nHora: 13:42:49\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram, porém não tinha mais Una intra, então foi feito Certena 22 bialteral. A tarde paciente veio para a adaptação bilateral. Achou que onde não usa aparelho estranho. Falei que é a primeira vez que esta usando. Marcado retorno dia: 01/09. Paciente deixou 8 cheques de 500,00, sendo que falta 2 de 500,00. Total: 5.000,00 autorizado pelo Duarte.\n---------------------------------------------------------\nData: 01/11/2011\nHora: 10:51:47\nFono: Tanara\nAssunto: Paciente veio para a 1 visita sem o caderninho. Orientei trazer. Expliquei e troquei o protetor de cera e marquei retorno dia: 09/12.\n---------------------------------------------------------\nData: 16/11/2011\nHora: 08:43:11\nFono: Tanara\nAssunto: Paceinte veio com o aparelho da OE sem amplificação. Vai para S.P. Certena 11 OE 09114508.\n---------------------------------------------------------\nData: 28/11/2011\nHora: 16:32:07\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho chegou. Virá buscar hoje. Final da tarde paciente veio retirar o aparelho. Esqueceu o canhoto e assinou atras da OS.\n---------------------------------------------------------\nData: 08/12/2011\nHora: 11:48:33\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho esta baixo. Era apenas o protetor de cera. Feito a troca ficou ótimo. Orientei trocar 1 vez por mês.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 16:15:55\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 15:09:26\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 02/07/2012\nBruna: Veio para adaptação do AMBRA nano que adiquiriu, fiz adaptação, ficou ótimo. Foi pra casa sem acertar a compra. Disse que falou com Duarte e disse que ia testar antes de fechar. Retorna na quinta-feira. \nAMBRA NANO - P12F1418L NF: 423265 DATA: 27/06/2012 - PILHA 10\n---------------------------------------------------------\nData: 24/07/2012\nHora: 17:30:38\nFono: Tanara\nAssunto: Paciente deixou o aparelho para colocar o fio de naylon. Certena 11 OD 09114508.\n---------------------------------------------------------\nData: 06/08/2012\nHora: 10:23:27\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá buscar a tarde.\n---------------------------------------------------------\nData: 06/08/2012\nHora: 15:47:21\nMirella: Pct veio buscar aasi, não trouxe o canhoto, aasinou o termo.\nPaciente perdeu há algum tempo o aparelho da OE, e veio para comprar um novo. Duarte autorizou vender por R$3500,00 em 10 vezes. Pedi Certena ART CIC. - PG R$350,00 de entrada.\nFilho do paciente veio pagar as 9 parcelas restantes da compra do AASI. Passou no cartão de crédito R$3150,00 em 9 vezes (R$350,00 cada parcela). Tudo OK.\nPACIENTE DEIXOU APARELHO PARA REVISÃO POIS O MESMO ESTA COM PROTETOR DE CERA CAIDO MODELO CERTENA ART R09114508(OS AUDIOZOOM 1305)\nPACIENTE RETIROU AASI FEITO CONSERTO PAGOU 280,00 REAIS MODELO AASI CERTENA ART R09114508 OS AUDIOZOOM 1305) 6 MESES DE GARANTIA\n', 0, '', '', '2009-06-01'),
(316, 'OTOVIDA', 'Leticia ', '', '', 'USA AP. ARGOSY SOLOT+ 311 N  OD- 08CX18229 / OE- 08CX18280 \nData: 22/05/2009\nDÉBORA: Motorista deixou ap. SOLOT+ 311 Nº OD- 08CX18229 / OE- 08CX18280 \npara orçamento.\n---------------------------------------------------------\nData: 23/06/2009\nDébora: Feito revisão, troca de mangueira e fiação. R$150,00.\n---------------------------------------------------------\nData: 27/04/2011\nHora: 15:13:01\nMichelle: Motorista retirou aparelho sem OS  Sidney Vieira pago 200,00\n---------------------------------------------------------\nData: 24/04/2012\nHora: 11:23:41\nAssunto:cida. entrada da os 13/04/2012 os. 2535, Sidney motorista da Reunidas retirou sem canhoto assinou termo de responsabilidade.\n', 0, '', '', '2012-01-01'),
(317, '', 'Leticia ', 'KOWALSKI', '', 'DIA: 24/08/2012 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1206X0MPG\nOE: 1205X0DCE\nNF: 427.517 DATA: 24/07/2012\nR$: 8.000,00 À VISTA EM DEPÓSITO\n01 ANO DE GARANTIA.\nData: 22/08/2012\nHora: 13:50:33\nFono: Tanara\nAssunto: Paciente veio com seu filho Edio encaminhado pelo Dr. Kowalski. Feito audiometria e teste com Audéo S Smart III bilateral. Paciente levou para casa e voltará na sexta. Não falei de valores. Dr. Kowalski falou que tem que ver o mais barato, pois ele não tem condições. Duarte irá atender.\n---------------------------------------------------------\nData: 24/08/2012\nHora: 10:06:14\nFono: Tanara\nAssunto: Paciente veio com seu filho Edio para o retoro. Fechou o Audéo Smart III bilateral em R$: 8.000,00 à vista em depósito. Adorou os aparelhos. Vem na segunda para o retorno de venda.\n---------------------------------------------------------\nData: 16/01/2013\nHora: 15:18:59\nAssunto: fran: contato telefônico com o S. Edio (filho) e vai trazer o pai para fazer uma regulagem.\n---------------------------------------------------------\nData: 18/01/2013\nHora: 16:33:48\nAssunto: FRAN: feita regulagem - ficou bom. Entregue ítens do programa de acompanhamento.\n', 0, '', '', '2012-01-01'),
(318, '', 'Leticia ', '', '', 'DIA: 29/09/2011 COMPROU NAÍDA SP III OE PILHA 13\nOE: 1122X10KG\nNF: 379.577 DATA: 31/08/2011\nR$: 4.100,00 ENT. 2.000,00 MAIS 4X DE 525,00 NO CARTÃO\n01 ANO DE GARANTIA.\n---------------------------------------------------------\nData: 29/09/2011\nHora: 10:28:05\nFono: Tanara\nAssunto: Paciente veio com a esposa do neto Márcia para um teste com aparelho. Já usa aparelho e quer comprar somente 1 por enquanto. Colocamos na OE um Naída SP III. Paciente gostou e fechou a venda.\n---------------------------------------------------------\nData: 06/10/2011\nHora: 08:46:09\nFono: Tanara\nAssunto: Paciente veio para o retorno extra. Buscou o molde novo e voltará dentro de 1 semana para a 1 visita.\n---------------------------------------------------------\nData: 13/10/2011\nHora: 14:07:23\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. ok.\n', 0, '', '', '2011-09-29'),
(319, '', 'Leticia ', '', '', '13/04/09 Comprou 02 ap. Argosy Solo T+ 311 dWDRC OD- 091X10140 / OE- 091X10107\nValor total R$ 5.350,00 Entr. de R$ 1.000,00 + 15x de R$ 290,00\n2 anos de garantia       DEVOLVEU APARELHOS\nData: 06/07/2009\nGracielle: fui receber terceira parcela na casa da paciente. R$290,00. Pc comprou uma cartela de pilhas 13 e 6 pastilhas para limpeza do molde.\n---------------------------------------------------------\nData: 13/08/09\nTHAIS: PC PAGOU 4ª/15 PARCELA AP R$290,00;\n---------------------------------------------------------\nData: 17/09/2009\nThais: Pagou a 5ª/15 parcelas aparelho. Graci recebeu.\n---------------------------------------------------------\nData: 05/10/2009\nTHAIS: Pagou a 6ª/15 parcelas aparelho. Graci recebeu.\n---------------------------------------------------------\nData: 19/04/2010\nDEVOLVEU APARELHOS.\n', 0, '', '', '2012-01-01'),
