(322, '', 'Leticia ', '', '', 'DIA: 12/03/2010 COMPROU AUDEO III OD\nOD: 0933X0FNW\nR$: 3.511,00 ENT. R$: 1.000,00 + 9X DE R$: 277,00 (deixou 6 cheques)\nNF: 293269  DATA: 18/12/2009\nDIA: 14/01/2011 COMPROU AUDEO YES III OE\nOE: 1024X0F8M\nR$: 3.500,00  \nData: 03/01/2011\nHora: 16:56:33\nFono: Tanara\nAssunto: Paciente veio com sua filha Dirlei trazendo o seu aparelho para a revisão e limpeza na garantia. Testamos 2 Mini Audéos e paciente gostou bastante. Levou para teste e voltará para fazer a negociação. Aparelho dela foi para a fábrica.\n---------------------------------------------------------\nData: 06/01/2011\nHora: 13:47:19\nFono: Tanara\nAssunto: Paciente veio com sua filha e falou que irá ficar com o aparelho Audeo Yes e comprará o outro lado. Quando chegar o aparelho vamos ligar e ela irá negociar com o Duarte.\n---------------------------------------------------------\nData: 14/01/2011\nHora: 08:49:31\nFono: Tanara\nAssunto: Aparelho chegou da fábrica, feito troca do Receptor na garantia. Paciente comprou o outro lado, falou que estava mais acostumada com o dela e devolveu os Audeos Mini. R$: 3.500,00, sendo 800,00 de entrada mais 10x no cheque, sendo que os 2 primeiros são de R$: 350,00 mais mais 8 de R$: 250,00. Deu 4 cheques, falta 6 cheques no valor de R$: 250,00. Retorno dia: 28/01.\n---------------------------------------------------------\nData: 28/01/2011\nHora: 13:08:59\nFono: Tanara\nAssunto: Paciente veio para a 1 visita do aparelho novo. Ebtreguei 3 cartelas de pilhas. Falou que estava muito baixo. Aumentei para o nivel 2 da aclimatização. Entregou mais 6 cheques que restava. Esta tudo pago e entregamos a nota fiscal. Marcado retorno em março.\n---------------------------------------------------------\nData: 02/02/2011\nHora: 09:52:06\nFono: Tanara\nAssunto: Paciente veio para aumentar o ganho do aparelho esquerdo. Deixei na aclimatização 4 e fiz o gerenciador de microfonia ok. Vem dia: 11/03 para o retorno.\n---------------------------------------------------------\nData: 11/03/2011\nHora: 13:13:13\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregues os brindes e baixado o ganho geral da OD pois diz que estava muito alto. Marcado a 2 visita.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 13:14:02\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento 2 visita do aparelho novo. Entregue os brindes e marcado a 3 visita. Tudo ok com os aparelhos.\n---------------------------------------------------------\nData: 16/09/2011\nHora: 17:11:13\nFono: Tanara\nAssunto: Paciente deu 1 cheque R$: 350,00, sendo a entrada mais 2 cheque de R$: 350,00 mais 4 de R$: 250,00. Falta mais 4 cheques de R$: 250,00, sendo agosto, setembro outubro e novembro.\n---------------------------------------------------------\nData: 10/10/2011\nHora: 09:45:05\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Deixou o aparelho da OD para mandar para S.P na garantia pela última vez. Audéo III OD 0933X0FNW.\n---------------------------------------------------------\nData: 20/10/2011\nHora: 11:04:42\nFono: Tanara\nAssunto: Liguei e avisei o Genro Danir que o aparelho da sogra já chegou. Vem buscar.\n---------------------------------------------------------\nData: 27/10/2011\nHora: 16:52:17\nFono: Tanara\nAssunto: A filha veio buscar o aparelho ok.\n---------------------------------------------------------\nData: 15/05/2012\nHora: 15:39:51\nAssunto: Suzan - Falei com Danir-genro. Passei promoções, vai falar para a cliente passar aqui para conhecer as promoções.\nPACIENTE DEIXOU APARELHO POIS O RECEPTOR QUEBROU MODELO AUDEO YES III N° SÉRIE 1024X0F8M(OS AUDIOZOOM 2928)\nGenro veio retirar aparelho sem canhato, pois o mesmo foi extraviado.\npACIENTE DEIXOU APARELHO PARA ORÇAMENTO POIS O MESMO ESTA COM RECEPTOR QUEBRADO MODELO AUDÉO N° SÉRIE 1024X0F8M (OS AUDIOZOOM 2970)\nPaciente retirou aparelho que foi trocado recpetor em loja com o valor de R$250,00.Paciente pagou R$100,00 em dinheiro, e 150,00 em cheque p/ 30 diasDEIXOU OS NO DIA 19/7/2013 COM MICHELE COM RECEPTOR QUEBRADO, FIZ A TROCA DE RECEPTOR COBEI 250,00 REAIS DEI CX DE DESUMIDIFICADOR MAIS CERUSTOP. AP ENCONTRA-SE COM SOM DE ÓTIMA QUALIDADE.', 0, '', '', '2012-01-01'),
