(328, '', 'Leticia ', '', '', 'Usa CIC bilateral\n22/01/2010 Fez teste com audeo V OE\nData: 09/01/2009\nDÉBORA DEIXOU APARELHO PRA REVISÃO E LIMPEZA, POIS 1 PILHA ESTA DURANDO 2 DIAS. PEGOU AP. MSM DIA COLOCADO PROTETOR DE CERA VALOR:75,00 REAIS\n---------------------------------------------------------\nData: 13/02/2009\nDébora: Veio à clínica com a queixa de q seu aparelho continua consumindo muita pilha. Evaldo verificou e o receptor estava com muita cera. Foi feito limpeza e trocada a flange. Não foi cobrado.\n---------------------------------------------------------\nData: 12/06/2009\nDébora: Esposo esteve na clínica e comprou 6 pilhas 10 powerone.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 16:28:02\nAssunto: Suzan - Confirmado endereço para mandar carta do Open.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 15:50:31\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 12/06/2012\nHora: 15:05:27\nAssunto: Suzan - Ninguem atende.\n', 0, '', '', '2012-01-01'),
(329, '', 'Leticia ', '', '', 'Usa ap. Intrason Retro n  0459  OE\nDIA: 18/04/2012 COMPROU NAÍDA III UP OE PILHA 675\nOE: 1119X19RA\nNF: 392.117 DATA: 29/11/2011\nR$: 4.500,00 ENT. 500,00 MAIS 1X DE 444,00 MAIS 8X DE 444,00 NO CHEQUE\n01 ANO DE GARANTIA. CF 3290.\nData: 27/07/2009\nTHAIS: DEIXOU AP. PARA REVISAO E LIMPEZA. Deixou pago R$65,00.\n---------------------------------------------------------\nData: 29/07/2009\nGraci: veio buscar com a filha. Já havia deixado pago. Havia levado par de Ambia 411 para teste. Só usou da OE e sentiu diferença. Passei valor de R$4000,00. Vão pensar e retornarão.\n---------------------------------------------------------\nData: 18/04/2012\nHora: 11:43:30\nFono: Tanara\nAssunto: Paciente veio com a sua filha para fazer teste e orçamento de aparelho novo. Usa um antigo Retro analógico da Intrason. Feito audiometria e teste com Naída III UP. Paciente adorou e fechou a venda R$: 4.500,00. Ent. 500,00 mais 9x de 444,00 no cheque. Vem em 15 dias para a 1 visita e dará os 9 cheques.\n---------------------------------------------------------\nData: 02/05/2012\nHora: 14:38:20\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Buscou o molde de acrílico ok. Marquei retorno dentro de 2 meses.\n---------------------------------------------------------\nData: 18/10/2012\nHora: 14:46:46\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Levou os brindes e marcado retorno dia: 18/04/2013 as 13:30 h. Passado para Cida. Paciente esta bem feliz com o uso do aparelho e agora não pode comprar o outro lado pois esta pagando a prestação ainda.\n', 0, '', '', '2012-01-01'),
(330, '', 'Leticia ', '', '', 'DIA: 13/04/2011 PACIENTE TEM 2 APARELHOS DA OTICON TROCOU A MANGUERINHA.\nPilha 13\nData: 13/04/2011\nHora: 14:01:31\nFono: Tanara\nAssunto: Paciente tem 2 aparelhos da Oticon e veio para trocar a manguerinha. Pagou R$: 5,00.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 15:10:11\nAssunto: NUMERO DO TELEFONE ESTA INCORRETO.\n---------------------------------------------------------\nData: 27/02/2013\nHora: 16:10:53\nAssunto: Suzan - Sr. Etelvino comprou pilha 13. Mostrei nossos aparelho para ele, disse que vai vir outro dia para fazer um teste.\n---------------------------------------------------------\nData: 05/03/2013\nHora: 15:05:25\nFRAN - TESTE COM NAIDA S CRT III BILATERAL. TEVE BOA RESPOSTA COM ADAPTAÇÃO BILATERAL. FIZ 4,500 CADA OU R$8000,00 O PAR. EM TESTE ATÉ 5ª-FEIRA.\n---------------------------------------------------------\nData: 07/03/2013\nHora: 16:27:57\nFRAN - VEIO DEVOLVER OS AASIS - RELATOU QUE OE FICOU COM CHIADO. TROQUEI O TAMANHO DO RECEPTOR (DE 0 PARA 3 - POIS ESTAVA EM FALTA) E A OLIVA (DE POWER PARA FECHADA) - FICOU BOM, POREM COMEÇOU UM POUCO DE MICROFONIA. PACIENTE SÓ QUER COMPRAR 1 APARELHO, DA OD. VAI VOLTAR EM 7 DIAS E QUANDO VIER FECHAR, OFERECER PARA TESTE POR 15 DIAS O OUTRO AASI, DA OE FAZENDO A REGULAGEM DA MICROFONIA.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
