(333, 'HU', 'Leticia ', '', '', 'USA APARELHO WIDEX  MODELO B2 N  646752\n\nPAGO  R$50,00  02/08/2010\nData: 7/6/2010\nHora: 10:07:56\nMichelle:Paciente deixou aparelho pois não esta funcionando MODELO B2\nN° 646752 OS AUDIOZOOM 1153).\n---------------------------------------------------------\nData: 01/07/2010\nHora: 09:27:16\nMichelle:Paciente REITORU aparelho feito revisão e limpeza MODELO B2\nN° 646752 OS AUDIOZOOM 1153). Pago R$50,00 PAGO R$50,00.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 07:44:57\nFono: Tanara\nAssunto: Paciente veio fazer molde de silicone rosa, meia concha com 1 mm de ventilação. Pagou 30,00 e vai pagar mais 30 dia: 30/01.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 08:55:13\nFono: Tanara\nAssunto: Paciente retirou o molde e já pagou R$: 30,00. Vai pagar o resto 35,00 dia: 30/01.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 09:21:49\nMichelle: Paciente deixou aparelho pois esta mudo modelo b2 n° 646723(os audiozoom 1453).\n---------------------------------------------------------\nData: 31/01/2011\nHora: 15:27:07\nFono: Tanara\nAssunto: Ligado para a paciente passando o valor do conserto, sendo R$: 490,00 o receptor. Não autorizou.\n---------------------------------------------------------\nData: 02/02/2011\nHora: 15:52:02\nMichelle: Paciente reitoru aparelho sem conserto aparelho retidado sem OS cliente extraviou o mesmo.\n---------------------------------------------------------\nData: 10/02/2011\nHora: 12:25:09\nFono: Tanara\nAssunto: Paciente veio relatando que o molde não ficou bom. O médico sugeriu fazer igual ao antigo. Feito novo pré-molde e Jaimar vai fazer igual sem custo.\n---------------------------------------------------------\nData: 11/02/2011\nHora: 15:27:54\nFono: Tanara\nAssunto: Paciente veio buscar o molde ok sem custo.\n---------------------------------------------------------\nData: 18/03/2011\nHora: 09:32:38\nMichelle: Paciente retirou molde  pagou 35,00\n---------------------------------------------------------\nData: 16/05/2012\nHora: 14:31:34\nAssunto: Suzan - Telefone desligado.\n', 0, '', '', '2012-01-01'),
(334, '', 'Leticia ', '', '', 'DIA: 11/11/2009 Fez teste com ap. microExta OD/OE R$ 3.511,20\nHOSPITAL POLICIA MILITAR - DR  JOÃO\nData: 18/06/2010\nDébora: Liguei e falei com a esposa. Disse que o Sr. Eurico não quer usar aparelho, mas que dará o recado a ele.\n---------------------------------------------------------\nData: 01/10/2012\nHora: 17:07:00\nAssunto: Suzan - Confirmado endereço para mandar carta do Open. Esposa diz q Sr. Eurico não quer usar aparelho. Mas vai fazer de tudo para ele vir para o Open. A neta é fono.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 16:26:27\nAssunto: Suzan - Falei com esposa, disse que Sr. Eurico recebeu carta do Open mas nao tem interesse.\n---------------------------------------------------------\nData: 19/10/2012\nHora: 14:08:41\nFono: Tanara\nAssunto: Paciente veio para fazer um novo teste. Feito audiometria e teste com Naída III SP OE R$: 3.500,00 em 10x de R$: 350,00. Vai conversar com a esposa e voltará na segunda com ela. Falou que vai fazer em cheque.\n---------------------------------------------------------\nData: 22/10/2012\nHora: 13:54:13\nFono: Tanara\nAssunto: Paciente ligou e falou que agora não poderá comprar o aparelho. Diz que conversou com a esposa não não tem condições. Expliquei que temos por R$: 2.800,00. Falou que ligaria.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
