(336, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 12/09/2012\nHora: 14:45:46\nAssunto: Suzan - Sr. Gidalth não estava em casa. Deixei recado para me retornar.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 14:08:01\nAssunto: Suzan - Falei com Sra. Gidalth, disse que esta com o aparelho antigo. Confirmado endereço para o Open.\n---------------------------------------------------------\nDIA: 03/02/2012 TESTE COM APARELHO AUDÉO SMART III BILATERAL.', 0, '', '', '2012-02-03'),
