(338, '', 'Leticia ', '', '', 'Data: 14/01/2009\nPAI TROUXE APARELHOS P/ORÇAMENTO PHONAK SUPER-FRONT PPCL-4 /DANAVOX AGCI 255PP/DÉBORA PASSOU INFORMAÇÕES SOBRE NOVOS APARELHOS VEM FAZER TESTE\n---------------------------------------------------------\nData: 21/05/2009\nDébora: Pai esteve na clínica para buscar os aparelhos. Feito revisão e limpeza. Pagou R$120,00 e uma cartela de pilhas Panasonic 675 R$21,00.\n---------------------------------------------------------\nData: 09/07/2012\nHora: 17:29:29\nAssunto:CIDA. PACINTE ESTEVE NA LOJA E RETIROU MOLDE OD. OE. VALOR 150,00 REAIS. BRINDE 20 PASTILHAS PARA LIMPEZA MOLDE.\nCOMPROU AP. PPCL4 N  KC 25688 DIA 29/04/2000\n1.360,00 CONSER.AP. SIEMENS MESMA DATA. R$ 435,00 02 MOLDES SILICONE 100,00', 0, '', '', '2000-04-29'),
(339, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 29/07/2011\nHora: 09:22:36\nFono: Tanara\nAssunto: Paciente do centro veio fzer teste com aparelhos. Duarte sugeriu usar Audéo Smart III bilateral. Feito a audiometria e regulagem ok. Levou para a casa e vem na segunda dia: 01/08.\n---------------------------------------------------------\nData: 01/08/2011\nHora: 09:23:36\nFono: Tanara\nAssunto: Paciente voltou relatando que esta ouvindo bem porém sente o ouvido ocluido. Feito troca da oliva power 11 pelo número 9 ok. Quer mais alto e aumentamos apenas o lado esquerdo pois a OD esta com muita perda e sentiu desconforto. Esta testando tambem na Telex mas esta gostando muito dos nossos aparelhos.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 12:10:58\nFono: Tanara\nAssunto: Paciente veio relatando que esta gostando dos aparelhos e que vai ver se consegue um bom desconto com um plano. Falou que vem dia: 10/08 para fazer o fchamento dos aparelhos. Se não conseguir o desconto vai comprar apenas 1 aparelho.\n---------------------------------------------------------\nData: 10/08/2011\nHora: 13:54:40\nFono: Tanara\nAssunto: Paciente veio para buscar mais pilhas falou que esta muito bem adaptado e que vai comprar 1 de certeza. Vem na segunda para negociar.\n---------------------------------------------------------\nData: 16/08/2011\nHora: 13:34:43\nFono: Tanara\nAssunto: Paciente veio para fechar a venda. R$: 4.500,00 deu R$: 3.000,00 e R$: 1.500,00 em 8x de R$: 187,00 no carnê. Colocou a caixa cinza e ficou ok. Marcado a 1 visita dia: 30/08.\nDIA: 16/08/2011 COMPRA AUDÉO SMART III OE PILHA 312', 0, '', '', '2011-08-16'),
(341, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/03/2009\nDébora: Paciente trouxe aparelho para revisão e limpeza. Depositou R$65,00.\n---------------------------------------------------------\nData: 31/08/2009\nGRACIELLE: LIGOU E PASSOU NÚMERO DA NF: 39717\n---------------------------------------------------------\nData: 15/09/2009\nTHAIS: ap. entregue para o motorista.\n---------------------------------------------------------\nData: 25/04/2013\nHora: 17:01:09\nFRANCINE - CONTATO TELEFÔNICO - Paciente perguntou sobre preço do aparelho Audeo Smart III. Falei o valor de tabela (R$4500,00) e expliquei a nova tecnologia - S Smart III. Perguntou sobre intra, se tem como fazer o mesmo aparelho como intra, expliquei que tem o Cassia, e que a questão do bluetooh vai depender no tamanho do intra. Ficou bem interessado, porém vai enviar o aparelho velho para fazer orçamento do conserto. Vai tentar pegar o valor do aparelho novo com a prefeitura.\n---------------------------------------------------------\ntrouxe ap. para conserto 26/08/05 obs: está apitando dia:28/11/06levou 1 cartela de pilhas 312 vai depositar na conta.', 0, '', '', '2012-01-01'),
(342, 'fgo. daniel', 'Leticia ', '', '', '---------------------------------------------------------\nData: 16/09/2009\nDébora: Paciente esteve na clínica e deixou 02 ap. para revisão da garantia. MICROELEVA 100 OE.210704H1091/OD.210704H109H. Enviados pra fábrica.\n---------------------------------------------------------\nData: 02/10/2009\nDébora: Retornou à clínica para buscar ap. Achou um pouco baixo e pediu para aumentar o som. Foi aumentado o ganho geral de ambos aparelhos.\n---------------------------------------------------------\nData: 26/10/2009\nDébora: Esteve na clínica para aumentar o ganho do aparelho. Fez pré-moldagem para confecção de tampão para banho.\n---------------------------------------------------------\nData: 6/4/2010\nHora: 13:37:46\nAssunto:cliente teve na loja e comprou 3 cartelas de pilha 312 da promoçao quebrando o silencio e fez teste com aparelho auditivo.\n---------------------------------------------------------\nData: 03/03/2011\nHora: 17:51:35\nMichelle: Paciente deixou aparelho para revisão Duarte escutou aparelho e esta funcionando modelo micro eleva 100 daz 0704h1091\n---------------------------------------------------------\nData: 04/03/2011\nHora: 17:21:31\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho. Pagou 100,00 no cartão.\n---------------------------------------------------------\nData: 31/05/2011\nHora: 14:45:21\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho não esta bom. Feito uma audiometria e regulagem no seu aparelho. Expliquei que ele estava com cera no conduto esquerdo e vai no otorrino retirar. Falei que vamos testar um aparelho novo, vai trazer a audiometria que fez na clínica.\n---------------------------------------------------------\nData: 03/06/2011\nHora: 14:47:15\nFono: Tanara\nAssunto: Paciente veio relatando que o som ainda esta alto. Diminui a saída máxima tirei xerox da audiometria e dia: 16/06 depois que voltar do Otorrino virá testar Audéo Smart bilateral.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 13:20:02\nFono: Tanara\nAssunto: Paciente veio relatando que vai primeiro esperar o resultado da Marinha que irá dar 1 aparelho e depois virá aqui para testar o Smat. Falou que depois da regulagem que foi feito ficou ótimo.\n---------------------------------------------------------\nData: 10/10/2011\nHora: 10:14:09\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para fazer a revisão e limpeza na Audiozoom. Duarte irá fazer. Micro-Eleva OD 0704H109H. Vai pagar R$: 125,00. Deixei em teste 2 Audéo Smart III.\n---------------------------------------------------------\nData: 18/10/2011\nHora: 13:50:11\nAssunto: Paciente esteve na loja e retirou o ap. phonak micro eleva OD.0704m1091 OE.0704m109h para revisão. foi feito a revisão só no direito. pagamento 125,00 reais (foi feito com cartão de credito)obs. não trouxe o canhoto).cida.\n---------------------------------------------------------\nData: 28/10/2011\nHora: 12:14:12\nFono: Tanara\nAssunto: Paciente veio para levar o Audéo Yes IX para teste. Duarte conversou com ele e a princípio vai fechar a venda o IX pelo preço do V. Virá na segunda.\n---------------------------------------------------------\nData: 08/11/2011\nHora: 08:12:59\nFono: Tanara\nAssunto: Paciente veio e conversou com o Duarte. Fechou a venda Audéo Yes IX bilateral por R$: 11.200,00. Entrada de 5.600,00 mais 1x de 1.600,00 para dia: 20/11 mais 2.000,00 para dia: 20/12 e mais 2.000,00 para dia: 20/01.\n\nDIA:     COMPROU AUDÉO YES IX BILATERAL PILHA 312\nR$: 11.200,00 ENT. 5.600,00 MAIS 1.600,00 2X DE 2.000,\nOE210704H1091\nNF211749 / EMISSAO02/08/2007 ATÉ 02/08/2009\nPHONAK MICRO ELEVA 100 OD. 210704H109H\nNF 218748 EMISSAO 23/10/2007 ATÉ 23/10/2009', 0, '', '', '2012-01-01'),
(340, 'centro auditivo de curitiba', '0', '', 'PILHA 13\n01 ANO DE PILHAS', '17/06/2014 - TESTE COM NAÍDA SCRT III PASSADO VALOR DE RS10.000,00 EM 10X, RETORNA DIA 23/06.\n23/06/2014 - COMPROU APARELHO NAÍDA S CRT III NS: 1412X0CHC/ 1412X0CHM NF: 537.782 DT NF: 30/04/2014.\n01 ANO DE GARANTIA ATÉ A DATA DE 03/07/2015 + PILHAS POR 03 ANOS.\nVALOR DA COMPRA R$9.000,00 FEZ TRANSFERÊNCIA PARA CONTA DA LOJA, VERIFICADA POR DUARTE.', 0, 'MODERADA À SEVERA', 'MODERADA À SEVERA', '2014-06-16'),
(343, 'SIEMENS', 'Leticia ', '', '', '---------------------------------------------------------\nData: 11/05/2009\nGracielle: orçamento do conserto: R$ 65,00 (troca da gaveta da pilha e colagem do faceplate). Pc autorizou.\n---------------------------------------------------------\nData: 25/08/2009\nDébora: Paciente esteve na clínica e fez orçamento de 02 ap. Una 311 R$5.600,00 entrada de 560,00 + 9x de 560,00. miniP3 R$7.000,00\nentrada de R$2.000,00 + 10x de 500,00.\n---------------------------------------------------------\nData: 27/08/2009\nHora: 10:21:21\nAssunto: CIDA ENTREGOU O AP. IRÁ RETORNAR.\n---------------------------------------------------------\nData: 09/04/2010\nDébora: Liguei e falei sobre nova tecnologia. Demonstrou interesse, irá marcar horário para fazer um teste.\n---------------------------------------------------------\nData: 11/03/2011\nHora: 08:33:52\nFono: Tanara\nAssunto: Paciente veio com sua esposa para trocar o micro-tubo do seu aparelho. Usa 2 Maxx 211 com adaptação aberta. Expliquei as novas tecnologias e deixei em teste até segunda 2 Audeo Mini no qual adorou. Deixou os deles para o Jaimar dar uma olhadinha. Fiz a audio e expliquei que o Maxx 211 já esta fraco para a perda dele. Valor R$: 4.100,00 cada aparelho.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 13:17:52\nFono: Tanara\nAssunto: Paciente falou que adorou os aparelhos mas no momento não tem condições de comprar. Falou que esta esperando entrar um dinheiro e que por enquanto vai ficar com os velhos mesmo. Orientei fazer revisão e limpeza pois os aparelhos estavam muito sujos R$: 200,00. Vai esperar pois vai tentar comprar os novos.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 17:22:20\nAssunto: Suzan - Confirmado endereço do cadastro para mandar carta do Open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 17:12:21\nAssunto: Suzan - Ligar amanha no celular.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 15:24:04\nAssunto: Suzan - Confirmado presença no Open. 18/06 as 10:30.\n---------------------------------------------------------\n11.05.2009 DEIXOU APARELHO ITC DA SIEMENS PARA ORÇAMENTO DE CONSERTO\nFACEPLATE SOLTO E SEM GAVETA DE PILHA\n17/05/2013 - COMPROU 2 AUDEO S SMART III - OD: 1252X0VLJ / OE: 1252X0VMM - PILHA 312 - 3 ANOS PROG. DE ACOMPANHAMENTO - CF: 7453 (AUDIOZOOM)                NF: 462.087 - 28/02/2013 - GARANTIA ATÉ 17/05/2014.                                          VALOR: R$7200,00 (ENTRADA R$2000,00 + 9 CHEQUES DE R$578,00)', 0, '', '', '2013-05-17'),
(344, 'OTOVIDA', '0', '', '', '---------------------------------------------------------\nData: 24/12/2009\nDébora: Deixou ap. para revisão da garantia. SOLO T22 - OD: 06081156 / OE: 06081156.\n---------------------------------------------------------\nData: 2/12/2009\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 11/12/2009\nDébora: Paciente esteve na clínica para pegar aparelho.\n---------------------------------------------------------\nData: 8/6/2010\nHora: 14:53:10\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza . SOLO T22 - OD: 06081156 / OE: 06081156 (OS AUDIOZOOM 1157).\n---------------------------------------------------------\nData: 8/6/2010\nHora: 14:54:02\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza ORÇAMENTO (OS AUDIOZOOM 1158).\n---------------------------------------------------------\nData: 18/06/2010\nDébora: Ap. veio da fábrica. OD - troca de trimpot / OE - revisão e limpeza.\n---------------------------------------------------------\nData: 01/07/2010\nHora: 15:27:27\nMichelle:Paciente retirou aparelho feito  revisão e limpeza  (OS AUDIOZOOM 1157).\n---------------------------------------------------------\nData: 30/11/2010\nHora: 14:30:53\nMichelle: Paciente deixou aparelho pois a flange esta solta modelo solot22 L06081156(OS AUDIOZOOM 1376).\n---------------------------------------------------------\nData: 02/12/2010\nDébora: Paciente retirou aparelho. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 12/01/2011\nHora: 09:19:17\nMichelle: Paciente deixou aparelho pois liga e desliga defeito intermitente MODELO SOLOT 22 L 06081156(OS AUDIOZOOM 1422).\n---------------------------------------------------------\nData: 09/02/2011\nHora: 10:52:55\nMichelle: Paciente retirou aparelho feito revisão e limpeza e troca do trimpot pago 280,00.\n---------------------------------------------------------\nData: 11/08/2011\nHora: 17:54:18\nMichelle: Paciente deixou aparelho pois o mesmo as vezes liga as vezes não liga modelo solo t 22 r06081156(os audiozoom 1833)\n---------------------------------------------------------\nData: 17/08/2011\nHora: 10:12:34\nFono: Tanara\nAssunto: Liguei e conversei que o conserto do aparelho é R$: 480,00. Não autorizou falou que agora não tem dinheiro. Vem retirar o aparelho hoje.\n---------------------------------------------------------\nData: 17/08/2011\nHora: 12:27:18\nMichelle: Paciente retirou aparelho conserto não autorizado.\n---------------------------------------------------------\nData: 09/09/2011\nHora: 10:43:42\nMichelle:Paciente deixou aparelho pois o mesmo  liga e desliga MODELO solo t 22 r06081156 autorizou conserto 480,00(os audiozoom 1709)Tanara verificar com Duarte se pode fazer em 2 x no crédito o paciente pediu mais eu falei que é uma no débito e outro podeira verificar se ficaria no crédito.\n---------------------------------------------------------\nData: 07/10/2011\nHora: 12:02:33\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho e pagou R$: 480,00 em 2x no cartao de crédito. Deixou o outro para o orçamento. Solo 22 OE 06081156.\n---------------------------------------------------------\nData: 14/10/2011\nHora: 16:27:07\nFono: Tanara\nAssunto: PAciente veio retirar o aparelho da OE e pagou R$: 35,00 pois Duarte só trocou a flange. Deixou novamente o aparelho da OD pois estava apitando. Tirei um pré-molde para fazer troca da caixa intra. Solo 22 OD 06081156.\n---------------------------------------------------------\nData: 27/10/2011\nHora: 16:50:55\nFono: Tanara\nAssunto: Liguei e avisei o paciente que o aparelho já chegou. Virá buscar na segunda.\n---------------------------------------------------------\nData: 03/11/2011\nHora: 17:03:11\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho, porém continua apitando no ouvido dele. Vai novamente para a fábrica. Solo 22 OD 06081156.\n---------------------------------------------------------\nData: 24/11/2011\nHora: 11:43:53\nFono: Tanara\nAssunto: Liguei para o paciente e avisei que o aparelho já chegou da fábrica. Virá buscar hoje ou amanhã.\n---------------------------------------------------------\nData: 24/11/2011\nHora: 10:33:48\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho mas esta novamente sem amplificação comparado com o aparelho Solo 22 da OE. Vai novamente para S.P Solo 22 OD R06081156 na garantia.\n---------------------------------------------------------\nData: 29/11/2011\nHora: 14:49:57\nFono: Tanara\nAssunto: O aparelho chegou da fábrica todo quebrado. Vai novamente para S.P.\n---------------------------------------------------------\nData: 10/01/2012\nHora: 15:30:50\nFono: Tanara\nAssunto: Liguei para o paciente avisando que o aparelho já chegou. mandaram um aparelho novo para assim resolver o problema de vez. Vem buscar na sexta.\n---------------------------------------------------------\nData: 17/08/2012\nHora: 17:42:02\nFono: Tanara\nAssunto: Liguei para o paciente avisando que os aparelhos já chegaram, porém o da OD esta com defeito e voltou para S.P. Versata Art ITC P12G1871R. Vem na segunda para buscar o da OE.\n---------------------------------------------------------\nData: 21/08/2012\nHora: 11:42:52\nFono: Tanara\nAssunto: Paciente veio para buscar os aparelhos, mas explicamos que veio somente o da OE. Levou e vai pagar somente quando chegar o outro lado.\n---------------------------------------------------------\nData: 23/08/2012\nHora: 10:23:08\nFono: Tanara\nAssunto: Paciente veio relatando que esta baixo a OE. Aumentei um pouco e levou o controle de volume cheveiro. Duarte passou o valor de R$: 760,00. Ligaremos quando chegar o aparelho da OD. Vai pagar somente quando chegar.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 16:23:46\nAssunto:cida. paciente esteve na loja para consulta c/ tanara e trouxe o comprovante de depósito valor 18/9 1.200,00 8/092.000,00 20/09/ 800,00.\n---------------------------------------------------------\nData: 17/12/2012\nHora: 17:50:35\nAssunto: Suzan - Deixou aparelho para conserto Phonak Cassia 22 Intra. OS:2761.\n---------------------------------------------------------\nData: 14/01/2013\nHora: 11:24:25\nAssunto: AASI chegou do conserto. Não consegui avisar o paciente - celular fora de área.\n---------------------------------------------------------\nData: 30/01/2013\nHora: 15:56:13\nAssunto:cida. paciente esteve na loja e retirou o aparelho phonak cassia 22 do conserto.\n---------------------------------------------------------\nData: 06/02/2013\nHora: 11:24:01\nJOICE: LIGUEI AVISANDO QUE ASSI JÁ CHEGOU DO CONSERTO.\nRETIROU BRINDES DO PROGRAMA DE ACOMPANHAMENTO. VAI VIR NA 2ª-FEIRA PARA CONVERSAR COM DUARTE POIS QUEIXA DA MICROFONIA DO APARELHO NA HORA DE COLOCAR. JA FIZ TUDO QUE PODIA SER FEITO. PACIENTE REFERE QUE ASSIM NÃO QUER FICAR.', 0, '', '', '2012-09-17'),
