(348, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 06/09/2011\nHora: 16:47:25\nMichelle: Paciente deixou aparelho para orçamento som destorcido modelo arena 2 hp km 43368 (os audiozoom 1704)\n---------------------------------------------------------\nData: 06/09/2011\nHora: 17:34:06\nFono: Tanara\nAssunto: Paciente veio com seu marido Ivan para fazer o conserto do seu aparelho auditivo OE. Porém expliquei que o custo será de R$: 1.200,00, pois o som esta distorcido. Não autoizou e mostrei o Naída. Se interessou e feito teste. Paciente adorou e fechou a venda. Duarte negociou em R$: 4.715,00, sendo uma entrada de R$: 715,00 mais 12x de R$: 333,00 no carnê. Entregue a 1 visita e vai fazer o programa de acompanhamento em Concórdia onde mora.  \nMichelle: Paciente retirou aparelho pagou 21,00 reais Laudo Técnico\n---------------------------------------------------------\nData: 16/09/2011\nHora: 17:00:59\nFono: Tanara\nAssunto: Segunda vai pelo correio o molde junto com o carnê de 12 parcelas no vaor de R$: 333,00 que será feito depósito.\n---------------------------------------------------------\nDIA: 06/09/2011 COMPROU NAÍDA UP III OE PILHA 675\nOE: 1115X1GLD\nNF: 370.600 DATA: 30/06/2011\nR$: 4.715,00 ENT. R$: 715,00 MAIS 12X DE R$: 333,00 NO CARNÊ\n01 ANO DE GARANTIA.', 0, '', '', '2011-09-06'),
(349, '', 'Leticia ', 'Kowalski', '', 'DIA: 24/10/2011 COMPROU AUDÉO YES III OE PILHA 312\nOE: 1115X0YXC\nNF: 371.346 DATA: 06/07/2011\nR$: 4.000,00 ENT. 1.000,00 MAIS 8X DE 375,00 NO CHEQUE\n01 ANO DE GARANTIA.\nData: 20/10/2011\nHora: 09:41:36\nFono: Tanara\nAssunto: Paciente veio encaminhada pelo Dr. Kowalski para realizar uma audiometria e teste com aparelho. Feito audiometria e teste com Audéo Yes III OE. Quer apenas 1 aparelho. Levou para a casa e virá na segunda.\n---------------------------------------------------------\nData: 24/10/2011\nHora: 09:43:58\nFono: Tanara\nAssunto: Paciente veio fechar a venda. R$: 4.000,00, sendo 1 entrada de 1.000,00 mais 8x de 375,00 no cheque. Virá para a visita dia: 07/11.\n---------------------------------------------------------\nData: 07/11/2011\nHora: 09:45:13\nFono: Tanara\nAssunto: Paciente veio para a 1 visita ok. Marcada a 2 visita.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 14:23:49\nMirella: O cheque do mês de maio voltou R$ 375,00, liguei para a pct a mesma irá retornar a ligação para verificar o que aconteceu.\n---------------------------------------------------------\nData: 24/10/2012\nHora: 09:52:03\nFono: Tanara\nAssunto: Paciente veio para a 4 visita deixou o aparelho para a revisão e limpeza na garantia. Audéo Yes III OE 1115X0YXC.\n---------------------------------------------------------\nData: 31/10/2012\nHora: 16:47:05\nFono: Tanara\nAssunto: O aparelho chegou de S.P. Liguei e vem retirar na semana que vem. Final da tarde a filha veio buscar o aparelho ok.\nPACIENTE DEIXOU APARELHO POIS O MESMO NÃO ESTA FUNCIONANDO MODELO AUDÉO YES 1115X0YXC OS AUDIOZOOM 1374)', 0, '', '', '2012-01-01'),
(350, '', 'Leticia ', 'Kowalski', '', 'DIA: 16/12/2011 COMPROU AUDÉO SMART V BILATERAL PILHA 312\nOD: 1107X1F6A NF: 363.188 DATA: 23/05/2011\nOE: 1122X1HLX NF: 387.974 DATA: 31/10/2011\nR$: 14.700,00 À VISTA EM CHEQUE\n02 ANOS DE GARANTIA.\nData: 14/12/2011\nHora: 10:22:36\nFono: Tanara\nAssunto: Paciente veio com sua filha Luzia encaminhado pelo Dr.Kowalski. Feito audiometria e teste com Audéo Smart V bilateral. Fechou a venda em R$: 14.700,00 à vista em cheque para dia: 16/12/2011. Marcado retorno dia: 19/12.\n---------------------------------------------------------\nData: 19/12/2012\nHora: 11:21:51\nFono: Tanara\nAssunto: Paciente veio com a sua filha Luzia para o retorno extra. Passei para o nível 2 e marquei o retorno para dia: 03/01/2012 para a 1 visita.\n---------------------------------------------------------\nData: 03/01/2012\nHora: 11:24:02\nFono: Tanara\nAssunto: Paciente veio com sua filha Luzia para a 1 visita. Expliquei o kit de manutenção e entreguei 2 cartelas de pilhas 312. Paciente esta usando o aparelho 5 horas por dia. Expliquei que pode usar 8 hs. Trabalha muito na roça e dai nao usa. Marquei o retorno em março para a 2 visita.\n', 0, '', '', '2012-01-01'),
(351, 'HU', 'Leticia ', '', '', 'USA APARELHO PHONAK NF 355050 28/03/2011 ATÉ 28/03/2012\nMODELO ELEVA 211 DAZ\nOE 211049X0K43 OD 211102X17F6\nData: 27/07/2011\nHora: 15:45:32\nMichelle: Paciente deixou aparelho pois não esta dando sinal da pilha e esta muito baixo MODELO ELEVA 211 DAZ OE 211049X0K43 OD 211102X17F6(os audiozoom 1996)\n---------------------------------------------------------\nData: 05/09/2011\nHora: 17:05:23\nMichelle: Paciente retirou aparelho sem os Evanir Luiza Kleim CPF 351.621.479-15\n---------------------------------------------------------\nData: 16/05/2012\nHora: 15:52:42\nAssunto: Suzan - Não esta disponivel no momento.\nPACIENTE DEIXOU APARELHO PARA ORÇAMENTO MODELO ELEVA211 DAZ 1049X0K43(OS AUDIOZOOM 1363)\nPACIENTE RETIROU APARELHO CONSERTADO POR LUCIANO MODELO ELEVA 211 DAZ 1049X0K43PAGOU 1040,00( TEM 3 MESES DE GARANTIA DO SERVIÇO(OS AUDIOZOOM 1363)', 0, '', '', '2012-01-01'),
(352, '', 'Leticia ', '', '', 'DIA: 26/07/011 COMPRA AUDÉO SMART III BILATERAL PILHA 312\nOD: 1115X1D53 NF: 370.632 DATA: 30/06/2011\nOE: 1115X1D4V NF: 363.561 DATA: 24/05/2011\nR$: 7.000,00 À VISTA\n01 ANO DE GARANTIA.\nData: 22/07/2011\nHora: 13:49:56\nFono: Tanara\nAssunto: Paciente veio com sua esposa Norma encaminhado pelo Otorrino mas não lembra o nome dele. Falou que foi na clínica ciência. Fez audiometria e trouxe. Feito teste com Audéo Smart III bilateral levou para a a casa e vem na terça para o retorno. Falei o preço de R$: 8.200,00 bilateral.\n---------------------------------------------------------\nData: 26/07/2011\nHora: 13:33:25\nFono: Tanara\nAssunto: Paciente veio com sua esposa Norma para fazer a compra dos aparelhos. Falou que adorou pois ouviu bem as pessoas na reunião. Autorizado pelo Duarte R$: 7.000,00 a vista. Paciente pagou em dinheiro e marcado o retorno dia: 03 de agosto.\n---------------------------------------------------------\nData: 09/08/2011\nHora: 13:11:06\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Relatou que o aparelho da OE não esta funcionando, era o protetor de cera. Feito a troca ok. Expliquei e dei um kit. Entreguei o kit de manutenção e 4 cartelas de pilhas. aumentei para o nível 4. Marcado o retorno dia: 26/10 para a 2 visita.\n---------------------------------------------------------\nData: 16/05/2012\nHora: 15:57:54\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 27/07/2012\nHora: 11:18:41\nFono: Tanara\nAssunto: Paciente veio deixar os aparelhos para a revisão e limpeza. Audéo Smart III bilateral OD 1115X1D53 OE 1115X1D4V.\n---------------------------------------------------------\nData: 02/08/2012\nHora: 15:05:19\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram. Virá buscar. Final da tarde paciente veio retirar os aparelhos ok.\n', 0, '', '', '2012-01-01'),
(353, '', 'Leticia ', '', '', 'DIA: 08/02/2011 TAMPÃO OEata: 08/02/2011\nHora: 15:14:50\nFono: Tanara\nAssunto: Paciente veio fazer tampão de silicone OE cor transparente. Já pagou R$: 65,00 e vem buscar amanhã.\n---------------------------------------------------------\nData: 09/02/2011\nHora: 17:07:43\nFono: Tanara\nAssunto: Paciente veio buscar o tampão e pagou R$: 65,00 ok.\n---------------------------------------------------------\nData: 24/03/2011\nHora: 10:49:09\nFono: Tanara\nAssunto: Paciente veio fazer um novo tampão da OE pois perdeu o dele. Cor azul escuro sem puxador. R$: 65,00 vem buscar amanhã.\n---------------------------------------------------------\nData: 25/03/2011\nHora: 10:52:10\nFono: Tanara\nAssunto: Paciente veio buscar o tampão ok. Pagou R$: 65,00.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 12:10:12\nFono: Tanara\nAssunto: Paciente veio para fazer um novo tampão de silicone de cor vermelha na OE. Como vai viajar quer deixar um de reserva. Falou que tem uma novidade em tampão e vai trazer pra a gente ver.\n----------------------------------------------------------\nData: 28/04/2011\nHora: 12:10:12\nMichelle: Paciente retirou tampão pago 65,00.\n', 0, '', '', '2012-01-01'),
