(367, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 30/03/2012\nHora: 09:49:36\nFono: Tanara\nAssunto: Paciente comprava pilha e veio fazer um teste. Feito audiometria e colocado um Audéo Smart III OD, pois na OE ela jpa usa aparelho e o da OE não funciona mais. Levou para casa, ams voltou depois falando que não tem condições agora. Passei R$: 3.800,00 ia dar uma entrada e parcelar o resto. Falou que agora não pode fazer mais dívidas. Voltará quando tiver um dinheiro guardado.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 09:51:33\nFono: Tanara\nAssunto: Liguei e conversamos sobre a possibilidade de comprar o aparelho. Falei que agora esta por R$: 3.100,00 no mês de maio. Mas não poderá comprar nada agora. Virá quando puder.\n---------------------------------------------------------\nData: 13/09/2012\nHora: 10:54:19\nAssunto: Suzan - Confirmado endereço para mandar carta do Open.\nDIA: 30/03/2012 TESTE COM AUDÉO SMART III OD', 0, '', '', '2012-01-01'),
(368, '', 'Leticia ', '', 'CASSI\nnfe 000.000.049', 'DIA: 24/4/2012 COMPROU AUDEO SAMRT IX BILATERAL PILHA 312\nOD: 1116H0CWE NF: 363.176 DATA: 23/05/2011\nOE: 1138H005R NF: 392.117 DATA: 29/11/2011\nR$: 16.000,00 ENT. R$: 1.000,00 MAIS 8X DE R$: 1.875,00 EM CHEQUE\n03 ANOS DE GARANTIA CF 3297                                                                                     27/05/2013 - COMPROU 2 NAIDA S CRT IX - OD: 1214H08KA / OE: 1214H08LG - PILHA 13 - NF: 452219 / 434576 - GARANTIA ATÉ 27/05/2016. - 3 ANOS PROG. DE ACOMP.             VALOR: R$9000,00 (6X R$1500,00 - CHEQUE) + 2 APARELHOS AUDEO SMART IX.\nData: 24/04/2012\nHora: 17:07:30\nFono: Tanara\nAssunto: Paciente veio com seu filho Silvio relatando que o aparelho não esta bom. Comprou Micro-Power III OD.\nMirella: DIA: 07/12/2009 COMPROU MICRO-POWER III OD PILHA 312\nOD: 0924X06L4 R$: 3.500,00 ENT. R$: 300,00 MAIS 2X DE R$: 350,00 MAIS 1X DE R$: 2.500,00.NF: 280414 DATA: 26/08/2009\n01 ANO DE GARANTIA.\n---------------------------------------------------------\nData: 16/11/2012\nHora: 14:26:05\nJOICE: Programa de acompanhamento dei 6 caretlas de pilhas 312 mais duas de cerustop\n', 0, '', '', '2012-01-01'),
(370, '', 'Leticia ', '', '', 'DIA: 13/07/2011 COMPRA NAÍDA III SP OD/OE BILATERAL PILHA 13\nOD: 1115X02EW\nOE: 1119X110A\nNF: 370.600 DATA: 30/06/2011\nR$: 7.200,00 À VISTA EM CHEQUE\n01 ANO DE GARANTIA.\nData: 12/01/2012\nHora: 11:57:18\nFono: Tanara\nAssunto: Paciente veio com seu filho Nilton para a 3 visita. Entregue os brindes e paciente diz que esta bem, porém relata ter alguns barulhos, mas expliquei que é devido os sons que esta escutando. Marcado o retorno da 4 visita em julho.\n---------------------------------------------------------\nData: 11/07/2012\nHora: 16:44:15\nFono: Tanara\nAssunto: Paciente veio com seu filho para a 4 visita. Entregue os brindes e deixou os aparelhos para fazer a revisão e limpeza na garantia. Naída III SP bilateral OD 1115X02EW OE: 1119X110A.\n---------------------------------------------------------\nData: 23/07/2012\nHora: 11:09:25\nFono: Tanara\nAssunto: Liguei e avisei seu filho seu Nilton que os aparelhos já chegaram. Virá buscar.\n', 0, '', '', '2012-01-01'),
(371, '', 'Leticia ', 'Kowalski', '', '10/03/2009      Pilha 13 \nComprou 02 ap. Argosy Argus DP n  OD- 0843X1KWV / OE- 0843X1KWU\nValor total R$ 9.040,00 Entr. de R$ 3.040,00 + 6x de R$ 1.000,00\nEntregue 1 kit limpeza + 30 pilhas rayovac. \nNF 35146   30/12/08\nData: 20/07/2009\nCIDA: CLIENTE COMPROU APARELHO NESTE ANO.\n---------------------------------------------------------\nData: 13/10/2009\nDébora: Paciente esteve na clínica e deixou ap. Argus DP nº OD- 0843X1KWV / OE- 0843X1KWU para revisão da garantia. Enviados pra fábrica.\n---------------------------------------------------------\nData: 20/10/2009\nDébora: Ap. veio da fábrica. Feito somente limpeza.\n---------------------------------------------------------\nData: 21/10/2009\nDébora: Paciente veio buscar aparelho. Levou 04 olivas abertas 10s R$40,00.\n---------------------------------------------------------\nData: 25/02/2010\nDébora: Paciente esteve na clínica e deixou ap. Argus nº OD- 0843X1KWV\ncom a queixa de após um tempo de uso o ap. começa a apitar e de que está oxidando a pilha.\n---------------------------------------------------------\nData: 10/03/2010\nDébora: Ap. veio da fábrica. Feito troca de módulo completo.\n---------------------------------------------------------\nData: 12/03/2010\nHora: 10:20:23\nMichelle: paciente esteve na loja e comprou 1 caixa de capsula desumidificador 61,60 + 1 cixa de pastilha 30,00 + 1 caixa de oliva 30,00 =  121,60 - pago com cheque.\n', 0, '', '', '2012-01-01'),
