(375, '', 'Leticia ', 'Gustavo Fasolo', '', '12/08/2009\nCOMPRA PAR DE MAXX 22\n2 ANOS DE GARANTIA\nTOTAL: R$ 5600,00\nENTR. R$1800,00 + PRESTAÇÕES\nENT. R$1800,00 + PARCELAS A COMBINAR\n05/08/09: ZUMBIDO (MAXX 22 OD/OE R$2800,00) graci\n---------------------------------------------------------\nData: 13/08/2009\nGracielle: adaptação aparelhos. Filha referiu que não queria mais usar pela adaptação que terá que passar. Mas colocou e ficou satisfeito. Pensou que o valor de R$2800,00 era pelos dois aparelhos. Conversamos e vai ver o que poderá dar da diferença no retorno em setembro.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 16:41:40\nAssunto: Suzan - Cliente não quer participar do Open.', 0, '', '', '2012-01-01'),
(376, '', 'Leticia ', '', '', 'DIA: 22/10/2012 AUDIOMETRIA E TESTE COM AUDÉO S SMART V BILATERAL\nHora: 17:35:36\nFono: Tanara\nAssunto: Paciente veio pela 2 vez na Audiozoom para testar aparelhos. Fala que a familia insiste mas ele não quer comprar, não quer usar. Diz que encomodo e não tem perda de audição. Mesmo explicando para ele sua perda ele diz que me ouve bem. Expliquei do Nano R$: 15.000,00 o par e fiz uma sessão de psicologia. Mesmo assim é teimoso. Quem conseguir vender aparelhos para ele por favor me avise que compro um presente.\n--------------------------------------------------', 0, '', '', '2012-01-01'),
(377, '', 'Leticia ', '', '', 'USA APARELHO MAXX 22 \n0610758\n---------------------------------------------------------\nData: 12/03/2009\nDébora: Deixou aparelho para revisão e limpeza.\n---------------------------------------------------------\nData: 16/03/2009\nFono: Débora\nEsteve na clínica para buscar os aparelhos. R$120,00\n---------------------------------------------------------\nData: 13/12/2011\nHora: 15:28:04\nMichelle: Paciente deixou aparelho para orçamento pois o mesmo esta sem amplificação MAXX 22 0610758(os audiozoom 2219)\n---------------------------------------------------------\nData: 15/12/2011\nHora: 11:37:08\nFono: Tanara\nAssunto: Liguei e falei com a esposa Aurea que o aparelho terá um custo de R$: 1.200,00. Falei de aparelho novo. Ficou de trazer o marido para fazer uma audiometria e comprar um aparelho novo.\n---------------------------------------------------------\nData: 22/12/2011\nHora: 17:03:05\nFono: Tanara\nAssunto: Aparelho autorizado. Esse aparelho foi para Jaraguá onde foi feito revisão e limpeza. O paciente vai pagar R$: 1.200,00 com 6 meses de garantia. Avisei que o aparelho já esta aqui na Audiozoom. Virá buscar.\n---------------------------------------------------------\nData: 23/12/2011\nHora: 13:18:10\nMichelle: Paciente retirou aparelho feito troca do microfone e receptor  pago 1200,00 6 mese de garantia. Enviamos cupon fical por email, conforme solicitado pelo cliente.(Thaisa) Ok\n---------------------------------------------------------\nData: 10/05/2012\nHora: 16:42:14\nAssunto: Suzan - Sr. Jair esta com problemas no aparelho.Utilizava 2 mas segundo sua esposa Sra. Aurea, perdeu um quando foi internado. Falei para marcar um retorno para arrumar o aparelho. Sra. Aurea diz q ele esta com problemas de saude. Vai verificar se tem alguem q pode ajudar ela a trazer ele ate aqui.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 10:43:32\nFono: Tanara\nAssunto: Paciente veio com a esposa para o conserto do aparelho. Usa um Maxx 22 OD S/N, porém o som esta horrível. Fiz pré-molde para fazer uma nova caixa intra e vamos mandar para S.P. Esta na garantia do paciente pois foi cobrado R$: 1.200,00 em dezembro e na verdade esse aparelho foi somente para Jaraguá.\n---------------------------------------------------------\nData: 22/06/2012\nHora: 17:59:11\nMirella:A Sr Áurea do Pct ligou questionando a demora do aasi, verifiquei com a Tanara e o aasi está em SP, irei retornar a ligação na segunda, para informar sobre o ocorrido.\n---------------------------------------------------------\nData: 25/06/2012\nMirella: Entrei em contato com a Sr Áurea, informei que o aasi já está a caminho e que demorou um pouco devido a falta de peça para a reposição.\n---------------------------------------------------------\nData: 26/06/2012\nHora: 16:31:56\nAssunto:os. 2479 já chegou de são paulo.', 0, '', '', '2012-01-01'),
(378, '', 'Leticia ', '', '', 'DIA: 16/08/2010 COMPROU AUDÉO V OD PILHA 312\nOD: 0838X1LW6\nNF: 253504 DATA: 29/11/2008\nR$: 5.852,00 ENT. 585,20 MAIS 9X DE 585,20\n02 ANOS DE GARANTIA\nDIA: 02/04/2012 COMPROU AUDÉO IX OE \nOE: 0939X06AU\nNF: 294.441 DATA: 11/12/2009\n02 ANOS DE GARAN\nData: 09/08/2010\nHora: 09:41:48\nMichelle: Paciente deixou aparelho,pois não está funcionando.\n---------------------------------------------------------\nData: 02/09/2010\nHora: 17:19:41\nMichelle: Filho retirou aparelho.\n---------------------------------------------------------\nData: 03/01/2011\nHora: 07:53:57\nFono: Tanara\nAssunto: Paciente ligou falando que seu filho Adrian irá trazer seu aarelho pois parou de funcionar dia: 31/12.\n---------------------------------------------------------\nData: 03/01/2011\nHora: 17:29:47\nMichelle: Filho do paciente deixou aparelho pois não esta funcionando MODELO AUDÉO OD0836X11W16(OS AUDIOZOOM 1416).\n---------------------------------------------------------\nData: 10/01/2011\nHora: 13:45:21\nFono: Tanara\nAssunto: Aparelho chegou da fábrica. feito apenas revisão e limpeza na garantia. Liguei e deixei recado para vir buscar.\n---------------------------------------------------------\nData: 14/01/2011\nHora: 15:15:00\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho. Feito regulagem ok.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 11:40:01\nFono: Tanara\nAssunto: Paciente veio com a sua esposa relatando que o aparelho esta fraco. Estava sem o protetor de cera e o receptor estava danificado. Feito troca do receptor na garantia e aumentei para o nível 4. Falou que ficou ótimo. Dei um cerustop. Gostou do relógio e vai comprar quando vir para a 2 visita em março.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 08:30:55\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Levou os brindes mas falou que ainda não poderá comprar o relógio. Valor R$: 1.480,00 em 3x. Marcado retorno dia: 15/08 (3 visita) ver se ele vai querer comprar o relógio. Deixar o aparelho para a revisão e limpeza.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 13:10:44\nFono: Tanara\nAssunto: Paciente veio para fazer uma regulagem pois o aaprelho estava fraco, porém era protetor de cera. Feito a troca ok.\n---------------------------------------------------------\nData: 02/07/2012\nBruna: Veio pois os aparelhos estavam sem amplificação, coloquei no teste de ganho e realmente não estava bom, troquei receptores e continuo igual. Enviado para SP para OS na garantia. OK\n---------------------------------------------------------\nData: 10/07/2012\nHora: 10:37:40\nFono: Tanara\nAssunto: Liguei e falei com a esposa que os aparelhos já chegaram. Virá buscar.\n---------------------------------------------------------\nData: 17/07/2012\nHora: 15:38:24\nFono: Tanara\nAssunto: Duarte levou os aparelhos e o paciente retirou por la mesmo. Porém tem que fazer regulagem.\n---------------------------------------------------------\nData: 09/08/2012\nHora: 14:33:18\nFono: Tanara\nAssunto: Paciente veio para regular os aparelhos. Feito bilateral com troca das olivas e protetor de cera ok. Ficou interessado por comprar um outro. Falei R$: 2.700,00 com 1 ano de garantia, aparelho semi-novo.\n---------------------------------------------------------\nData: 19/02/2013\nHora: 08:32:52\njoice: programa de acompanhamento, ei 6 cartelas de pilha 312 mais 6 capsulas desumidificador e 2 cerustop', 0, '', '', '2012-01-01'),
(379, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 17/11/2009\nDébora: Deixou ap. para revisão da garantia. PICO FORTE PP - C - P 094412592 / PICO FORTE PP - C - P 094412593.\n---------------------------------------------------------\nData: 26/11/2009\nDébora: Ap. veio da fábrica. nº 094412592-troca de caixa nº 094412593- revisão da garantia.\n---------------------------------------------------------\nData: 3/12/2009\nDébora: Motorista pegou aparelho.\n---------------------------------------------------------\nData: 18/07/2011\nHora: 08:15:33\nMichelle: Motorista deixou aparelho para orçamento PICO FORTE PP - C - P 094412592(os audiozoom 2042)\n---------------------------------------------------------\nData: 12/08/2011\nHora: 10:31:11\nMichelle: Motorista retirou aparelho\n---------------------------------------------------------\nMotorista deixou aparelho PHONAK PICO FORTE 3 PP-C-P N° 094H12593 para orçamento.\nMotorista retirou aparelho PHONAK PICO FORTE N° 094H12593 OS 2961\nOTOVIDA - GARANTIA 1 ANO - 17/07/2009 ATÉ 17/07/2010 - NF 43602\nPICO FORTE PP - C - P 094412592 / PICO FORTE PP - C - P 094412593', 0, '', '', '2012-01-01'),
(380, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/07/2009\nCIDA: CLIENTE VAI LIGAR PARA MARCAR UMA AVALIAÇÃO.\n---------------------------------------------------------\nData: 22/07/2009\n03/07/08 comprou 12 pilhas power.\n---------------------------------------------------------\nData: 22/07/2009\nDébora: Paciente compareceu à clínica para a avaliação auditiva. Comprou kit de adaptação aberta OD/OE R$60,00 e 01 cartela de pilhas 312 phonak.\n---------------------------------------------------------\nData: 25/06/2012\nHora: 13:33:45\nFono: Tanara\nAssunto: Paciente veio deixar os aparelho para fazer orçamento. Micro-Eleva bilateral OD 0704H109J OE 0703H1224. Levou para teste Audéo S Smart IX bilateral. Virá na quinta. Passei R$: 22.000,00.\n---------------------------------------------------------\nData: 07/08/2012\nHora: 17:27:48\nFono: Tanara\nAssunto: Paciente veio para o retorno. Diz que esta muito satisfeito com os aparelhos. Falta entregar 4 cartelas de pilhas e o kit de manutenção. Marcado retorno para outubro.\n---------------------------------------------------------\nData: 09/10/2012\nHora: 16:39:13\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes (kit de manutenção) e falta entregar 4 cartelas de pilhas 312. Marcado retorno dia: 09/01/2013 as 14:00h.\n FOI ENTREGUE 1 CARTELA DE PILHA 312\nPaciente veio a consulta de aompanhamento e retirou 42 pilhas 312, e 2 cerustop.', 0, '', '', '2012-01-01'),
(381, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 04/06/2012\nHora: 17:08:36\nFono: Tanara\nAssunto: Paciente veio com a filha Margarida encaminhada pelo Dr. Kowalski para fazer audiometria e teste com aparelhos. Feito teste com Audéo Smart S III bilateral e passei o valor de R$: 4.500,00 cada. Achou muito caro e vai primeiro resolver os olhos e depois quem sabe voltará. Fiz em 10x sem juros.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 14:11:29\nAssunto: Suzan - Confirmado endereço Open.\nDIA: 04/06/2012 TESTE COM AUDÉO SMART S III BILATERAL.', 0, '', '', '2012-01-01'),
(382, 'HU', 'Leticia ', '', '', 'DIA:22/02/07 COMPROU 1 APARELHO C-15 BERNAFON N   PILHA 13 VALOR;1499,00 ÀVISTA E 1 CARTELA DE PILHA ARGOSY', 0, '', '', '2012-01-01'),
(383, 'fga: kátia', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/06/2010\nDébora: Liguei e consersei com a nora Eliane que dará recado ao esposo.\n---------------------------------------------------------\nR. DA  PACIENTE R. GERAL  VARGEM DO BOM JESUS 2147\nFEZ TESTE COM 2 APARELHOS MICRO POWER V  7022,00 A PRAZO OU R$ 6.000,00 À VISTA', 0, '', '', '2012-01-01'),
(384, 'DR. KOWALSKI', '0', '', '', '---------------------------------------------------------\nData: 26/01/2011\nHora: 08:34:32\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo Dr. Kowalski para realizar audiometria e teste com aparelhos. eito teste com Audeo Mini V bilateral. Paciente obtou por apenas 1 pelo valor. Levou para casa e retornará. Duarte esta na negociação.\n---------------------------------------------------------\nData: 31/01/2011\nHora: 08:36:33\nFono: Tanara\nAssunto: Fui na casa da paciente para fechar a venda a vista R$: 5.000,00 1 aparelho Audeo mini V OE. Falou que virá para a 1 visita.\n---------------------------------------------------------\nData: 10/02/2011\nHora: 12:44:48\nFono: Tanara\nAssunto: Paciente veio com seu filho para o retorno. Diz que a pilha dura 2 dias. Trocamos de aparelhos. Duarte vai na casa dela na sexta para saber como esta. 1 visita. Levar kit de manutenção e 3 meses de pilha.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 13:05:42\nFono: Tanara\nAssunto: O filho veio retirar 3 cartelas de pilhas. Dar baixa no programa de acompanhamento.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 15:25:06\nFono: Tanara\nAssunto: Ligado para a nora da paciente e deixado recado que a caixa do aparelho já chegou. Dará o recado.\n---------------------------------------------------------\nData: 28/03/2011\nHora: 13:23:25\nFono: Tanara\nAssunto: Paciente veio para colocação do micro-molde. Ficou ótimo. Marcamos a 2 visita dia: 29/04.\n---------------------------------------------------------\nData: 29/04/2011\nHora: 13:24:06\nFono: Tanara\nAssunto: Paciente veio para a 2 visita, entregue os brindes e falou que não tava escutando nada. Aumentei o nivel da aclimatização pois estava no nivel 1 e expliquei que deve usar para estimular a orelha. Expliquei que o ideal seria usar também aparelho na OD. Vai conversar com o Duarte.\n---------------------------------------------------------\nData: 29/07/2011\nHora: 13:26:26\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e falou que não consegue mais ficar sem aaprelho e que logo logo vai comprar o outro lado. Falou que queria entender mais as pessoas. Fiz uma regulagem e marquei retorno agora somente em dia: 31 de janeiro de 2012.\n---------------------------------------------------------\nData: 27/12/2011\nThaisa: Veio para P.A. entreguei brindes. Ok\n---------------------------------------------------------\nData: 13/03/2013\nHora: 08:30:38\nFRAN - PA E REGULAGEM AASI. FICOU TUDO OK.\nPaciente retirou brindes 6 pilhas 10.\nDIA: 31/01/2011 COMPRA DO AUDEO MINI V OE PILHA 10\nOE: 1046X1Y4D RECEPTOR 2\nR$: 5.000,00 A VISTA EM DINHEIRO\nNF: 342544 DATA: 21/12/2010\n02 ANOS DE GARANTIA.\n-------------------------------\n15/10/2014 - Zana\nVeio regular, fiz limpeza e revisão.\nComprou pilhas, pois PA acabou.\n-------------------------------\n', 0, '', '', '2012-01-01'),
(385, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/10/2010\nHora: 10:05:45\nAssunto:CIDA. CLIENTE ESTEVE NA LOJA E PAGOU A 2ª PARCELA DO APARELHO AUDITIVO . OBS. FOI PAGO NA MESMA DATA DO VENCIMENTO DA PARCELA.\n---------------------------------------------------------\nData: 18/02/2011\nHora: 11:46:07\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e trocado a oliva, falou que ficou bem melhor, pois a outra estava machucando.\n---------------------------------------------------------\nData: 18/08/2011\nHora: 13:23:32\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Fez 1 ano que esta usando o aparelho na OD. Não quer saber de aparelho na OE, pois diz que não etsa bem adaptada. O aparelho vai para S.P na garantia e quando voltar vamos fazer uma audiometria e nova regulagem.\n---------------------------------------------------------\nData: 26/08/2011\nHora: 09:46:05\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou da fábrica. Virá buscar. Inicio da tarde a paciente veio retirar o aparelho ok.\nDIA: 18/08/2010 COMPROU AUDÉO YES III OD PILHA 312\nOD: 1010X0CTK\nR$: 3.500,00 ENT. R$: 1.500,00 MAIS 4X DE R$: 500,00\n01 ANO DE GARANTIA\nNF: 308875 DATA: 30/4/2010', 0, '', '', '2012-01-01'),
(386, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/06/2011\nHora: 16:17:46\nFono: Tanara\nAssunto: Paciente veio com a neta Roberta e filha para falar de aparelhos. Paciente tem 1 aparelho retro que não se adaptou e gostaria de testar os aparelhos que o seu Franscisco testou no qual não vai comprar agora pois estava melhor que sua esposa. Feito audiometria insito e regulamos. Paciente diz que esta ouvindo muito bem e até a voz ficou mais baixa. Vem na segunda para fazer uma audiometria completa e regulagem para testar e levar para a casa. Passei o valor de R$: 8.200,00 a vista R$: 7.600,00.\n---------------------------------------------------------\nData: 06/06/2011\nHora: 13:19:53\nFono: Tanara\nAssunto: Paciente veio com a neta Roberta para a teste. Feito primeiramente uma audiometria e deixado em teste 2 Audéo Mini III bilateral. Paciente tem câncer e esta fazendo tratamento de quimioterapia. Virá dia: 21/06 para o retorno. Mas final da semana a Roberta virá para fazer o pagamento se a avó se adaptar bem.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 13:12:19\nFono: Tanara\nAssunto: A filha Bete veio com seu marido para fazer o pagamento os aparelhos a vista R$: 7.400,00. A paciente virá dia: 20/06 para o retorno.\n---------------------------------------------------------\nData: 21/06/2011\nHora: 13:20:29\nFono: Tanara\nAssunto: Paciente veio com a neta Roberta. Feito aumento da aclimatização para nível 3. Paciente diz que esta gostando muito de usar os aparelhos. Marcamos o retorno da 1 visita dia: 30/06.\n---------------------------------------------------------\nData: 30/06/2011\nHora: 13:22:30\nFono: Tanara\nAssunto: Paciente veio com sua neta Roberta para a 1 visita. Entreu os brindes e o kit de manutenção. Esta muito bem e vaos deixar mais um tempo no nível 3. Marcado a 2 visita em 3 meses.\n---------------------------------------------------------\nData: 04/08/2011\nHora: 12:36:46\nMichelle:Neta veio buscar 5 cartelas de pilha\n---------------------------------------------------------\nData: 26/06/2012\nHora: 14:02:58\nFono: Tanara\nAssunto: Cida. filha da paciente deixou aparelho para revisão. Audéo Mini III bilateral OD 1101X169M OE 1101X169V. Esta na garantia.\n---------------------------------------------------------\nData: 16/07/2012\nHora: 10:53:17\nFono: Tanara\nAssunto: Falei com a filha Eliana e avisei que os aparelhos já estão de volta de S.P. Virá buscar.\n---------------------------------------------------------\nData: 17/07/2012\nHora: 09:09:43\nAssunto: Suzan - Filha da Sr. Irene veio buscar aparelho que estava na revisão. Nda foi cobrado.\n---------------------------------------------------------\nData: 01/11/2012\nHora: 11:32:14\nAssunto: Suzan - Pegou pilha 10, 2 cartelas do programa de acompanhamento de Dezembro.\nDIA: 16/06/2011 COMPRA AUDÉO MINI III BILATERAL PILHA 10\nOD: 1101X169M RECEPTOR 0\nOE: 1101X169V\nNF: 363.188 DATA: 23/05/2011\nR$: 7.400,00 À VISTA\n01 ANO DE GARANTIA', 0, '', '', '2011-06-16'),
(387, 'HU', 'Leticia ', '', '', 'GANHOU AP. EXT 211 AZ OD: 210818X11HR DATA: 17/11/2009 ATE 17/11/2010\nNF: 289275 PILHA 13\n---------------------------------------------------------\nData: 12/05/2010\nHora: 10:18:56\nMichelle:Paciente deixou aparelho para fazer revisão e limpeza EXT 211 AZ OD: 210818X11HR (os audiozoom 1120).\n---------------------------------------------------------\nData: 21/5/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 26/05/2010\nDébora: Paciente retirou aparelho.', 0, '', '', '2012-01-01'),
(388, '', '0', '', '', '21/05/2013 - COMPROU 2 AMBRA 10 CIC - VALOR: R$16000,00 - ENTRADA R$10000,00 + 3 X 2000,00 NO CHEQUE. GARANTIA ATÉ 21/05/2016. CF AUDIOZZOM: 7457.\nVeio para P.A. Paciente veio relatando que os sons estavam muito altos e precisa retirar o aparelho em algumas situações. Veriquei que o nível de experiencia estava em 70%. Nesse caso diminui ganho geral e o mesmo ficou satisfeito. Também entreguei: 1 cx pilha 10 + 4 capsula + 2 kit cerustop\n------------------------------\n06/10/2014 - Zana\nCompareceu para pequeno ajuste, quis aumentar. Passei pra 90% e ele achou ótimo. Entreguei somente 2 kits de cerustop, os demais ele não quis, disse que ainda tem bastante.\nSe interessou pelo Lyric mas tem mta produção de cera, mesmo assim vai pensar.\n----------------------', 0, '', '', '2012-01-01'),
(389, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/07/2009\nCIDA: PACIENTE NÃO MORA FLORIANOPOLIS. QD A PACIENTE VIER  FPOLIS, A SOBRINHA IRA TRAZER.\n---------------------------------------------------------\nData: 09/09/2011\nHora: 15:53:01\nFono: Tanara\nAssunto: Paciente veio deixar os aparelhos para a revisão e Limpeza. Verifiquei cera nos condutos e orientei procurar o Otorrino enquanto os aparelhos estão em S.P. Eleva 22 bilateral OD/OE 11099512. Vamos fazer uma noa audiometria quando chegar os aparelhos.\n---------------------------------------------------------\nData: 23/09/2011\nHora: 08:37:27\nFono: Tanara\nAssunto: Paciente veio com a filha para buscar os aparelhos. Feito uma audiometria e uma nova regulagem. Paciente retirou toda a cera a regulagem ficou ótima. Vai para Curitiba e orientei que em novembro deve voltar para o programa de acompanhamento.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 17:08:49\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 25/05/2012\nHora: 16:52:26\nAssunto: Suzan - Confirmado endereço para mandar OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 14:36:57\nAssunto: Suzan - Tania é sobrinha e responsável pela paciente. Disse que a Sra. Irene esta muito doente. Mora em Curitiba e não virá ao Open.\n---------------------------------------------------------\nData: 14/08/2012\nHora: 15:45:02\nFono: Tanara\nAssunto: Paciente veio com a sobrinha Tânia relatando que os aparelhos estão caindo da orelha. Fiz pré-molde e falei que o custo seria de R$: 960,00. Expliquei que deixaria em teste 2 aparelhos e expliquei a diferença de tecnologia. Naída S CRT bilateral. A paciente adorou e fechou a venda em R$: 15.400,00, sendo R$: 6.400,00 de entrada mais 9x de R$: 1.000,00 em cheque. Vem amanhã concluir a venda.\n---------------------------------------------------------\nData: 15/08/2012\nHora: 16:02:22\nFono: Tanara\nAssunto: Paciente veio relatando que o filho virá no final do mês e vai pagar o aparelho a vista. Vai dar hoje R$: 1.000,00 de sinal.\n---------------------------------------------------------\nData: 24/08/2012\nHora: 10:13:11\nFono: Tanara\nAssunto: Paciente fez mais um depósito de R$: 5.000,00 e seu neto veio e deu mais 3 cheques de R$: 2.600,00 cada para dia: 15 de cada mês. Paciente irá fazer o programa de acompanhamento em Curitiba.\n---------------------------------------------------------\nData: 14/02/2013\nHora: 14:53:48\nAssunto: Suzan - Trouxe um amigo para fazer teste e ja trocamos Cerustop e bonificamos pastilhas para limpeza.\n\nDIA: 30/11/2009 COMPROU ELEVA 22\nOD/OE: 11099512\nR$: 11.438,00 ENT. R$: 5.586,00 MAIS 10X DE R$: 500,00 MAIS 2X DE R$: 426,00\nNF: 288.294\nDIA: 15/08/2012 COMPROU NAÍDA S CRT BILATERAL\nOD: 1208H0200\nOE: 1208H01YD', 0, '', '', '2012-01-01'),
(390, 'OTOVIDA', 'Leticia ', '', '', 'GANHOU 02 AP. ARGOSY MAXX 411 OD-089H16360 / OE-089H16362\nNF 31739 DATA 10/10/08 2 ANOS DE GARANTIA\nData: 14/04/2009\nDébora: Sr. Ivan deixou 2 aparelhos ARGOSY MAXX 411 OD-089H16360 / OE-089H16362 para revisão da garantia.\n---------------------------------------------------------\nData: 10/05/2009\nDébora: Sr. Ivan esteve na clínica para buscar os aparelhos.\n---------------------------------------------------------\nData: 11/11/2009\nDébora: Ap. enviados pra fábrica. ARGOSY MAXX 411 OD-089H16360 / OE-089H1636.\n---------------------------------------------------------\nData: 18/11/2009\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 19/11/2009\nDébora: Motorista pegou aparelho.\n---------------------------------------------------------\nData: 13/05/2010\nHora: 15:15:50\nMIichelle:Paciente deixou aparelho para fazer revisão e limpeza MAXX 411 OD-089H16360 / OE-089H1636 (os audiozoom 1123)\n---------------------------------------------------------\nData: 26/05/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 06/08/2010\nHora: 16:29:18\nMichelle:Paciente retirou aparelho.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(392, '', 'Leticia ', '', '', 'DIA: 18/01/2012 TESTE COM APARELHOS \nDIA: 28/05/2012 NÃO COMPROU APARELHO AINDA. (OPEN)\nData: 18/01/2012\nHora: 11:38:53\nFono: Tanara\nAssunto: Paciente estava passando pela frente da Audiozoom e revolveu entrar para ver os aparelhos. Já fez a audiometria e o médico Otorrino falou que precisa usar aparelhos. Fiz a audiometria pois não tinha no momento e teste 2 Audéo Smart III mas achou caro e quer um intra bialteral. Duarte fez por R$: 7.000,00 sendo 14x de 500,00. Paciente levou o Smart para casa e virá na sexta para decidir se vai mandar fazer o intra ou não.\n---------------------------------------------------------\nData: 19/01/2012\nHora: 11:44:40\nFono: Tanara\nAssunto: Liguei para saber como estava mas falou que não vai comprar aparelho agora. Falou que não dormiu de preocupação e não tem condições no momento de comprar. Vai esperar e comprar a vista quando puder. Amanhã vem trazer os aparelhos.\n---------------------------------------------------------\nData: 20/01/2012\nHora: 16:30:50\nFono: Tanara\nAssunto: Paciente veio devolver os aparelhos. Falou que agora não vai comprar.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 14:20:38\nAssunto: Suzan - Cadastro atualizado para mandar carta do open.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 16:44:09\nAssunto: Suzan - Sra. Joana disse que conseguiu um aparelho pelo SUS. Vai pegar dia 11 de Julho 2012.\n', 0, '', '', '2012-01-01'),
(393, 'OTOVIDA', 'Leticia ', '', '', 'Data: 03/04/2009\nKELLEN:PCTE.DEIXOU APARELHO OD.030711313 REVISÃO E LIMPEZA!\n---------------------------------------------------------\nData: 29/04/2009\nDébora: Assistente social veio pegar aparelho. Deve R$35,00.\n---------------------------------------------------------\nData: 27/01/2011\nHora: 10:16:24\nFono: Tanara\nAssunto: Paciente veio com seu marido para fazer novo aparelho, porém o Duarte sugeriu colocarmos aparelhos novos. Teste com Audeo Mini bilateral.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 08:07:14\nFono: Tanara\nAssunto: Paciente veio com seu marido e comprou os Mini Audeo III. Falou que foi o melhor aparelho que já testou. Depostirou a entrada de 1.000,00 na conta do Duarte e dará o resto em parcelas. Negociado com o Duarte. Será feito tudo depósito bancário. Entrada dia: 04/02 de 1.000,00, dia: 04/03 400,00, dia: 04/04 400,00 e dia: 04/05 o restante de 4.200,00. Total R$: 6.000,00. Fiz já a 1 visita e marcado retorno dia: 09/05/2011 para a 2 visita.\n---------------------------------------------------------\nData: 16/02/2011\nHora: 09:53:55\nFono: Tanara\nAssunto: Paciente veio com seu marido para fazer regulagem. Diz que o aparelho da OE esta com eco e grave. Feito regulagem falou que ficou ótimo sem eco e bem mais agudo. Marcado a proxima dia: 09/05.\n---------------------------------------------------------\nData: 06/05/2011\nHora: 13:18:58\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregue os brindes e falou que o aparelho da OE não esta bom, baixo e abafado. Feito regulagem aumento da aclimatização, ganho geral. Falou que ficou ótimo como o 1 aparelho.\nMarcado a 3 visita.\n---------------------------------------------------------\nData: 05/08/2011\nHora: 11:02:29\nFono: Tanara\nAssunto: pacient veio com seu amrido para fazer o programa de acompanhamento 3 visita. Paciente diz que esta bem feliz pois esta ouvindo muito bem e não precisa regular os aparelhos. Enreguei os brindes e marquei a 4 visita dia: 03/02/2012. Vem janeiro para deixar os aaprelhos para a revisão e limpeza na garantia.\n---------------------------------------------------------\nData: 20/01/2012\nHora: 12:48:36\nFono: Tanara\nAssunto: Paciente veio para deixar os aparelhos para a revisão e limpeza na garantia. Deixei 2 em empréstimo. Entreguei 3 cartelas de pilhas número 10. Audéo Mini III bilateral OD 1042X0JNJ OE: 1042X0JPE. Virá em fevereiro para a 4 visita.\n---------------------------------------------------------\nData: 31/01/2012\nHora: 10:59:50\nFono: Tanara\nAssunto: Liguei e avisei a paciente que os aparelhos já chegaram. Virá na sexta dia: 03/02/2012 retirar.\n---------------------------------------------------------\nData: 24/08/2012\nHora: 09:21:42\nFono: Tanara\nAssunto: Paciente veio para a 5 visita. Entregues os brindes. Feito uma audiometria e nova regulagem. Paciente adorou e fizemos um campo livre onde teve um grande resultado. Audição quase normal. Marcado retorno dia: 01/02/2013 para a 6 visita.\nUSA VALEO 23 N  L/R 03071198\nDATA: 04/04/07 GARANTIA ATÉ 04/04/09 NF 10985\nDIA: 04/02/2011 COMPRA AUDEO MINI III BILATERAL\nOD: 1042X0JNJ\nOE: 1042X0JPE\nR$: 6.000,00 ENT. 1.000,00 + 2X 400,00 +1X 4.200 \nNF: 347394 DATA: 31/01/2011', 0, '', '', '2012-01-01'),
