(397, '', 'Leticia ', '', '', 'Data: 26/02/2009\nkellen: Esteve na clínica e pagou os 30,00 reais do protetor de cera!\n---------------------------------------------------------\nData: 14/04/2009\nDébora: Paciente esteve na clínica com a queixa de que seu aparelho estava apitando muito. Escutei o aparelho e está com o som rachado e mta microfonia. Deixou o aparelho para orçamento. OE 42722.\n---------------------------------------------------------\nData: 15/04/2009\nDébora: Orçamento do aparelho receptor, face plate R$600,00.\n---------------------------------------------------------\nData: 22/04/2009\nDébora: Paciente não autorizou o conserto do aparelho. Esteve na clínica e deixou o ap. da OD com chiado para orçamento de conserto. Foi passado o orçamento de 2 aparelhos novos pegando os antigos como parte do pagamento. Dois ap. SoloT+ 11 em 1+3 de R$1.000,00 ou 1+9 de R$450,00. Levou o orçamento dos aparelhos novos e aguardará o orçamento do conserto do ap. OD.\n---------------------------------------------------------\nData: 24/04/2009\nDébora: D. Izaura retornou à clínica acompanhada de sua filha para teste com aparelhos novos. esta em teste com o Fez o orçamento do microambia\n---------------------------------------------------------\nData: 28/04/2009\n18/07/06 COMPROU 2 APARELHOS CIC ANALÓGICO BERNAFON Nº42722/42708     \nVALOR R$ 4.800,00 ENTR. DE R$ 1.800,00 + 3X DE R$ 1.000,00  \nCOM UM ANO DE PILHA GRÁTIS\n---------------------------------------------------------\nData: 16/04/2010\nDébora: Ap. veio da fábrica. OD- feito revisão e limpeza. OE- troca de módulo completo.\n---------------------------------------------------------\nData: 26/04/2010\nDébora: Paciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 18/05/2011\nHora: 14:29:24\nFono: Tanara\nAssunto: Paciente veio relatando que perdeu um aparelho e o outro não esta fraco. Feito audiometria e comprou 1 Micro-Eleva por R$: 4.100,00. Na verdade fechou a venda mas ia ver o aparelho que seria dela. Deu uma entrada de R$: 1.000,00 no cheque e vai parcelar o resto.\n---------------------------------------------------------\nData: 27/06/2011\nHora: 12:11:54\nFono: Tanara\nAssunto: Paciente veio relatando que achou o aparelho que tinha perdido. Duarte fez a proposta de entregar os 2 Argosy micro-ambia por 2 micro-eleva em troca R$: 6.000,00. Feito a adaptação ok.\nDIA: 29/04/2009 MICRO-AMBIA \n08441RGC/0844X1RGA\nR$: 9.000,00 ENT. 4.000,00 + 5x de R$1.000,00\nDIA: 18/05/2011 COMPROU MICRO-ELEVA \nOD: 0605H15JO\nOE: 1001X0N83\nR$: 6.000,00 ENT. 1.000,00 MAIS 8X DE 625,00 CHEQUE\nNF: 330585 DATA: 29/09/2010 \n01 ANO', 0, '', '', '2012-01-01'),
(398, '', '0', 'Kowalski', 'PILHA 675', '20/06/2014 TESTE COM APARELHO NAÍDA UP, PASSADO ORÇAMENTO DE R$7.000,00 O PAR, PACIENTE COM BAIXA RENDA.\n24/06/2014 - COMPROU PAR DE APARELHOS NAÍDA S V UP NS: 1201X1HU6/ 1201X1HUK GARANTIA DE 01 ANO ATÉ A DATA DE 24/06/2015 \nPILHAS POR 01 ANO', 0, 'PERDA AUDITIVA NEUROSENSSORIAL PROFUNDA ', 'PERDA AUDITIVA NEUROSENSSORIAL PROFUNDA ', '2014-06-20'),
(399, 'indicação de outra paciente', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/10/2012\nHora: 14:13:38\nAssunto: Suzan - Confirmado endereço com empregada.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:51:47\nAssunto: Suzan - Não pode me atender no momento.\n---------------------------------------------------------\nFalei via telefone com o paciente. O mesmo informou que ainda não tem condições financeiras e que vai deixar para a próxima promoção, no final do ano. Falei que na próxima promoção ligo para ele. Ligar em setembro ou outubro.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 14:13:38\nAssunto: Suzan - Confirmado endereço com empregada.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:51:47\nAssunto: Suzan - Não pode me atender no momento.\n---------------------------------------------------------\nDIA: 21/06/2012 TESTE COM APARELHOS', 0, '', '', '2012-06-21'),
(400, '', 'Leticia ', '', 'tenente juliana 3244-0306', 'DIA: 15/09/2011 COMPRA NAÍDA III UP BILATERAL PILHA 675\nOD: 1120X0MCM NF: 370.632 DATA: 30/06/2011\nOE: 1027X121C NF: 330.585 DATA: 29/09/2010\nR$: 7.800,00 À VISTA\n01 ANO DE GARANTIA.\nData: 21/03/2011\nHora: 11:35:17\nFono: Tanara\nAssunto: Paciente veio com a documentação para fazer 3 orçamentos para levar pra Marinha. Fiz teste com Naída III SP e vem buscar amanhã os 3 orçamentos.\n---------------------------------------------------------\nData: 06/05/2011\nHora: 12:10:09\nFono: Tanara\nAssunto: Ligaram da Marinha (Juliana) e conversaram com o Duarte para fechar a venda dos aparelhos do seu João. Vamos esperar a Marinha autorizar e mandar o dinheiro. Paciente veio para realizar os pré-moldes para ficar tudo pronto. Molde de silicone concha escavada bilateral sem ventilação.\n---------------------------------------------------------\nData: 01/08/2011\nHora: 13:35:22\nFono: Tanara\nAssunto: Paciente veio para buscar os aparelhos, porém não temos mais os certenas. Colocamos 1 Una AZ SP na OE e semana que vem virá para colocar o outro. A marinha autorizou a compra.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 09:52:34\nFono: Tanara\nAssunto: Paciente veio para buscar os aparelhos. Relata muito baruho, mesmo colocando no nível 1. Duarte achou melhor colocarmos Naída UP III, pois paciente tem muita perda e precisa de um bom aparelho. Ao colocarmos Naída adorou. falou que ficou bem melhor. Voltará para fazer o pagamento a marinha irá depositar o dinheiro. Cada aparelho R$: 3.900,00.\n---------------------------------------------------------\nData: 10/08/2011\nHora: 13:12:50\nFono: Tanara\nAssunto: Paciente veio relatandoque esta com muita dor de cabeça porque esta muito alto. Fiz uma nova audiometria e apresentou uma grande melhora principalmente na OE. Orientei procurar o médico otorrino para fazer uma avaliação e mais exames. Coloquei o aparelho Naída SP na OE e marquei retorno para amanhã.\n---------------------------------------------------------\nData: 11/08/2011\nHora: 13:49:29\nFono: Tanara\nAssunto: Paciente veio buscar o encaminhamento para realziar os exames necessários. Falou que agora esta se adaptando bem.\n---------------------------------------------------------\nData: 01/09/2011\nHora: 12:02:02\nFono: Tanara\nAssunto: Paciente veio com a audiometria que fez no Otovida. O exame teve modificações foi feito uma nova regulagem. Paciente diz que ficou bem melhor e marcamos o retorno dia: 03/10 para a 1 visita pois até la a marinha já pagou os aparelhos.\nPACIENTE DEIXOU APARELHO NAÍDA III SP NS: 1027X121C E NAÍDA III UP NS: 1120X0MCM PARA ORÇAMENTO DE CONSERTO.\nPACIENTE NÃO VAI PAGAR PELO CONSERTO, SOLICITOU ORÇAMENTO POR ESCRITO PARA TENTAR CONSERTAR PELA MARINHA, CASO CONTRÁRIO NÃO IRÁ MAIS USAR APARELHOS.', 0, '', '', '2012-01-01'),
(401, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 28/09/2012\nHora: 14:22:56\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo Dr. Fasolo. Tem perda somente na OE. Feito teste com Audéo S Smart V e levou para casa. Vem na terça para o retorno. Passei o preço de R$: 7.200,00 a vista.\n---------------------------------------------------------', 0, '', '', '2012-09-28'),
