(410, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 02/04/2009\nDébora: Paciente esteve na clínica para trocar a gaveta de pilha e comprou 1 cartela de pilhas power one R$53,00.\n---------------------------------------------------------\nData: 29/10/2009\nUsa aparelho Rexton ITC     Pilha 312\n---------------------------------------------------------\nData: 27/05/2011\nHora: 14:26:11\nFono: Tanara\nAssunto: Paciente veio para trocar o protetor de cera ok.\n---------------------------------------------------------\nData: 21/05/2012\nHora: 14:43:05\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 17:26:00\nAssunto: Suzan - Sra Ivone pediu para ligar semana que vem para marcar um horario para o Open.\n---------------------------------------------------------\nData: 14/06/2012\nHora: 10:18:03\nFono: Tanara\nAssunto: Liguei avisando que o aparelho já chegou. Virá buscar.\n---------------------------------------------------------\nData: 20/06/2012\nHora: 15:39:09\nMirella: Pct veio buscar o aparelho OD e deixou o outro aasi para revisão e limpeza ( Phonak Eleva 22D L11095526)\n---------------------------------------------------------\nData: 10/07/2012\nHora: 15:38:41\nAssunto: Suzan - Sra. Ivone veio pegar o aparelho. Nao foi cobrado nada.\nDIA: 28/10/2009 COMPROU ELEVA 22 BILATERAL PILHA 312\nOD/OE: 11095526\nR$: 9.500,00 ENT. R$: 4.500,00 + 5X  de R$: 1.000,00\nNF: 288294 DATA: 10/11/2009 ATÉ 10/11/2012\n03 ANOS DE GARANTIA ', 0, '', '', '2009-10-28'),
