(415, 'OTOVIDA', 'Leticia ', '', '', 'GANHOU 02 APARELHOS SOLO T 22 DSC OD.R04081305 / OE.L04061395 ARGOSY NF.24226 DATA:28/04/08 2 ANOS DE GARANTIA PILHA 312 POWER\n21/06/2007 COMPROU APARELHO BERNAFON ANALOGICO 2800,00\nData: 13/03/2009\nKELLEN:CLIENTE ESTEVE NA CLÍNICA COMPROU 6 PILHAS 312 POWER''ONE 18,00 REAIS!\n---------------------------------------------------------\nData: 17/3/2010\nHora: 16:18:45\nMichelle: Paciente trouxe aparelho OE.L04061395 ARGOSY pois está mudo (OS AUDIOZOOM 543 GARANTIA)e aparelho bernafon modelo itc para orçamento aparelho está mudo (OS AUDIOZOOM 544).\n---------------------------------------------------------\nData: 19/03/2010\nDébora: Orçamento: troca de microfone R$380,00.\n---------------------------------------------------------\nData: 25/03/2010\nHora: 12:07:45 \nMichelle: Paciente retirou aparelho feito revisão e limpeza (OS AUDIOZOOM 543) e aparelho bernafon foi feito troca do Microfone valor:380,00 foi parcelado em 3 vezes data: 25/03 1° parc.100,00 pago  2°parc. 25/04 e 3° parc. 25/05.\n---------------------------------------------------------\nData: 08/06/2010\nHora: 11:10:33\nMichelle: Paciente retirou aparelho feito revisão e limpeza (OS AUDIOZOOM 543) e aparelho bernafon foi feito troca do Microfone valor:380,00 foi parcelado em 3 vezes data: 25/03 1° parc.100,00 pago  2°parc.25/04 100,00 e 3° parc25/05 100,00 PAGO .\n', 0, '', '', '2012-01-01'),
(416, '', 'Leticia ', '', '', 'DIA: 16/12/2010 Em teste domiciliar com Audéo Yes III bilateral.\nData: 21/12/2010\nHora: 08:39:35\nFono: Tanara\nAssunto: Paciente veio devolver os aparelhos. Falou que não sentiu diferença, fiz aumento de ganho e percebeu, expliquei que a adaptação é assim mesmo e o aparelho tem um som muito natural. Falou que vem em janeiro para fazer novo teste.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 14:53:31\nAssunto: Suzan - Não atende\n---------------------------------------------------------\nData: 17/10/2012\nHora: 15:54:44\nAssunto: Suzan - Telefone desligado.\n', 0, '', '', '2012-01-01'),
(417, '', 'Leticia ', '', '', 'DIA: 10/05/2012 COMPROU AMBRA NANO BILATERAL PILHA 10\nOD: P12E0991R\nOE: P12E0990L\nNF: 416.284 DATA: 15/05/2012 ATÉ 15/05/2015\nR$: 18.000,00 À VISTA EM CHEQUE\n03 ANOS DE GARANTIA\nData: 08/05/2012\nHora: 14:54:27\nFono: Tanara\nAssunto: Paciente para saber de preços de aparelhos. Feito audiometria colocamos Audéo Smart IX bialteral. Paciente gostou bastante e levou para casa. Falei também do Nano e ficou mais empolgado. Vai conversar em casa pra decidir qual será melhor para ele. Passei R$: 20.000,00 parcelado ou R$: 18.000,00 vista.\n---------------------------------------------------------\nData: 09/05/2012\nHora: 09:07:59\nFono: Tanara\nAssunto: Paciente veio e decidiu comprar o Nano Ambra com 20 canais. Paciente assinou o contrato e dará cheques que totalizem R$: 18.000,00 dentro do mês de junho. Sendo então aparelho a vista. Vai trazer R$: 500,00 amanhã como sinal.\n---------------------------------------------------------\nData: 13/08/2012\nHora: 10:49:15\nFono: Tanara\nAssunto: Paciente veio para a 2 visita, entregues os brindes e marquei o retorno para Novembro. Vamos aumentar.\n---------------------------------------------------------\nData: 16/11/2012\nHora: 11:22:11\nJOICE: PACIENTE VEIO COM QUEIXA DE QUE APARELO PODE ESTAR COM CERA INTERNAMENTE, INDIQUEI VOLTAR PARA FAZER REVISÃO .DEI 3 CARTELAS DE PILHAS MAIS DOIS KITS DE CERUSTOP.\n---------------------------------------------------------\nData: 23/01/2013\nHora: 10:48:56\nAssunto: Suzan - Deixou aparelho para revisão. OS: 2801. PHONAK AMBRA P12E0990L. Esta na garantia. Veio buscar um ceruspot do programa de acompanhamento.\n---------------------------------------------------------\nData: 24/01/2013\nHora: 11:37:01\nAssunto: FRAN: liguei confirmando horário do dia 29/01, as 8:00 para adaptação do Lyric.\n---------------------------------------------------------\nData: 01/02/2013\nHora: 16:15:15\nAssunto: Francine: Paciente colocou Lyric no dia 29/01. Tudo Ok. Hoje veio para dar uma regulada e dei orientações para controle de volume. paciente vai viajar e ficará 2 semanas fora.\n---------------------------------------------------------\nData: 11/03/2013\nHora: 08:58:47\nFRANCINE - TENTEI CONTATO TELEFONICO. PCTE NÃO ESTA EM CASA, SÓ A NOITE E O CELULAR ESTA DESLIGADO.\n---------------------------------------------------------\nData: 11/03/2013\nHora: 15:23:09\nFRAN - AGENDADO PARA AMANHÃ, 12/3 AS 9:00 PARA FECHAR CONTRATO LYRIC.\n---------------------------------------------------------\nData: 12/03/2013\nHora: 09:41:27\nAssunto: Suzan - Veio buscar aparelho OS: 2801. Esta na garantia. PHONAK AMBRA P12E099OL.\nPACIENTE DEIXOU APARELHO POIS CAIU BASE DO PROTETOR DE CERA MODELO AMBRA P12E0990L(AUDIOZOOM 1744)', 0, '', '', '2012-01-01'),
(419, 'dr.kowalski', 'Leticia ', '', '', 'Data: 22/08/2012\nHora: 10:27:22\nFono: Tanara\nAssunto: Paciente veio com sua esposa Judite encaminhado pelo Dr. Kowalski. Levu para testar Audéo S Smart III na OE.\n---------------------------------------------------------\nData: 27/08/2012\nHora: 10:30:49\nFono: Tanara\nAssunto: Duarte atendeu o paciente e pelo que sei vai esperar para comprar.\n---------------------------------------------------------\nData: 26/09/2012\nHora: 10:31:23\nFono: Tanara\nAssunto: Liguei e falei com a esposo Judite. Falou que vai comprar o aparelho mas agora não tem condições. Esta esperando juntar o dinheiro.\nDIA: 22/08/2012 AUDIOMETRIA E TESTE COM AUDÉO S SMART III laercioecoelho@hotmail.com / dr.kowalski', 0, '', '', '2012-08-22'),
(420, '', 'Leticia ', '', '', 'Data: 22/05/2012\nHora: 14:02:06\nAssunto: Suzan - O numero chamado não existe.\n---------------------------------------------------------\nCOMPROU AP. BELTONE PETITE PLUS INTRA CANAL   N 7982 DIA 09/10/01 VALOR 2000,00\nVENDA DUARTE', 0, '', '', '2012-01-01'),
(421, 'DR. GILSON GLUSZCZUK', 'Leticia ', '', '', '---------------------------------------------------------\nData: 29/08/2011\nHora: 14:20:12\nFono: Tanara\nAssunto: Paciente veio com sua filha Maria Aparecida e seu genro Vanderlei para fazer teste e compra de 2 aparelhos auditivos. Falou que foi o Dr. Gilson que indicou. Trouxe já a audiometria e feito teste com Audéo Smart III bilateral. Falou que tem muito zumbido "grilo" e que gostaria que esse "grilo" fosse embora. Expliquei que com o uso dos aparelhos ia melhorar. Levou para a casa e passei o valor de R$: 4.500,00, sendo R$: 9.000,00 bilateral e a vista R$: 8.200,00. Falou que vai fazer depósito a vista.  \n---------------------------------------------------------\nData: 30/08/2011\nHora: 14:00:17\nFono: Tanara\nAssunto: Paciente veio para o retorno de teste falou que fez depósitos sendo R$: 3.000,00 outro de R$: 1.700,00 e mais um de R$: 1.500,00. Totalizando R$: 6.200,00. E deu hoje R$: 2.000,00 em dinheiro. Pagou R$: 8.200,00 a vista. Falou que esta adorando os aparelhos e que a TV ficou mais baixa e o "grilo" foi embora. Feito contrato, emtregue kit de compra e marcamos a 1 visita para dia: 13/09.\n---------------------------------------------------------\nData: 08/09/2011\nHora: 14:37:11\nFono: Tanara\nAssunto: Paciente veio para mais um retorno, fiz aumento da aclimatização para o nível 2. Vamos entregar a nota fiscal na 1 visita.\n---------------------------------------------------------\nData: 14/09/2011\nHora: 14:51:08\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e entreguei a nota fiscal. Diz que esta ouvindo bem e por enquanto não quer aumentar. Diz que o "grilo" não voltou mais.\n---------------------------------------------------------\nData: 30/08/2012\nHora: 08:49:51\nMirella: Pct foi atendida pelo Duarte na sua 5ª vista do programa de acompanhamento, pct não tem usado constantemente o aasi.\n---------------------------------------------------------\nData: 28/02/2013\nHora: 08:20:02\njoice: PACIENTE VEIO PARA PROGRAMA DE AOMPANHAMENTO, A MESMA RELATA ESTÁ TUDO MUITO BEM COM O AASI. DEI MAIS 3 CARTELAS DE PILA UMA CAIXA DESUMIDIFICADOR MAIS DOIS CERUSTOP;\n---------------------------------------------------------\nDIA: 30/08/2011 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1113X18JV NF: 363.188 DATA: 23/05/2011\nOE: 1113X22TY NF: 370.632 DATA: 30/06/2011\nR$: 8.200,00 À VISTA FEZ DEPÓSITO\n01 ANO DE GARANTIA.', 0, '', '', '2011-08-30'),
(418, '', 'Leticia ', 'KOWALSKI', '', 'TESTE COM APARELHO AUDITIVO BAIXA RENDA.\nCOMPROU APARELHO MICRO ELEVA POR R$2.000,00 COM 01 ANO DE GARANTIA    E 03 ANOS DE PILHA.\nNF: 214.997  DTNF: 10/09/2007 ', 0, '', '', '2014-06-24'),
(422, 'ACHOU NA INTERNET', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/02/2010\nHora: 16:48:59\nAssunto:cida. filho teve na loja e pagou a 1ª parela do aparelho auditivo valor R$ 300,00 reais\n---------------------------------------------------------\nData: 03/03/2010\nHora: 10:02:27\nMichelle: filho teve na loja e pagou a 2ª parela do aparelho auditivo valor R$ 300,00 reais\n---------------------------------------------------------\nData: 02/07/2010\nGracielle: visita do programa de acompanhamento, aumento do nível de experiência.\n---------------------------------------------------------\nData: 15/10/2010\nHora: 13:19:32\nAssunto:cida. filha esteve na loja pagou E PAGOU A 9ª PARCELA DO APARELHO AUDITIVO PHONAK AUDEO III VALOR 300,00 REAIS . ficou devendo 14,40 do atraso da parcela 14 dias de atraso.\n---------------------------------------------------------\nData: 04/11/2010\nDébora: Pago última parcela R$300,00.\n---------------------------------------------------------\nData: 15/12/2010\nDébora: Paciente esteve na clínica e deixou 01 ap.  Phonak Audeo III nº OD- 0938X0T4K mudo para conserto da garantia.\n---------------------------------------------------------\nData: 22/12/2010\nHora: 18:05:07\nFono: Tanara\nAssunto: Ligado para o paciente avisando que seu aparelho já esta pronto. Feito apenas Revisão e Limpeza.\n---------------------------------------------------------\nData: 27/12/2010\nHora: 14:08:03\nMichelle: Paciente retirou aparelho e deixou o outro lado para a revisão e limpeza, na garantia.\n---------------------------------------------------------\nData: 06/01/2011\nHora: 07:56:27\nFono: Tanara\nAssunto: Aparelho chegou da fábrica, feito apenas revião e limpeza. Ligado para vir retirar.\n---------------------------------------------------------\nData: 10/01/2011\nHora: 13:31:55\nFono: Tanara\nAssunto: A filha veio buscar o aparelho que esta na garantia.\n---------------------------------------------------------\nData: 11/01/2011\nHora: 13:18:30\nFono: Tanara\nAssunto: Paciente veio falando que a oliva estava pequena e estava dando microfonia. feito a troca pelo power ok. Fiz o programa de acompanhamento (6 visita). Entregue os brindes e marquei dia: 29/06 a 7 visita.\n---------------------------------------------------------\nData: 23/05/2011\nHora: 13:23:23\nFono: Tanara\nAssunto: Paciente veio com aparelho mudo. Era protetor de cera. feito a troca ok.\n---------------------------------------------------------\nData: 29/06/2011\nHora: 15:27:56\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Deixou os 2 aparelhos para ir pra fábrica, pois estão com o som distorcido. Vou mandar como garantia. Audéo III bilateral 0938X0T4k e 0938X0T5D.\n---------------------------------------------------------\nData: 08/07/2011\nHora: 11:26:25\nFono: Tanara\nAssunto: Liguei para o Marcelo o genro que os aparelhos já chegaram. Vem retirar.\n---------------------------------------------------------\nData: 18/07/2011\nHora: 14:59:12\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos na garantia. Expliquei que na próxima vez será cobrado R$: 280,00 de cada aparelho. Vai retirar a cera do conduto e virá para fazer uma audiometria nova e nova regulagem também.\n---------------------------------------------------------\nData: 20/12/2011\nHora: 11:14:11\nFono: Tanara\nAssunto: Paciente veio para a 6 visita. Entregue os brindes e falou que os aparelhos não estão funcionando. Como ainda esta na agrantia de conserto. Vai para a fábrica. Audéo III OD 0938X0T4K revisão e limpeza OE 0938X0T5D aparelho mudo.\n---------------------------------------------------------\nData: 09/01/2012\nHora: 10:33:07\nMichelle: Paciente retirou aparelho\n---------------------------------------------------------\nData: 24/05/2012\nHora: 13:29:43\nAssunto:cida. paciente esteve na loja e deixou ap. phonak audéo nº0938xot5D /Nº0938XDT4K.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 14:10:23\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram. Falei que tem que marcar uma hora para regular.\n---------------------------------------------------------\nData: 06/06/2012\nHora: 09:21:37\nMirella: Seu genro veio retirar o aasi, informei que é necessário reprogramar o aasi, pct irá ligar agendando um horário.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio para visita de 2 anos e meio, entregue pilhas e acessórios. Marcou para o dia 02 de julho para reprogramação pois hoje eu estava sem programa pois Tanara levou o NOTBOOK. OK\n---------------------------------------------------------\nData: 02/07/2012\nBruna: Veio para regulagem dos aparelhos. Reprogramei da OD pois tinha vindo de SP sem programação, aumentei ganho geral. OK\nDIA: 29/12/2009 COMPROU AUDÉO III BILATERAL PILHA 312\nOD: 0938X0T4K NF: 292441 DATA: 11/12/2009 \nOE: 0938X0T5D NF: 293269 DATA: 18/12/2009\nR$: 6.500,00 ENT. R$: 3.500,00 MAIS 10X DE R$: 300,00\n01 ANO DE GARANTIA.', 0, '', '', '2009-12-29'),
