(424, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 12/02/2009\nDébora: Paciente esteve na clínica e comprou 12 pilhas 10 panasonic. R$42,00\n---------------------------------------------------------\nData: 16/06/2009\nDébora: Paciente esteve na clínica referindo que só o ap. da OD apitava qdo tampava com a mão. Escutei o ap.da OE e o mesmo estava mudo e descarregando a pilha. Deixou ap. para conserto.\n---------------------------------------------------------\nData: 07/07/2009\n27/11/2008 Comprou 2 ap. Argosy Maxx 11 OD/OE\nValor total: R$ 6.700,00 1 entr. de R$ 1.700,00 + 5x de R$ 1.000,00\n2 anos de garantia  NF 0291515 DATA 28/08/08\n---------------------------------------------------------\nData: 06/07/2009\nDébora: Paciente retornou à clínica para buscar ap.Referiu estar mto descontente com o ap., pois apresenta mta oclusão. Sugeriu a troca de aparelho pelo MicroAmbia (ap. com adaptação aberta), pois referiu grande melhora com esse tipo de adaptação. Devolveu seu ap. antigo e pagou mais R$1.300,00 na troca pelo aparelho MicroAmbia.\n---------------------------------------------------------\nData: 10/08/2009\nDébora: Paciente esteve na clínica para aumentar o ganho do ap. Foi aumentado o nível de experiência e o ganho geral.\n', 0, '', '', '2008-07-06'),
