(428, '', 'Leticia ', '', '', 'DIA: 05/10/2011 COMPRA NÁIDA UP III OE PILHA 675\nOE: 0847H1763\nNF: 363561 DATA: 24/05/2011\nR$: 3.500,00 À VISTA EM DINHEIRO\n01 ANO DE GARANTIA.\nData: 29/09/2011\nHora: 08:21:20\nFono: Tanara\nAssunto: Paciente veio com seu filho Lauri para fazer teste com \nparelhos. Tem perda profunda bilateral, mas vai colocar apenas 1 aparelho por enquanto. Testei Solo 411 dSC e Naída UP III. Paciente gostou mais do Naída UP. Colocamos na OE pois é um pouco melhor que a OD. Falei que podemos fazer por R$: 3.500,00. Falou que vai fazer a vista e vem na quarta trazer o dinheiro. Feito pré-molde para a confecção de molde de silicone concha escavada sem ventilação.\n---------------------------------------------------------\nData: 05/10/2011\nHora: 08:24:49\nFono: Tanara\nAssunto: Paciente voltou com seu filho e fechou a venda a vista em dinheiro R$: 3.500,00. Gostou do aparelho, porém a compreensão não será total logo. Marcamos a 1 visita em 15 dias. Entregue o contrato, kit de compra e programa de acompanhamnto.\n---------------------------------------------------------\nData: 19/10/2011\nHora: 11:49:23\nFono: Tanara\nAssunto: Paciente veio com seu filho e fiz a 1 visita. Entregue o kit de manutenção e expliquei tudo. Estava reclamando que o som não vinha era manguerinha com água. Marquei um retorno extra dia: 03/11.\n---------------------------------------------------------\nData: 05/01/2012\nHora: 09:32:40\nFono: Tanara\nAssunto: Paciente veio com seu filho para a 2 visita. Diz que usa só de vez em quando o aparelho. Mas esta escutando bem. Entregue os brindes e Marquei retorno em abril. Esta tendo muita dificuldade ao falar no telefone. Expliquei que é normal devido a perda grande que tem.\n---------------------------------------------------------\nData: 02/08/2012\nHora: 01:02:03\nFono: Tanara\nAssunto: Paciente veio com um parente relatando que o molde rasgou. Fiz outro pré-molde para a confecção de molde de silicone conha escavada sem ventilação. Pagou R$: 70,00. \n-------------------------------------------------------------\nData: 09/08/2012\nHora: 10:31:21\nAssunto:cida.paciente esteve na loja e retirou o molde.\n---------------------------------------------------------\nData: 05/10/2012\nHora: 08:48:55\nFono: Tanara\nAssunto: Paciente veio com seu filho para deixar o aparelho para a revisão e limpeza na garantia. Deixei um de empréstimo. Naída III UP OE 0847H1763.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 15:09:08\nFono: Tanara\nAssunto: Liguei e avisei o filho que o aparelho do seu pai chegou. Vem buscar na sexta a tarde.\n---------------------------------------------------------\nData: 19/10/2012\nHora: 14:05:30\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n', 0, '', '', '2012-01-01'),
(429, '', 'Leticia ', '', 'INDICADO PELO BANCO DO BRASIL', 'DIA: 12/01/2012 COMPROU NAÍDA III SP OE PILHA 13\nOE: 1120X0PD2\nNF: 387.098 DATA: 25/10/2011\nR$: 3.600,00 À VISTA EM DEPÓSITO\n01 ANO DE GARANTIA\nData: 27/12/2011\nThaisa: paciente veio para regulagem e orientação. passado orçamento 4.500,00 cada aparelho. na compra dos dois 7.800,00 parcelados em 10x ou 7.200 a vista. Vai conversar com a família e vem na quinta-feira, dia 29. Ok\n---------------------------------------------------------\nData: 28/12/2011\nThaisa: Paciente devolveu aparelhos em teste. Virá segunda para colocar Naida III e fazer audiometria. Ok\n---------------------------------------------------------\nData: 02/01/2012\nThaisa: Paciente ligou desmarcado. Irá na consulta com ORL, depois vai ligar para remarcar. Ok\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:00:45\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho esta baixo e com eco. Feito regulagem e marcamos retorno na sexta para fazer teste com o Naída V SP. Conversei com a Marilu nora e vai comprar o aparelho na segunda.\n---------------------------------------------------------\nData: 05/01/2012\nHora: 09:35:18\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho esta baixo. Achei estranho e fiz uma nova audiometria. A perda tinha piorado. Fiz uma nova regulagem e paciente achou que o som teve uma grande melhora. Virá amanhã para colocarmos o Naída V.\n---------------------------------------------------------\nData: 06/01/2012\nHora: 09:30:12\nFono: Tanara\nAssunto: Paciente veio com dificuldade para colocar o aparelho. Passei orientações e vamos deixar o Naída III SP mesmo. Esta ouvindo bem melhor depois da última regulagem.\n----------------------------------------------------------\nData: 10/01/2012\nHora: 08:30:36\nFono: Tanara\nAssunto: Paciente veio com seus parentes Eduardo e Marilu para buscar o molde e conversar com o Duarte. Porém o Duarte só vem amanhã e ficaram de negociar amanhã de manhã a compra do aparelho.\n---------------------------------------------------------\nData: 16/01/2012\nHora: 17:34:20\nFono: Tanara\nAssunto: Paciente veio para buscar o programa de acompanhamento que irá fazer no Rio de Janeiro. Comprou um telefone amplificado por R$: 380,00. Vai pagar na semana que vem. Fiz a 1 visita entreguei o kit de manutenção e pilhas. Expliquei tudo como funciona o kit de manutenção. paciente agora voltará somente em julho.\n---------------------------------------------------------\nData: 26/12/2012\nHora: 16:55:32\nFRANCINE: Paiente veio com queixa de que aasi esta estridente. Reguli e não ficou bom. Suspeito do molde. Tirei preo-molde para fazer molde com ventilação de 1,5mm.\n', 0, '', '', '2012-01-01'),
