(432, 'HU', 'Leticia ', '', '', '01 AP. PHONAK N  OD- 1010X0LL2\n- 01 ANO DE GARANTIA\nNF 308988 30/04/2010 ATÉ 30/04/2011\n---------------------------------------------------------\nData: 18/11/2010\nDébora: Paciente esteve na clínica e deixou 01 AP. PHONAK Nº OD- 1010X0LL2 para revisão da garantia. Enviar via sedex qdo voltar da fábrica, já está pago.\n---------------------------------------------------------\nData: 24/11/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza. Enviado para o paciente via sedex.\n---------------------------------------------------------\nData: 28/04/2011\nHora: 12:41:42\nMichelle: Paciente deixou aparelho para revisão modelo una m az od 211010x0ll2(os audiozoom 1591)\n---------------------------------------------------------\nData: 09/05/2011\nHora: 10:12:18\nFono: Tanara\nAssunto: Liguei e falei com o paciente que seu aparelho já esta pronto. Virá buscar.\n---------------------------------------------------------\nData: 20/05/2011\nHora: 09:30:18\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(433, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/10/2012\nHora: 14:57:39\nAssunto: Suzan - Sr. João diz que esta com um aparelho a 60 dias. Falei do evento e confirmei endereço.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:54:43\nAssunto: Suzan - Falei com esposa sobre o Open. Disse que vai falar com esposo.\n---------------------------------------------------------\n---------------------------------------------------------\nData: 03/10/2012\nHora: 14:57:39\nAssunto: Suzan - Sr. João diz que esta com um aparelho a 60 dias. Falei do evento e confirmei endereço.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:54:43\nAssunto: Suzan - Falei com esposa sobre o Open. Disse que vai falar com esposo.\n---------------------------------------------------------\nPaciente comprou aparelho na Telex e informou que não tem interesse pela promoção. Relatou que compra pilha aqui conosco.\n', 0, '', '', '2012-01-01'),
