(443, '', 'Leticia ', '', '', 'DIA: 28/01/2011 VENDA CERTENA MICRO BILATERAL PILHA 13\nOD: 1022X0EHX NF: 330585 DATA: 29/09/2010\nOE: 1017X0692 NF: 316291 DATA: 25/06/2010\nR$: 6.000,00 ENT. 2.000,00 MAIS 2X DE 2.000,00 NO CHEQUE\n01 ANO DE GARANTIA.\nData: 24/01/2011\nHora: 17:22:53\nFono: Tanara\nAssunto: CLIENTE ESTEVE NA LOJA PARA FAZER AVALIAÇAO. (SORTEIO DA RÁDIO GUARAREMA)ESTA EM TESTE COM APARELHO AUDITIVO. Paciente veio com genro Leonildo e esposa Alzira para a avaliação. Expliquei que pela perda do paciente necessita de aparelhos. Feito teste com Certena Micro e paciente gostou. Levou para teste domiciliar e entrará em contato. Duarte pasou o Valor de $: 6.000 a vista bilateral.\n---------------------------------------------------------\nData: 28/01/2011\nHora: 15:06:30\nFono: Tanara\nAssunto: Liguei e conversei com o genro. Vai comprar em 3x os R$: 6.000,00. Duarte autorizou e virá as 17:00 para fechar a venda. Paciente veio e fechou com 3 cheques de 2.000,00. Feito pré-moldes bilateral e vem buscar na segunda.\n---------------------------------------------------------\nData: 31/01/2011\nHora: 13:45:26\nFono: Tanara\nAssunto: Paciente com seu genro buscar os moldes. Entregue o manual, 2 cartelas de pilhas, as caixinhas e o programa de acompanhamento. Marcado retorno dia: 11/02 para a 1 visita.\n---------------------------------------------------------\nData: 11/02/2011\nHora: 13:23:53\nFono: Tanara\nAssunto: Paciente veio com seu genro e esposa com as pilahs gastas. Orientei verificar a pilha já que ele não sabe quando esta terminando pelo bip. O genro comprou o testador de pilhas, pagou R$: 45,00. Estava também com os moldes machucando. Jaimar desgastou ok. Entreguei o kit de manutenção e pilhas e marquei a 2 visita, porém não trouxe o caderno para assinar, falei para trazer na segunda.\n---------------------------------------------------------\nData: 29/04/2011\nHora: 13:08:58\nFono: Tanara\nAssunto: Paciente veio com o genro e sua esposa para a 2 visita. Entregue os brindes e fiz aumento da aclimatização para o nivel 4 já que estava no nível 2. Paciente diz que ficou bem melhor. Marcado a 3 visita.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
