(444, '', 'Leticia ', '', '', 'APARELHO AUDITIVO REXTON CIC OD PILHA 10 \nOD: 0905R2990\nAPARELHO AUDITIVO PHONAK UNA CIC/MC BILATERAL PILHA 10\nOD: P11F0883R\nOE: P11F0884L\nNF: 368287 DATA: 24/06/2011 ATÉ 24/06/2012\nData: 03/09/2009\nDébora: Deixou ap. mudo com gaveta quebrada e caixa trincada Rexton CIC OD nº0905R2990 para orçamento de conserto.\n---------------------------------------------------------\nData: 09/09/2009\nDébora: Orçamento: receptor, microfone e face plate R$820,00.\n---------------------------------------------------------\nData: 24/09/2009\nDébora: Paciente esteve na clínica para buscar aparelho. Pago R$779,00 com 5% de desconto à vista.\n---------------------------------------------------------\nData: 22/07/2011\nHora: 14:29:19\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo HU para verificar os aparelhos. OE não detecta não le no IPFG e OD feito regulagem ok. OE vai para a fábrica e ligaremos quando chegar para fazer a regulagem.\n---------------------------------------------------------\nData: 28/07/2011\nHora: 16:43:40\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Precisa fazer a regulagem.\n---------------------------------------------------------\nData: 24/08/2011\nHora: 10:09:57\nMichelle: Paciente retirou aparelho sem os pois o mesmo foi extraviado Sr Jonei Sens CPF: 445.396.069-72\n---------------------------------------------------------\nData: 31/08/2011\nHora: 09:35:40\nFono: Tanara\nAssunto: Paciente veio encaminhado pela Fga. Luciana do HU. Os aparelhos estão saindo do ouvido. Fazer fazer troca da caixa maior possível. Vai para a Fábrica. Una 11 OE P11F0884L.\n---------------------------------------------------------\nData: 09/09/2011\nHora: 14:14:22\nFono: Tanara\nAssunto: Liguei e avisei o filho Dornei que o aparelho já chegou. Virá buscar. Final da tarde paciente veio buscar o aparelho, falou que segunda vai deixar o outro lado.\n---------------------------------------------------------\nData: 19/09/2011\nHora: 16:10:52\nFono: Tanara\nAssunto: Paciente veio deixar o lado direito para enviar para S.P. sai do conduto. Una 11 OD P11F0883R. Conversei com a Rosana Blanco sobre o caso. Falou que é importante colocar o Bite (Baite) para não sair mais do conduto. Deixou o aparelho velho da Rexton 11 como modelo.\n---------------------------------------------------------\nData: 07/10/2011\nHora: 10:29:24\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 17:26:00\nAssunto: Suzan - Confirmado endereço para mandar carta do Open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 17:46:20\nAssunto: Suzan - Sr. Jonei pediu para ligar dia 13/04, disse que talvez ira viajar. Ligar para confirmar.\n---------------------------------------------------------\nData: 15/06/2012\nHora: 14:30:03\nAssunto: Suzan - Sr. Jonei disse que não vira para o Open pq vai esta viajando a trabalho. Mas vai mandar alguem para comprar pilhas.\n---------------------------------------------------------\nData: 21/06/2012\nHora: 16:29:45\nMirella: Pct comprou 3 cartelas de pilhas 10.\n---------------------------------------------------------\nData: 31/10/2012\nHora: 10:13:04\nAssunto: suzan - Pct comprou 3 cartelas de pilhas 10.\n---------------------------------------------------------\nData: 04/03/2013\nHora: 15:13:01\nAssunto: Suzan - Deixou aparelho para conserto. R$ 364,00 ja efetuou pagamento de R$110,00. Ficou para pagar quando pegar o aparelho R$254,00. Comprou 18 pilhas 10. Pagou junto com a primeira entrada do conserto no cartão de credito. OS: 2834.\n---------------------------------------------------------\nData: 14/03/2013\nHora: 15:49:36\nAssunto:Suzan - Veio buscar aparelho. OS: 2834. Pagou o restante que faltava do conserto do aparelho. R$ 254,00.\n---------------------------------------------------------\nAASI PHONAK UNA CIC N° P11F0884L PAROU DE FUNCIONAR. DEIXOU PARA FAZER ORÇAMENTO. VALOR DO ORÇAMENTO R$364,00. AGUARDANDO APROVAÇÃO.\nPaciente retirou aparelho PHONAK Una CIC P11F0884L OS 2932.PAGO paciente trouxe cartao fidlidade comprou tres cartelas da promoção e ganhou a 11 cartela.pilhas 10.', 0, '', '', '2012-01-01'),
(445, '', 'Leticia ', '', '', 'DIA: 29/06/2012 COMPROU AUDÉO S SMART IX BILATERAL PILHA 312\nOD: 1208H02WU\nOE: 1208H02XC\nNF: 415.738 DATA: 11/05/2012\n03 ANOS DE GARANTIA.\n--------------------------------------------------------------\nData: 17/12/2012\nHora: 17:23:45\nFRANCINE: Programa de acompanhamento - tudo OK. Fiz leve aumento de ganho no Target. Dei 3 cartelas de pilha 312.\n----------------------------------------------------------------\n17/06/13 - Entregue brindes do P.A. e feita regulagem. Tudo OK.', 0, '', '', NULL),
(446, '', 'Leticia ', '', '', '18/04/07 COMPROU 1 APARELHO ITC PILHA 312 BERNAFON OD \nENTRADA  R$ 700,00 + 1X R$ 700,00 E 6X R$100,00\n08/12/2008 Deixou 2 cheques de 100,00\nData: 08/12/2008\nFono: Débora\nVeio à clínica com a queixa de que seu aparelho estava com chiado intermitente.\n---------------------------------------------------------\nData: 12/03/2009\nKELLEN:CLIENTE ESTEVE NA CLINICA COMPROU 12 PILHAS 13/10 RAYOVAC 36,00 REAIS!\n---------------------------------------------------------\nData: 10/08/2009\nTHAIS: Comprou um kit smartguard (R$45,00), 1 cartela de pilha 10 power (R$18,00), troca de gaveta (R$35,00) e troca de protetor de cera (R$20,00). DEVE UM TOTAL DE R$ 118,00.\n---------------------------------------------------------\nData: 12/08/2009\nTHAIS: PC veio acertar os R$118,00. Pagou em cheque.\n---------------------------------------------------------\nData: 05/05/2011\nHora: 08:30:58\nMichelle: Paciente comprou 1 cartela de pilha 312 + 1 smart guard deve 63,00 reais.\n---------------------------------------------------------\nData: 06/07/2011\nHora: 08:57:24\nMichelle: Paciente pagou 63,00 e levou mais 1 cartela de pilha 312 pagou no total 81,00\n---------------------------------------------------------\nData: 13/08/2012\nHora: 10:16:07\nAssunto:CIDA. PACIENTE ESTEVE NA LOJA PARA FAZER PRÉ-MOLDE\n---------------------------------------------------------\nData: 13/08/2012\nHora: 10:50:39\nFono: Tanara\nAssunto: Paciente veio para fazer o molde da OD. Vai usar um aparelho que ganhou do pai. Mostrei aparelhos novos, mas não tem condições de comprar. Feito pré-molde para a confecção de molde de silicone concha escavada com ventilação de 1,5 mm na OD.\n---------------------------------------------------------\nData: 16/08/2012\nHora: 10:04:41\nAssunto:paciente esteve na loja e retirou o molde e comprou uma cartela de pilha 675. o molde e a pilha foi pago no cartão. brinde uma aixa de pastilha.\n', 0, '', '', '2012-01-01'),
(447, '', '0', '', '', 'USA APARELHO ARGOSY \nMODELO MAXX 311\nOD 078X16616 OE 078X13138\n---------------------------------------------------------\nData: 13/07/2010\nHora: 11:59:56\nMichelle:Motorista deixou aparelho para fazer orçamento MODELO MAX 311\nOD 078X16616 OE 078X13138 (os audiozoom 1186).\n---------------------------------------------------------\nData: 02/08/2010\nMotorista retirou aparelho OD.078x16616.\n---------------------------------------------------------\nData: 30/06/2011\nHora: 15:23:05\nAssunto:cida. secretaria da saúde ligou para saber sobre o aparello que estava na loja desde 2010 para orçamento EO. 078X13138 foi passado o valor do orçamento por motivo da demora de retirado o aparelho foi para reavaliaçao do tecnico novamente.\n---------------------------------------------------------\nData: 07/07/2011\nHora: 09:54:58\nFono: Tanara\nAssunto: Paciente veio para retirar o orçamento, porém Duarte atendeu e fez um preço especial para o conserto do seu aparelho. R$: 600,00 Receptor e controle de volume. Feito também uma audiometria e teste com Naída. Paciente gostou bastante e passei os valores de R$: 8.200,00 a vista R: 7.000,00 autorizad pelo Duarte. Ficou de pensar. Feito também pré-moldes para a confecção de moldes de silicone rosa concha escavada com 1 mm de ventilação, pois o aparelho estava apitando no ouvido. Michelle: Paciente retirou aparelho feito troca do receptor + chave mais molde pagou 700,00 reis motorista vem busca moldes. Autorizado pelo Duarte.\n---------------------------------------------------------\nData: 11/07/2011\nHora: 09:07:48\nMichelle: Motorista retirou moldes .\n----------------------------------------------------------------------\n20/08/2013 - MOTORISTA DEIXOU APARELHO PARA ORÇAMENTO. APARELHO NÃO ESTÁ FUNCIONANDO E ESTÁ COM BOTÃO DE LIGA QUEBRADO. OS 3014. ORÇAMENTO: R$1540,00 - 5° ANO DE USO.', 0, '', '', NULL),
(449, 'HU', 'Leticia ', '', '', '12/06/08 ESTEVE NA LOJA FEZ EXAME AUDIOLOGICO CREDLIG - está em teste domiciliar com minivaleo OD - 59 ANOS                                                                             19/04/2013 - GANHOU CERTENA ART ITC - OD: R04136514 - PILHA 312 - NF: 470770 - GARANTIA ATÉ 19/04/2014.\n', 0, '', '', '2012-01-01');
