(450, '', 'Leticia ', '', 'BERNAFON CURITIBA', '18/01/08 COMPROU APARELHO PHONAK PICO FORTE 3 OE N  07AH18444 PILHA 13 \n VALOR TOTAL R$ 2.300,00 À VISTA\nDIA: 18/01/2011 COMPROU AUDEO SMART III OE \nOE: 1041X0GHP RECEPTOR 2\nR$: 3.700,00 A VISTA\nNF: 342544 DATA: 21/12/2010\n01 ANO DE GARANTIA.\nData: 18/01/2011\nHora: 17:38:04\nFono: Tanara\nMichelle: Paciente deixou aparelho pois esta com ruido e caixa rachada MODELO PICO FORTE 3PPCP N° 07AH18444(OS AUDIOZOOM 1451). Paciente comprou aparelho novo a vista R$: 3.700,00 em cheque da filha. Audeo Smart III OE. Já fiz a 1 visita que seria dia 01/02. Paciente vai para sua cidade e quando voltar virá fazer a 2 visita.\n---------------------------------------------------------\nData: 26/01/2011\nHora: 18:09:35\nFono: Tanara\nAssunto: Aparelho ficou pronto e liguei para a filha Rosane. Vem buscar o aparelho na semana que vem. Feito troca da caixa completa mais revisão e limpeza, não terá custo pois comprou aparelho novo.\n---------------------------------------------------------\nData: 31/01/2011\nHora: 13:57:47\nFono: Tanara\nAssunto: Ligaram e falaram que o aparelho não esta funcionando. Mandamos um novo e mais o velho do paciente. Mandamos o Audeo Smart III OE número de série: 1041X0GHP. Paciente irá mandar o dele de volta.\n---------------------------------------------------------\nData: 14/02/2011\nHora: 13:38:52\nFono: Tanara\nAssunto: Liguei e conversei com a esposa Jolita para saber como esta o paciente. Falou que esta ótimo pois foi para Blumenau e fez regulagem. Agora esta ouvindo bem. Pedi para devolver o aparelho que esta lá. Audeo Smart III.\n---------------------------------------------------------\nData: 18/01/2011\nHora: 10:25:34\nFono: Paciente pagos 3700,00 compra de aparelho.\n', 0, '', '', '2012-01-01'),
(451, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/01/2012\nHora: 11:42:58\nFono: Tanara\nAssunto: Paciente esta em Floripa e veio para fazer o programa de acompanhamento. Comprou aparelho em Joinville com a Fga: Samira, Certena Micro OE. Tem perda Unilateral. Feito a 2 visita entregue os brindes e vai morar no Rio de Janeiro e fazer o programa de acompanhamento por lá. Verifiquei excesso de cera na OE e orientei procurar o Otorrino.\n---------------------------', 0, '', '', '2012-01-01'),
(452, '', 'Leticia ', '', '', 'DIA: 24/10/2012 TESTE COM AUDÉO S SMART III BILATERAL\nData: 24/10/2012\nHora: 11:54:28\nFono: Tanara\nAssunto: Paciente veio pela internet. Tem perda somentes nas frequencias de 6 e 8 Hz. Mas tem muito zumbido. Expliquei que é importante usar os aparelhos e que iríamos fazer um teste para ver se realmente o zumbido melhorar. Deixei em teste 2 Audéo S Smart III bilateral. R$: 8.000,00. Quer pagar a vista e já fez pesquisa de preço. Só vai comprar se realemnte sentir uma diferente em relação ao zumbido. Vem dia: 29/10/2012 para o retorno.\n---------------------------------------------------------\nData: 25/10/2012\nHora: 11:38:29\nFono: Tanara\nAssunto: Liguei e falei com a esposa Eliane. Ela falou que ele esta gostando de usar os aparelhos e esta conseguindo colocar sozinho. Vem dia: 29/10 para o retorno.\n', 0, '', '', '2012-01-01'),
(453, '', 'Leticia ', 'Kowalski', '', 'DIA: 13/06/2012 TESTE COM AUDÉO S SMART V BILATERAL\nData: 13/06/2012\nHora: 17:36:07\nFono: Tanara\nAssunto: Paciente veio com a esposa Jair encaminhadp pelo Dr. kowalski. Feito audiometria e teste com Audéo S Smart V bilateral. Paciente gostou bastante e levou para casa. Passei R$: 15.000,00 em 10 de 1.500,00 no carnê, pois não tem cheque e nem cartão.\n---------------------------------------------------------\nData: 14/06/2012\nHora: 17:37:43\nFono: Tanara\nAssunto: Paciente veio devolver falando que não tem condições de comprar aparelhos agora e vai esperar. Paciente é meio enrrolado só queria fazer no carnê.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 16:43:29\nAssunto: Suzan - Não atende.\n', 0, '', '', '2012-01-01'),
(454, '', 'Leticia ', 'Kowalski', '', 'DIA: 23/11/2011 NÃO QUER SABER DE APARELHO.\nData: 05/06/2012\nHora: 14:26:27\nAssunto: Suzan - Falei com esposa do Sr. José sobre orçamento no final de 2011. Ela disse que ele ainda não comprou aparelho pq achou muito caro. Falei que o motivo do contato é sobre promoções. Passei por R$2.800,00. Ela vai conversar com o marido.\n', 0, '', '', '2012-01-01'),
