(456, '', 'Leticia ', '', '', 'Data: 29/05/2012\nHora: 14:25:37\nAssunto: Suzan - Cadastro atualizado para mandar carta do open.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 16:49:41\nAssunto: Suzan - So na segunda feira.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 15:27:31\nAssunto: Suzan - Sr. José Erico disse que trabalha com vendas. E na semana do Open vai trabalhar nos ingleses. Vai tentar vir para o Open, so que sem marcar horario.\n---------------------------------------------------------\nData: 17/05/2013\nHora: 15:16:57\nAssunto: Fran - Paciente veio com queixa que a pilha esta ruim, que coloca e não funciona. Olhei, e Microtubo estava entupido. Orientei o paciente e tudo OK. Quer receber carta com promoções.', 0, '', '', '2012-01-01'),
