(458, '', 'Leticia ', '', 'FILHA TÂNIA SEMPRE ACOMPANHA O PAINAS CONSULTAS E ESCREVE TUDO O QUE FALAMOS.', 'DIA: 17/03/2008 COMPROU BERNAFON C15 OE PILHA 13\nOE: 1164338\nR$: 2.500,00 À VISTA \n23.11.2012 comprou 1 aparelho audeo smart S IX por 8.500,00 em 2 x entrada 4.500,00  e 1 x 4.000,00 24.12.12  receptor n 01 oliva aberta\nData: 16/12/2009\nDébora: Pegou ap. feito revisão e limpeza. Pago R$65,00.\n---------------------------------------------------------\nData: 23/04/2012\nHora: 08:38:49\nFono: Tanara\nAssunto: Paciente veio com a filha Tânia para fazer audiometria e teste. Paciente fala bastante e tem muitas dúvidas a filha também. Fiquei no atendimento das 15:00 até as 17:30 h. Levou o Audéo Smart IX bilateral para fazer teste com casa. Se observar que realmente teve uma melhora nas queixas irá comprar. Tem sensibilidade para sons altos. Virá na sexta para o retorno de teste.\n---------------------------------------------------------\nData: 11/9/2012\nHora: 13:44:44\nAssunto: Suzan - Confirmado endereço com a filha Tânia para mandar carta do Open.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 11:13:06\nAssunto: Suzan - Tania vai falar com Sr. José  para vir na segunda feira dia 5/11 no Open.\n---------------------------------------------------------\nData: 13/11/2012\nHora: 10:26:13\nAssunto: EM TESTE COM AUDEO S SMART IX\n---------------------------------------------------------\nData: 03/12/2012\nHora: 16:38:40\nAssunto: FRANCINE - PROGRAMA DE ACOMPANHAMENTO - LEVOU 3 CARTELAS PILHA 312. FEITA AUDIOMETRIA E NOVA REULAGEM. FICOU BOM. RELATEI DA IMPORTANCIA DE USAR 2 AASIS. REFERE QUE TEM PA TOTAL NO OE.\n---------------------------------------------------------\nData: 03/12/2012\nHora: 16:49:38\nAssunto: AUDIOMETRIA: OD: 30 35 45 55 60 65 65 75\n---------------------------------------------------------\nData: 06/02/2013\nHora: 10:44:15\nAssunto: Suzan - Veio fazer o molde com a Joice e não efetuou pagamento. Vai deixar