(473, 'HU', 'Leticia ', '', '', 'USA AP. WIDEX B11 231974\nDIA: 13/01/2011 COMPRA CERTENA MICRO OD PILHA 13\nOD: 1017X0694\nR$: 3.700,00 ENT. 400,00 MAIS 10X DE 330,00 EM BOLETO\n02 ANOS DE GARANTIA.\nNF: 316291 DATA: 25/06/2010\nData: 30/06/2010\nHora: 16:26:40\nMichelle:Paciente deixou aparelho para fazer orçamento aparelho esta mudo (OS AUDIOZOOM 1170)\n---------------------------------------------------------\nData: 06/07/2010\nDébora: Orçamento: Apenas revisão e limpeza R$100,00.\n---------------------------------------------------------\nData: 03/08/2010\nHora: 14:02:38\nMichelle: Paciente retirou aparelho. Pago R$100,00.\n---------------------------------------------------------\nData: 25/8/2010\nHora: 14:36:18\nMichelle: Paciente deixou aparelho para fazer orçamento aparelho esta mudo (OS AUDIOZOOM 1287).\n---------------------------------------------------------\nData: 31/08/2010\nDébora: Orçamento: troca de microfone R$490,00.\n---------------------------------------------------------\nData: 03/09/2010\nHora: 14:51:48\nMichelle: Paciente retirou aparelho. Pago R$390,00 descontado R$100,00 da revisão.\n---------------------------------------------------------\nData: 13/01/2011\nHora: 10:09:16\nFono: Tanara\nMichelle: Paciente deixou aparelho pois esta mudo modelo b11 n° 231974 (OS AUDIOZOOM 1423). Paciente não deixou mais o aparelho para o conserto pois comprou um na OD. Deu R$: 200,00 de entrada e dará mais 200,00 dia: 27/01. Levou Naída III SP. Falei que o aparelho ia sai 400,00 de entrada mais 10x de 330,00. Verificar com o Duarte o melhor aparelho para a paciente.\n---------------------------------------------------------\nData: 24/01/2011\nHora: 09:41:23\nFono: Tanara\nAssunto: Paciente veio para o retorno e fiz a troca dos aparelho. Coloquei o Certena Micro na OD pelo preço de R$: 3.700,00. Entreguei o contrato com 02 anos de garantia. Fiz o pré-molde de silicone meia concha escavada com 1 mm de ventilação. Vem amanhã as 08:00 horas.\n---------------------------------------------------------\nData: 25/01/2011\nHora: 18:46:42\nFono: Tanara\nAssunto: Paciente veio buscar o molde ok. Marquei o retorno dia: 12/04/2011 para a 2 visita.\n---------------------------------------------------------\nData: 12/04/2011\nHora: 13:14:26\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes e feito o gerenciador de microfonia ok. Marcado a 3 visita dia: 15/07.\n---------------------------------------------------------\nData: 06/06/2011\nHora: 12:44:08\nMichelle: Paciente pagou a 5° parcela do aparelho auditivo\n---------------------------------------------------------\nData: 30/06/2011\nHora: 10:31:21\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e feito um pré-molde da orelha esquerda pois o molde não estava mais encaixando e o aparelho estava apitando. Molde de silicone cor da pele, concha escavada sem ventilação. Vai pagar os R$: 65,00 no carne no mês que vem. Pagou a prestação do seu aparelho adiantado.\n---------------------------------------------------------\nData: 01/07/2011\nHora: 13:35:23\nFono: Tanara\nAssunto: Paciente veio retirar o molde ficou devendo R$: 65,00.\n---------------------------------------------------------\nData: 10/08/2011\nHora: 10:59:22\nMichelle: Paciente pagou 65,00 reais do molde.\n---------------------------------------------------------\nData: 17/01/2012\nHora: 13:31:23\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Entregue os brindes e orientei para fazer o aparelho em junho para a revisão antes que termine a garantia. Marquei a 5 visita para julho. Foi trocado a manguerinha do lado direito.\n---------------------------------------------------------\nData: 13/07/2012\nHora: 09:29:23\nFono: Tanara\nAssunto: Paciente veio para a 5 visita. Entregue os brindes e deixou o aparelho para a revisão e limpeza na garantia Certena Micro OD 1017X0694.\n---------------------------------------------------------\nData: 20/07/2012\nHora: 16:27:20\nFono: Tanara\nAssunto: Liguei e falei com a Zilma que o aparelho já chegou de S.P.\n---------------------------------------------------------\nData: 27/07/2012\nHora: 14:15:21\nFono: Tanara\nMirella: Seu neto veio buscar o aasi, e devolveu o outro que estava de empréstimo Extra 211 AZ.\n---------------------------------------------------------\nData: 03/01/2013\nHora: 17:43:09\nAssunto: Suzan - Deixou aparelho para revisão. OS:2778. Garantia vai ate 13/01/2013.\n---------------------------------------------------------\nData: 17/01/2013\nHora: 14:36:50\nAssunto: Suzan - Veio buscar aparelho, estava na garantia ate 13/01/2013. OS: 2778.\nFIZ  ULTIMO PROGRAMA DE ACOMPAHAMENTO, TROQUEI MANGUEIRINHA, ENTREGUEIM 6 CARTLEAS DE PILHA 13, CX DE DESUMIDIFICADOR E CX DE PASTILHA DE LIMPEZA. FALEI DA IMPORTÂNCIA DE FAZER MOLDE NOVO NAS PROXIMA CONSULTA SE PRECISAR VIR.', 0, '', '', '2012-01-01'),
