(482, 'ficou sabento da loja através de mala-direta 9102-', 'Leticia ', '', '', 'Data: 20/07/2009\nKELLEN: LIGAR AS 12:00H\n---------------------------------------------------------\nData: 29/07/2010\nDébora: Paciente deixou ap. Oticon GO ITE com flange solta para orçamento.\n---------------------------------------------------------\nData: 06/08/2010\nDébora: Feito revisão e limpeza. R$100,00.\n---------------------------------------------------------\nData: 06/08/2010\nDébora: Esteve na clínica para buscar seu aparelho e comprou 01 cartela de pilhas phonak 13. Pago R$118,00.\n---------------------------------------------------------\nData: 22/11/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 26/11/2010\nDébora: PAciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 13:47:54\nFono: Tanara\nAssunto: Paciente veio para regular o aparelho da OD. Fiz aumento de ganho ok. O aparelho da OE Bernafon 33 estava descolado. Jaimar colou na garantia pois em novembro já tinha feito esse serviço. Colocou um fio de naylon para solucionar o problema de vez.\n---------------------------------------------------------\nData: 21/02/2011\nHora: 13:13:35\nFono: Tanara\nAssunto: Paciente veio pagar a parcela de seu aparelho auditivo\n---------------------------------------------------------\nData: 18/03/2011\nHora: 12:33:36\nFono: Tanara\nAssunto: Aline esposa do paciente ligou falando que esta devendo 1 parcela no valor de R$: 390,00 e vem pagar dia: 01/04\n---------------------------------------------------------\nData: 29/06/2011\nHora: 15:26:36\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento e deixou o aparelho para ir pra fábrica, já que sua garantia termina dia: 13/07/2011. O aparelho esta com o som rachado. Audéo Yes III OD 1010X0CU1.\n---------------------------------------------------------\nData: 11/07/2011\nHora: 09:57:30\nFono: Tanara \nAssunto: Liguei e avisei que o aaprelho já chegou da fábrica. Virá buscar.\n---------------------------------------------------------\nData: 11/07/2011\nHora: 14:07:28\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 12/01/2012\nHora: 12:09:35\nFono: Tanara\nAssunto: Paciente veio para a 5 visita, entregue os brindes. Tem Audéo Yes III na OD que esta ótimo e um Intra 33 velho na OE que parou de fincionar. Falei que o aparelho esta mudo e que não vale a pena arrumar. Passei o valor de um aparelho novo igual da OD R$: 3.200,00 em 10x. Ficou de pensar e retornará.\nPACIENTE FEZ ULTIMA VISITA DO PROGRAMA DE ACOMPANHAMENTO NESTA DATA COM A FGA. JOICE NA PALHOÇA.\n\nDIA: 13/07/2010 COMPROU AUDÉO YES III OE PILHA 312 \nOE: 1010XCU1\nR$: 3.906,30 ENT. R$: 390,63 MAIS 9X DE R$: 390,63 NO CARNÊ \n01 ANO DE GARANTIA\nNF: 308875 DATA: 30/04/2010 ficou sabento da loja através de mala-direta 9102-', 0, '', '', '2010-07-13'),
(483, 'internet', 'Leticia ', '', '', '---------------------------------------------------------\nData: 30/07/2012\nHora: 15:07:36\nAssunto: Suzan - Liguei referente ao orçamento. Ninguem atendeu.\n---------------------------------------------------------\nData: 30/07/2012\nHora: 15:36:14\nAssunto: Suzan - Falei com Sr. Leandro sobre o orçamento feito dia 02/03/2012. Ele disse que comprou aparelho de um conhecido. Mas não teve resultado. Marcado retorno para dia 02/08 quinta feira as 11:00.\n---------------------------------------------------------\nData: 14/08/2012\nHora: 16:50:51\nFono: Tanara\nAssunto: Liguei e o paciente esta muito interessado em ver os novos aparelhos, mas ele esta trabalhando das 8 até as 19 horas. Falei que assim que ele tiver um tempinho vir até a Audiozoom.\n---------------------------------------------------------\nData: 20/03/2013\nHora: 17:16:28\nFRANCINE: LIGUEI E O PACIENTE SE MOSTROU MUITO INTERESSADO EM VER AASI NOVO. MARCOU PARA PROXIMA 4ª-FEIRA DIA 27/03 AS 17:00.\n\nDIA: 02/03/2012 TESTE COM NAÍDA III UP OD internet\n', 0, '', '', '2012-03-02'),
(484, 'CONHECIDO INDICOU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 06/01/2012\nHora: 13:41:53\nFono: Tanara\nAssunto: Paciente veio com seu marido Rudinei indicado por um paciente que compra pilha aqui. Fiz a audiometria porém a perda auditiva é muito grande tendo somente as frequências de 250, 500 e 1.000 Hz presentes. Paciente faz leitura labial e não tem condições de colocar aparelho. Expliquei que a perda é grande e não tem mais estímulos. O marido falou que os médicos também falaram isso e não tem nada para se fazer.\n', 0, '', '', '2012-01-06'),
