(485, 'OTOVIDA', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/01/2012\nHora: 17:44:49\nFono: Tanara\nAssunto: O motorista Vando deixou o aparelho para fazer um orçamento. Solo 311 dSC 067X19540.\n---------------------------------------------------------\nData: 31/01/2012\nHora: 14:28:36\nFono: Tanara\nAssunto: Liguei e falei com a esposa que o custo do aparelho é R$: 1.200,00. Vai dar a resposta se autoriza ou não na segunda-feira.\nAPARELHO AUDITIVO ARGOSY SOLO 311 dSC \n067X19540', 0, '', '', '2012-01-01'),
(486, '21/08/2006', 'Leticia ', '', '', 'Data: 20/05/2009\nDébora: Liguei e falei com a esposa. Referiu que o Sr. Leo não está usando o ap. há 2 anos e ficou interessada na troca por um ap. mais moderno. Irá conversar com seu esposo para agendar um horário.\n---------------------------------------------------------\nData: 15/12/2011\nHora: 10:20:10\nFono: Tanara\nAssunto: Paceinte veio com sua esposa trazendo um aparelho velho da Bernafon OD. Expliquei que esse aparelho esta velho e não tem mais conserto. Fiz uma audiometria e testei Audéo Smart V bilateral. Gostou bastante e fechou a venda em R$: 10.000,00 a vista em cheque. Marcado retorno de venda dia: 20/12.\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:35:20\nFono: Tanara\nAssunto: Paciente veio com sua esposa para a 1 visita. Entregue os brindes. Paciente esta com dificuldade para colcoar os aparelhos. Marcamos retorno dentro de 15 dias.\n---------------------------------------------------------\nData: 18/01/2012\nHora: 13:07:25\nFono: Tanara\nAssunto: Paciente veio com esposa relatando que não esta escutando direito. Fiz troca das olivas fechada por power assim vedou mais o conduto auditivo. Aumentei o aaprelho ok. Falou que agora esta escutando bem melhor. Fiquei de ligar na sexta para saber como esta. Qualquer coisa vamos colocar o receptor power.\n\nPaciente retirou brindes 24 pilhas 312, 1 cerustop.', 0, '', '', '2012-01-01'),
(487, '', 'Leticia ', '', '', 'Não foi posivel retirar pré-molde pois a paciente estava com excesso de secreção na OE, quase formando uma rolha. encaminhei para ORL pra fazer remoção e psteiormente voltar aqui. Paciente já deixou o tampão pago (R$120,00).\nPACIENTE RETIROU SEU TAMPÃO.\n17/06/2013 - TAMPÃO BILATERAL - PAGO R$120,00', 0, '', '', '2012-01-01'),
(488, 'fga: cláudia simões', '0', '', '', '---------------------------------------------------------\nData: 04/10/2011\nHora: 10:12:14\nFono: Tanara\nAssunto: Paciente veio encaminhada pela Fga. Cláudia para teste com aparelhos. Feito teste com Audéo Smart III bilateral. Levou para casa e voltará para o retorno.\n---------------------------------------------------------\nData: 09/12/2011\nHora: 11:55:23\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e marcado a 2 visita. esta bem contente com os aparelhos. O exame com a Fga. Cláudia apresentou um resultado muito bom. Quase dentro dos padrões da normalidade.\n---------------------------------------------------------\nData: 09/10/2012\nHora: 11:00:49\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho da OE para a revisão na garantia. Audéo Smart III OE 1102X0D1W.\n---------------------------------------------------------\nData: 15/10/2012\nHora: 15:20:29\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou de S.P.\n---------------------------------------------------------\nData: 17/10/2012\nHora: 09:02:30\nFono: Tanara\nAssunto: suzan - Sra. Leonilda veio buscar aparelho. E deixou o outro para a revisão e limpeza na garantia. Audéo Smart III OD 1113X22T1. Emprestei um aparelho na OD.\n---------------------------------------------------------\nData: 23/10/2012\nHora: 11:38:25\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Vem retirar e devolver o de empréstimo.\n---------------------------------------------------------\nData: 24/10/2012\nHora: 15:51:49\nFono: Tanara\nAssunto: Paciente veio para retirar o aparelho da OD ok. Devoleu o de empréstimo.\n\nDIA: 25/11/2011 COMPROU AUDÉO SMART III PILHA 312\nOD: 1113X22T1 NF: 370.600 DATA: 30/06/2011\nOE: 1102X0D1W NF: 355.407 DATA: 29/03/2011\nR$: 8.100,00 ENT. 810,00 MAIS 9X 810,00 NO CRÉDITO\n01 ANO DE GARANTIA\n-----------------------------------------------------------------------------\n30.10.14\nLidiane: En