(501, '', 'Leticia ', '', '', '11/07/07 COMPROU 01 AP.BERNAFON FLAIR 400 OE PILHA 10\nVALOR R$ 3.950,00 À VISTA COM 1 ANO DE PILHAS JÁ ENTREGUES\nData: 24/03/2009\nKELLEN:DEIXOU APARELHO PRA REVISÃO E 18 PILHAS 10 POWER 114,00 REAIS!\n---------------------------------------------------------\nData: 24/03/2009\nDébora: Retornou à clínica para buscar o aparelho.\n---------------------------------------------------------\nData: 31/07/2009\nTHAIS: ESTEVE NA LOJA E COMPROU 18 PILHAS POWER (10).\n---------------------------------------------------------\nData: 26/08/2010\nDébora: Paciente deixou 01 ap. BERNAFON FLAIR 400 mudo para orçamento.\n---------------------------------------------------------\nData: 01/09/2010\nDébora: Feito revisão e limpeza R$100,00.\n---------------------------------------------------------\nData: 08/10/2010\nDébora: Paciente deixou ap. BERNAFON FLAIR 400 mudo para orçamento.\n---------------------------------------------------------\nData: 15/10/2010\nDébora: Paciente esteve na clínica para retirar aparelho. Feito troca de receptor pago R$390,00.\n---------------------------------------------------------\nData: 13/12/2010\nHora: 09:05:49\nMichelle:Paciente deixou ap. BERNAFON FLAIR 400 pois esta com volume baixo (os audiozoom 1392).\n---------------------------------------------------------\nData: 14/12/2010\nHora: 08:28:33\nMichelle: Paciente retirou aparelho feito programação.\n---------------------------------------------------------\nData: 08/06/2011\nHora: 08:27:26\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho mudo para o conserto. Falei de aparelhos novos mas paciente não quer. Bernafon Intra CIC Flair 400 OE.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 08:28:48\nFono: Tanara\nAssunto: Paciente veio para saber do aparelho. Jaimar analisou e passou o valor de R$: 490,00 receptor. Como paciente já trocou o receptor em outubro o Duarte deu brinde pra ele. Vem buscar amanhã e não vamos cobrar nada.\n---------------------------------------------------------\nData: 20/06/2011\nHora: 09:14:49\nAssunto:CIDA. PACIENTE VEIO NESTA DATA E RETIROU O APARELHO BERNAFON INTRA FLAIR OE. S/N.(OS.1628).\n---------------------------------------------------------\nData: 08/05/2012\nHora: 08:33:53\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho. Expliquei que não tem mais conserto e ofereci o Nano, porém não quer saber. Duarte deu desconto de 2.000,00. Fica R$: 5.000,00 mas paciente não quer. Falei que em junho vamos fazer o open house e falou que vem.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 16:37:29\nAssunto: Suzan - Não atende. Tentar confirmar endereço para mandar convite do OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 15:04:30\nAssunto: Suzan - Não atende.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(502, 'OTOVIDA', 'Leticia ', '', '', 'USA APARELHO ARGOSY NF 26631 19/06/08\nMODELO SOLO T +311 DWDRC\n084X15113\nData: 14/11/2011\nHora: 10:45:10\nMichelle: Motorista deixou aparelho para orçamento MODELO SOLO T +311 DWDRC 084X15113(os audiozoom 2174)\n---------------------------------------------------------\nData: 18/11/2011\nHora: 14:33:53\nFono: Tanara\nAssunto: Liguei e avisei que o custo do conserto é R$: 1.040,00. Achou caro mas ia falar com o marido. Vai ligar na segunda para autorizar ou não.\n---------------------------------------------------------\nData: 28/11/2011\nHora: 16:58:04\nFono: Tanara\nAssunto: paciente ligou e autorizou o conserto. Vai para a fábrica.\n---------------------------------------------------------\nData: 09/12/2011\nHora: 17:34:51\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou vai pagar em 5x de 218,00. R$: 1.040,00 o conserto mais 3 cartelas de pilha número 13. Total R$: 1.090,00 em 5x de 218,00. Vai dar 5 cheques\n---------------------------------------------------------\nData: 19/12/2011\nHora: 11:22:03\nMichelle: Paciente retirou aparelho sem canhoto pois o mesmo ficou com a secretaria de saúde de lages cida autorizou a mesma a retirar pagou 1040,00 em 5x nocheque valor e 218,00 pois levou pilha também, foi trocado no aparelho caixa completa + angulo + controle de volume + amplificador 6 meses de garantia\n---------------------------------------------------------\nData: 15/06/2012\nHora: 14:42:19\nMirella: Pct e seu esposo vieram trocar o cheque ( banco apresentou o cheque com o valor de R$ 2.180,00 sendo o cheque R$ 218,00 desta forma o cheque voltou e o pct veio trocar por um cheque à vista, aproveitou para comprar 18 pilhas 13)\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(503, '', '0', '', 'FALECIDO', 'DIA: 21/12/2011 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1120X0TTV NF: 384.143 DATA: 30/09/2011\nOE: 1041X0GGU NF: 342.544 DATA: 21/12/2010\nR$: 6.000,00 À VISTA EM DEPÓSITO\n01 ANO DE GARANTIA.\n---------------------------------------------------------\nData: 21/12/2011\nHora: 09:06:24\nFono: Tanara\nAssunto: Paciente veio com sua esposa Maria Alice e comprou Audéo Smart\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:07:11\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e aumentado para nível 2 a aclimatização. Marquei um retorno extra dentro de 15 dias. Tem um pouco de dificuldade para deixar o aparelho bem dentro da orelha.\n', 0, '', '', '2012-01-01'),
(504, '', 'Leticia ', '', '', '11/11/2011 COMPROU NAÍDA III SP OE 1125X0LUE PILHA 13\nR$: 4.500,00 ENT. 450,00 MAIS 9X DE 450,00-CHEQUE -1 ANO DE GARANTIA.\n-----\n21/12/2012 GANHOU 2 MILO PLUS MICRO SP- OD: 1238X0L4Y / OE: 1241X072F -PILHA 13\nNF: 452049 - GARANTIA ATÉ 21/12/2013\nData: 31/03/2009\nKELLEN: ESPOSA ESTEVE NA CLINICA, MARIDO FICOU DOENTE FOI TOMAR BANHO E MOLHOU APARELHO, VAI TRAZER SEMANA QUE VEM!\n---------------------------------------------------------\nData: 06/04/2009\nKELLEN: PACTE DEIXOU APARELHO P/ORÇAMENTO! Danavox Amplius nº155PPAGCI.\n---------------------------------------------------------\nData: 09/04/2009\nDébora: Paciente retornou à clínica para buscar o aparelho. Revisão e limpeza R$65,00. Levou uma cartela de pilhas 675 rayovac. Deixou o outro ap. Danavox Amplius nº OD- HH17181 para revisão.\n---------------------------------------------------------\nData: 16/04/2009\nDébora: Paciente esteve na clínica acompanhado da esposa para buscar seu aparelho. Revisão e limpeza R$65,00.\n---------------------------------------------------------\nData: 12/05/2011\nHora: 13:10:35\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho não esta funcionando bem e pagou R$: 150,00 pela Revisão e Limpeza. Jaimar irá verificar e ligaremos, porém não é o aparelho que havia feito o conserto. Liguei e expliquei para Andréia. Será feito um orçamento e verificação.\n---------------------------------------------------------\nData: 08/11/2011\nHora: 13:17:15\nFono: Tanara\nAssunto: Paciente veio com a nora para comprar o aparelho. Estava ontem em Palhoça e Thaisa colocou 1 Certena P na OD. Conversamos e paciente vai comprar o Naída III SP OE por R$: 4.500,00 em 10x de 450,00 no cheque. Vem na sexta para comprar. Fiz o pré-molde para a confecção de molde de acrílico meia concha escavada com 1 mm de ventilação.\n---------------------------------------------------------\nData: 16/11/2011\nHora: 15:22:09\nFono: Tanara\nAssunto: Paciente veio para fazer o