(506, 'FGA FRANCIS SELL', '0', '', '', 'DIA: 27/04/2012 TESTE COM AUDÉO SMART IX BILATERAL\nData: 09/05/2012\nHora: 15:31:11\nMirella: Pct comprou Audéo IX por R$ 5.000,00 ( 10 Cheques de R$ 500,00 cada)\n---------------------------------------------------------\nData: 09/08/2012\nHora: 14:34:34\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Feito regulagem pois falou que estava muito estridente. Marcado retorno para outubro.\n---------------------------------------------------------\nData: 17/12/2012\nHora: 13:51:25\nFRANCINE: Paciente veio com queixa de que a gaveta de pilha estava caindo. Troquei ferrinho que prende a gaveta, e tudo OK. Queixou que aasi estava fraco, aumentei um pouco o volume no iPFG. Saiu satisfeito.\n---------------------------------------------------------\nData: 04/01/2013\nHora: 17:36:40\nAssunto: FRAN: Paciente veio com queixa de estalitos no aparelho - suspeito de problema eletrônico. Fiz leve regulagem e vai testar. Se precisar, trará aasi para enviar para SP, pois esta na garatia.\n---------------------------------------------------------\nData: 08/03/2013\nHora: 09:46:42\nFRAN - REGULAGEM - AUMENTEI 3DB DO GANHO GERAL. FICOU BOM. OK.\n---------------------------------------------------------\n30.10.2014\nLidiane: Entrei em contato com o paciente para revisão porém paciente já fez á uns 15 dias.', 0, '', '', '2012-01-01'),
