(509, 'HU', '0', '', 'PERDEU AASI ORELHA DIREITA.\nTERMINOU PAA', 'APARELHO AUDITIVO PHONAK EXTRA 22 \nOD/OE: 07088272\nDIA: 03/10/2011 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1115X1D4C\nOE: 1115X1D4G\nNF: 370.632 DATA: 30/06/2011\nR$: 7.700,00 ENT. R$: 770,00 MAIS 9X DE R$: 770,00 NO CHEQUE\n01 ANO DE GARANTIA\n---------------------------------------------------------\nData: 19/1/2010\nDébora: Deixou 02 Ap. Phonak Extra 22 L/R nº 07088272. OD- caixa trincada e revisão. OE- apenas revisão e limpeza.\n---------------------------------------------------------\nData: 1/2/2010\nDébora: Ap. veio da fábrica. OE- feito revisão e limpeza OD- revisão e troca de caixa. Total R$590,00.\n---------------------------------------------------------\nData: 03/02/2010\nDébora: Retornou à clínica para buscar os aparelhos. Pago R$590,00 em 3 cheques.\n---------------------------------------------------------\nData: 10/11/2010\nHora: 09:32:23\nMichelle: Paciente deixou aparelho para orçamento modelo extra22 r07088272(os audiozoom 1359).\n---------------------------------------------------------\nData: 10/11/2010\nDébora: Ap. com cera, feito revisão e limpeza. Paciente retirou a ap. e pagou R$100,00.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 10:43:31\nMichelle: Paciente deixou aparelho para revisão limpeza modelo extra22 L07088272(os audiozoom 1454).\n---------------------------------------------------------\nData: 21/01/2011\nHora: 17:27:56\nMichelle: Paciente retirou aparelho feito revisão e limpeza pago 100,00 (os audiozoom 1454).\n---------------------------------------------------------\nData: 16/05/2011\nHora: 17:47:39\nMichelle: Paciente deixou aparelho pois o mesmo esta mudo autorizado por Duarte modelo extra 22 l07088272( os audiozoom 1671). Verificar com cliente se foi feito pagamento via cartão 45,00 reais\n---------------------------------------------------------\nData: 19/05/2011\nHora: 13:26:01\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho 115,00 e comprou uma silica com potinho 66,00. Passou no cartão de crédito em 2x. Total R$: 181,00.\n---------------------------------------------------------\nData: 19/08/2011\nHora: 09:27:09\nFono: Tanara\nAssunto: Duarte conversou e mostrou os aaprelhos de tecnologia nova. paciente gostou e queria testar. Feito uma audiometria e deixado em teste 2 Audéo Smart. Levou para a casa e vai falar com a Fga Cláudia na semana que vem. Levou também o I-com pois achou muito interessante. Virá dia: 29/08 para fazer uma regulagem, pois irá na Fga: Cláudia depois. \nMichelle: Paciente deixou aparelho para orçamento desliga sozinho defeito intermitente MODELO EXTRA 22 N°L07088272(OS AUDIOZOOM 1854). Explicado que o valor para o conserto é de R$: 480,00.\n---------------------------------------------------------\nData: 22/08/2011\nHora: 13:23:23\nFono: Tanara\nAssunto: Paciente veio para regular achou um pouco alto. Feito diminuição do ganho geral. ok.\n---------------------------------------------------------\nData: 25/08/2011\nHora: 12:34:20\nFono: Tanara\nAssunto: Paciente veio para fazer uma regulagem e ir na Fga. Cláudia. ok. Virá amanhã para trazer o resultado.\n---------------------------------------------------------\nData: 26/08/2011\nHora: 12:36:03\nFono: Tanara\nAssunto: Paciente veio com o resultado. Fga Cláudia falou que precisa dar mais ganho nas frequencias agudas na OD. Fiz aumento de ganho e vou fazer o campo livre na terça. E voltará para a cláudia na semana que vem. Vou fazer um relatório da paciente.\n---------------------------------------------------------\nData: 19/09/2011\nHora: 13:09:02\nFono: Tanara\nAssunto: Paciente veio para o retorno. Fga. Cláudia falou que os aparelhos estão ótimos e sugeriu o controle remoto. Feito a regulagem do controle e levou para teste. Duarte autorizou o pagamento do controle depois que terminar de pagar as prestações sendo R$: 1.400,00.\n---------------------------------------------------------\nData: 03/10/2011\nHora: 09:20:33\nFono: Tanara\nAssunto: Paciete veio para a 1 visita. Entregue os brindes falou que adorou o controle remoto, porém não vai levar agora. Diz que mais tarde virá comprar.\nMichelle: Paciente retirou aparelho sem canhoto pois o mesmo foi extraviado Srª Mara Lucia Bedin CPF: 246.027.449-15.\n---------------------------------------------------------\nData: 03/01/2012\nHora: 11:19:53\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregues os brindes e aumentei um pouco o aparelho. Ativei o controle de volume no aparelho e troquei as caixinhas por castanho. Paciente esta bem contente com os aparelhos. Marcado o retorno em abril para a 3 visita.\n---------------------------------------------------------\nData: 30/08/2012\nHora: 10:07:39\nMirella: Pct  veio dixar os aasi para revisão e limpeza, Duarte emprestou outros aasi para a paciente não ficar sem, (Audéo Smart III 1115X104C, 1115X104G).\n---------------------------------------------------------\nData: 25/09/2012\nHora: 11:16:30\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos, porém não sei o dia certo pois ninguem anotou no aplicativo.\n---------------------------------------------------------\nData: 17/01/2013\nHora: 11:26:21\nAssunto: FRAN: regulagem com nova audiometria. Coloquei volume 4 para fazer teste de ganho com Fga Claudia. vai retornar após teste de ganho.\n---------------------------------------------------------\nData: 21/01/2013\nHora: 11:59:48\nAssunto: FRAN: regulagem - baixei para volume 3.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
