(519, 'FGO. DANIEL', 'Leticia ', '', '', '02 AP. PHONAK NAÍDA III SP \nOD- 0844H11P4 / OE- 0844H11P5\nNF: 267107 DATA: 29/04/2009 ATÉ 29/04/2011 \n21/12/2012 - COMPROU 2 NAIDA S CRT IX - OD: 1208H01T3 OE: 1208H01Y4 - PILHA 13\nR$18000,00 - PARCELADO - NF AZ: 7020. GARANTIA 3 ANOS E PROG ACOMP.\nData: 14/04/2009\nDébora: Esteve na clínica com a queixa de que seu ap. estava mudo (molhou na água do mar). Deixou para orçamento Rexton Targa 3p nº OD- AL48782.\n---------------------------------------------------------\nData: 16/04/2009\nDébora: Aparelho Rexton Targa 3p nº OD- AL48782 enviado para fábrica.\n---------------------------------------------------------\nData: 04/05/2009\nDébora: Retornou à clínica para buscar aparelho que não foi autorizado o conserto e devolver o ap. que havia ficado para teste.\n---------------------------------------------------------\nData: 22/02/2010\nDébora: Paciente esteve na clínica e deixou 02 ap. Phonak Naída SP para revisão da garantia.\n---------------------------------------------------------\nData: 22/02/2010\nUsa 2 aparelhos Rexton Targa 3p nº OD- AL48782 / OE-\n14/04/09 Fez teste com aparelho Ambia 411 AZ OD/OE valor unitário R$ 5.000,00 à vista\n---------------------------------------------------------\nData: 22/02/2010\nDÉBORA: Paciente esteve na clínica e deixou 02 ap. PHONAK NAÍDA III SP Nº OD- 0844H11P4 / OE- 0844H11P5 para revisão da garantia.\n---------------------------------------------------------\nData: 04/03/2010\nDébora: Ap. veio da fábrica. Feito troca de ângulo em ambos aparelhos.\n---------------------------------------------------------\nData: 05/03/2010\nDébora: Paciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 17/09/2010\nDébora: Esteve na clínica e comprou uma caixa de pilhas 13 phonak R$160,00; 02 kits protetor de vento naída R$70,00 e 02 ângulos R$70,00.\nPago total R$300,00.\n---------------------------------------------------------\nData: 13/01/2011\nHora: 08:04:54\nFono: Tanara\nAssunto: Paciente veio para fazer novos moldes bilateral, silicone, concha escavada sem ventilação. Deixou o aparelho da OE para revisão pois o aparelho esta com som de TV fora de ar. Naída 0844H11P5. Vai para a fábrica na garantia.\n---------------------------------------------------------\nData: 21/01/2011\nHora: 10:37:16\nFono: Tanara\nAssunto: Ligado para o paciente e conversado com a esposa que seu aparelho já chegou da fábrica. Feito troca do Amplificador, angulo, revisão e limpeza na garantia. Vem buscar a tarde.\n---------------------------------------------------------\nData: 21/01/2011\nHora: 16:04:44\nMichelle: Paciente retirou aparelho e molde de silicone pagou 130,00. Paciente deixou aparelho para revisão e limpeza MODELO NAÍDA II SP OD 0844H11P4(OS AUDIOZOOM 1458).\n---------------------------------------------------------\nData: 04/02/2011\nHora: 09:31:37\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Feito uma nova regulagem bilateral. Paciente gostou bastante e falou que seu irmão quer comrar aparelhos novos. Passei o valor do Naída IX mais sistema FM.\n---------------------------------------------------------\nData: 23/01/2012\nHora: 15:12:04\nFono: Tanara\nAssunto: Deixei de empréstimo 2 Naída V SP.\nMichelle: Paciente deixou aparelho para orçamento modelo naida III SP 0844h11p5 0844h11p4(os audiozoom 2303) e também deixou o aparelho para orçamento modelo prisma 167038 da Marca: Siemens (os audiozoom 2304)\n---------------------------------------------------------\nData: 10/12/2012\nHora: 16:47:09\nAssunto:suzan. paciente esteve na loja e deixou phonak naida III SP  Nº 0844H11P4 . OBS. APARELHO MUDO.\n---------------------------------------------------------\nData: 11/12/2012\nHora: 09:10:27\nMirella: Francine me passou o orçamento para que eu entrasse em contato com o paciente,desta forma entrei em contato falei com sua esposa, informei o valor R$ 1.040,00 (Entrada + 2x cheque ou no cartão de crédito), ela irá conversar com ele hoje e entrará em contato para informar se irá aprovar ou não o conserto.\n---------------------------------------------------------\nData: 11/12/2012\nHora: 09:40:11\nMirella: Sua esposa ligou aprovando o orçamento (1 + 2x), virá trazer a entrada a tarde.\n---------------------------------------------------------\nData: 14/01/2013\nHora: 17:36:02\nAssunto: FRANCINE: Final de dezembro comprou 2 Naida CRT IX. R$18000,00 - parcelado pelo Duarte. Esta em fase de regulagem. Fiz nova regulagem hoje e vai testar.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(520, '', 'Leticia ', 'Kowalski', '', 'DIA: 01/08/2012 TESTE COM AUDÉO SMART III BIALTERAL\n---------------------------------------------------------\nData: 01/08/2012\nHora: 17:36:10\nFono: Tanara\nAssunto: Paciente veio encaminahdo pelo Dr. Kowalski com a audiometria. Feito teste com Audéo Smart III Bilateral. Levou para casa e voltará na sexta para o retorno de teste. Passei os valores de R$: 4.100,00 cada, dando desconto, ficando R$: 3.800,00 cada.\n---------------------------------------------------------\nData: 03/08/2012\nHora: 10:04:52\nFono: Tanara\nAssunto: Paciente veio devolver os aparelhos. Falou que não tem condições de comprar no momento. Vai esperar quem sabe no final do ano. Agora realmente não tem condições. Adorou o atendimento.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 15:50:20\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(521, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/04/2009\nDébora: Esteve na clínica com a queixa de que seu aparelho estava "estralando" e que não estava usando o ap. da OD. Regulei o ap. da OD e diminui o agudo de ambos os aparelhos. Paciente referiu melhora.\n---------------------------------------------------------\n27/11/07    PILHA 13\nComprou 02 aparelhos Bernafon Neo 102  n   OD 103088 / OE 102897 no valor de \nR$ 9.200,00 com um ano de pilhas e um telefone amplificado grátis.', 0, '', '', '2007-11-27'),
(522, '', '0', '', '', '---------------------------------------------------------\nData: 25/11/2009\nDébora: Deixou ap. ITE para orçamento de conserto. Ap. c/ microfonia e chiado.\n---------------------------------------------------------\nData: 26/11/2009\nDébora: Feito revisão, limpeza e troca de flange. Filha pegou ap. pago R$100,00.\n---------------------------------------------------------\nData: 6/1/2010\nGraci: retorno acompanhamento. Aumento do ganho. Esqueceu de trazer programa de acompanhamento. Filha trará amanhã. Vai vir pagar todo mês na loja.\n---------------------------------------------------------\nData: 25/1/2010\nDébora: Esteve na clínica para o 3º acompanhamento. Pagou a 2ª parcela do aparelho.\n---------------------------------------------------------\nData: 24/02/2010\nHora: 17:53:18\nAssunto:cida) filha teve na loja e pagou a 3ª parcela do aparelho auditivo valor R$585,00 reais.\n---------------------------------------------------------\nData: 24/03/2010\nHora: 16:58:21\nMichelle:Filha esteve na loja e pagou a 4° parcela do aparelho auditivo valor 585,00 reais.\n---------------------------------------------------------\nData: 22/04/2010\nHora: 15:54:36\nAssunto:cida. filha teve na loja e pagou 5º parcela do aparelho auditivo valor R$585,00 REAIS .\n---------------------------------------------------------\nData: 25/5/2010\nHora: 17:01:46\nAssunto:CIDA. FILHA ESTEVE NA LOJAE PAGOU 6º PARCELA DO APARELHO AUDITIVO R$585,00 REAIS.\n---------------------------------------------------------\nData: 15/07/2010\nDébora: Orçamento de ap. intra R$1.280,00. Trocar de lado + R$280,00 da caixa. \n---------------------------------------------------------\nData: 13/09/2010\nDébora: Filha esteve na clínica e pagou a 9ª parcela. R$585,00.\n---------------------------------------------------------\nData: 28/09/2010\nHora: 17:22:37\nMichelle: Paciente esteve na clinica e pagou 10° parcela R$585,00\n---------------------------------------------------------\nData: 06/10/2010\nDébora: Ap. veio da fábrica. Feito troca de receptor.\n---------------------------------------------------------\nData: 21/10/2010\nHora: 11:29:59\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 14:13:25\nFono: Tanara\nAssunto: Pciente veio relatando que o aparelho da OD esta dando microfonia. Expliquei como troca o protetor de cera, fiz o gerenciador de microfonia ok. Fiz também o programa de acompanhamento. Falei também sobre aparelho da OE. Diz que virá em abril ou maio fazer o outro lado.\n---------------------------------------------------------\nDIA: 22/12/2009 COMPROU AUDÉO V OD PILHA 312\nOD: 0924X0D85\nR$: 5.852,00 ENT. R$: 585,00 MAIS 9X DE R$: 585,00\nNF: 280.416 DATA: 26/08/2009\n02 ANOS DE GARANTIA                                                                                                   Dia:19/12/2013 COMPROU SMART S IX OD / OE                                                               N° SÉRIE:12280943F6 / 1303H0D69    \n------------------------------------\n15/08/2014 COMPROU AUDE S SMART IX COM 60% DE DESC. NO SEGURO PHONAK PLUS\nVALOR R$ 5.000,00 À VISTA', 0, '', '', '2009-12-22'),
(523, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 05/01/2011\nHora: 11:31:06\nFono: Tanara\nAssunto: Paciente veio com suas filhas para comprar aparelhos. Veio de Palhoça no qual a venda será por lá. Feito uma audiometria e testado Naída III bilateral, sendo que na OD será UP e na OE SP. Paciente ouviu bem e vai comprar por R$: 8.000,00 em 10x, sendo uma entrada mais 9x de R$: 800,00. Virá amanhã buscar os moldes.\n---------------------------------------------------------\nData: 07/01/2011\nHora: 08:12:06\nFono: Tanara\nAssunto: Paciente veio com a sua filha Cristiane e fecharam a venda pelos valores a cima. Paciente irá viajar no domingo entao foi feita a 1 visita. Entregue os brindes e voltará em abril para a 2 visita. Cristiane deu 10 cheques do marido (Gilberto).\n---------------------------------------------------------\nData: 07/01/2011\nHora: 10:18:46\nTanara: Paciente pagou 8000,00 na compra de aparelho auditivos\n---------------------------------------------------------\nData: 04/01/2012\nHora: 08:27:00\nFono: Tanara\nAssunto: A filha Cristiane veio deixar o aparelho para a revisão e limpeza na garantia. Naída UP III OD 1019X10KX.\n---------------------------------------------------------\nData: 12/01/2012\nHora: 15:20:49\nMichelle: Paciente retirou aparelho\n---------------------------------------------------------\nData: 23/01/2012\nHora: 15:30:13\nMichelle: Paciente deixou aparelho para revisão modelo naida III SP 1027x120n(os audiozoom 2305)\n---------------------------------------------------------\nData: 01/08/2012\nHora: 15:27:58\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto, esta fazendo uns ruídos. Naída III UP OD 1019X10KX. Será cobrado R$: 280,00. Feito o programa de acompanhamento da visita 5. Marcado retorno em janeiro.\n---------------------------------------------------------\nData: 09/08/2012\nHora: 15:15:34\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Vai pagar R$: 280,00.\n---------------------------------------------------------\nData: 10/08/2012\nHora: 16:06:20\nAssunto:cida.filha da paciente eteve na loja e retirou ap. phonak naida III CONSERTO VALOR 280,00 REAIS.(PAGOU EM DINHEIRO)\n---------------------------------------------------------\nData: 16/08/2012\nHora: 15:58:02\nFono: Tanara\nAssunto: Paciente veio com o aparelho apitando na OD, era o molde. Tirei um novo pré-molde para a confecção de molde de silicone concha sem ventilação. Será feita uma reposição.\n---------------------------------------------------------\nData: 17/08/2012\nHora: 15:59:37\nFono: Tanara\nAssunto: Levei o molde até o restaurante pois era perto da minha casa ok. Paciente voltará em janeiro de 2013.\n---------------------------------------------------------\nData: 04/01/2013\nHora: 17:35:52\nAssunto: FRAN: Programa de acompanhamento - tudo ok.\nPACIENTE VEIO PEGAR ACESSÓRIOS FOI DADO 18  PILHAS 13, 18 PILHAS 675, 20 PASTILHAS DE LIMPEZA DE MOLDE, 6 CAPSULAS.\npaciente esteve na loja e retirou o aparelho phonak naída up  nº 1019x10kx. valor do conserto 800,00 reais paciente pagou a vista . pct fez pré-molde vai retirar dia 22/05/2014 irá pagar o valor total 150,00 quando retirar.\n\nDIA: 07/01/2011 COMPRA NAÍDA UP OD E NAÍDA SP OE PILHA 675 OD E 13 OE\nOD: 1019X10KX NF: 323041 DATA: 11/08/2010\nOE: 1027X120N NF: 330585 DATA: 29/09/2010\nR$: 8.000,00 ENT. 800,00 MAIS 9X DE 800,00 EM CHEQUE DO GENRO\n02 ANO DE GARANTIA.', 0, '', '', '2011-01-07'),
(524, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/09/2012\nHora: 11:09:08\nAssunto: Suzan - Filha disse que Sr. Lourdes não quer utilizar aparelho.\n---------------------------------------------------------\nDIA: 17/04/2012 TESTE COM AUDÉO SMART III BILATERAL', 0, '', '', '2012-04-17'),
(525, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 08/05/2012\nHora: 14:48:20\nFono: Tanara\nAssunto: Paciente veio com a esposa Zenetilte para saber de preços de aparelhos. Falei que tinha pciente e que vamos fazer apenas a audiometria e amanhã vamos continuar com o atendimento. Feito audio marquei para amanhã as 08:00 h. Paciente tem perda somente nas frequancias de 3, 4, 6 e 8 Hz bilateral.\n---------------------------------------------------------\nData: 09/05/2012\nHora: 14:49:54\nFono: Tanara\nAssunto: Paciente voltou e colocamos o Audéo Smart V bilateral e passei os valores de R$: 14.000,00 em 10x sem juros ou a vista R$: 13.000,00. Levou para casa e vai voltar na terça.\n---------------------------------------------------------\nData: 10/05/2012\nHora: 10:06:38\nFono: Tanara\nAssunto: Liguei para o paciente e diz que esta sentindo algumas melhoras. Falou que bem provavel que compre na segunda, esta gostando bastante.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 16:01:17\nAssunto: Suzan - Confirmado endereço para Open. Não esta utilizando aparelho.\n---------------------------------------------------------\nFalei com a esposa do paciente, D. Zeneditte, e esta informou que o paciente comprou AASI na Teuto por ser mais barato. Coloquei a loja a disposição para pilhas e acessórios.\nDIA: 08/05/2012 TESTE COM APARELHOS AUDÉO SMART V BILATERAL.', 0, '', '', '2012-05-08'),
(526, '', '0', '', '', '---------------------------------------------------------\nData: 28/07/2009\nTHAIS: CADASTRO ATUALIZADO. PACIENTE ESTA DOENTE, MAIS ASSIM Q MELHORAR O ESPOSO TRARA PRA FAZER AVALIAÇÃO.\n---------------------------------------------------------\nData: 03/02/2011\nHora: 08:19:16\nFono: Tanara\nAssunto: Paciente veio com seu marido josé e seu cunhado Diogo no qual comprou 2 Maxx 22 bilateral em 2009 mas nunca se adaptou com os aparelhos. Gostaria de passar para dona Luci. Feito então uma audiometria e orientei, expliquei as tecnologias e que pelo tipo de perda audtiva ficaria melhor o nosso lançamento. Testei Audeo Smart e adorou. fechou a venda ccom R$: 4.000,00 a vista no cheque. Marcado retorno dia: 07/02.\n---------------------------------------------------------\nData: 07/02/2011\nHora: 08:13:47\nFono: Tanara\nAssunto: Paciente veio para o pagamnto. Deu um cheque de R$: 4.000,00 do josé deu marido. Paciente esta com Audeo Smart V, vamos trocar pelo III. Verifiquei excesso de cera na OD e orientei retirar a cera, para assim também fazermos um micro-molde para uma melhor adaptação. Marcado retorno dia: 21/02/2011 para a 1 visita. Tirado nota fiscal.\n---------------------------------------------------------\nData: 02/03/2011\nHora: 13:10:30\nFono: Tanara\nAssunto: Paciente veio com seu marido José. Retirou a cera e fez audiometria e imitanciometria. Perda Neuro. Fiz pré-molde OD para fazer micro-molde e fiz a 1 visita que era dia: 21/02. Marcado a 2 visita dia: 09/05 e assim que chegar o micro-molde ligaremos.\n---------------------------------------------------------\nData: 24/03/2011\nHora: 11:01:45\nFono: Tanara\nAssunto: Liguei e deixei recado com a empregada que a caixinha do aparelho chegou.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 12:50:54\nFono: Tanara\nAssunto: Paciente veio com seu marido José relatando que o aparelho não esta funcioando. Estava com o protetor de cera entupido. expliquei como faz a troca e entreguei 1 kit. Expliquei que a micro-caixa deve estar chegando e pedi desculpas pela demora. Marido irá fazer uma cirurgia dia: 02/05 e qualquer coisa levaria a micro-caixa na casa dela.\n---------------------------------------------------------\nData: 02/06/2011\nHora: 20:02:12\nFono: Tanara\nAssunto: Pacinte veio para buscar a caixinha mas estava com o receptor mudo. Vai novamente para a fábrica.\n----------------------------------------------------------\nData: 10/06/2011\nHora: 15:26:25\nFono: Tanara\nAssunto: Liguei e avisei que a caixinha já chegou. Virá na semana que vem.\n---------------------------------------------------------\nData: 13/06/2011\nHora: 17:29:13\nFono: Tanara\nAssunto: Paciente veio retirar a caixinha ok.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 11:08:56\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e falou que o aparelho da OD esta ótimo não vive mais sem. Estava querendo comprar da OE. Fiz teste e fechou por R$: 3.900,00 a vista. Vem amanhã trazer o dinheiro.\n---------------------------------------------------------\nData: 04/08/2011\nHora: 11:52:32\nFono: Tanara\nAssunto: Paciente veio com seu marido José e trouxe em dinheiro R$: 3.900,00. Feito o contrato e kit de compra. Feito também o pré-molde da OE para a confecção da micro-caixa. Ligaremos quando chega a micro-caixa.\n---------------------------------------------------------\nData: 19/08/2011\nHora: 08:25:35\nFono: Tanara\nAssunto: Paciente veio retirar a micro-caixa Duarte atendeu ok. Duarte falou que os protetores de cera estavam entupidos.\n---------------------------------------------------------\nData: 13/09/2011\nHora: 17:27:32\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OE não esta funcionando. Era apenas o protetor de cera. Feito a troca ok. Expliquei como faz a troca.\n---------------------------------------------------------\nData: 10/11/2011\nHora: 17:06:47\nFono: Tanara\nAssunto: Paciente veio com o aparelho da OE mudo. Deixado para levar para S.P. Audéo Smart III OE 1115X1D4F.\n---------------------------------------------------------\nData: 15/12/2011\nHora: 14:31:47\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Estava na garantia.\n---------------------------------------------------------\nData: 10/12/2012\nHora: 14:32:43\nAssunto: PROG. DE ACOMPANHAMENTO - 5ª visita. levou 1 cartela de pilha 312 e fiz regulagem aasi esquerdo - estava fraco.\n---------------------------------------------------------\nData: 11/12/2012\nHora: 14:56:30\nAssunto: D. Luci veio com a mesma queixa de aparelho fraco da OE. Não esta mais na garantia. E AASI OD esta na garantia. Abertura de OS para OD.\n---------------------------------------------------------\nData: 26/12/2012\nHora: 11:19:04\nFRANCINE: D. Luci veio dia 21/12 para buscar AASI OD que estava na garantia. Tudo OK. Hoje chegou AASI OE, liguei avisando. vai vir buscar amanhã. Valor: R$250,00.\nPaciente retirou brindes 36 pilhas 312, 6 capsulas desumidificadoras.\nDIA: 07/02/2011 COMPRA AUDEO SMART III OD PILHA 312\nOD: 1041X03V5 REC 1\nR$: 4.000,00 À VISTA\nNF: 339652 DATA: 30/11/2010 \nDIA: 04/08/2011 COMPRA AUDÉO SMART III OE\nOE: 1115X1D4F\nNF: 370.632 DATA: 30/06/2011\nR$: 3.900,00 À VIST\n01 ANO DE GARANTIA.\n------------------------------------\n08/10/2014 - Zana\nFoi confeccionado caixa c-shell para OD, solicitado pela fga Letícia. Pcte compareceu para adaptação da c-shell e ajuste, regulei AO pois estava mto alto e OD apresentava chiado. Sentiu bastante melhora, vai testar em casa e ir a missa pra ver como fica... do contrário marcará horário para novo ajuste.\n-----------------------------', 0, '', '', '2011-02-07'),
(527, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 25/10/2012\nHora: 10:34:24\nMichelle: Motorista deixou aparelho para revisão modelo una m az OE:210714H14MK / OD 210714H14NA(OS AUDIOZOOM 2717)\n---------------------------------------------------------\nData: 31/10/2012\nHora: 17:55:00\nFono: Tanara\nAssunto: Os aparelhos chegaram de S.P.\n---------------------------------------------------------\nData: 13/11/2012\nHora: 14:43:23\nMirella: Um senhor veio buscar os aasi, trouxe canhoto.\nUSA APARELHO PHONAK NF 396591 28/12/2011 ATÉ 28/12/2012\nMODELO UNA M AZ\nOE210714H14MK / OD210714H14NA', 0, '', '', '2012-01-01'),
(528, 'PARENTE DO BANCO DO BRASIL', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/04/2011\nHora: 13:19:31\nFono: Tanara\nAssunto: Duarte foi na casa da paciente um dia antes e colocou 2 Audéos Smart III bilateral. Hoje veio para fazer uma audiometria e regulagem melhor os aparelhos. Expliquei a sua perda e paciente gostou bastante de ouvir com os aparelhos. Levou para teste Duarte esta negociando.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 12:38:08\nFono: Tanara\nAssunto: Paciente voltou para o retorno e Duarte fechou a venda da OD com o filho da paciente por R$: 3.500,00 a vista. Aumentamos a aclimatização para o nivel 2 a deixei mais um pouco em teste o aparelho da OE. Voltará em 15 dias. Entreguei o kit de compra com manual e pilhas. Entregar o contrato e a caixinha do aparelho.\n---------------------------------------------------------\nData: 03/06/2011\nHora: 15:01:26\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e falou que esta muito bem adaptada. Passamos para a aclimatização nível 3 e entregou o aparelho da OE pois não sente diferença. Falei que preicsa ser o Naída mas não quis por causa do tamanho.\n---------------------------------------------------------\nData: 24/04/2012\nHora: 11:07:03\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para a revisão e limpeza na garantia. Audéo Smart III OD 1103X0GAH.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 10:16:50\nFono: Tanara\nAssunto: Liguei e avisei o neto que o aparelho já chegou.\n---------------------------------------------------------\nData: 08/05/2012\nHora: 10:29:23\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 21/12/2012\nHora: 08:45:43\nfrancine: retirada de pré-molde para pedido de AMBRA NANO\n---------------------------------------------------------\nData: 11/01/2013\nHora: 17:48:47\nAssunto: FRAN - entrega de AASI - Paciente gostou bastante. Feita adaptação de Smart III para o lado esquerdo - paciente esta escutando e gostou bastante da adaptação.\nPACIENTE DEIXUO APARELHO PARA CONSERTO MODELO AMBRA NANO P12L1738R(OS AUDIOZOOM 2933).\nPACIENTE RETIROU AASI .\nPACIENTE DEIXOU APARELHO AUDEO SMART III PARA CONSERTO, DUARTE FALOU COM WILSON PARA ABONAR O PAGAMENTO, POIS A IRMÃ COMPROU UM PAR DE AUDEO S SMART IX. APARELHO ENVIADO PARA SÃO PAULO.\n25/04/2011 COMPROU AUDÉO SMART III OD PILHA 312\nOE: 1103X0GAH NF: 355.407 R$: 3.500,00 A VISTA - 01 ANO DE GARANTIA.\n11/01/2013 - COMPROU AMBRA NANO - OD: P12L1738R - PILHA 10\nNF: 453491 - ATÉ 04/01/2016', 0, '', '', '2011-04-25'),
(529, '', 'Leticia ', '', '', 'Data: 28/07/2009\nKELLEN:PCTE QUEBROU A PERNA E FICOU UM TEMPO SEM USAR O AP., ESTAVA MSM PENSANDO EM VIR A CLINICA, VAI LIGAR E AGENDAR HORARIO!\n---------------------------------------------------------\nData: 18/08/2010\nHora: 15:45:29\nMichelle: Paciente deixou aparelho para fazer revisão modelo minivaleo 101 az 067x13284,comprou kit micro tubo com 2 haste e 2 oliva + cartela de pilha phonak 10 deve 78,00(os audiozoom 1274).\n---------------------------------------------------------\nData: 20/08/2010\nHora: 15:45:29\nMichelle: Paciente retirou aparelho feito revisão e limpeza 100,00 modelo minivaleo 101 az 067x13284, comprou kit micro tubo com 2 haste e 2 oliva + cartela de pilha phonak 10 pago 78,00 valor pago 178,00 reais(os audiozoom 1274).\n---------------------------------------------------------\nData: 24/04/2013\nCIENTE VEIO PARA COMPRAR PILHA E ACABOU LEVANDO PARA TESTE DOMICILIAR APARELHO AUDEO S SMART III. VALOR: R$8000,00 DANDO AASI USADO COMO PARTE DO PAGAMENTO. NEGOCIAMOS ENTRADA DE R$2000,00 + 6X R$1000,00.\nPaciente retirou brindes 8 cerustop.\n29/08/07 COMPROU 1 AP ARGOSY 211 DAZ MINI VALEO O.E. NO VALOR DE R$ 4.850,00 à vista.                                                                                                               12/06/2013 - COMPROU AUDEO S SMART III - OE: 1206X14U1 - PILHA 312. RECEPTOR STANDARD 2-L. VALOR: R$3800,00 A VISTA. 1 ANO DE GARANTIA E 3 ANOS DE PROGRAMA DE ACOMPANHAMENTO. NF: 423.747 - 29/06/2012.\n', 0, '', '', '2007-08-29'),
(530, 'CLÍNICA DIRCKSEN', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/09/2011\nHora: 09:09:44\nFono: Tanara\nAssunto: Paciente veio encaminhada pelo Dr. Kowalski para teste com aparelhos. Porém a audição esta normal exceto na frequencia de 4 Hz na OD. Encaminhei para a clínica Dircksen para realizar exames mais complementares já que bateu muito forte a cabeça do lado direito em 1993. Relata que tem labirintite.\n---------------------------------------------------------\nDIA: 22/09/2011 PACIENTE VEIO COM AUDIO NORMAL ENCAMINHEI PARA CLÍNICA DIRCKSEN\nDR. KOWALSKI', 0, '', '', '2011-09-22'),
(531, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/01/2011\nHora: 13:55:17\nFono: Tanara\nAssunto: Paciente veio do HU relatando que um aparelho esta alto e o outro baixo. Fiz regulagem e orientei ir no HU. Falou que vai dia: 17/02.\n---------------------------------------------------------\nData: 21/08/2012\nHora: 11:21:08\nAssunto: Suzan - Sr. Ludovico comprou pilha 13, cx de pastilhas e cx de capsula. Deixou um aparelho intra para Duarte verificar se tem conserto.\n---------------------------------------------------------\nData: 30/08/2012\nHora: 13:38:40\nMirella: Orçamento R$ 560,00 aprovado, aasi está em Jaraguá o conserto será efetuado lá.\n---------------------------------------------------------\nData: 05/09/2012\nHora: 10:04:08\nAssunto: Suzan - Sr. Ludovico veio retirar o aparelho R$560,00 enpagou R$250,00. Falta R$310,00\n---------------------------------------------------------\nData: 11/09/2012\nHora: 09:32:12\nAssunto:cida. paciente esteve na loja e pagou o restante do conserto do aparelho auditivo 300,00 REAIS EM DINHEIRO.\nDIA: 30/11/2010 NF: 339864 EXTRA 211 AZ BILATERAL PILHA 13\nOD: 1041X0E3G\nOE: 1041X0E3N\n01 ANO DE GARANTIA.', 0, '', '', '2010-11-30'),
(532, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 21/02/2011\nHora: 11:43:50\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho da OE para arrumar pois esta mudo. Diz que puxou um fio sem querer. Jaimar irá arrumar. Passei o valor de no máximo R$: 280,00. Autorizou, ligaremos quando tiver pronto.\n---------------------------------------------------------\nData: 23/02/2011\nHora: 13:50:26\nFono: Tanara\nAssunto: Paciente veio e deixei em teste 2 Audeo Mini IX para ficar até o outro chegar de S.P. Deixou da OD também para fazer revisão e limpeza.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 09:06:37\nFono: Tanara\nAssunto: Liguei para o paciente e deixei recado no posto de saúde onde trabalha que o aparelho chegou da fábrica. R$: 280,00 vem buscar.\n---------------------------------------------------------\nData: 15/03/2011\nHora: 10:35:58\nMichelle: Paciente retirou aparelho feito troca do microfone gaveta pago 280,00\n---------------------------------------------------------\nData: 25/04/2012\nHora: 16:17:41\nMirella: Pct comprou um Kit Smartguard.\n---------------------------------------------------------\nData: 25/09/2012\nHora: 17:09:32\nFono: Tanara\nAssunto: Paciente veio deixar o seu aparelho da OD para orçamento. Una 11 OD 07097577.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 17:18:11\nAssunto:cida . paciente retirou o aparelho una 11 od. 07097577. orçamento por escrito.\nAP. PHONAK UNA CIC/MC OD/OE N  07097577    PILHA10\nN  NF 276462 EMISSÃO 22/07/09 GARANTIA  ATÉ 22/07/2010 luisamadeo@pop.com.br   hu', 0, '', '', '2012-01-01'),
(533, 'cassi', 'Leticia ', '', '', 'DIA: 19/11/2009 COMPROU MICRO-EXTRA 100 AZ OD PILHA 312\nn   0921X15F3      pilha 312\nValor total R$ 2.800,00 à vista\nGanhou 1 cartela de pilhas\n1 ano de garantia', 0, '', '', '2009-11-19'),
(534, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 21/08/2012\nHora: 16:33:29\nFono: Tanara\nAssunto: Paciente veio com a sua esposa para a 2 visita. Entregues os brindes e marquei o retorno para dia: 10/10/2012. Estava com o protetor de cera entupido e o som baixo. Aumentei para o nível 3 da aclimatização e expliquei como faz a troca dos protetores de cera.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(535, 'FGO: DANIEL', 'Leticia ', '', '', '---------------------------------------------------------\nData: 02/05/2011\nHora: 10:32:47\nFono: Tanara\nAssunto: Paciente veio com sua esposa Milena trazendo um aparelho intra antigo da Bernafon mais de 10 anos. Deixou para orçamento, mesmo sabendo que será muito difícil o conserto. Deixamos em teste 2 Audéo Smart V. Levou para a casa e retornará. Paciente é indicado do Fgo. Daniel que tabalhou com a Phonak.\n---------------------------------------------------------\nData: 04/05/2011\nHora: 10:35:43\nFono: Tanara\nAssunto: Liguei e falei com a Milena. Expliquei que o aparelho não tem conserto. Falou que esta gostando dos aparelhos mas quer dentro da orelha. Ficou de vir. A tarde paciente veio trazendo o outro aparelho da OD. Falou que esta gostando do aparelho e vai comprar primeiramente somente o lado esquerdo. Deixou um Siemens OD intra pra ver o que pode ser feito e retirou o lao esquerdo intra da Bernafon no qual não tem conserto.\n---------------------------------------------------------\nData: 09/05/2011\nHora: 13:05:20\nFono: Tanara\nAssunto: Paciente veio e falei que seu aparelho só ficará pronto dia: 11/05. Fiz pré-molde da OE para a confecção do intra Certena 22 Power. Vai comprar apenas 1 aparelho e quer o outro consertado da Siemens OD. Vai pagar o Certena a vista R$: 3.700,00.\n---------------------------------------------------------\nData: 10/05/2011\nHora: 16:54:50\nFono: Tanara\nAssunto: Liguei para o paciente e falei que não iamos cobrar o conserto se ele compresse o outro lado, mas paciente não quis e perguntou o valor do conserto. Passei o valor de R$: 480,00 sendo o receptor. Autorizou e vem buscar quando eu ligar.\n---------------------------------------------------------\nData: 20/05/2011\nHora: 30:12:31\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho novo. Feito adaptação e marcado a 1 visita. Ligarei quando chegar o aparelho da Siemens. Pagou a vista R$: 3.700,00 em cheque.\n------------------------------------------------------\nData: 30/05/2011\nHora: 11:38:46\nFono: Tanara\nAssunto: Liguei e falei com a esposa Milena. Passei o recado que o aparelho já chegou. Virá a tarde.\n---------------------------------------------------------\nData: 31/05/2011\nHora: 12:19:19\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho da Siemens, porém estava apitando no ouvido. Falei que precisava fazer uma nova caixa de intra e o custo era R$: 290,00. Falou que agora não vai gastar mais com nada. Pagou R$: 490,00 pelo conserto. Falou que o aparelho novo da OE esta bom, porém que mais alto Aumentei um pouco e expliquei que ele esta sentindo a falta do outro ouvido e que seria bom fazer um novo aparelho para OD. Mas no momento não quer. Michelle: Paciente retirou aparelho sem os pois a mesma foi extraviada.\n---------------------------------------------------------\nData: 24/08/2011\nHora: 13:17:07\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da lado direito não esta regulando. Liguei e conversei com o Fgo. Daniel, falou que o ideal seria mandar para S.P para verificar os ganchos já que esta na garantia. Siemens ITC OD.\n---------------------------------------------------------\nData: 13/09/2011\nHora: 10:05:52\nFono: Tanara\nAssunto: Liguei e falei que o seu aparelho da Siemens terá um custo de R$: 800,00 e não vale a pena o conserto. Falou que é para deixar assim sem conserto. Duarte falou que dará desconto de R$: 600,00 por um novo. Valor R$: 3.900,00 menos 600,00 fica R$: 3.300,00 Certena 22. Vou explicar quando ele chegar.\n---------------------------------------------------------\nData: 06/10/2011\nHora: 10:39:55\nFono: Tanara\nAssunto: Liguei e falei com a esposa que o aparelho da Siemens chegou. paciente esta em Chapecó e voltará somente dia: 11/10. Dará o recado.\n---------------------------------------------------------\nData: 28/10/2011\nHora: 17:05:09\nMichelle: Paciente retirou aparelho feito troca do receptor+ faceplate + assistencia técnica pagou 400,00 não tem garantia\n---------------------------------------------------------\nData: 10/05/2012\nHora: 08:34:59\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho na garantia. Quer colocar o fio de Naylon. Certena 22 OE P11E0647L.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 14:23:03\nAssunto: Suzan - Não consigo falar com Sr. Luiz para confirmar endereço do open.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 09:34:28\nFono: Tanara\nAssunto: Paciente veio retirar o aaprelho. Feito regulagem ok, estava na garantia.\nPACIENTE RETIROU APARELHO PAGOU RESTANTE DO CONSERTO 533,36 NÃO TROUXE CANHOTO POIS O MESMO FOI EXTRAVIADO.\nDIA: 20/05/2011 COMPRA CERTENA ITC/HS OE PILHA 312\nOE: P11E0647L\nR$: 3.700,00 À VISTA NO CHEQUE\nNF: 362193 DATA: 17/05/2011 ATÉ 17/05/2012.', 0, '', '', '2011-05-20'),
(536, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 17/02/2009\nFEZ TROCA DE RECEPTOR R$ 380,00 VEM PAGAR EM 19/02\n---------------------------------------------------------\nData: 20/07/2009\nDébora: Deixou ap. AM para troca de caixa. R$255,00\n---------------------------------------------------------\nData: 30/07/2009\nDébora: Esteve na clínica com a queixa de que a caixa do ap. ficou curta e sai da orelha qdo fala e mastiga. Foi tirado nolvo pré-molde para confecção de nova caixa com conduto mais longo.\n---------------------------------------------------------\nData: 04/08/2009\nDébora: Retornou à clínica para buscar aparelho.\n---------------------------------------------------------\nData: 11/08/2009\nDébora: Paciente veio à clínica com a queixa de que a caixa do ap. estava mto comprida e machucando a orelha. Deixou o ap. para diminuir a caixa.\n---------------------------------------------------------\nData: 11/9/2012\nHora: 14:01:47\nAssunto:Suzan - Confirmado endereço para mandar carta do Open. Sr. Luiz me confundio com uma atendente de outro centro auditivo e revelou que comprou aparelho esse mês em outro lugar.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 14:49:49\nAssunto: Suzan - Não atende.\n', 0, '', '', '1956-03-09'),
(537, 'OTOVIDA', '0', '', 'FALECIDOO', 'pACIENTE DEIXOU APARELHO PARA ORÇAMENTO MODELO SOLO T +311 DSC  N°109X14256 (OS AUDIOZOOM 3001) / FRAN: RETIREI PRÉ-MOLDE PARA MOLDE CONCHA ESCAVADA. PAGOU R$40,00 DE ENTRADA.\nPACIENTE VEIO PEGAR O MOLDE. TUDO OK. PAGOU OS R$40,00 RESTANTES. OK.\n12/08/13 - RETIROU PRÉ-MOLDE PARA MOLDE.', 0, '', '', NULL),
(538, '', '0', '', '', '---------------------------------------------------------\nData: 29/05/2012\nHora: 14:32:25\nAssunto: Suzan - Cadastro atualizado para mandar carta do open. Segundo a esposa dele. O paciente ainda não comprou o aparelho.\n---------------------------------------------------------\nDIA: 25/10/2011 FEZ TESTE COM AUDÉO SMART\nDIA:29/05/2012 NÃO ESTA UTILIZANDO APARELHO.\n--------------------------------------------------------------------------------\n30.10.14\nLidiane: Entrei em contato com o paciente para revisão e conhecer nova linha paciente aceitou e agendou horário.', 0, '', '', '0201-10-25'),
