(541, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/02/2009\nDébora: Paciente esteve na loja e comprou três cartelas de pilhas 10 rayovac R$45,00.\n---------------------------------------------------------\nData: 21/09/2011\nHora: 10:59:57\nMichelle: Paciente deixou asparelho pois o mesmo esta mudo bernafon(os audiozoom 1739)\n---------------------------------------------------------\nData: 28/09/2011\nHora: 15:10:13\nFono: Tanara\nAssunto: Liguei para o paciente e falei que o aparelho não tem conserto. Falou que queria saber o que aconteceu. Duarte falou ao telefone com ele e vai mandar o aparelho para o Nerival arrumar e passar o orçamento.\n---------------------------------------------------------\nData: 16/12/2011\nHora: 12:18:22\nMichelle: Paciente retirou aparelho\n---------------------------------------------------------\nData: 09/01/2012\nHora: 15:06:58\nMichelle: Paciente deixou aparelho para verificar aparelho pois o mesmo esta muito baixo (os audiozoom 2248)\n---------------------------------------------------------\nData: 17/01/2012\nHora: 15:59:05\nFono: Tanara\nAssunto: Michely ligou e avisou que o aparelho já chegou de Jaraguá.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 15:58:06\nAssunto: Suzan - Esta viajando so retorna dia 22/06/12. Não vai participar do Open.\n---------------------------------------------------------\nData: 03/07/2012\nHora: 09:17:37\nFono: Tanara\nAssunto: Paciente veio ser atendendo pela Bruna pois estava de férias. Duarte vai fazer OE Nano Ambra para ele. Porém não sabe se vai comprar P12F1418L. Será remontado era do Genésio Rocha.\n---------------------------------------------------------\nData: 07/08/2012\nHora: 17:25:57\nFono: Tanara\nAssunto: paciente veio para buscar o aparelho Nano OE. Porém falou que vai fazer um teste para ver se acostuma. Levou para casa e voltará na quinta.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 15:42:47\nFono: Tanara\nAssunto: Os 2 aparelhos foram para S.P para aumento da ventilação.\nDIA: 04/10/2007 COMPROU BERNAFON NEO 401 OE PILHA 10\nOE: 006082\nR$: 4.200,00 À VISTA\n01 ANO DE GARANTIA\nDIA:   /07/2012 COMPROU AMBRA NANO OE\nOE: P12F1418L\nNF: 423.265 DATA: 27/06/2012 ATÉ 27/06/2015\nR$:\n', 0, '', '', '2007-10-04'),
(542, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 25/05/2012\nHora: 10:16:30\nMirella: Valdir veio comprar 2 kit Smartguard, + 3 cartelas de pilhas 312.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 14:05:34\nFono: Tanara\nAssunto: Paciente veio com seu filho reclamando dos aparelhos antigos. Falei de aparelhos novos e levou para teste até quinta um par de Naída S CRT III. Gostou bastante e vai fechar em R$: 8.280,00 à vista.\nEntregue ao paciente de brinde 36 pilhas 13.\nDIA: 08/02/2008 COMPROU BERNAFON NEO 322 OD E AF 310 OE PILHA 312\nOD: 65803880\nOE: 297108\nR$: 6.700,00 À VISTA\nDIA: 24/09/2012 TESTE COM NAÍDA S CRT III BILATERAL', 0, '', '', '2008-02-08'),
