(548, 'moram próx. a loja', '0', '', 'PACIENTE FALECEU', 'Data: 16/02/2009\nDébora: Paciente esteve na clínica com a queixa de que seu aparelho estava com amplificação baixa. Deixou aparelho COS D AGC A012860.\n---------------------------------------------------------\nData: 19/02/2009\nKellen:adorou o aparelho e fexou a venda comprou 1 ap.OD maxx 22 3.726,00 reais\n---------------------------------------------------------\nData: 16/04/2009\nDébora: Filha da paciente esteve na clínica com a queixa de que o aparelho estava com o som mto baixo. Deixou aparelho COS D AGC A012860 para orçamento.\n---------------------------------------------------------\nData: 17/04/2009\nDébora: Filha veio buscar aparelho. Revisão e limpeza R$65,00.\n---------------------------------------------------------\nData: 18/05/2009\nGracielle: Filha veio pagar parcela maio. R$222,60\n---------------------------------------------------------\nData: 19/06/2009\nDébora: Filha veio pagar parcela junho. R$222,60\n---------------------------------------------------------\nData: 20/07/2009\nTHAIS: FILHA VEIO PAGAR PARCELA DE JULHO. R$ 222,60\n---------------------------------------------------------\nData: 25/08/2009\nHora: 10:09:23\nAssunto:FILHA PAGOU 6ª PARCELA AGOSTO 222,60 (cida)\n---------------------------------------------------------\nData: 16/09/2009\nTHAIS: Pc esteve na loja e pagou a 7ª parcela aparelho.\n---------------------------------------------------------\nData: 16/09/2009\nDébora: Veio à clínica com a queixa de que seu ap. estava com o som mto baixo. Foi aumentado o ganho geral.\n---------------------------------------------------------\nData: 14/10/2009\nDébora: Esteve na clínica com a queixa de que seu ap. estava mto baixo. Foi aumentado o ganho geral.\n---------------------------------------------------------\nData: 18/11/2009\nDébora: Pagou a 9ª parcela do aparelho.\n---------------------------------------------------------\nData: 15/12/2009\nKellen: Filha veio na clinica pegar aparelho da mãe, levou 1 pilha 13 phonak pra testar ap. ficou devendo 3,00 reais !\n---------------------------------------------------------\nData: 14/01/2010\n17/02/2009 Comprou aparelho Argosy OD Maxx 22 nº                     PILHA 312\nValor total: R$ 3.726,00    Entrada de R$ 1.500,00 + 10x de R$ 222,60\n2 anos de garantia\n---------------------------------------------------------\nData: 14/01/2010\nDébora: Foi feito a troca do aparelho Maxx 22. Ap. fraco para a PA. Está usando ap. Phonak Una FS.\n---------------------------------------------------------\n15/12/2009\nPegou ap. Phonak Una FS VC OE n 12094555         pilha 13\nNF 291462  04/12/09   \n----------------------------------------------------------------\n30/05/2014 COMPROU PAR DE CASSIA 312 PETITE ATENDIMENTO DOMICILIAR COM BRUNA VALOR R$4.000,00', 0, '', '', '2012-01-01'),
(549, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 02/12/2011\nHora: 09:55:46\nFono: Tanara\nAssunto: Paciente veio e autorizou o conserto de R$: 624,00 Extra 11 OD 07099561. Não quer saber de aparelho novo e emprestei um Audéo Smart III OD até chegar o dela. Vai pagar os R$: 624,00 em 4x de R$: 156,00. Deu a entrada hoje, falta mais 3x de 156,00.\n---------------------------------------------------------\nData: 06/12/2011\nHora: 09:30:45\nFono: Tanara\nAssunto: Paciente veio devolver o aparelho que estava em teste.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 13:32:54\nFono: Tanara\nAssunto: Paciente veio tazendo os aparelhos para o orçamento. Extra 11 OD/OE 07099561 OD Aparelho Mudo OE Aparelho quebrado. Falei de aparelho novo. Fiz teste com Audéo S Smart III bilateral. R$: 9.400,00 em 10x de R$: 940,00. Duarte fez por R$: 7.400,00 ou 1 aparelho por R$: 3.400,00 em 10x. Ficou de pensar.\n---------------------------------------------------------\nData: 30/11/2012\nHora: 09:52:16\nMirella: Pct veio buscar aasi, Duarte ofereceu R$ 9.000,00 os dois aasi, e ainda irá consetar seus aasi de graça caso ela adquira. Não trouxe canhoto aasinou o termo Phonak Extra 11  OD 07099561, OE 07099561, O orçamento do conserto deu R$ 1.040,00 cada aasi.\n---------------------------------------------------------\nData: 21/01/2013\nHora: 11:44:04\nAssunto: FRAN - Dia 03/12/2012 a filha da paciente deixou aasis na palhoça para conserto. Autorizou somente OD. Pagou na Palhoça. Paciente veio buscar hoje o AASI - tudo OK.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
