(551, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 14/09/2010\nHora: 08:17:22\nMichelle: Paciente deixou aparelho com face plate quebrado para orçamento(os audiozoom 1301).\n---------------------------------------------------------\nData: 21/09/2010\nHora: 08:41:04\nMichelle: Paciente retirou aparelho. Face plate restaurado pago R$290,00.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 16:45:29\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho está Mudo. Jaimar vai tentar arrumar e emprestamos 2 Micro-Eleva semi-novos por R$: 1.500,00 cada.\n---------------------------------------------------------\nData: 15/03/2011\nHora: 13:36:22\nFono: Tanara\nAssunto: Paciente comprou 1 aparelho Micro-Eleva OD. Duarte fez por R$: 1.500,00 em 10x de 150,00 em cheque. Sendo que a entrada ficou para o dia: 15/04. Aparelho semi-novo (era do Ivo).\n---------------------------------------------------------\nData: 22/03/2011\nHora: 13:06:59\nFono: Tanara\nAssunto: Paciente veio para o retorno. Diz que não consegue passar o fio no Micro-Tubo. Troquei de micro-tubo pois estava amassado. Diz que esta escutando bem e retirou o aparelho dele antigo que não funciona.\n---------------------------------------------------------\nData: 12/04/2011\nHora: 13:16:27\nFono: Tanara\nAssunto: Paciente veio relatando que a oliva fica dentro do aparelho auditivo e que já foi 2 vezes no médico para retirar. Feito um pré-molde para a confecção do micro-molde da OD.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 11:57:02\nFono: Tanara\nAssunto: Paciente veio buscar o micro-molde ok.\n---------------------------------------------------------\nData: 21/07/2011\nHora: 13:11:22\nFono: Tanara\nAssunto: Paciente veio relatando que a pilha esta durando 2 horas. Dei para ele 1 cartela da pilha da Phonak para fazer o teste. Ligarei amanhã.\n---------------------------------------------------------\nData: 25/07/2011\nHora: 09:53:54\nFono: Tanara\nAssunto: Paceinte veio deixar o aparelho Mudo para o conserto. Esta na garantia de compra, porém pra fábrica não. A Audiozoom vai pagar R$: 280,00 para o conserto. Vai pra fábrica e ligaremos quando chegar. Micro-Eleva OD 0605H15HR.\n---------------------------------------------------------\nData: 05/08/2011\nHora: 09:32:52\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Devolveu o de emprestimo.\n---------------------------------------------------------\nPACIENTE DEIXOU PARA ORÇAMENTO MODELO MICRO ELEVA  O6D5R15HR(OS AUDIOZOOM 1733)\nUsa Ap. CIC Widex na OE\nDIA: 15/03/2011 COMPROU MICRO-ELEVA OD PILHA 312\nOD: 0605H15HR\nR$: 1.500,00 EM 10X DE 150,00 NO CHEQUE\n01 ANO DE GARANTIA.\nNF: 224456 DATA: 28/12/2007 hu', 0, '', '', '2011-03-15'),
(552, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/06/2012\nHora: 14:58:47\nAssunto: Suzan - Celular desligado.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 14:20:53\nAssunto: Suzan - Confirmado endereço para mandar carta do open.\n---------------------------------------------------------\nData: 16/10/2012\nHora: 16:41:21\nAssunto: Suzan - Sr. Neir disse para ligar mais perto do evento. Usa aparelho mas não é Phonak.\n---------------------------------------------------------\nDIA: 26/03/2010 FEZ TESTE NA CLÍNICA COM AP. AUDEO V OD/OE / questões financeiras', 0, '', '', '2010-03-26'),
(553, 'HU', '0', '', '', 'DIA: 30/05/2012 COMPROU AUDÉO S SMART III OD PILHA 312\nOD: 1206X1F87\nNF: 415.102 DATA: 08/05/2012\nR$: 4.300,00 ENT. 1.433,00 MAIS 2X DE 1.433,00 NO CHEQUE\n01 ANO DE GARANTIA.\n-----------------------------------------------------------------\n28.10.14\nLidiane: Efetuei ligação para paciente para vir fazer revisãoo paciente aceitou porém masrcou para o centro.', 0, '', '', '2012-05-30'),
(554, '', '0', '', '', '---------------------------------------------------------\nData: 01/10/2010\nHora: 16:36:50\nMichelle: Paciente deixou aparelho para revisão está com volume baixo,modelo unison 2 03037986(os audiozoom 1317)\n---------------------------------------------------------\nData: 14/10/2010\nDébora: Paciente esteve na clínica e retirou aparelho antigo e molde novo.\n---------------------------------------------------------\nData: 04/01/2011\nHora: 10:28:21\nFono: Tanara\nAssunto: Paciente veio fazer molde na OD de acrílico, concha escavada com 1 mm de ventilação. Vem buscar amanhã. Falou que perdeu o aparelho Audeo que comprou em outubro. Vai fazer uma cirurgia de cancer e se possível virá para fazer em troca um Intra.\n---------------------------------------------------------\nData: 05/01/2011\nHora: 11:27:42\nFono: Tanara\nAssunto: Paciente veio buscar o molde ok. Pagou R$: 50,00.\n---------------------------------------------------------\nData: 17/02/2011\nHora: 08:48:41\nFono: Tanara\nAssunto: Paciente veio buscar os novos aparelhos ok. Feito regulagem gerenciador de microfonia e paciente retirou toda a cera. Entreguei o programa de acompanhamento com 2 cartelas de pilhas. Duarte recebeu o pagamento de R$: 5.000,00 a vista. Marquei retorno dia: 03/03.\n---------------------------------------------------------\nData: 03/03/2011\nHora: 14:30:54\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e falou que esta super bem adaptado.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 10:43:12\nFono: Tanara\nAssunto: Paciente veio depois de ficar internado por meses. Entreguei os brindes da 2 visita. Marquei a 3 visita.\n---------------------------------------------------------\nData: 29/08/2011\nHora: 17:18:35\nFono: Tanara\nAssunto: Paceinte veio com os aparelhos mudos. vai para a S.P na garantia. Deixei um Náida de empréstimo na OD.\nMichelle: Paciente deixou aparelho pois o mesmo esta mudo modelo extra 22 r02117518 / l02117518(os audiozoom 1884).\n---------------------------------------------------------\nData: 12/09/2011\nHora: 14:13:33\nFono: Tanara\nAssunto: Liguei e avisei o paciente que os aparelhos já chegaram. Virá buscar a tarde. A tarde veio retirar e devolveu o Naída que estava de empréstimo.\n---------------------------------------------------------\nData: 15/09/2011\nHora: 09:49:19\nFono: Tanara\nAssunto: Paciente veio com o filho para comprar o Naída III SP OD. Diz que adorou e Duarte fez por R$: 3.000,00 a vista. Feito o contrato, kit de venda e virá na semana que vem para a 1 visita. Feito pré-molde para a confecção do molde de acrílico, concha escavada com 2,0 mm de ventilação.\n---------------------------------------------------------\nData: 30/09/2011\nHora: 08:56:58\nFono: Tanara\nAssunto: Paciente veio retirar o molde na garantia pois o paciente comprou o aparelho.\n---------------------------------------------------------\nData: 04/01/2012\nHora: 09:37:15\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Porém tem tudo pilhas, silicas e pastilhas. Feito somente a troca da manguerinha e esta tudo certo. Marcado retorno em 6 meses. Irá fazer uma cirurgia na segunda.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 15:25:47\nAssunto: Suzan - Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:50:01\nAssunto: Suzan - Confirmado presença no Open. Pediu para ligar antes para lembrar.\n---------------------------------------------------------\nData: 26/12/2012\nHora: 15:39:46\nFRANCINE: veio somente para trocar mangueirinha. tudo ok.\n---------------------------------------------------------\nData: 21/01/2013\nHora: 15:16:03\nAssunto: FRAN: troquei o angulo e mangueirinha. Pagou R$35,00 pelo angulo.\n---------------------------------------------------------\nData: 28/02/2013\nHora: 17:54:10\ncomprou naida sp III para orelha esquerda, por 2.000,00 reais negociado com duarte em minha sala.\n---------------------------------------------------------\nData: 15/03/2013\nHora: 10:36:50\nAssunto: Joice quem atendeu dia 28/02/2013.\nENTREGUE BRINDES DO PA - FEITA REVISÃO NO APARELHO. TUDO OK. \nDIA: 01/10/2010 AUDÉO YES III OD\nOD: 1010X0CTJ\nR$: 3.300,00\nDIA: 17/02/2011 EXTRA 22\nOD/OE: 02117518\nR$: 5.000,00 A VISTA\nNF: 350118 DATA: 16/02/2011\n----------------------------------------------------------------------------------\n28.10.14\nLidiane; Liguei para paciente para marcar horário porém depende do filho, e irá retornar.', 0, '', '', '2010-10-01'),
