(559, '', 'Leticia ', '', '', 'Paciente veio com aparelho estragado da OE. Ainda usa o Bernafon comprado em 2007. Falei q não tem mais conserto, para vermos um aparelho novo. Falou que vai segurar um tempo com o aparelho da OD e que vem nos próximos meses.\nDuarte falou que vai fazer orçamento para consertar o aparelho. - Bernafon CIC da OE.\nFalei com a nora do paciente que vai passar o valor para o sogro e depois retorna para autorizar ou não. Feito em Jaraguá.\n29/05/07 COMPROU 2 APARELHOS NEO 401 BERNAFON PILHA 10 VALOR R$ 8.000,00 à VISTA COM 1 ANO DE PILHAS GRÁTIS JÁ ENTREGUES', 0, '', '', '2012-01-01'),
(560, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/02/2011\nHora: 11:34:00\nFono: Tanara\nMichelle: Paciente deixou aparelho para orçamento Tanara escutou o aparelho e ele esta funcionando (os audiozoom 1476). Feito uma audiometria e teste com Naída III. Paciente tem apenas perda na OE. Verifiquei cera e orientei retirar. Levou o aparelho para casa e virá depois devolver.\n---------------------------------------------------------\nData: 04/02/2011\nHora: 11:32:49\nFono: Tanara\nAssunto: Seu amigo Cid veio devolver o aparelho. Liguei para o paciente e ele diz que ficou alto pois retirou a cera. Foi pra praia e voltará somento dia: 16/02. Expliquei que seu aparelho é muito velho e não vale a pena arrumar. Virá dia: 16/02 para conversarmos sobre a possibilidade de comprar.\n---------------------------------------------------------\nData: 28/02/2011\nHora: 11:12:27\nMichelle: Paciente retirou aparelho e molde pago 65,00. Foi explicado que o aparelho é muito velho e não vamos fazer conserto dele.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 14:11:53\nAssunto: Suzan - Com os telefones do cadastro, impossivel falar com paciente.\n---------------------------------------------------------\nDIA: 03/02/2011 TESTE COM APARELHO', 0, '', '', '2011-02-03'),
(561, '', 'Leticia ', '', '', 'TESTE C/ AUDIO', 0, '', '', '2012-01-01'),
(562, 'sesc', 'Leticia ', '', '', '---------------------------------------------------------\nData: 02/12/2010\nHora: 14:41:37\nAssunto:01/11/2010 CLIENTE ESTEVE NA LOJA E PAGOU A 5º PARCELA DO APARELHO AUDITIVO VALOR 195,00 REAIS (ATENDENTE DÉBORA )\n---------------------------------------------------------\nData: 02/03/2011\nHora: 14:39:25\nFono: Tanara\nAssunto: Paciente veio relatando que o som não esta muito bom. Fiz regulagem ok.\n---------------------------------------------------------\nData: 04/04/2011\nHora: 13:22:21\nFono: Tanara\nAssunto: Paciente veio pagar a prestação do aparelho auditivo. R$: 195,00 que vence dia: 05/04. Fiz uma limpeza no micro-tubo pois estava entupido.\n---------------------------------------------------------\nData: 05/05/2011\nHora: 13:15:42\nMichelle:Paciente pagou 10° parcela valor 195,00\n---------------------------------------------------------\nData: 05/06/2011\nHora: 13:16:33\nMichelle:Paciente pagou 11° parcela valor 195,00\n---------------------------------------------------------\nData: 22/09/2011\nHora: 09:16:01\nFono: Tanara\nAssunto: Paciente veio relatando que não estava ouvindo bem desde ontem. Estava com a manguerinha com muita água. Orientei para comprar a bombinha e silica. Comprou e após limpeza o aparelho voltou a ficar ótimo. Pagou R$: 52,00 e levou 1 pastilha de molde.\n---------------------------------------------------------\nData: 03/10/2011\nHora: 13:59:07\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para a revisão e limpeza. Vai pagar R$: 100,00 e será feito na Audiozoom pelo Duarte. Vem buscar na quarta. Ambia 411 AZ 0844X1U5A.\nAssunto:cida. cliente pagou a 15\n---------------------------------------------------------\nData: 05/10/2011\nHora: 09:03:54\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho e pagou R$: 100,00. Esqueci de entregar o recibo de R$: 100,00.\n---------------------------------------------------------\nData: 30/04/2012\nHora: 13:59:5\nMirella: Pct veio trocar a mangueirinha, ( Jonathan trocou).\n---------------------------------------------------------\nData: 10/12/2012\nHora: 08:42:03\nAssunto: Suzan - Duarte deu uma cartela de pilha 13.\n\nDIA: 05/08/2010 COMPROU AMBIA 411 AZ OD PILHA 13\nOD: 0844X1U5A\nR$: 3.511,00 ENT. R$: 195,00 MAIS 17X DE R$: 195,00\n01 ANO DE GARANTIA.\nNF: 35146 DATA: 30/12/2008', 0, '', '', '2010-08-05'),
(563, '', 'Leticia ', '', '', 'EM 23/12/04 FEZ ORÇ. AP. AM 152 AGC 2.000,00', 0, '', '', '2012-01-01'),
(564, '', '0', '', '', '---------------------------------------------------------\nData: 25/05/2009\nDébora: Paciente esteve na clínica para buscar as pilhas que ganhou qdo comprou o aparelho. Foi trocado o protetor de cera Smart Guard R$15,00.\n---------------------------------------------------------\nData: 28/12/2009\nHora: 15:25:57\nCris: Deixou aparelho , pois está mudo (Garantia) e levou 1 kit smartGuard + 6 pilhas power 10 - R$ 63,00\n---------------------------------------------------------\nData: 08/1/2010\nDébora: Ap. veio da fábrica. Feito troca de receptor, microfone, face plate, chave de programação, híbrido e capacitor.\n---------------------------------------------------------\nData: 12/1/2010\nDébora: Paciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 06/05/2010\nDébora: Deixou ap. da OE nº642199 para fazer ventilação de alívio.\n---------------------------------------------------------\nData: 24/05/2010\nDébora: Retornou à clínica para buscar aparelho e deixou o da OD para revisão da garantia.\n---------------------------------------------------------\nData: 26/05/2010\nDébora: Esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 14/01/2011\nHora: 09:15:15\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho da OD esta baixo. Feito troca do protetor de cera ok. Verifiquei excesso de cera em ambas as orelhas. Orientei retirar com o Médico Otorrino e depois voltar pois o aparelho da OE sente o som abafado. Expliquei que pode ser a cera.\n---------------------------------------------------------\nData: 10/05/2011\nHora: 10:05:14\nFono: Tanara\nAssunto: Paciente veio relatando que o som esta fraco. Era protetor de cera furado. Fiz a troca ok. Paciente comprou 1 kit de SmartGuard. Pagou R$: 45,00.\n---------------------------------------------------------\nData: 11/07/2011\nHora: 15:25:18\nFono: Tanara\nAssunto: Liguei e deixei recado que o aparelho já chegou da fábrica. Virá buscar.\n---------------------------------------------------------\nData: 12/07/2011\nHora: 11:20:24\nFono: Tanara\nAssunto: Paciente veio para retirar o aparelho. Feito uma nova audiometria e uma nova regulagem ok. Falei que a orelha esquerda teve uma piora e que é necessário trocar de aparelho colocar um mais forte. Falou que quem sabe no final do ano. Michelle: Paciente retirou aparelho feito troca de caixa intra e microfone pago 480,00 reais.\n---------------------------------------------------------\nData: 20/07/2011\nHora: 13:21:28\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho da OE estava apitando. feito o gerenciador de microfonia ok. Duarte conversou sobre a possibilidade de trocar de aparelhos, dando os delas fica...Versata 11 Power por R$: 11.000,00, dando 2.000,00 de entrada mais 9x de 1.000,00. Paciente ficou de pensar até o fim de ano.\n---------------------------------------------------------\nData: 25/05/2012\nHora: 16:58:15\nAssunto: Suzan - Confirmado endereço para mandar OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 15:03:13\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 04/12/2012\nHora: 17:16:54\nAssunto: Francine - 3ª visita prog. de acomp. - levou 8 cartelas pilha 10 e 2 cápsulas desumidifiantes.\n---------------------------------------------------------\nData: 05/02/2013\nHora: 10:09:15\nAssunto: Suzan - Veio buscar do programa de acompanhamento com Duarte. 1cx de desumidificador e 1 kit Cerustop.\n---------------------------------------------------------\nDIA: 14/07/2008 COMPROU VALEO 11 BILATERAL PILHA 10\nOD: 315408\nOE: 315508\nR$: 10.000,00 ENT. 1.000,00 MAIS 9X DE 1.000,00 \n02 ANOS DE GARANTIA \nDIA: 05/06/2012COMPROU SOLANA \nOD: P12F0278R\n-------------------------------------------------------------------------------------\n28.10.14\nLidiane: Tentei contato porém telefone nao existe.', 0, '', '', '2008-07-14'),
(565, 'HU', 'Leticia ', '', '', 'USA APARELHO PHONAK \nMODELO EXTRA 22\nL01071157\n---------------------------------------------------------\nData: 09/12/2011\nHora: 10:09:32\nMichelle: Paciente deixou aparelho pois esta sem base do protetor Tanara verificou aparelho esta funcionando normal MODELO EXTRA 22 L01071157(os audiozoom 2211)\n---------------------------------------------------------\nData: 13/12/2011\nHora: 09:28:57\nFono: Tanara\nAssunto: Liguei e falei com a paciente. Passei o valor de R$: 1.200,00. Não autorizou e falei de aparelho novo. Falou que ia falar com o marido.\n---------------------------------------------------------\nData: 20/12/2011\nHora: 11:35:09\nMichelle: Paciente retirou aparelho não autorizado.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(566, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 26/01/2011\nHora: 17:52:43\nFono: Tanara\nAssunto: Paciente esteve na clínica para fazer teste com aparelhos. Levou para casa 2 Audeos Mini V. Vem até sexta dar a resposta. Duarte esta negociando.\n---------------------------------------------------------\nData: 31/01/2011\nHora: 13:19:58\nFono: Tanara\nAssunto: Paciente veio e fechou a venda com o Duarte. Vai dar R$: 4.000,00 de entrada mais parcelas...Vai viajar e volta dia: 21/02 para colocarmos os Audeos v definitivos. Aumentei para a aclimatização 2.\n---------------------------------------------------------\nData: 21/02/2011\nHora: 13:29:22\nFono: Tanara\nAssunto: Paciente veio para pegar os aparelhos definitivos. Levou o programa de acompanhamento, manual, caixinhas e mais a 1 visita (kit de manutenção e 3 meses de pilha. Marcado dia: 29/04 a 2 visita. Ficou mais 4 parcelas de 2.000,00 para depositar, sendo dia: 04 de cada mês.\n---------------------------------------------------------\nData: 22/03/2011\nHora: 13:03:16\nFono: Tanara\nAssunto: Paciente veio relatando que o som não esta muito bom. Feito aumento da aclimatização e gerenciador de microfonia. Paciente diz que ficou bem melhor. Vai viajar e quando voltar marquei um retorno antes da 2 visita.\n---------------------------------------------------------\nData: 18/04/2011\nHora: 13:48:58\nFono: Tanara\nAssunto: Paciente veio relatando que os aparelhos estão bons. Expliquei como faz a troca do protetor de cera ok.\n---------------------------------------------------------\nData: 29/07/2011\nHora: 20:15:02\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e falou que queria aumentar mais os aparelhos. Fiz uma regulagem e expliquei novamente como faz a troca do protetor de cera ok. Marcado retorno agora somente dia: 31 de janeiro de 2012 para a 4 visita.\n---------------------------------------------------------\nDIA: 31/01/2011 COMPRA AUDEO MINI V BILATERAL PILHA 10\nOD: 1046X1Y34 RECEPTOR 1\nOE: 1049X0ARR\nR$: 12.000,00 ENT. 4.000,00 MAIS 4X DE 2.000,00\nNF: 349.988 DATA: 16/02/2011\n02 ANOS DE GARANTIA.', 0, '', '', '2011-01-31'),
(567, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 25/05/2012\nHora: 17:57:13\nAssunto: Suzan - Cliente reclamou de atendimento e disse que o aparelho nunca prestou. Tanara vai entrar em contato.\n---------------------------------------------------------\n01/10/2008 COMPROU 2 APARELHOS ARGOSY VALEO 11 OD N 481108 / N  481008\nVALOR TOTAL R$ 12.000,00 ENTRADA R$ 6.000,00 + 1x de R$ 6.000,00\n2 ANOS DE GARANTIA\n1 ANO DE PILHAS  GRÁTIS 02/10/2008 ENTREGUE 30 PILHAS\n1 DESUMIDIFICADOR\n', 0, '', '', '2008-10-01'),
(568, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 31/01/2011\nHora: 13:26:00\nFono: Tanara\nAssunto: Paciente veio com sua filha Cleide para saber preços de aparelhos auditivos. Trouxe a audiometria e fiz teste com Audeo Yes bilateral. Paciente gostou bastante e levou para casa. Virá na quarta dar a resposta. Passei o valor de R$: 8.000,00 os 2 aparelhos.\n---------------------------------------------------------\nData: 10/02/2011\nHora: 16:19:53\nFono: Tanara\nAssunto: Paciente veio com sua filha Cleide para comprar o aparelho. feito regulagem e dará 500,00 em depósito mais 6.700,00 dia: 15/02 em depósito também. Tirei pré-molde bilateral para a confecção do micro-molde pois o paciente tem dificuldade para colocar. Ligarei quando chegar. Entregue manual, caixinha e 2 cartelas de pilhas.\n---------------------------------------------------------\nData: 17/02/2011\nHora: 10:26:44\nFono: Tanara\nAssunto: Cleide veio pagar os aparelhos. Fez em 10x no cartão de crédito. Marquei retorno dia: 03/03 para a 1 visita. Feito aumento da aclimatização para o nivel 3. Vamos colcoar o Micro-Molde.\n---------------------------------------------------------\nData: 22/02/2011\nHora: 16:41:17\nFono: Tanara\nAssunto: Paciente veio com a filha Fátima para buscar a caixinha do aparelho, porém achou ruim o som e se adaptou bem com as olivas. Deixamos então as olivas. Virá dia: 03/03 para a 2 visita.\n---------------------------------------------------------\nData: 03/03/2011\nHora: 14:35:44\nFono: Tanara\nAssunto: Paciente veio com a filha Fátima para a 1 visita. Entregue os brindes ok e deixamos no nível 4 da aclimatização. Marcado o retorno da 2 visita.\n---------------------------------------------------------\nData: 03/05/2011\nHora: 12:47:38\nFono: Tanara\nAssunto: Paciente veio com a filha para a 2 visita. Diz que esta tudo certo, ouvindo bem, porém acha que poderia ser mais alto. Entreguei os brindes e aumentei a aclimatização para o nivel 4. Ficou ótimo. Marcado o retorno da 3 visita.\n---------------------------------------------------------\nData: 17/08/2011\nHora: 13:09:20\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Diz que esta muito feliz com os aparelhos. Entregues os brindes e marcado o retorno para o ano que vem. Vamos fazer um campo livre.\n---------------------------------------------------------\nPaciente veio para Programa de acompanahemtno. Reclamou de aparelho fraco. Fiz Audiometria in-situ e piorou as frequencias graves. Refiz regulagem e ficou bom. Entreguei os brindes (pilha, cerustop e desumidificador). Falei que a próxima será a ultima visita e propus do paciente pensar em investir em um novo aparelho, com mais recursos e mais potente já como a sua perda de audição está piorando, além de manter o programa de acompanhamento por mais 3 anos. OK\nDIA: 17/02/2011 COMPRA AUDEO YES III BILATERAL PILHA 312\nOD: 1024X09HY RECEPTOR 3\nOE: 1030X0C2C\nR$: 7.800,00 ENT. 780,00 MAIS 9X 780,00 NO CRÉDITO\nNF: 330585 DATA: 29/09/2010\n01 ANO DE GARANTIA', 0, '', '', '2011-02-17'),
(569, 'dr: kowalski', 'Leticia ', '', '', '---------------------------------------------------------\nData: 11/08/2011\nHora: 13:41:28\nFono: Tanara\nAssunto: Paciente veio com a audiometria encaminhado pelo Dr: Kowalski para fazer teste com aparelhos auditivos. Tem uma grande perda mista na OD. Veirifiquei muita cera no conduto da OD e orientei\n---------------------------------------------------------\nData: 18/08/2011\nHora: 13:25:36\nFono: Tanara\nAssunto: Paciente veio para devolver o aaprelho na OD diz que só tem zuada e não esta ouvindo nada. Colocamos o Audéo V na OE e expliquei que tem perda e se a gente não cuidar pode piorar. Vai no Dr. Kowalski e voltará aqui na segunda.\n---------------------------------------------------------\nData: 22/08/2011\nHora: 13:25:59\nFono: Tanara\nAssunto: Paciente voltou relatando que não sente diferença e que tem uns barulhos estranhos. Falou que vai esperar e se piorar a perda vai pensar em colocar aparelho.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 14:39:55\nAssunto: Suzan - Falei com esposa. Disse que Sr. Ocy nao tem interesse em usar aparelho.\nDIA: 11/08/2011 TESTE COM APARELHOS AUDÉO V OE.', 0, '', '', '2011-08-11'),
(570, 'ACHOU NA INTERNET', '0', '', '', '---------------------------------------------------------\nData: 21/06/2011\nHora: 16:29:58\nFono: Tanara\nAssunto: Paciente veio com a nora Sandra para fazer orçamento de aparelho. Foi na Widex e achou aro R$: 3.300,00 cada. Falei que tínhamos por R$: 2.800,00 cada Una 11 intra. Bilateral R$: 5.600,00. Sendo 2.000,00 de entrada mais 9x de 400,00 sem juros no cheque. Paciente achou ótima a prosposta e vai conversar com os filhos para a autorização. Feito pré-molde bilateral e vai ligar amanhã para mandar fazer.\n---------------------------------------------------------\nData: 28/06/2011\nHora: 13:29:27\nFono: Tanara\nAssunto: Paciente veio com a nora Sandra para comprar os Micro-Ambias que era da dona Isaura Wener. Feito regulagem e pagou R$: 1.500,00 mais 1x 1.500,00 no cheque. Vamos dar 1 ano de garantia, 2 cartelas de pilhas e 1 silica.\n---------------------------------------------------------\nData: 04/07/2011\nHora: 13:31:37\nFono: Tanara\nAssunto: Paciente veio com a nora Sandra para o retorno. Feito um aumento da aclimatização pois ela estava achando baixo e colocado também o micro-molde com ventilação de 1 mm ok.\n---------------------------------------------------------\nData: 21/07/2011\nHora: 13:34:05\nFono: Tanara\nAssunto: Paciente veio relatando que o micro-molde da OD esta machucando e OE pouco muito. Jaimar desgastou e fiou ótimo. Diz que não vive mais sem aparelhos. Aumentei para o nível 3 a aclimatização. Expliquei também a limpeza dos aparelhos ok.\n---------------------------------------------------------\nData: 23/01/2012\nHora: 13:52:09\nFono: Tanara\nAssunto: Paciente veio relatando que os micro-moldes estão machucando muito. Coloquei as olivas power de volta. Diz que ficou bem melhor. Marquei retorno em 1 semana.\n---------------------------------------------------------\nData: 30/04/2012\nHora: 10:50:32\nMirella: Pct comprou duas cartelas de pilhas 312.( cartão fidelidade)\n---------------------------------------------------------\nData: 14/05/2012\nHora: 09:50:32\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho na garantia da OE para o conserto, esta mudo. Micro-Ambia 100 AZ OE 0844X1RGA. Duarte irá pagar pois para a fábrica terá custo.\n---------------------------------------------------------\nData: 21/05/2012\nHora: 16:41:21\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá buscar amanhã.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 16:44:08\nAssunto:cida. paciente deixou ap.argosy microambia nº0844x100gc.garantia\ne retirou o ap.argosy microambia nº0844x1rga.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 16:19:11\nFono: Tanara\nAssunto: Liguei e deixei avisado que o aparelho já esta pronto.\n---------------------------------------------------------\nNora deixou aparelho para fazer orçamento. OS: 2864. Comprou aparelho conosco em 2011ARGOSY MICRO AMBIA 0844X1RGC.\nDIA: 28/06/2011 COMPROU MICRO-AMBIA BILATERAL PILHA 312\nOD: 0844X1RGC\nOE: 0844X1RGA\nNF: DATA:\nR$: 3.000,00 ENT. 1.500,00 MAIS 1X DE 1.500,00 NO CHEQUE\n01 ANO DE GARANTIA.\n------------------------------------------------------------------------------------\n28.10.12\nLidiane: Entrei em contato para oferecer novos aparelos e revisão do aintigo, porém nora disse que ela ja havia comprado outro em outro lugar.', 0, '', '', '2011-06-28'),
(571, 'PAI DA FGA. TANARA', 'Leticia ', '', '', '---------------------------------------------------------\nData: 25/05/2012\nHora: 10:01:08\nFono: Tanara\nAssunto: Meu pai veio na Audiozoom nesse dia para negociar com o Duarte os Aparelhos Ambra Nano bilateral. Fechou em R$: 7.000,00 a vista devolvendo os aparelhos dele. Audéo Yes IX bilateral OD 0950H08C3 OE 0950H08C2.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 10:03:30\nFono: Tanara\nAssunto: Aparelho chegou, feito regulagem e irei para Lajeado no fim de semana. Irá fazer o depósito de R$: 7.000,00 na conta do Duarte.\n---------------------------------------------------------\nDIA: 11/06/2012 COMPROU AMBRA NANO BILATERAL PILHA 10\nOD: P12E2361L\nOE: P12E2360R\nNF: 419.080 DATA: 31/05/2012 ATÉ 31/05/2015\n03 ANOS DE GARANTIA.\n', 0, '', '', '2012-06-11'),
(572, '', 'Leticia ', '', '', '19/02/2014 - COMPROU DOIS AUDEO S SMART III NS 1345X0WKV/ 1345X0WKW   VALOR DE R$8.500,00                                                                                          FORMA DE PAGAMENTO: ENTRADA DE R$2.000,00 REIAS E 10X R$650,00                     GARANTIA ATÉ 19/02/2015                                      POSSUI PAA', 0, '', '', '2014-02-19'),
(573, '', 'Leticia ', '', '', '31/10/2013 - COMPROU PAR DE AUDÉO S SMART III NS: 1228X0FH1/ 1303X0MGH \nVALOR R$8.0000,00 ENTRADA DE R$3.000,00 + 8X R$625,00 NO CHEQUE\nGARANTIA ATÉ 31/10/2015 \nPROGRAMA DE ACOMPANHAMENTO COM LIVRETO DE 03 ANOS.', 0, 'NEUROSSENSORIAL DE GRAU LEVE À MODERADO', 'NEUROSSENSORIAL DE GRAU LEVE À MODERADO', '2014-10-31'),
(574, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 31/03/2009\n01/12/2008 Comprou aparelho Bernafon MicroPrio 106 nº056580  pilha 312\nValor total R$5.500,00 Entrada de R$ 1.500,00 + 5x de R$ 800,00\n---------------------------------------------------------\nData: 31/03/2009\nDébora: Trocou ap. MicroPrio 106 por um MicroEterna 100dAZ e pagou a diferença. Comprou relógio watchpilot.\n---------------------------------------------------------\nData: 11/05/2009\nGracielle: queixa de que ambiente de reuniões ainda sente dificuldade. Comentei sobre perda na OD que interfere tb. Aumento do nível de experiência para 3.\n---------------------------------------------------------\nData: 9/11/2009\nDébora: Esteve na clínica com a queixa de que o ap. estava com o som estridente. Foi diminuído o ganho nas freq. altas.\n---------------------------------------------------------\nData: 28/04/2010\nDébora: Paciente veio à clínica e deixou ap. MicroEterna 100dAZ nº 0844X1RUA para revisão da garantia.\n---------------------------------------------------------\nData: 05/05/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 06/05/2010\nDébora: Paciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 17/12/2010\nHora: 16:21:19\nFono: Tanara\nAssunto: Paciente veio e tirou o pré-molde para a confecção do aparelho Exélia CIC. Duarte vendeu por 8.000,00, dando 2.000,00 quando chegar o aparelhos e mais 6x de 1.000,00.\n31/03/2009 Comprou aparelho Argosy MicroEterna 100dAZ nº 0844X1RUA  pilha 312\nValor total R$ 9.000,00 Entrada de R$ 4.000,00 + 5x de R$ 1.000,00\n2 anos de garantia\n1 ano de pilhas grátis / levou 2 cartelas\n09/03 LEVOU + 3 CARTELAS PHONAK 312. Quando chegar o aparelho fazer uma nova audometria.\nEntrei em contato telefônico com o paciente para avisar do lançamento do Lyric. Paciente está indo viajar, e quando retornar passa na loja paa conhecer\nDIA: 31/03/2009 COMPROU MICRO-ETERNA OE PILHA 312\nOE: 0844X1RUA\nR$: 9.000,00 ENT. R$: 4.000,00 MAIS 5X DE R$: 1.000,00\n02 ANOS DE \nDIA: 27/12/2010\nCOMPRA DO EXÉLIA ART 11 OE PILHA 10\nOE: 12107557', 0, '', '', '2009-03-31'),
(575, '', 'Leticia ', '', '', 'Padastro da Samanta comprou Naída V Jr por R$ 2.000,00 à vista.', 0, '', '', '2012-01-01'),
(576, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/09/2011\nHora: 13:20:44\nFono: Tanara\nAssunto: Paciente veio com suas filhas para testar aparelho. Veio encaminhada pela paciente Marina Maciel Vieira. Feito audiometria e teste com Audéo Smart V bilateral. Paciente é bastante vaidosa. Tinha muita cera no conduto e orientei retirar no Otorrino. Levou os aparelhos para casa e voltará na quinta sem a cera. Porém sua filha ligou mais tarde falando que só conseguiu médico para terça que vem e depois irá trazer ela na audiozoom.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 14:47:01\nAssunto: Suzan - Falei com filha Necy. Disse que a paciente esta com 101 anos e esta muito complicado para se adaptar. Ja tentou usar aparelhos mas nao conseguiu.\n---------------------------------------------------------\nDIA: 20/09/2011 TESTE COM AUDÉO SMART V BILATERAL', 0, '', '', '2011-09-20'),
(577, '', 'Leticia ', '', '', 'DIA: 25/04/2012 FEZ AUDIOMETRIA NORMAL', 0, '', '', '2012-01-01'),
(578, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 24/04/2009\nGracielle: conversei com paciente. Ainda não está usando. Está na perícia e sem condições de comprar no momento. Falei da promoção das mães e que enviaremos mala direta.\n---------------------------------------------------------\n12/06/08 ESTEVE NA LOJA FEZ EXAME AUDIOLOGICO CREDLIG\nFez teste domiciliar com C15', 0, '', '', '2012-01-01'),
