(580, '', '0', '', 'VIRTO Q50-10NW - 1 ANO DE GARANTIA + 1 ANO DE PILHAS 10 ATÉ 10/11/2015', '06/08/2013 - ORÃ‡AMENTO PARA CASSI - FIZ CASSIA OU AUDEO S SMART III POR R$3800,00 A VISTA CADA.\nPACIENTE COMPROU CASSIA 10. PAGOU R$7600,00 NO CHEQUE PARA 30 DIAS (PARA RECEBER O REEMBOLSO DA CASSI). CF 7682. \n30/08/2013 - COMPROU 2 CASSIA 10 - P13H2695L / P13H2696R - PILHA 10 - NF: 492680 - GARANTIA ATÉ 30/08/2014 - VALOR: R$7600,00 A VISTA NO CHEQUE - 3 ANOS P.A. -   CF 7682.\n------------------------------------------------------------------------------------------------\n10/11/2014 - COMPROU VIRTO Q50-10NW VALOR DE R$9.500,00\n1+9X R$950,00\n11/11/2014 - PACIENTE CANCELOU COMPRA DO APARELHO PARA O LADO ESQUERDO.\nCANCELADA COMPRA ATRAVÉS DA MAQUINA CIELO  DOC:815810\nNOVA VENDA DE VIRTO Q50-10NW PAR AORELHA DIREITA VALOR R$4.950,00 ENTRADA DE R$950,00 + 4X R$1.000,00', 0, '', '', '2012-01-01'),
