(583, 'OTOVIDA', 'Leticia ', '', '', '---------------------------------------------------------\nData: 24/04/2009\nDébora: Motorista deixou 2 aparelhos ARGOSY SOLOT311DSC Nº OD-074X16689 / OE-074X16741 para revisão da garantia.\n---------------------------------------------------------\nData: 04/06/2009\nDébora: Motorista esteve na clínica para buscar os aparelhos.\n---------------------------------------------------------\nData: 9/12/2009\nDébora: Deixou ap. Beltone EZT73-V com caixa quebrada e chiado e Argosy SoloT+ 311 074X16741 mudo para orçamento.\n---------------------------------------------------------\nData: 14/12/2009\nDébora: Ap. Beltone EZT73-V - s/ caixa. Ap. SoloT+ 311 074X16741- revisão, limpeza e troca de caixa R$355,00.\n---------------------------------------------------------\nData: 21/12/2009\nDébora: Motorista pegou aparelho. Pago. R$355,00.\n---------------------------------------------------------\nData: 04/02/2010\nDébora: Motorista deixou ap. com interferência para orçamento. ARGOSY SOLOT+ 311 DSC 074X16741.\n---------------------------------------------------------\nData: 18/02/2010\nDébora: Orçamento: CJ modulo soquete/trimpot/bobina R$472,00.\n---------------------------------------------------------\nData: 09/03/2010\nHora: 16:19:19\nCris:Motorista retirou o aparelho que foi feito o rçamento e não foi autorizado.\n---------------------------------------------------------\nData: 09/12/2010\nHora: 08:50:04\nMichelle: Motorista deixou para fazer orçamento modelo solo t+311 od 074x18689(os audiozoom 1388)\n---------------------------------------------------------\nData: 16/12/2010\nHora: 11:00:17\nMichelle: Motorista retirou aparelho feito troca de caixa + revisão e limpeza R$ 350,00 PAGO.\n---------------------------------------------------------\nData: 27/12/2010\nHora: 11:39:16\nMichelle: Motorista deixou para fazer orçamento modelo solo t+311 od 074x16689(os audiozoom 1409)\n---------------------------------------------------------\nData: 03/01/2011\nHora: 16:39:46\nFono: Tanara\nAssunto: Ligado para o paciente avisando que seu aparelho já esta pronto. Não terá custo pois pagou R$: 350,00 dia: 16/12. Feito apenas uma limpeza, explicar a maneira como limpa, pois a gaveta do aparelho estava com pilha vazada.\n---------------------------------------------------------\nData: 07/01/2011\nHora: 10:43:26\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho. Expliquei para não deixar a pilha dentro do aparelho ok, não teve custo.\n---------------------------------------------------------\nData: 09/05/2011\nHora: 15:05:48\nFono: Tanara\nAssunto: Paciente deixou o aparelho com o Duarte. Esta na garantia, vai para a fábrica. Solo 311 dWDRC.\n---------------------------------------------------------\nData: 19/05/2011\nHora: 10:52:06\nFono: Tanara\nAssunto: Liguei e deixei recado que o aparelho já chegou da fábrica. O motorista virá buscar.\n---------------------------------------------------------\nData: 23/05/2011\nHora: 09:24:09\nMichelle: Motorista retirou aparelho.\n---------------------------------------------------------\nData: 29/06/2011\nHora: 11:31:30\nMichelle: Motorista deixou aparelho para revisão e limpeza MODELO SOLOT+ 311 DWDRC  109X11497(os audiozoom 1957)\n---------------------------------------------------------\nData: 29/06/2011\nHora: 11:33:12\nMichelle: Motorista deixou aparelho pois não funciona SOLOT311DSC Nº OD-074X16689 / OE-074X16741(os audiozoom 1956)\n---------------------------------------------------------\nData: 01/07/2011\nHora: 17:51:19\nFono: Tanara\nAssunto: Liguei e passei o valor do conserto R$: 1.600,00, sendo R$: 800,00 cada. Falou que tem um aparelho que ganhou em janeiro e que esta na garantia. Falei que precisa da NF e data. Vai ligar e passar na semana que vem.\n---------------------------------------------------------\nData: 13/07/2011\nHora: 10:26:34\nMichelle: Motorista retirou aparelho.\n---------------------------------------------------------\nData: 15/07/2011\nHora: 14:18:37\nMichelle: Motorista retirou os aparelhos sem conserto e pagou 21,00 pelo laudo técnico.\n---------------------------------------------------------\nData: 25/08/2011\nHora: 10:18:52\nMichelle: Motorista deixou os aparelhos laudo técnico (os audiozoom 1873)\n---------------------------------------------------------\nData: 14/09/2011\nHora: 15:12:29\nFono: Tanara\nAssunto: O motorista retirou o aparelho junto cm o orçamento. Pagou R$: 21,00. Nao autorizado o conserto de R$: 1.200,00.\n---------------------------------------------------------\nData: 09/11/2011\nHora: 15:53:00\nMichelle:Motorista deixou aparelho modelo solo t 311 dwdrc 109x11497(os audiozoom 2169)\n---------------------------------------------------------\nData: 13/12/2011\nHora: 15:03:21\nMichelle: Motorista Alex Colonetti retirou aparelho\n---------------------------------------------------------\nData: 27/04/2012\nHora: 16:18:31\nAssunto: Suzan - Numero chamado não existe.\n', 0, '', '', '2012-01-01'),
