(585, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 18/08/2009\nDébora: Nguém atende.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 15:02:57\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 15:53:50\nAssunto: Suzan - Confirmado presença no Open. Dia 18/06 as 10:00. Sr. Otávio não tem mais aparelhos foi roubado.\n---------------------------------------------------------\nData: 19/06/2012\nHora: 13:37:29\nFono: Tanara\nAssunto: Paciente comprou Solana Petite bilateral R$: 10.000,00. Fez um depósito de R$: 8.000,00 e fará outro depósito de R$: 2.000,00 quando chegar os aparelhos.\n---------------------------------------------------------\nData: 03/07/2012\nBruna: AASI chegou de SP, liguei para paciente e vem amanhã ás 10:30h. OK\n---------------------------------------------------------\nData: 04/07/2012\nBruna: Veio buscar aparelhos, adaptação OK. Entregue livro do programa de acompanhamento, não fiz contrato pois quer falar com o Duarte para pagar o restante em vezes. Deixou mais R$ 500,00. OK\n--,-------------------------------------------------------\nData: 29/8/2012\nHora: 15:30:02\nMirella:Pct efetuou o pagamento da parcela referente a setembro no valor de R$ 500,00, consultou com o Duarte.\n---------------------------------------------------------\nData: 03/09/2012\nHora: 09:53:30\nMirella: Pct trouxe aasi Solana P12F1412R para conserto, pois o puxador caiu (garantia)\n---------------------------------------------------------\nData: 17/09/2012\nHora: 09:43:00\nMirella: Pct veio buscar aasi, não trouxe canhoto.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 10:52:\n---------------------------------------------------------\nData: 04/10/2012\nHora: 11:12:19\nAssunto:cida.paciente esteve na loja e pagou a parcela do aparelho auditivo valor 500,00 reais .obs. não sei qual o nº da parcela porque no aplicativo está muito confuso.\n---------------------------------------------------------\nData: 18/10/2012\nHora: 16:33:23\nFono: Tanara\nAssunto: Paciente deixou o aparelho para conserto na garantia. Colocou a pilha dentro do aparelho Solana CIC OD P12F1412R.\n---------------------------------------------------------\nData: 26/10/2012\nHora: 14:16:00\nFono: Tanara\nAssunto: Liguei e avisei a filha Lucineia que o aparelho do seu pai já chegou. Dará o recado.\n---------------------------------------------------------\nData: 19/11/2012\nHora: 15:11:27\nMirella: Pct veio buscar aasi, levou 4 cartelas de pilhas 10 + kit cerustop.\n---------------------------------------------------------\nData: 12/03/2013\nHora: 16:48:15\nFRAN - FILHA DO PACIENTE TROUXE AASI POIS NÃO ESTA FUNCIONANDO. TROQUEI CERUSTOP E TUDO OK. DEI AS ORIENTAÇÕES PARA A FILHA.\n---------------------------------------------------------\nData: 14/03/2013\nHora: 17:52:36\nAssunto: Suzan - Deixou aparelho para botar Fio de Nylon. OS: 2846.\nVeio buscar aparelho. Michelle recebeu e esqueceu de anotar no aplicativo. OS:2846\nDIA: 19/06/2012 COMPROU SOLANA 11 BILATERAL PILHA 10\nOD: P12F1412R\nOE: P12F1413L\nNF: 423.794  DATA: 29/06/2012\nR$: 10.000,00 ENT. 8.000,00 MAIS 1X DE 2.000,00\n02 ANOS DE GARANTIA.', 0, '', '', '2012-06-19'),
(586, '', '0', '', 'PILHA 312', '---------------------------------------------------------\nData: 18/08/2009\nDébora: Liguei e falei com a nora sobre a avaliação auditiva. Dará o recado.\n---------------------------------------------------------\nData: 11/01/2010\nDébora: Deixou ap. para conserto.\n---------------------------------------------------------\nData: 12/01/2010\nDébora: Feito revisão, limpeza, troca de flange e base do protetor de cera. Filho veio buscar pago R$170,00.\n---------------------------------------------------------\nData: 11/03/2010\nHora: 18:03:26\nMichelle: Filho retirou aparelho foi feito revisão e limpeza (OS 534 Orçamento) R$ 100,00 revisão e limpeza em setembro não cobrar.\n---------------------------------------------------------\nData: 15/12/2010\nHora: 12:17:39\nMichelle: Filho deixou aparelho para fazer revisão e limpeza. Paciente retirou ap. e levou Audeo Yes III para teste domiciliar. Retirou o aparelho intra da revisão e limpeza, pagou R$: 100,00. Fez pré-molde da OD caso não se adapte com o Audeo Yes III.\n---------------------------------------------------------\nData: 21/12/2010\nHora: 17:32:49\nFono: Tanara\nAssunto: Paciente veio com seu filho Anicaso para fechar a venda. Deu um cheque de R$: 2.200,00 a vista e dará o outro cheque no próximo retorno no início de janeiro de R$: 2.135,00. Paciente ainda vai decidir se vai ficar com Audeo Yes ou vai querer um Intra com o mesmo valor. Entragar o kit de venda com o programa de acompanhamento.\n---------------------------------------------------------\nData: 23/12/2010\nHora: 15:01:25\nFono: Tanara\nAssunto: O filho veio devolver o aparelho pois a paciente quer o Intra. Duarte vai montar aqui na loja o Extra 22 OD. Levou um Audeo V e ligaremos assim que o Intra ficar pronto.\n---------------------------------------------------------\nData: 19/01/2011\nHora: 15:38:34\nFono: Tanara\nAssunto: Paciente veio com seu filho buscar o aparelho. Explicamos que é outra tecnologia. Marcamos a 1 visita para o dia: 02/02. Entregue 3 cartelas de pilhas.\n---------------------------------------------------------\nData: 03/02/2011\nHora: 11:41:28\nFono: Tanara\nAssunto: Paciente veio com seu filho Anicaso para a 1 visita. Esta se adaptando bem falando que esta ouvindo bem melhor. Expliquei o kit de manutenção e uma regulagem, coloquei o supressor de ruído. Marcado o retorno dia: 21/03 para a 2 visita.\n---------------------------------------------------------\nData: 18/01/2011\nMichelle: Paciente ultima parcela pagou 2150,00\n---------------------------------------------------------\nData: 31/03/2011\nHora: 13:35:20\nFono: Tanara\nAssunto: Pqaciente veio com seu filho Sidinei relatando que o aparelho não esta bom. Realamente estava com um chiado. O Jaimar arrumou colocando um receptor novo na garantia.\n---------------------------------------------------------\nData: 01/04/2011\nHora: 13:37:36\nFono: Tanara\nAssunto: Paciente voltou com o mesmo problema. Vai pra fábrica, sendo que a gente vai pagar os R$: 280,00. Paciente ficou com o aparelho antigo dela. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 14/04/2011\nHora: 16:25:15\nFono: Tanara\nAssunto: Liguei e deixei recado que chegou o aparelho.\n---------------------------------------------------------\nData: 06/05/2011\nHora: 10:21:34\nFono: Tanara\nMichelle: Filho Sidney retirou aparelho sem canhoto pois o mesmo foi extraviado. Paciente veio a tarde relatando que o aparelho esta saindo do conduto. Vai para S.P novamente para a troca da cápsula. Vai ser feito uma mais longa.\n---------------------------------------------------------\nData: 19/05/2011\nHora: 17:08:00\nFono: Tanara\nAssunto: Liguei e falei com o filho Sidnei, avisei que o aparelho já chegou. Virá amanhã.\n---------------------------------------------------------\nData: 25/05/2011\nHora: 17:12:11\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 25/08/2011\nHora: 11:16:30\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Feito a 2 e 3 visita ok. Entregues os brindes. Feito troca do protetor de cera e limpeza da ventilação. Expliquei que é importante fazer a limpeza semanal do aparelho. Falei tambem da importancia de colocar um aparelho na OE. Falou que vai esperar.\n---------------------------------------------------------\nData: 13/09/2011\nHora: 17:33:17\nFono: Tanara\nAssunto: Paciente veio com a nora relatando que o aparelho não esta funcionando bem. Era protetor de cera, fiz a troca e orientei ela para retirar a cera do con\n---------------------------------------------------------\nData: 01/12/2011\nHora: 17:57:19\nMichelle:Paciente deixou aparelho para revisão modelo extra 22d r12096547(os audiozoom 2189)\n---------------------------------------------------------\nData: 13/12/2011\nHora: 16:38:45\nFono: Tanara\nAssunto: Liguei para todos os telefones celular e estão desligados. atendeu apenas a empregada da Sonia. Deixei recado que o aparelho da Osvaldina já chegou.\n---------------------------------------------------------\nData: 14/12/2011\nHora: 11:47:13\nFono: Tanara\nAssunto: Paciente veio com seu filho para retirar o aparelho ok.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 17:50:23\nAssunto: Suzan - Falei com Filha (Sonia). Ela me passou o seu endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 11/12/2012\nHora: 11:18:26\nFrancine: Visita de 2 anos (6ª visita) - Fiz limpeza no aparelho, entreguei 2 cartelas de pilha 312, smartguard e 1 caixa de desumidificador (para 1 ano).\n---------------------------------------------------------\nRegulei e entreguei 2 acrtelas de pilha 312. Tudo OK.\n\nDIA: 21/12/2010 VENDA EXTRA 22 OD PILHA 312\nNF: 294158 DATA: 29/12/2009           \nOD: 12096547                \nR$: 4.350,00 ENT. R$: 2.200,00 MAIS UM CHEQUE DE R$: 2.135,00\n01 ANO DE GARANTIA.\n\n\nPACIENTE COMPROU CÁSSIA 312 OD\nVALOR R$5.300,00 À VISTA\nPAA 03 ANOS\nGARANTIA ATÉ 21/03/2015\nNF: 528541\nCF: 8136', 0, '', 'NEUROSSENSORIAL DE GRAU SEVERO', '2010-12-21'),
(587, '', '0', '', '', '---------------------------------------------------------\nData: 27/12/2010\nHora: 08:25:53\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho esta dando uns barulhos. Feito uma regulagem tirando o supressor de ruído ok. Virá em março para a prieira revisão e limpeza.\n---------------------------------------------------------\nData: 18/01/2011\nHora: 09:38:33\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho parou de funcionar de repente e esta com o som baixo. Deixado para o Jaimar verificar se tiver problemas vai para a Fábrica. Emprestei um Audeo IX.\n---------------------------------------------------------\nData: 09/02/2011\nHora: 17:03:41\nFono: Tanara\nAssunto: Liguei e falei que o aparelho já chegou feito revisão, limpeza e troca do angulo. Virá buscar amanhã. Falei com o Duarte e ele falou que Naída III volta 3.000,00 e Naída V volta 5.000,00 na troca.\n---------------------------------------------------------\nData: 10/02/2011\nHora: 08:21:15\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho ok. Expliquei da diferença de preço, mas paciente vai ficar com o dela.\n---------------------------------------------------------\nData: 03/03/2011\nHora: 14:28:40\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho não esta dando mais o ganho de antes. Deixou aqui e vem na segunda para ver como podemos fazer uma negociação. Falei com o Duarte e ele fez por até R$: 2.500,00 a vista ou 3.000,00 em 6x de 500,00 ou 10x de 300,00. Em troca do Ambia leva o Naída.\n---------------------------------------------------------\nData: 17/03/2011\nHora: 14:44:42\nFono: Tanara\nAssunto: Paciente veio buscar seu aparelho e passei as condições a cima. Vai pensar e voltará.\n---------------------------------------------------------\nData: 31/05/2011\nHora: 20:10:02\nFono: Tanara\nAssunto: Paciente veio fazer um novo pré-molde da OE pois o dela esta muito velho. Será feito molde de acrílico concha escavada sem ventilação. Vai pagar R$: 55,00. \n-----------------------------------------------------------\nData: 17/06/2011\nHora: 11:53:26\nAssunto:CIDA LIGUEI PARA A CLIENTE A MESMA FALOU QUE IRÁ BUSCAR O MOLDE DE ACRILICO FEITO NO DIA 31/05/2011.\n---------------------------------------------------------\nData: 21/06/2011\nHora: 09:46:19\nFono: Tanara\nAssunto: Paciente veio retirar o molde e pagou R$: 55,00 no cartão de débito.\n---------------------------------------------------------\nData: 04/07/2011\nHora: 10:09:40\nMichelle: Paciente levou pilha 13 e não pagou.\n---------------------------------------------------------\nData: 19/07/2011\nHora: 10:43:44\nMichelle: Paciente pagou cartela de pilha 13\n---------------------------------------------------------\nData: 25/06/2012\nHora: 15:32:56\nMirella: Pct comprou 3 pilhas 13, deixou aasi para orçamento queixando-se de funcionamento.\n---------------------------------------------------------\nData: 28/06/2012\nHora: 09:53:23\nMirella: Pct veio buscar aasi, Tanara regulou o aasi.\n----------------------------------------------------------------------------------------\n30.10.14\nLidiane: Fiz ligação para paciente para fazer revisão, paciente aceitou e disse que tem que fazer um novo molde.\n', 0, '', '', '2010-09-20'),
(588, '', '0', '', '', '---------------------------------------------------------\nData: 13/01/2011\nHora: 14:01:30\nFono: Tanara\nAssunto: Paciente veio relatando que não esta escutando nada com o aparelho. Fiz aumento de ganho geral da aclimatização e saída máxima ok, porém ao colocar a pilha o aparelhos teve som distorcido. Feito uma audiometria. Verifiquei excesso de cera na OE e orientei retirar. Fiz novamente uma leve regulagem e o som continua distorcido. Emprestei um aparelho e o da paciente vai para a fábrica na garantia.\n---------------------------------------------------------\nData: 19/01/2011\nHora: 13:58:39\nFono: Tanara\nAssunto: Paciente veio não escutando muito bem fiz regulagem e coloquei o mesmo aparelho na outra orelha. Falou que melhorou bastante. Orientei para comprar o outro lado, mas falou que vai esperar terminar de pagar. Vai trazer o velho dela pra arrumar. Emprestei o lado direito.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 13:52:52\nFono: Tanara\nAssunto: Paciente veio com seu aparelho antigo no qual esta funcionando bem. Expliquei que ela deve usar 2 aparelhos para uma melhor compreensão. Quando terminar de pagar o aparelho da OE vai comprar da OD Naída III UP. Quando chegar o aparelho da OE da fábrica ligaremos.\n---------------------------------------------------------\nData: 21/01/2011\nHora: 14:30:28\nFono: Tanara\nAssunto: Aparelho chegou da fábrica, feito apenas revisão e limpeza. Liguei e passei o recado para a irmã. Virá na segunda de manhã.\n---------------------------------------------------------\nData: 24/01/2011\nHora: 18:43:44\nFono: Tanara\nAssunto: Paciente veio para buscar o aparelho ok. Devolveu o que estava emprestado.\n---------------------------------------------------------\nData: 11/04/2011\nHora: 13:21:57\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Diz que não escuta nada. Tentei aumentar mas o aparelho só apita. Deixei como estava e falou que melhorou um pouco. Expliquei que a sua perda é muito grande e que é assim mesmo o aparelho vai ajudar mas não vai resolver o caso. Paciente entendeu e marquei retorno dia: 10/10 para a 4 visita. Não quer comprar nenhum aparelho e o que ela tem em casa só atrapalha.\n---------------------------------------------------------\nData: 12/04/2011\nHora: 13:22:45\nFono: Tanara\nAssunto: Paciente voltou insatisfeita com o aparelho e muito nervosa. Trocamos de aparelho, colocamos um Naída SP III na OE. Ficou feliz e diz que agora não tem mais soada. Conversei com o Duarte e autorizou a troca ok.\n---------------------------------------------------------\nData: 19/04/2011\nHora: 13:05:53\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho so faz soada. Diminui o ganho geral e passei para o nivel 1 da aclimatização. Falou que melhorou. Marquei retorno.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 12:35:44\nFono: Tanara\nAssunto: Paciente veio para a regulagem, falou que melhorou mas ainda sendo a soada. Expliquei novamente que que é assim e que vai melhorando aos poucos. Aumentei um pouco o ganho e diminui os graves. Falou que ficou melhor ainda. Se precisar voltará.\nPACIENTE VEIO COM QUEIXA Q AASI NÃO ESTÁ FUNCIONANDO. NÃO VEIO NA VISITA DE 2 ANOS E 2 ANOS E 6 MESES. TROQUEI MANGUEIRINHA. AASI ESTÁ OK, PORÉM NÃO É ADEQUADO PARA A SUA PERDA. VAMOS TESTAR NAIDA UP. RETIREI PRÉ-MOLDE, POIS NAIDA UP ESTÁ DANDO MICROFONIA COM MOLDE ATUAL.\nDIA: 13/10/2010 COMPROU NAÍDA III SP OE PILHA 13\nOE: 1027X1204\nR$: 5.852,00 ENT. MAIS 9X DE R$: 585,20\n02 ANOS DE GARANTIA.\nNF: 330585 DATA: 29/09/2010\nNF 323041 EMISSÃO 11/8/2010\n----------------------------------------------------------------------------\n30.10.14\nLidiane: Entrei em contato com a paciente para agendar horário porém uma moça disse que não queria agendar.', 0, '', '', '2010-10-13'),
(589, 'internet', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/07/2011\nHora: 15:06:08\nFono: Tanara\nAssunto: Paciente veio com a cuidodora Cida e esposa Rosa para teste com aparelho auditivos. Tem um Intra da Widex que nunca usou pois diz que tinha muito barulho e não conseguia colocar o aparelho. Feito uma audiometria no qual a OD não escuta nada só tem presente em 250 e 500 Hz. Devido uma bomba que explodiu. OE perda moderada e colocamos Audéo Smart III. Paciente ficou muito feliz pois estava ouvido novamente. Fechou a venda em R$: 4.500,00 e 10x se juros. Deu uma entrada de R$: 450,00 no débito e mais 9x de 450,00 no cheque que a sua filha Fátima irá trazer. Marcado retorno na segunda dia: 04/07.\n---------------------------------------------------------\nData: 04/07/2011\nHora: 15:09:41\nFono: Tanara\nAssunto: Paciente veio com a Cida e tem muita dificuldade para colocar o aparelho. Por causa disso vamos fazer uma micro-caixa com ventilação de 1 mm. Marcado retorno dia: 13/07. Entregar o programa de acompanhamento.\n---------------------------------------------------------\nData: 15/07/2011\nHora: 16:55:52\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e a micro-caixa. Ficou ótimo. Marcado retorno em 15 dias. A filha virá entregar os cheques que faltam sendo 9 cheques de 450,00.\n---------------------------------------------------------\nData: 08/08/2011\nHora: 13:26:00\nFono: Tanara\nAssunto: Paciente veio com a Cida relatando que o aparelho esta fraco. feito aumento da aclimatização ok.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio para 5ª visita, entregue pilhas e acessórios de manutenção. OK\n---------------------------------------------------------\nDIA: 01/07/2011 COMPRA AUDÉO SMART III OE PILHA 312\nOE: 1113X22TG RECEPTOR 2\nNF: 363.561 DATA: 24/05/2011\nR$: 4.500,00 ENT. 450,00 NO DÉBITO MAIS 9X DE 450,00 NO CHEQUE\n01 ANO DE GARANTIA.', 0, '', '', '2011-07-01'),
(590, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 06/12/2011\nHora: 09:18:45\nFono: Tanara\nAssunto: Paciente veio para a 1 visita, entregue os brindes e aumento da aclimatização para nível 3. Virá dia: 20/12 para um retorno extra e dia: 23/02 para a 2 visita.\n---------------------------------------------------------\nData: 11/01/2012\nHora: 14:52:55\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OE não estava funcionando era protetor de cera. Expliquei como faz a troca ok.\n---------------------------------------------------------\nData: 27/03/2013\nHora: 14:34:08\nAssunto: fran - Paciente veio pq recetor OE estava estragado. troquei receptor que ainda esta na garantia, e coloquei oliva nova. tudo ok.\n---------------------------------------------------------\nDIA: 23/11/2011 COMPROU AUDÉO SMART V BILATERAL PILHA 312\nOD: 1123X0KV0\nOE: 1123X0KUG\nNF: 387.974 DATA: 31/10/2011\nR$: 18.000,00 À VISTA EM DEPÓSITO\n02 ANOS DE GARANTIA', 0, '', '', '2011-11-23'),
(591, '', '0', '', '', '---------------------------------------------------------\nData: 04/12/2009\nHora: 11:51:55\nCris: Deixou aparelho para fazer orçamento, está mudo, comprou 1 cartela de pilhas power 312\n---------------------------------------------------------\nData: 8/12/2009\nDébora: Feito revisão e limpeza 65,00. Comprou kit Smart Guard 45,00. Pago R$110,00.\n---------------------------------------------------------\nData: 18/12/2009\nDébora: Paciente deixou ap. com som rachado para orçamento.\n---------------------------------------------------------\n21/12/07 LEVOU 1  CARTELA PILHA 312 E FEZ LIMPEZA NO APARELHO\n---------------------------------------------------------\nData: 6/1/2010\nGracielle: veio adaptar par de Eleva 22. Ficou satisfeito. Programas manuais para uso do controle remoto KeyPilot.\n---------------------------------------------------------\nData: 13/01/2010\nDébora: Paciente veio para 1º retorno do programa de acompanhamento. Foi orientado sobre o uso do controle remoto.\n---------------------------------------------------------\nData: 12/07/2010\nDébora: Paciente esteve na clínica e deixou 01 ap. phonak Eleva 22 R12095561 com queixa de chiado no microfone para ser enviado à fábrica.\n---------------------------------------------------------\nData: 09/08/2010\nDébora: Ap. enviado para fábrica, pois não aceita programação.\n---------------------------------------------------------\nData: 13/08/2010\nDébora: Ap. veio da fábrica.\n---------------------------------------------------------\nData: 20/09/2010\nDébora: Paciente retornou à clínica com a queixa de queo ap. da OD estava mais baixo q. o da OE. Foi aumentado o ganho geral do aparelho da OD.\n---------------------------------------------------------\nData: 13/12/2010\nHora: 10:27:08\nMichelle: Paciente deixou aparelho modelo eleva 22d l12095561 r12095561 (os audiozoom 1394)para revisão da garantia. Enviado para fábrica.\n---------------------------------------------------------\nData: 17/12/2010\nHora: 08:53:56\nMichelle: Paciente retirou aparelho. Duarte entregou 02 cartelas de pilhas.\n---------------------------------------------------------\nData: 03/01/2011\nHora: 08:44:55\nFono: Tanara\nAssunto: Paciente veio para a 6 visita. Entregues os brindes ok. MArcado dia: 06/07 o retorno da 7 visita.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 11:30:53\nFono: Tanara\nAssunto: Paciente veio para pegar mais pilhas e verificar os aparelhos. Estão todos ok.\n---------------------------------------------------------\nData: 23/05/2011\nHora: 08:45:40\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD esta baixo. Fiz aumento de ganho geral ok.\n---------------------------------------------------------\nData: 31/05/2011\nHora: 10:09:02\nMichelle: Paciente deixou aparelho pois o mesmos liga e desliga com som intermitente modelo eleva 22d r12095561(os audiozoom 1699)\n---------------------------------------------------------\nData: 14/06/2011\nHora: 15:18:28\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou da fábrica. Virá buscar.\n---------------------------------------------------------\nData: 15/06/2011\nHora: 09:33:10\nAssunto:cida. cliente retirou o aparelho phonak eleva 220d nª r12095561.  obs. o mesmo testou e disse que o aparelho está bom.\n---------------------------------------------------------\nData: 27/06/2011\nHora: 09:05:08\nMichelle: Paciente deixou aparelho pois o mesmo demora para ligar e consome pilha muito rápido eleva 22 d l12095561(os audiozoom 1949)\n---------------------------------------------------------\nData: 08/07/2011\nHora: 11:49:56\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho e virá na segunda para fazer a audiometria.\n---------------------------------------------------------\nData: 26/07/2011\nHora: 17:26:45\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho chegou. Vem buscar amanhã. Feito troca do controle de volume.\n---------------------------------------------------------\nData: 27/07/2011\nHora: 10:20:16\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 08/08/2011\nHora: 13:15:16\nFono: Tanara\nAssunto: Paciente veio para regular o aparelho, diz que o som vai e volta. O microfone estava entupido. orientei para fazer sempre a limpeza do microfone, ventilação e trocar o protetor de cera. Diz que ficou ótimo.\n---------------------------------------------------------\nData: 05/09/2011\nHora: 14:04:54\nFono: Tanara\nAssunto: Paciente veio relatando do som. Fiz troca do protetor de cera e limpei a ventilação ok.\n---------------------------------------------------------\nData: 21/09/2011\nHora: 13:54:17\nFono: Tanara\nAssunto: Paciente veio para aumento de ganho geral da OE ok.\n---------------------------------------------------------\nData: 07/11/2011\nHora: 11:52:57\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho sem amplificação para o conserto. Eleva 22 OD 12095561. Esta na garantia.\n---------------------------------------------------------\nData: 22/11/2011\nHora: 10:03:47\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá retirar amanhã.\n---------------------------------------------------------\nData: 23/11/2011\nHora: 14:13:30\nFono: Tanara\nAssunto: Paciente veio e retirou o aparelho ok.\n---------------------------------------------------------\nData: 02/12/2011\nHora: 11:01:44\nFono: Tanara\nAssunto: Paciente veio relando que o aparelho da OD não esta funcionando bem. O pessoal de S.P estava na audiozoom e vai fazer um aparelho novo pro paciente. Eleva 22 OD 12095561.\n---------------------------------------------------------\nData: 16/01/2012\nHora: 14:06:14\nFono: Tanara\nAssunto: Paciente veio para a 8 visita. Entregues os brindes e marcado a próximo pra julho. Paciente diz que os aparelhos estão ótimos.\n---------------------------------------------------------\nData: 23/04/2012\nHora: 11:31:54\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto, esta com o som "rachado". Eleva 22 OE 12095561. A fábrica cobrou R$: 480,00, mas Duarte irá fazer na cortesia e irá pagar o custo do paciente.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 17:11:37\nFono: Tanara\nAssunto: Liguei e avisei o paciente que o aparelho já chegou. Virá buscar amanhã de manhã.\n---------------------------------------------------------\nData: 04/05/2012\nHora: 14:48:27\nMirella: Pct veio buscar o aasi,ficou satisfeito, retorna na segunda para conversar com o Duarte.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 14:52:30\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:22:35\nAssunto: Suzan - Confirmado presença no Open dia 18/06 as 09:00.\n---------------------------------------------------------\nData: 11/07/2012\nHora: 10:34:33\nFono: Tanara\nAssunto: Paciente deixou o aparelho com o som distorido para arrumar. Esta na garantia. Eleva OE L12095561.\n---------------------------------------------------------\nData: 02/08/2012\nHora: 14:53:58\nFono: Tanara\nAssunto: avisei que o aaprelho já chegou. Será feito uma regulagem.\n---------------------------------------------------------\nData: 03/08/2012\nHora: 10:49:05\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho. Feito regulagem ok.\n---------------------------------------------------------\nData: 06/08/2012\nHora: 10:12:21\nFono: Tanara\nAssunto: Paciente voltou relatando que os programas manuais não estão funcionando. Verifiquei e era no IPFG. Regulei ok.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 09:26:01\nFono: Tanara\nAssunto: Veio para fazer regulagem. Tirei o programa automático, pois relatava que o som vai e volta.\n---------------------------------------------------------\nData: 17/12/2012\nHora: 08:45:11\nFRANCINE: pcte queixa q aasi od esta mais baixo que da oe. Fiz nova regulgem. Ficou tudo OK. Conversei sobre o fim do programa de acompanhamento. Conversou com Duarte.\n---------------------------------------------------------\nData: 28/01/2013\nHora: 08:28:00\nAssunto: FRAN - confirmado horário para adaptação de lyric, dia 30/01 as 8:00hs.\n-----------------------------\n06/10/2014 - Zana\nLiguei e ofereci para vir até a loja testar nova tecnologia, pois chegou linha nova e com preço acessível.. Duarte autorizou dar 25% de desconto.\nFalei com a esposa q disse transmitir o recado pois seu Osmar estava dormindo, mas foi mto atenciosa e gostou do convite..\n-------------------------------\n', 0, '', '', '2010-01-06'),
