(593, 'HU', 'Leticia ', '', '', 'Paciente deixou aparelho PHONAK Eleva 211 dAZ n° 1114x0mt8, 1114xomt7 para orçamento. os 2984\nPCIENTE VEIO EM LOJA E RETIROU APARELHO PHONAK ELEVA 211 N° 1114X0MT8-1114X0MT7 COM MICHELLE COSTA.OS 2984\nUSA APARELHO PHONAK \nMODELO ELEVA 211\nOD 1114X0MT7', 0, '', '', '2012-01-01'),
(594, 'OTOVIDA', 'Leticia ', '', '', '---------------------------------------------------------\nData: 18/05/2009\nGracielle: deixou Solo T+ 311 084X15743 para revisão de garantia. Enviado para fábrica.\n---------------------------------------------------------\nData: 01/06/2009\nKELLEN:PACTE PEGOU 1 AP. E DEIXOU O OUTRO PRA REVISÃO E LIMPEZA SOLOT+311dSC OE.084X15783!\n---------------------------------------------------------\nData: 10/06/2009\nDébora: Ap. retornou da fábrica. Feito troca da caixa e tampa da caixa.\n---------------------------------------------------------\nData: 15/06/2009\nDébora: Veio à loja para buscar aparelho.\n---------------------------------------------------------\nData: 19/10/2009\nDébora: Deixou ap.SOLO T+ 311 084X15743 para conserto da garantia. Som com ruído.\n---------------------------------------------------------\nData: 30/10/2009\nDébora: Ap. veio da fábrica. Troca de caixa e amplificador.\n---------------------------------------------------------\nData: 11/11/2009\nDébora: Motorista pegou aparelho.\n---------------------------------------------------------\nData: 04/12/2009\nDébora: Paciente deixou ap. com ruído interno para conserto da garantia.\nSOLO T+ 311 (084X15783).\n---------------------------------------------------------\nData: 18/12/2009\nDébora: Ap.veio da fábrica. Feito troca de amplificador e caixa.\n---------------------------------------------------------\nData: 21/12/2009\nHora: 09:20:41\nCris: Paciente retirou aparelho (revisão da garantia)\n---------------------------------------------------------\nData: 25/03/2010\nHora: 12:05:11\nMichelle: Paciente trouxe aparelho para fazer revisão e limpeza (OS AUDIOZOOM 149).\n---------------------------------------------------------\nData: 16/04/2010\nDébora: Ap. veio da fábrica. Feito troca de receptor e amplificador.\n---------------------------------------------------------\nData: 22/04/2010\nHora: 14:15:50\nAssunto:CIDA. RETIROU O APARELHO ARGOSY SOLOT311 DSC Nº084X15743E\n---------------------------------------------------------\n18.05.2009\nUSA PAR DE APARELHOS SOLO T+ 311 (084X15743/783) 2 ANOS DE GARANTIA\nDATA: 19/06/2008\nNF: 26631', 0, '', '', '2009-05-18'),
(595, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/05/2011\nHora: 12:52:05\nFono: Tanara\nAssunto: Paciente é do centro e tem aparelho do Hu, porém estava fazendo teste com Audéo Yes IX. Duarte autorizou fazer teste com Audéo Mini IX bilateral. Levou para a casa e retornará. Falar com o Duarte.\n---------------------------------------------------------\nData: 27/05/2011\nHora: 12:20:39\nFono: Tanara\nAssunto: Paciente veio relatando que gostou dos aparelho e quer fechar. Duarte fez por R4: 5.000,00 2 Audéos Mini IX, pois o paciente vai fazer propaganda. Vai fazer depósito essa semana. Pediu uma caixinha da cor do cabelo branca.\n---------------------------------------------------------\nData: 22/06/2011\nHora: 13:24:36\nFono: Tanara\nAssunto: Paciente veio para fazer a 1 visita. Entregues os brindes ok. Paciente diz que esta adorando os aparelhos. Bruna que vai destacar os tiks.\n---------------------------------------------------------\nData: 05/03/2013\nHora: 17:58:09\nFRAN - PACIENTE ESTA EM TESTE COM LYRIC. HOJE REPOSICIONEI O OD E COLOQUEI OE COM O DUARTE. SENTE MUITO DESCONFORTO E CHEGA A SENTIR DOR NO MOMENTO DA COLOCAÇÃO. PCTE GOSTOU MUITO DOS APARELHOS.\nMICRO-POWER 100 DAZ\nOD: 210924X0MPU\nOE: 210924X0MP0 \nNF: DATA: 03/08/09 ATÉ 03/08/2010.\nDIA: 22/06/2012 AMBRA NANO\nOD: P12F0274R\nOE: P12F0275L', 0, '', '', '2012-01-01'),
(596, 'dr. kowalski', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/11/2011\nHora: 18:00:11\nFono: Tanara\nAssunto: Paciente veio com o filho Nain encaminhado pelo Dr. Kowalski. Feito audiometria e teste com Micro-Certena e passei os valores de R$: 2.800,00 cada, mas paciente não quer usar aparelhos pois diz que ainda ouve e trabalha na roça ainda e tem medo de perder. Vai passar no médico e depois retornará.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 15:01:45\nAssunto: Suzan - Telefone fora de área.\n---------------------------------------------------------\nDIA: 01/11/2011 TESTE COM APARELHOS MICRO-CERTENA BILATERAL', 0, '', '', '2011-11-01'),
