(598, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 29/07/2009\nCIDA: CADASTRO ATUALIZADO.VAI LIGAR PARA MARCAR.\n---------------------------------------------------------\nData: 27/1/2010\nDébora: Liguei para falar dos ap. phonak. Referiu que irá ligar para marcar um teste.\n---------------------------------------------------------\nData: 02/02/2010\nDébora: Paciente esteve na clínica e deixou 01 ap. CIC analógico que está mudo para orçamento de conserto.\n---------------------------------------------------------\nData: 04/02/2010\nDébora: Conserto não autorizado R$890,00. Ap. entregue.\n---------------------------------------------------------\nData: 25/03/2010\n21/09/06 \nCOMPROU  1 APARELHO BERNAFON CIC ANALOGICO Nº 05-42712 OD\nR$ 2.300,00 ENTRADA DE R$ 575,00 + 3X  de R$ 575,00\n25/03/2010                        pilha 13     \nComprou 01 Ap. Argosy Argus D OD n  0825X18F5\nValor total R$ 3.500,00 Entr. R$ 500,00 + 9x de R$ 330,00\n- 01 ano de garantia \nNF 41277    27/05/09\n', 0, '', '', '2010-03-25'),
(599, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/11/2009\nDébora: Esteve na clínica para a 3ª visita do programa de acompanhamento phonak.\n---------------------------------------------------------\nData: 29/03/2010\nHora: 11:32:52\nMichelle: Paciente trouxe aparelho (OS AUDIOZOOM 152).\n---------------------------------------------------------\nData: 16/04/2010\nDébora: Ap. veio da fábrica. Feito troca de receptor e amplificador.\n---------------------------------------------------------\nData: 13/05/2010\nDébora: Retornou à clínica para buscar aparelho.\n---------------------------------------------------------\nData: 30/09/2010\nDébora: Paciente esteve na clínica e deixou ap. Audeo III nº OD- 0919X0MRD para revisão da garantia. Enviado pra fábrica.\n---------------------------------------------------------\nData: 06/10/2010\nDébora: Ap. veio da fábrica. Feito revisão geral e limpeza.\n---------------------------------------------------------\nData: 01/12/2010\nHora: 10:46:49\nMichelle: paciente deixou aparelho pois esta com ruido interno modelo audéo n° 0919x0mmt(os audiozoom 1378).\n---------------------------------------------------------\nData: 15/12/2010\nHora: 16:05:11\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho ok. Estava na garantia.\n---------------------------------------------------------\nData: 27/12/2010\nHora: 09:58:37\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD esta baixo. feito uma nova audiometria e teve uma piora. Fiz uma nova regulagem e troca da Oliva fechada pela Power ok. Falou que ficou ótimo. Virá dia: 05/05/2011 para o retorno.\n---------------------------------------------------------\nData: 24/02/2011\nHora: 16:46:39\nFono: Tanara\nAssunto: Paciente veio com o receptor da OD mudo. Feito troca autorizado pelo Duarte na garantia. Na próxima vez cobrar R$: 250,00.\n---------------------------------------------------------\nData: 27/04/2011\nHora: 13:04:58\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD esta muito fraco. Fiz aumento de hanho e nada. Acha que a perda piorou. Orientei ir ao médico e fazer uma nova audiometria completa e me trazer e ver o que o médico vai fazer, pois da ultima vez o exame dele já piorou. Qualquer coisa vamos adaptar um Naída.\n---------------------------------------------------------\nData: 28/07/2011\nHora: 16:00:33\nMichelle: Paciente esteve na loja e pegou duas pilha do programa de acompanhamento.\n---------------------------------------------------------\nData: 11/01/2012\nHora: 15:20:38\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho da OD para a revisão. vai pagar R$: 480,00 mas não vai mais usar na OD pois sua perda piorou muito. Então vai deixar os 2 Audéo III na OE. Audéo III 0919X0MMT. Falei de aparelho novo na OD Naída, mas agora não vai comprar, esta com problemas de saúde grave.\n---------------------------------------------------------\nData: 24/01/2012\nHora: 13:59:14\nFono: Tanara\nAssunto: Deixei recado que o aparelho já chegou. Vai pagar R$: 480,00.\n---------------------------------------------------------\nDIA: 04/11/2009 COMPROU AUDÉO III BILATERAL PILHA 312\nOD: 0919X0MMT\nOE: 0919X0MPX\nR$: 6.843,20 ENT. R$: 3.350,00 MAIS 6X DE R$: 582,20\n01 ANO DE GARANTIA\nNF: 280.416 DATA: 26/08/2009                                                                                25/11/2013 NAIDA CRT V R$ 3.500,00 - DEU 2 AUDEO COMO PARTE DE PAGAMENTO. POSSUI 01 ANO DE GARANTIA ATÉ A DATA DE 25/11/2014.', 0, '', '', '2009-11-04'),
