(603, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 09/10/2009\nDébora: Paciente esteve na clínica e deixou ap. com som ruidoso para orçamento de conserto. Widex ITC nº B1X454428.\n---------------------------------------------------------\nData: 09/10/2009\nDébora: Genro esteve na clínica para buscar aparelho. Feito troca de receptor. R$340,00. pago\n---------------------------------------------------------\nData: 08/12/2009\nDébora: Filha trouxe ap. mudo Widex ITC nº B1X454428 para conserto.\n---------------------------------------------------------\nData: 9/12/2009\nDébora: Ap. estava com microfone entupido.\n---------------------------------------------------------\nData: 10/12/2009\nDébora: Genro pegou aparelho.\n---------------------------------------------------------\nData: 01/03/2010\nHora: 18:24:53\nMichelle: retirou aparelho que estava no conserto. Pagou R$ 380,00.\n+ desumificador 35,00 total 420,00.\n---------------------------------------------------------\nData: 16/03/2010\nHora: 17:34:03\nMichelle: Cliente esteve na loja e esta reclamando de microfonia vai fazer um pré-molde para troca de caixa.\n---------------------------------------------------------\nData: 19/03/2010\nDébora: Confecção de nova caixa R$250,00.\n---------------------------------------------------------\nData: 19/03/2010\nDébora: Retornou à clínica para buscar o aparelho. Pago R$250,00.\n---------------------------------------------------------\nData: 01/12/2011\nHora: 09:26:37\nFono: Tanara\nAssunto: Paciente veio para buscar os aparelhos novos. ok vai pagar na segunda dia: 05/12. Duarte fez o audéo Smart IX por R$: 15.000,00 bilateral em 5x de 3.000,00.\n---------------------------------------------------------\nData: 05/12/2011\nHora: 15:33:21\nFono: Tanara\nAssunto: Paciente veio com o Roberto para fazer o pagamento. Deu a entrada de R$: 3.000,00 em dinheiro e mais 4x de 3.000,00 que dará para o Duarte todo dia: 05 de cada mês.\n-------