(608, '', 'Leticia ', '', '', 'USA AP. RETRO AM OE\nDIA: 01/02/2011 COMPRA AUDEO SMART III OE PILHA 312\nOE: 1044X0WEP \nR$: 4.6870,00 ENT. 468,70 NO CHEQUE E MAIS 9X DE 468,70 NO CRÉDITO.\n01 ANO DE GARANTIA.\nNF: 339652 DATA: 30/11/2010\n---------------------------------------------------------\nData: 25/06/2010\nDébora: Paciente esteve na clínica para trocar o caninho do molde. Comprou 01 cartela de pilhas phonak 13 e falei sobre a tecnologia da phonak. Ficou interessado e retornará para fazer um teste.\n---------------------------------------------------------\nData: 26/01/2011\nHora: 13:50:58\nFono: Tanara\nAssunto: Paciente veio fazer pesquisa de preços. Usa um aparelho retro antigo na OE. Tem perda Unilateral. Feito audiometria e teste com Audeo Smart. Gostou bastante mas não quiser levar para casa. Passei o valor de R$: 4.687,00 em 10x sem juros. Falou que vai pensar e voltará.\n---------------------------------------------------------\nData: 01/02/2011\nHora: 13:53:30\nFono: Tanara\nAssunto: Paciente veio para fechar a venda. Falou que gostou muito do atendimento. Fechou em R$: 4.687,00 em 10x sem juros. Sendo entrada de 468,70 no cheque mais 9x de 468,70 no cartão de crédito. Levou a caixinha, 1 cartela de pilha e o programa de acompanhamento. Marcado retorno dia: 16/02 para a 1 visita.\n---------------------------------------------------------\nData: 16/02/2011\nHora: 09:26:14\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue o kit de manutenção e pilhas ok. Marcado a 2 viista dia: 02/05. Falou que não consegue entender a fala emsituações com ruído. Fiz uma nova regulagem e mudança para linear. Falou que estava machucando o ouvido tirei prá-molde da OE para a confecção da caixa micro-molde.\n---------------------------------------------------------\nData: 23/02/2011\nHora: 16:55:50\nFono: Tanara\nAssunto: Liguei e avisei que a caixinha já chegou do aparelho. Virá buscar na semana que vem.\n---------------------------------------------------------\nData: 04/03/2011\nHora: 12:15:21\nFono: Tanara\nAssunto: Paciente veio para colocarmos o Micro-molde mas paciente não gostou pois ficou aparecendo muito. Marcado retorno dia: 02/05 para a 2 visita.\n---------------------------------------------------------\nData: 02/05/2011\nHora: 09:44:18\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Diz que agora esta ouvindo muito bem esta perfeito. Entreguei o manual do aparelho os brindes. Marcado dia: 01/08 a 3 visita. Vai trazer o livronho para assinar.\n---------------------------------------------------------\nData: 02/08/2011\nHora: 13:28:48\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Diz que esta ouvindo muito bem. Entregue os brindes e marcado o retorno somente dia: 01/02. Feito troca da oliva pois estava amarelada.\n---------------------------------------------------------\nData: 10/01/2012\nHora: 15:37:57\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho na garantia. Audéo Smart III OE 1044X0WEP.\n---------------------------------------------------------\nData: 17/01/2012\nHora: 15:57:47\nFono: Tanara\nAssunto: Liguei e falei pro paciente que o aparelho já chegou. Virá buscar amanhã.\n---------------------------------------------------------\nData: 18/01/2012\nHora: 10:05:03\nMichelle: Paciente retirou aparelho.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(609, '', 'Leticia ', 'Kowalski', '', 'DIA: 02/06/2011 TESTE COM NAÍDA V SP OD  \nDR. KOWALSKI\n---------------------------------------------------------\nData: 02/06/2011\nHora: 09:20:42\nFono: Tanara\nAssunto: A mãe veio com seu filho encaminhado pelo Dr. Kowalski. Tem perda profunda somente na OD. Feito teste com Naída e levou para a casa. Feito pré-molde para a confecção de molde de silicone transparente concha escavada sem ventilação. Vem buscar na segunda. Passei os valores para a mãe do Naída V e IX.\n---------------------------------------------------------\nData: 06/06/2011\nHora: 16:17:46\nFono: Tanara\nAssunto: Paciente veio com a Mãe Daniela para buscar o molde. Diz que o Marcos não tira o aparelho. Vai fazer a cirurgia e depois vai comprar o aparelho. Orientei ficar com o aparelho até a cirurgia e depois vai devolver e quando fizer nova audiometria após a cirurgia vai comprar.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 16:10:00\nAssunto: Suzan - Confirmado endereço para Open.\n---------------------------------------------------------\nData: 18/10/2012\nHora: 10:18:30\nAssunto: Suzan - Falei com Avó, confirmado para o Open, dia 06/11 as 14:30.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(610, '', 'Leticia ', '', '', 'DIA: 17/02/2012 FEZ TESTE COM SMART III OE\n---------------------------------------------------------\nData: 17/02/2012\nHora: 14:57:31\nFono: Tanara\nAssunto: Paciente veio fazer teste com Audéo Smart III OE. Levou para casa.\n---------------------------------------------------------\nData: 20/02/2012\nHora: 15:01:21\nFono: Tanara\nAssunto: Bruna atendeu e falou que o paciente vem dia: 22/05/2012 para fechar a venda. Vai dar uma entrada de R$: 1.000,00 mais 9x de 388,88 no cheque. Quer caixinhas pretas.\n---------------------------------------------------------\nData: 22/02/2012\nHora: 15:03:19\nFono: Tanara\nAssunto: Paciente veio e devolveu os aparelhos. Falou que agora não tem condições de comprar.\n---------------------------------------------------------\nData: 31/05/2012\nHora: 17:17:27\nAssunto:Suzan - Esta viajando. Ligar amanha. Passar promoção do orçamento que fez em 17/02/2012. De R$ 4.500,00 Por R$3.900,00.\n---------------------------------------------------------\nData: 03/10/2012\nHora: 16:12:58\nAssunto: Suzan - CONFIRMADO PARA OPEN.\n---------------------------------------------------------\nData: 21/03/2013\nHora: 09:24:37\nFRAN - CONTATO TELEFÔNICO. CONVERSEI SOBRE PROMOÇÃO E CONVIDEI PARA VIR NA LOJA PARA FAZER UM TESTE SEM COMPROMISSO. VAI VIR NA SEMANA QUE VEM.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
