(614, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 26/02/2013\nHora: 15:40:12\nJOICE: PACIENTE EM TESTE COM DOIS AUDEO S SMART III 1205X0DAE/1206X1MPE, CONVERSA COM DUARTE FOI OFERECIDO 7.000,00 PELOS DOIS AASI.\n---------------------------------------------------------\nData: 28/02/2013\nHora: 14:05:41\nJOICE: COMPROU AAPARELHO AUDITIVO POR 7.000,00 DEU 1.500,00 DE ENTRADA E FINANCIO 5.500,00. ENTREGUEI KIT DE MANUNTENÇÃO MAIS 3 CATELAS DE PILHA 312, CERUSTOP E CARTÃO DE PROGRAMA DE ACOMPANHAMENTO. FALTA FAZER A NOTA FISCAL COM MICHELLE.\n---------------------------------------------------------', 0, '', '', '2012-01-01'),
(615, '', 'Leticia ', '', '', 'DIA: 10/12/2009 COMPROU NAÍDA V UP OD PILHA 675 \nOD: 0819H1ATN\nR$: 9.000,00 ENT. R$: 1.000,00 MAIS 8X DE R$: 1.000,00\nNF: 281686 DATA: 10/09/2009\n02 ANOS DE GARANTIA\n---------------------------------------------------------\nData: 11/09/2009\nDébora: Usa ap. Argosy Power Maxx411 nº\n---------------------------------------------------------\nData: 08/09/2009\nDébora: Paciente esteve na clínica e deixou ap. Power Maxx411 para revisão e limpeza. Fez pré-moldagem para confecção de novo molde.\n---------------------------------------------------------\nData: 11/09/2009\nDébora: Retornou à clínica para buscar ap. Pago R$65,00.\n---------------------------------------------------------\nData: 21/12/2009\n03/05/07 COMPROU 1 APARELHO AUDIOFLEX 120 BERNAFON PILHA 675 OD VALOR\nR$ 4.000,00 À VISTA foi entregue todas as pilhas (4 cartelas) dia  20/06/07 Feito troca de receptor dia 18/12/07 em garantia.\n---------------------------------------------------------\nData: 21/12/2009\nDébora: Comprou telefone amplificado R$380,00.\n---------------------------------------------------------\nData: 13/1/2010\nDébora: Paciente deixou ap. phonak powermaxx 411 064H12873 para revisão.\n---------------------------------------------------------\nData: 25/02/2010\nHora: 16:43:36\nAssunto:cida (veio na loja(neto) pagou a 2º parcela do aparelho auditivo  valor R$ 1.000,00 REAIS.\n---------------------------------------------------------\nData: 13/07/2010\nDébora:Ap. veio da fábrica. Feito troca de caixa, gaveta de pilha e ângulo.\n---------------------------------------------------------\nData: 16/07/2010\nDébora: Paciente retirou aparelho.\n---------------------------------------------------------\nData: 25/02/2011\nHora: 11:19:14\nFono: Tanara\nAssunto: Paciente veio com seu neto relatando que o aparelho esta apitando. Feito troca da manguerinha ok. Feito também pré-molde da OD para molde novo de silicone, concha escavada sem ventilação. Testou o i-com e gostou mas não vai comprar no momento.\n---------------------------------------------------------\nData: 28/04/2011\nHora: 08:19:13\nFono: Tanara\nAssunto: Paciente veio buscar o molde ok. Pago R$: 65,00.\n---------------------------------------------------------\nData: 28/07/2011\nHora: 18:05:33\nFono: Tanara\nAssunto: Paciente veio com seu neto Cristian para trocar a manguerinha. Verifiquei que o aparelho esta muito sujo e orientei fazer uma revisão e limpeza já que ainda esta na garantia. Vai para S.P Naída V UP Jr OD 0819H1ATN. Emprestei um Naída SP. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 08/08/2011\nHora: 11:50:15\nFono: Tanara\nAssunto: Liguei e falei que o aparelho chegou da fábrica. Vem na quinta-feira retirar. Vamos fazer uma audiometria e regulagem nova.\n---------------------------------------------------------\nData: 11/08/2011\nHora: 08:24:21\nFono: Tanara\nAssunto: Paciente veio com o neto para buscar o aparelho. Feito uma nova audiometria e nova regulagem ok. Paciente se interessou pelo Exélia 33. Falou que vai comprar para ter um de reserva. OE falou que não adianta colocar aparelho pois não se adaptou.\n---------------------------------------------------------\nData: 11/01/2012\nHora: 09:55:12\nFono: Tanara\nAssunto: Paciente veio com seu neto com o ângulo quebrado. Feito a troca do ângulo e troca da manguerinha. Deixou o aparelho antigo para o conserto. Power Maxx 411 OD 064H12873. Fazer uma revisão e limpeza. Vai pagar R$: 1.200,00. Autorizado.\n---------------------------------------------------------\nData: 18/01/2012\nHora: 16:02:09\nFono: Tanara\nAssunto: Liguei para a paciente avisando que o aparelho já chegou da fábrica. Virá buscar amanhã e vai pagar R$: 1.200,00.\n---------------------------------------------------------\nData: 19/01/2012\nHora: 14:37:35\nFono: Tanara\nAssunto: O neto Cristian veio bsucar o aparelho. Não pagou pois sua avó vai pagar quando receber a partir do dia: 29/01/2012. acho que vai parcelar. Pegou 1 cartela de pilha numero 13. Vai pagar junto.\n---------------------------------------------------------\nData: 03/05/2012\nHora: 14:22:26\nMirella: Christian veio efetuar o pagamento da última parcela, R$ 240,00.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio para regulagem, aumentei ganho geral. Ok\n---------------------------------------------------------\nData: 21/12/2012\nHora: 15:06:51\nMirella: Pgto da 2ª parcela R$ 1.250,00.\n---------------------------------------------------------\nData: 30/01/2013\nHora: 15:01:33\nAssunto: sUZAN - Pgto da parcela R$ 1.250,00.\n---------------------------------------------------------\nData: 28/02/2013\nHora: 16:30:37\nAssunto: Suzan - Pgto da parcela do mês de Março. R$ 1250,00.\n30/07/2013 - Paciente com seu neto vieram efetuar o pagamento da parcela no valor de R$ 1.250,00', 0, '', '', '2012-01-01'),
(616, '', 'Leticia ', '', '', '30/7/2013 - ORÇAMENTO S SMART III R$4500,00 CADA - COM DUARTE.\nPACIENTE FEZ TESTE COM DUARTE EM 30/07, E FICOU DE RETORNAR NO FINAL DE AGOSTO. TELEFONEI PARA AGENDAR A VISITA, E A PACIENTE INFORMOU QUE ESTÁ SEM CONDIÇÕES NO MOMENTO (PAGANDO FACULDADE DAS FILHAS E REMÉDIOS DOS PAIS, ENTRE OUTRAS COISAS). PASSEI PROMOÇÃO DE R$3000,00 CADA E MESMO ASSIM AINDA ACHOU CARO. EXPLIQUEI SOBRE A PERDA DE ADIÇÃO GRADATIVA, PRA VER O QUENTO ANTES PRA COLOCAR O APARELHO E COLOQUEI A LOJA A DISPOSIÇÃO. ', 0, '', '', '2012-01-01'),
