(619, '', 'Leticia ', '', '', 'DIA: 11/07/2011 COMPRA EXTRA 11 BILATERAL PILHA 10\nOD: R07113543\nOE: L07113543\nNF: 373966 DATA: 25/07/2011 ATÉ 25/07/2012.\nR$: 6.000,00 ENT. 3.000,00 MAIS 1X DE 3.000,00 NO CHEQUE\n01 ANO DE GARANTIA\nData: 24/07/2009\nKELLEN:FILHA ESTEVE NA CLINICA E LEVOU 6 PILHAS 10 POWER''ONE, DUARTE OFERECEU UM TESTE, MÃE USA UM AP. DELTA, VAI LIGAR E MARCAR!\n---------------------------------------------------------\nData: 14/04/2011\nHora: 10:25:07\nMichelle: Paciente deixou aparelho para orçamento pois o mesmo esta mudo Jaimar verificou  marca otcon (OS AUDIOZOOM 1579)\n---------------------------------------------------------\nData: 14/04/2011\nHora: 10:56:12\nFono: Tanara\nAssunto: Liguei e passei o valor de R$: 600,00 troca do receptor. Expliquei que não seria o original pois o aparelho da paciente é Oticon. Não autorizado e vem para verificar aparelhos novos.\n---------------------------------------------------------\nData: 29/04/2011\nHora: 11:00:18\nFono: tanara\nMichelle: Paciente retirou aparelho. E fez teste com Audéo Smart III. Paciente gostou bastante e vai ver as condições de pagamento com o filho pois ela não tem como pagar. Ficou de dar a resposta.\n---------------------------------------------------------\nData: 20/06/2011\nHora: 13:58:40\nFono: Tanara\nAssunto: Paciente veio para saber exatamente quanto que ficava o valor do aparelhos. Falou que gostou bastante e que vai ver com os filhos. Levou o orçamento.\n---------------------------------------------------------\nData: 04/07/2011\nHora: 13:10:10\nFono: Tanara\nAssunto: Liguei e a paciente falou que esta vendo com os filhos a possibilidade de comprar. Falou que vai entrar em contato.\n---------------------------------------------------------\nData: 27/07/2011\nHora: 13:22:41\nFono: Tanara\nAssunto: Paciente veio para fazer a adaptação ok feito regulagem e marcamos o retorno para quarta que vem.\n---------------------------------------------------------\nData: 11/08/2011\nHora: 14:59:55\nFono: Tanara\nAssunto: Paciente veio e deixou os 2 aparelhos. Feito um pré-molde bilateral e ligaremos quando chegar. Fazer uma caixa-intra maior possível.\nMichelle: Paciente deixou aparelho para fazer caixa nova foi conversado com Duarte ele disse que a paciente tem que trazer o outro aparelho para fazer um novo molde modelo extra 11 r07113543(os audiozoom 1832)\n---------------------------------------------------------\nData: 31/08/2011\nHora: 17:41:40\nFono: Tanara\nAssunto: Paciente veio buscar os aparelhos ok. Virá para a 1 visita.\n---------------------------------------------------------\nData: 26/09/2011\nHora: 13:04:05\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e marcado a 2 visita dia: 11/10. Esta super adaptada com os aparelhos dizendo que são os melhores que já colocou. Falou que tem uma amiga do Rio de Janeiro que virá e vai trazer para comprar aparelho aqui com a gente. Paciente retirou pilhas dia: 16/09 portanto na 3 visita que será dia 11/10 não vou entregar pilhas.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 15:48:13\nAssunto: Suzan - Numero chamado não existe.\n---------------------------------------------------------\nData: 30/05/2012\nHora: 10:45:50\nAssunto:CIDA. PACINTE ESTEVE NA LOJA E DEIXOU AP. PHONAK EXTRA 11 NºL07113543/ NºRD07112543 PARA REVISÃO. GARANTIA.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 15:56:17\nAssunto:CIDA. PACIENTE ESTEVE NA LOJA E RETIROU O AP. PHONAK EXTRA 11 NºL07113543 /NºR007113543. GARANTIA.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(621, '', '0', '', '', 'DIA: 27/04/2011 COMPROU VERSATA 11 OE PILHA 10\nOE: L04116534\nNF: 358.675 DATA: 25/04/2011 ATÉ 25/04/2013.\nDIA: 21/06/2012 COMPROU VERSATA 11 OD\nOD: P12E2759R\nNF: 419.303 DATA: 31/05/2012\nR$: 7.500,00 ENT. 1.250,00 MAIS 5X 1.250,00 NO CARNÊ\n02 ANOS\n---------------------------------------------------------\nData: 13/04/2011\nHora: 10:21:09\nFono: Tanara\nMichelle: Paciente deixou aparelho para revisão e limpeza Tanara verificou aparelho modelo neo 401 009165 (OS AUDIOZOOM 1578). Marcado as 16:00 horas para uma audiometria. A tarde paciente retirou aparelho feito revisão e limpeza pago 100,00. Feito também uma audiometria e a orelha esquerda teve uma piora. Orientei para fazer novo aparelho. Paciente fechou a venda no Versata 11 Power e vai pagar quando chegar o aparelho. Feito pré-molde e paciente vai pagar em 3x no preço da tabela ou a vista.\n---------------------------------------------------------\nData: 27/04/2011\nHora: 13:44:08\nFono: Tanara\nAssunto: Paciente veio com seu marido fazer a adaptação e o pagamento do aparelho Versata Power 11. Deu uma entrada de R$: 2.100,00 mais 5x de 1.000,00 no carne. Deixei a aclimatização nivel 1 e marquei retorno em 1 semana.\n---------------------------------------------------------\nData: 02/05/2011\nHora: 13:02:00\nFono: Tanara\nAssunto: Paciente veio para aumentar o aparelho diz que esta muito baixo. ok deixei no nivel 4 fiz gerenciador de microfonia e marquei retorno em semana. Seu marido vai retirar a cera no Dr. Kowalski e vou fazer uma nova audiometria.\n---------------------------------------------------------\nData: 13/05/2011\nHora: 14:14:27\nFono: Tanara\nAssunto: Paciente veio com a queixa que o aparelho esta fazendo uma pressão na orelha e isso esta incomodando. Fiz uma regulagem mais leve e orientei que quarta estarei de volta e vamos ver se vai resolver. Fiz a 1 visita e expliquei o kit de manutenção ok.\n---------------------------------------------------------\nData: 18/05/2011\nHora: 14:17:45\nFono: Tanara\nAssunto: Paciente voltou relatando que ainda esta com pressão. O Jaimar não esta vamos fazer um desgaste da cápsula. Na segunda paciente virá.\n---------------------------------------------------------\nData: 23/05/2011\nHora: 13:21:31\nFono: Tanara\nAssunto: Paciente veio para o desgaste da cápsula. Jaimar desgastou. Ficou de me dar a resposta se agora resolveu o problema até a segunda que vem.\n---------------------------------------------------------\nData: 25/05/2011\nHora: 15:20:04\nFono: Tanara\nAssunto: Paciente veio com seu amrido para o pagamento. Diz que esta bom mas ainda vai dar uma esperada. Qualquer coisa virá na semana que vem.\n---------------------------------------------------------------\nData: 01/06/2011\nHora: 20:30:01\nFono: Tanara\nAssunto: Duarte atendeu a apaciente. Veio fazer novo pré-molde pois continuava a machucar. Vai para S.P e ligaremos quando voltar.\n-------------------------------------------------------\nData: 10/06/2011\nHora: 15:23:22\nFono: Tanara\nAssunto: Liguei para a paciente e avisei que o aparelho já chegou. Virá no final da tarde. Paciente veio retirou o aparelho ok.\n---------------------------------------------------------\nData: 27/07/2011\nHora: 13:18:22\nFono: Tanara\nAssunto: Paciente veio com seu marido Jorge para fazer o pagamento do aparelho e a 2 visita. Paciente diz que ainda esta machucando um pouco o ouvido. Falei que era pra ir no Dr Kowalski e depois voltar aqui pois na semana que vem o técnico estará na clínica.\n---------------------------------------------------------\nData: 17/08/2011\nHora: 13:11:52\nFono: Tanara\nAssunto: Paciente veio e o Jonata fez um desgaste na cápsula. Expliquei que deve trocar o protetor de cera as vezes.\n---------------------------------------------------------\nData: 27/10/2011\nHora: 17:02:50\nFono: Tanara\nAssunto: Paciente veio com seu marido Jorge para a 3 visita do aparelho novo Versata 11 OE 04116534. Feito campo livre e orientei procurar o Dr. Kowalski para fazer uma audiometria e imitanciometria. Fiquei com o aparelho para mandarmos para S.P pois esta machucando a caixa intra.\n---------------------------------------------------------\nData: 17/11/2011\nHora: 16:23:23\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok.\n---------------------------------------------------------\nData: 09/01/2012\nHora: 14:56:09\nFono: Tanara\nAssunto: (Thaisa que atendeu) Paciente veio relatando que o aparelho não esta funcionando, esta mudo. Era protetor de cera. Feito a troca e aumentado um pouco o ganho geral ok.\n---------------------------------------------------------\nData: 21/06/2012\nHora: 09:32:48\nFono: Tanara\nAssunto: A paciente veio e buscou o aparelho da OD. Deu um cheque de R$: 1.000,00 mais 250,00 em dinheiro. O restante será em 5x de R$: 1.250,00 no carnê.\n---------------------------------------------------------\nData: 13/08/2012\nHora: 14:19:51\nFono: Tanara\nAssunto: Paciente veio com o aparelho mudo. Vai para S.P. Versata ITC OD P12E2759R.\n---------------------------------------------------------\nData: 05/09/2012\nHora: 15:21:51\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho, porém ninguem anotou no aplicativo.\n---------------------------------------------------------\nData: 29/11/2012\nHora: 17:10:12\nAssunto:cida. paciente esteve na loja e pagou a ultima parcela do aparelho auditivo valor 1.250,00 (cheque).\n---------------------------------------------------------\nData: 04/02/2013\nHora: 14:50:24\nAssunto: francine - programa de acompanhamento - ok.\n---------------------------------------------------------\nData: 07/03/2013\nHora: 11:10:11\nAssunto: FRANCINE - REGULAGEM E PA - TUDO OK.\n---------------------------------------------------------\nData: 27/03/2013\nHora: 09:14:45\nAssunto: Suzan -Filho da Sra. Maria de Lourdes deixou aparelho para conserto. Gaveta de pilha não fecha. Esta na garantia. OS: 2857.\n---------------------------------------------------------------------------------------\n30.10.14\nLidiane: Entrei em contato com o paciene para revisao e conhecer nova linha phonak, paciente agendou horáio para semana que vem.\n', 0, '', '', '2012-01-01'),
