(635, '', 'Leticia ', '', '', 'DIA: 05/04/2012 COMPROU AUDÉO MINI III OD PILHA 10\nOD: 1101X169C\nNF: 363.561 DATA: 24/05/2011\nR$: 3.300,00 ENT. R$: 1.500,00 MAIS 6X DE 300,00 NO CARTÃO DE CRÉDITO\n01 ANO DE GARANTIA.\nData: 15/12/2008\nFono: Débora\nCompareceu à clínica com aparelho mudo. Deixou para conserto.\n---------------------------------------------------------\nData: 09/01/2009\nFono: Débora\nFoi trocado o bloco do aparelho. Paciente veio buscar aparelho.\n---------------------------------------------------------\nData: 20/03/2009\nKELLEN:FICOU DEVENDO 18,00 REAIS 6 PILHAS 10 RAYOVAC!\n---------------------------------------------------------\nData: 03/04/2009\nDébora: Paciente esteve na clínica para aumentar o ganho do aperelho. Ao conectar o cabo para fazer a leitura do aparelho o mesmo não respondeu. O ap. foi enviado para Argosy.Maxx 11 OD nº 310608.\n---------------------------------------------------------\nData: 17/04/2009\nDébora: Kellen levou aparelho para a paciente .\n---------------------------------------------------------\nData: 07/05/2010\nDébora: Paciente esteve na clínica e deixou ap. maxx11 310608 para revisão da garantia.\n---------------------------------------------------------\nData: 14/05/2010\nDébora: Retornou à clínica para buscar aparelho.\n---------------------------------------------------------\nData: 04/03/2011\nHora: 14:23:57\nFono: Tanara\nAssunto: Paciente veio para aumentar o ganho do aparelho da OD ok. Estava com a gaveta quebrada Jaimar trocou pagou R$: 35,00.\n---------------------------------------------------------\nData: 05/04/2012\nHora: 11:50:22\nMirella: Pct comprou Audeo Mini III R$3.300,00 ( DÉBITO DE R$1.500,00+ 6x crédito R$ 300,00 cada parcela.\n---------------------------------------------------------\nData: 22/03/2013\nHora: 16:41:03\nFRAN - APARELHO PAROU DE FUNCIONAR. TROQUEI RECEPTOR E TUDO OK. AINDA ESTAVA NA GARANTIA.\n---------------------------------------------------------\n', 0, '', '', '2012-01-01'),
(636, 'fga. claúdia', 'Leticia ', '', '', '---------------------------------------------------------\nData: 13/06/2011\nHora: 13:50:13\nFono: Tanara\nAssunto: Paciente veio com sua filha Luciane encaminhado pela Fga. Cláudia para a adaptação de Micro-canal. Trouxe a audiometria e foi regulado 2 Audéo Smart V. Levou para a casa de teste e tirei pré-moldes bilateral para a confecção de aparelhos Intra Savia Art 11. (Era do seu Nabor). Foi para S.P para troca da caixa intra e revisão. Paciente vem na quarta para o retorno de teste.\n---------------------------------------------------------\nData: 15/06/2011\nHora: 13:02:23\nFono: Tanara\nAssunto: Paciente veio com sua filha Luciane relatando que vão fechar a venda. R$: 14.000,00. Vamos montar o Savia 11 bilateral. Ligaremos quando chegar. Vai pagar somente depois de terem ido na Fga: Cláudia no qual irá fazer uma avaliação.\n---------------------------------------------------------\nData: 30/06/2011\nHora: 13:33:04\nFono: Tanara\nAssunto: Paciente veio com sua filha Luciane para a adaptação. Primeiramente vai até a Fga: Cláudia para fazer o campo livre e depois voltará para fazer o pagamento. Fechou em R$: 14.000,00 e vai fazer em 5x de R$: 2.800,00. Marcado retorno dia: 07/07 para aumentar o aparelho.\n---------------------------------------------------------\nData: 05/07/2011\nHora: 13:36:51\nFono: Tanara\nAssunto: Paciente voltou com a pilha trancada dentro do aparelho. Orientei que a pilha deve ser colocada na gaveta não dentro do aparelho. Feito aumento da aclimatização para o nível 2 e orientei para que quando for na Fga: Cláudia passar antes aqui para aumentar mais os aparelhos.\n---------------------------------------------------------\nData: 18/07/2011\nHora: 02:10:03\nFono: Tanara\nassunto: Paceinte veio com a pilha trancada e aparelho mudo. Explique como faz a troca do protetor de cera e como se coloca a pilha de maneira certa. Paciente é bastante esquecido. Fiz aumento da aclimatização nível 3 e vem dia: 25/07 para passar para o nível 4.\n---------------------------------------------------------\nData: 25/07/2011\nHora: 12:20:45\nFono: Tanara\nAssunto: Paciente veio muito nervoso falando que não esta se adaptando com os aparelhos. Gosta de usar mas coloca a pilha ao contrário a pilha tranca. A filha falou que ele esta  muito esquecido e vai fazer uma tomografia. Falou que não dormiu a noite por ausa dos aparelhos. Devolveu e agradeceu a nosso atendimento.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 14:55:00\nAssunto: Suzan - Cadastro atualizado para mandar carta do open. Sr. Raul não comprou aparelho ainda. Pq não houve adaptação.\n---------------------------------------------------------\nData: 02/07/2012\nBruna: Veio pois oa aparelhos estavam mudos. Troquei as pilhas e voltaram a funcionar normalmente. Retorna na segunda para fechar a compra. OK\n---------------------------------------------------------\nData: 23/08/2012\nHora: 11:28:54\nFono: Tanara\nAssunto: Paciente veio para o retorno. Esqueceu o livreto. troquei o protetor de cera e falei pra ele vir 1 vez por Mês para eu fazer a limpeza básica.\n---------------------------------------------------------\nData: 10/12/2012\nHora: 10:40:04\nFrancine: Troca de cerustop e regulagem. Meatoscopia com suspeita de inflamação OD. Ficou satisfeito. Encaminhado ORL.\n---------------------------------------------------------\nData: 08/01/2013\nHora: 14:49:43\nAssunto: FRAN: Troca cerustop e orientação. Foi no médico e tomou atb para otite. Tudo OK.\n---------------------------------------------------------\nDIA: 30/07/2012 COMPROU AUDÉO SMART IX BILATERAL PILHA 312\nOD: 1150X01YR\nOE: 1147X0Y3U\nNF: 404.910 DATA: 29/02/2012\nR$: 11.000,00 À VISTA NO CHEQUE\n03 ANOS DE GARANTIA.', 0, '', '', '2012-07-30'),
(637, 'indicada pela fga. caro', 'Leticia ', '', '', 'Data: 26/03/2009\nKELLEN:PACIENTE LIGOU DISSE QUE PRETENDE VIM PRA TROCAR A MANGUEIRA DO MOLDE E OLHAR NOVOS APARELHOS ..!!\n---------------------------------------------------------\nData: 25/10/2011\nHora: 13:10:57\nFono: Tanara\nAssunto: Paciente veio com sua filha para consertar seu aparelho antigo. Usa Rexton analógico mais de 5 anos e apenas na OD pois a OE fez muitas cirurgias e não tem resposta.  Quem indicou foi a Fga. Carol que não trabalha mais com Rexton. Expliquei que o aparelho esta fazendo uns barulho e que não vale a pena o conserto. Feito Audio e deixei em teste o Naída IX UP. Marcado retorno dia: 27/10. Passei o valor de R$: 10.000,00.\n---------------------------------------------------------\nData: 27/10/2011\nHora: 13:28:15\nFono: Tanara\nAssunto: Paciente voltou relatando que o Náida não gostou pois achou baixo. Falou que quer comprar um analógico pois usa mais de 20 anos. Coloquei um Solo 411 dSC. Regulei mais uma vez o Náida IX e deixei os 2 com ela. Passei o Solo R$: 3.500,00.\n---------------------------------------------------------\nData: 31/10/2011\nHora: 10:09:53\nFono: Tanara\nAssunto: Paciente veio para o fechamento falou que ainda esta se acostumando com o aparelho. R$: 3.600,00, sendo entrada de 2.000,00 mais 2x de 800,00 no cartão de crédito. Feito pré-molde para confecção de molde de acrílico meia concha sem ventilação. Virá dia: 03/11 para o retorno. Feito contrato, entregar o kit de compra.\n---------------------------------------------------------\nData: 03/11/2011\nHora: 10:12:23\nFono: Tanara\nAssunto: Paciente veio mas o molde não estava pronto. Duarte vai pedir de S.P um aparelho mais potente analógico. Semana que vem virá para buscar o molde e o aparelho para o teste.\n---------------------------------------------------------\nData: 09/11/2011\nHora: 17:28:46\nFono: Tanara\nAssunto: Paciente veio para buscar o analógico Super-Front PP-C-P-4. Duarte falou que o aparelho é R$: 4.500,00, sendo que a paciente já pagou R$: 3.600,00 e a diferença é R$: 900,00. Vai dar na semana que vem no cartão. Levou o molde de acrílico.\n---------------------------------------------------------\nData: 02/01/2012\nHora: 15:30:45\nFono: Thaisa\nAssunto: Veio para regulagem.\n---------------------------------------------------------\nData: 09/01/2012\nHora: 15:00:15\nFono: Tanara\nAssunto: (Thaisa que atendeu) Paciente veio relatando que o aparelho não estava funcionando. porém etsava tudo normal. Feito troca da manguerinha ok.\n-----:----------------------------------------------------\nData: 03/07/2012\nBruna: Veio pois estava achando que seu aparelho não está funcionando direito. Aumentei ganho. OK\nDIA: 31/10/2011 COMPROU SUPER-FRONT PP-C-L-4 OD PILHA 675\nOD: 08CH18256\nR$: 4.500,00 ENT. R$: 2.000,00 MAIS 2X DE 800,00 MAIS 2X DE 450,00 NO CARTÃO\n01 ANO DE GARANTIA.', 0, '', '', '2011-10-31'),
(638, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/01/2012\nHora: 12:02:45\nFono: Tanara\nAssunto: Paciente veio com sua esposa para deixar o aparelho para orçamento. Esta com a tampa do trimpot quebrada. Pico-Forte PP-C-P 099H13633.\n---------------------------------------------------------\nData: 31/01/2012\nHora: 14:50:15\nFono: Tanara\nAssunto: Liguei e conversei com a esposa. Passei o valor de R$: 364,00. Foi autorizado.\nAPARELHO AUDITIVO PHONAK PICO-FORTE PP-C-P\n099H13633', 0, '', '', '2012-01-01'),
(639, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 26/04/2011\nHora: 14:25:02\nFono: Tanara\nMichelle: Paciente deixou aparelho pois esta mudo Duarte verificou o mesmo (os audiozoom 1589). Feito uma audiometria e teste com Audéo Mini III OD. Levou para a casa em vem na quinta dia: 05/05.\n---------------------------------------------------------\nData: 05/05/2011\nHora: 13:14:33\nFono: Tanara\nAssunto: Paciente veio para regular o aparelho de teste ok. Falou que quer ficar mais 1 semana e depois fazer o Intra CIC Power Certena. Quer o mais barato. Vai mandar a audio por faz e ligará para autorizar a confecção. Feito pré-molde da OE.\n---------------------------------------------------------\nData: 02/06/2011\nHora: 16:53:56\nFono: Tanara\nAssunto: Paciente veio com sua esposa para a adaptação. Feito regulagem e pagou a vista R$: 3.700,00. Marcado a 1 visita em 15 dias. Se interessou pelo relógio R$: 1.480,00.\n---------------------------------------------------------\nData: 16/06/2011\nHora: 13:07:08\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregues os brindes e diz que o aparelho esta muito bom e não sente mais mudar as programações. Diz que a pilha funciona apenas 4 dias, sendo que os dois primeiros são ótimos e depois enfraquece. Orientei deixar 2 minutos ativando antes de ligar o aparelho.\n---------------------------------------------------------\nData: 07/12/2011\nHora: 09:49:20\nFono: Tanara\nAssunto: Paceinte veio para a 3 visita. Entregue os brindes e falou que o aparelho esta ótimo. Orientei trocar o protetor de cera 1 vez por mês. Virá em abril para deixar para a manutenção na garantia.\n---------------------------------------------------------\nData: 23/05/2012\nHora: 14:27:18\nAssunto: Suzan - Endereço confirmado para mandar carta do Open.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 10:33:53\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Deixou o aparelho para a revisão Certena Art CIC OD R05116574. Levou um Audéo S Smart IX para teste e quem sabe compra um Ambra Nano na OD.\n---------------------------------------------------------\nData: 21/06/2012\nHora: 13:43:08\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho e acabou comprando o Ambra Nano OD por R$: 9.000,00 a vista. Deixou um cheque e virá trazer o dinheiro quando chegar o aparelho.\n---------------------------------------------------------\nData: 11/07/2012\nHora: 14:19:38\nFono: Tanara\nAssunto: Liguei e falei com o paciente que o aparelho já hegou. Vem na semana que vem buscar e dará R$: 9.000,00 em dinheiro em troca devolvemos o cheque.\n---------------------------------------------------------\nData: 01/08/2012\nHora: 11:56:04\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho Ambra Nano OD. Pagou R$: 9.000,00 em dinheiro ok. Marcado retorno dia: 14/08/2012.\n---------------------------------------------------------\nData: 14/08/2012\nHora: 17:35:01\nFono: Tanara\nAssunto: paciente veio para a 1 visita. Feito apenas algumas regulagem pois relatou ruído mais alto que a fala. Ativei os recursos.\n---------------------------------------------------------\nAtualização do programa de acompanahmento. Dei apenas 2 cartelas e de pilhas e 1 cerustop pois vai voltar em Agosto para seguir as datas do livreto. Em agosto a esposa virá pegar os brindes e trazer os livretos: pedir para fono separar 6 cartelas de pilha 10 + 1 cerustop + 1 cx de desumidificador.\nPACIENTE ESTÁ MUITO SATISFEITO COM NANO, REFERE QUE É UM APARELHO EXCELENTE. REGULAGEM OK. ENTREGUEI BRINDES: 6 CARTELAS DE PILHA 10 + 1 CERUSTOP + 1 CX DESUMIDIFICADOR.\nDIA: 02/06/2011 COMPRA CERTENA 11 OD\nOD: R05116574\nNF: 364.217 DATA: 27/05/2011 ATÉ 27/05/2012\nR$: 3.700,00 À VISTA\nDIA: 01/08/2012 COMPROU AMBRA NANO OD \nOD: P12F1601R\nNF: 423.375 DATA: 28/06/2012 ATÉ 28/06/2015.', 0, '', '', '2011-06-02'),
(640, 'sogro da fga: tanara', 'Leticia ', '', '', 'DIA: 09/02/2012 AUDIOMETRIA', 0, '', '', '2012-02-09'),
(641, 'internet', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/06/2012\nHora: 14:37:00\nFono: Tanara\nAssunto: Suzan - Sr. Richard diz que o valor pasado do aparelho no nosso orçamento foi de R$6.000,00 em 02/2012. Falei de promoção R$4.000,00. Ele disse que viu na Direito de Ouvir por R$2.500,00. Quer saber o pq da diferença de preço. Tanara vai ligar pra ele. \nMais tarde a Tanara ligou mas o paciente foi irredutível não querendo conhecer o aparelho de R$: 4.000,00. Falou que achou um por R$: 2.500,00 e vai comprar esse. Mesmo explicando as diferença e tecnologias não quis saber.\n---------------------------------------------------------\nDIA: 17/02/2012 TESTE COM APARELHOS', 0, '', '', '2012-02-17'),
(642, 'otovida/hu', '0', '', '', '---------------------------------------------------------\nData: 16/04/2009\nDébora: Paciente esteve na clínica com a queixa de que seu ap. estava mto baixo. Foi aumentado o ganho geral e nível de experiência.\n---------------------------------------------------------\nData: 25/3/2010\nDébora: Ap. veio da fábrica. OD-troca de receptor / OE-revisão e limpeza.\n---------------------------------------------------------\nData: 26/07/2011\nHora: 12:30:48\nFono: Tanara\nAssunto: Paciente veio comprar 3 cartelas de pilhas número 312 e 1 kit de protetor de cera smart guarde. Pagou R$: 95,00 no crédito.\n---------------------------------------------------------\nData: 28/11/2011\nHora: 17:14:01\nMichelle:Paciente deixou aparelho pois o mesmo esta mudo  MAXX 22 OD-4081393(os audiozoom 2146)\n---------------------------------------------------------\nData: 05/12/2011\nHora: 15:02:34\nMichelle: Paciente não autorizou conserto\n---------------------------------------------------------\nData: 07/12/2011\nHora: 13:46:06\nFono: Tanara\nAssunto: Paciente veio deixar os aparelhos intras para fazer orçamento. Maxx 2 bilateral OD 04081393 OE 04081393.\n---------------------------------------------------------\nData: 08/12/2011\nHora: 17:17:31\nFono: Tanara\nAssunto: Liguei e passei o valor do conserto para o apciente. Total R$: 960,00, sendo R$: 480,00 cada. Paciente não autorizou e quer um orçamento por escrito. Será cobrado R$: 21,00. Vem buscar amanhã.\n---------------------------------------------------------\nData: 13/12/2011\nHora: 12:35:29\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos juntos com o orçamento e pagou R$: 21,00.\n---------------------------------------------------------\nData: 29/02/2012\nHora: 16:01:43\nFono: Tanara\nAssunto: Paciente retirou os aparelho Maxx 22 bilateral na cortesia autorizado pelo Duarte, pois comprou 2 Audéo Smart III.\n---------------------------------------------------------\nData: 09/01/2013\nHora: 16:26:03\nAssunto: Suzan - Deixou aparelho para revisão, esta na garantia. Os: 2780.\n---------------------------------------------------------\nData: 29/01/2013\nHora: 10:21:57\nAssunto:cida. paciente veio retirar o aparelho phjonak audeo yes III Nº211145X004V , 211146X\n---------------------------------------------------------\nData: 09/02/2013\nHora: 14:32:50\njoice:programa de acompanhamento.\nPaciente deixou aparelho PHONAK AUDEO YES III n° 1146x0k4h-1145x004v para revisão...OS 2985\nPACIENTE RETIROU APARELHO .\nAPARELHO AUDITIVO PHONAK AUDEO YESIII OE: 211145X004V OD: 211146X0K4H\nNF N  429155 DATA: 31/07/2012 ATE 31/07/2013.\n------------------------------------------------------------------------------------\n30.10.2014\nLidiane: Efetuei ligação para paciente para agendar horário paciente aceitou.', 0, '', '', '2012-01-01'),
(643, 'syriaco', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/05/2012\nHora: 15:30:52\nAssunto: Suzan - Confirmado enderço para mandar carta do OPEN.\n--------------------------------------------------------\n20/07/06 COMPRA DE 2 APARELHOS FLAIR 321 ITC BERNAFON n ds1651/ds1652 VALOR 7.800.00  1 ENTRADA DE 2.400.00 MAIS 4X 1.350.00 \n', 0, '', '', '2006-07-20'),
(644, '', 'Leticia ', '', '', 'CLINICA SC FAZER AUDIOMÉTRIA \n', 0, '', '', NULL),
(645, '', 'Leticia ', '', '', 'Teste com Audeo S Smart IX para comprar o Ambra nano. Paciente qeria o Lyric, porém fica muito inconveniente devido a distancia da sua cidade (Campos Novos). Aconselhei em adquirir o Nano agora e daqui a 6 meses ou 1 ano optar pela Lyric, sendo que terá no Nano de reserva. Paciente concordou. Valor: R$22000,00 em 10X ou R$19800,00 a vista.\nFilha do paciente ligou confirmando a compra do Ambra Nano. Solicitou que eu enviasse para o email do Sr. Riscala (riscalafadel@hotmail.com) os dados para depósito, assim como entrada. Enviei. OK.\nPaciente veio na loja para fechar a compra do Nano. Referiu que gostou muito do S Smart IX, sendo a unica dificuldade usar o estetoscópio. Fizemos proposta de levar o S Smart IX para ter de reserva e o paciente concordou. Fechou a compra do Nano por R$22000,00 + S Smart IX por R$15000,00. Deu R$7000,00 de entrada (R$2200,00 já depositados mais um cheque de R$4800,00) e parcelou o restante em 10X R$3000,00 no cheque. Fiz regulagem nos AASIS, tudo OK. \n12/08/2013 - COMPROU AMBRA NANO - P13H1451R / P13H1452L - PILHA 10 - NF 490766 GARANTIA ATÉ 21/8/2014 - 3 ANOS PROGRAMA DE ACOMPANHAMENTO.                      COMPROU AUDEO S SMART IX - OD: 1228H029F / 1228H029K - PILHA 312 - NF438364 - 3 ANOS DE GARANTIA E PROG. DE ACOMPANHAMENTO. VALOR: R$37000,00 - ENTRADA DE R$7000,00 + 10X R$1000,00.', 0, '', '', '2013-08-12');
INSERT INTO `ntic_patient_info` (`patient_id`, `previous_doctor`, `next_doctor_id`, `pointer_doctor`, `comments`, `historic`, `deleted`, `left_loss`, `right_loss`, `last_test_date`) VALUES
(646, 'hu ', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/10/2009\nDébora: Deixou ap. PHONAK SOLO T 411 OD: 08CX13009 E OE: 08CX13027 para evisão de garantia.\n---------------------------------------------------------\nData: 12/11/2009\nDébora: Ap. veio a fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 13/11/2009\nDébora: Filha pegou aparelhos.\n---------------------------------------------------------\nData: 14/06/2010\nHora: 10:29:47\nMichelle:Paciente deixou aparelho para orçamento pois não esta funcionando SOLO T 411 OD: 08CX13009 (os audiozoom 1160).\n---------------------------------------------------------\nData: 15/06/2010\nDébora: Orçamento:Troca da chave MTO R$380,00.\n---------------------------------------------------------\nData: 31/10/2011\nHora: 11:51:25\nMichelle: Paciente deixou aparelho para orçamento  SOLO T 411 OD: 08CX13009 E OE: 08CX13027 (os audiozoom 2159)\n---------------------------------------------------------\nData: 03/11/2011\nHora: 10:26:17\nFono: Tanara\nAssunto: Liguei e falei com Devair e passei os valores de R$: 1.248,00, sendo R$: 624,00 cada. Não foi autorizado.\n---------------------------------------------------------\nData: 09/11/2011\nHora: 14:22:51\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos sem conserto.\nGANHOU AP. PHONAK SOLO T 411 OD: 08CX13009 E OE: 08CX13027\nDATA: 13/04/09 ATE 13/04/2010 (1 ANO) PILHA 13 NF: 265411\n33423400', 0, '', '', NULL),
(647, 'DR. KOWALSKI', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/08/2011\nHora: 09:34:21\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo Dr. Kowalski para realizar uma audiometria de acompanhamento e teste com aparelhos auditivos. Mostrou os exames de 1 ano atras e tinha uma audição normal. Em junho de 2011 a Bruna fez um audio e deu perda auditiva condutiva de grau leve a moderado. Feito a audiometria e continua com a mesma perda. Testei aparelhos Audéo Smart III bilateral e adorou. Orientei procurar o médico para fazer outros exames também.\n---------------------------------------------------------\nData: 04/10/2012\nHora: 15:18:03\nAssunto: Suzan - Ganhou do HU.\n---------------------------------------------------------\nData: 18/10/2012\nHora: 16:47:12\nAssunto: Sra. Rita diz que vai ganhar nenem na semana do Open, por isso nao vai poder comparecer.\n---------------------------------------------------------\nData: 15/01/2013\nHora: 09:24:46\nAssunto: Suzan - Deixou aparelho para revisão OS: 2785. Phonak Audeo Yes 1148x1D1l\n---------------------------------------------------------\nData: 19/02/2013\nHora: 08:14:17\nAssunto: Suzan - Esposo veio buscar aparelho que estava na revisão. Esta na garantia. OS: 2785 E deixou o outro aparelho para revisão. OS: 2823. Que tambem esta na garantia.\n---------------------------------------------------------\nData: 11/03/2013\nHora: 09:37:49\nAssunto: Suzan - veio buscar aparelho OS: 2823\n---------------------------------------------------------\nGANHOU DO HU AUDEO YES III OE 211148X1D1L, OD 211202X1P06 NF 407526 EMISSÃO 20/3/2012 1 ANO DE GARANTIA PILHA  312.', 0, '', '', '2012-01-01'),
(648, '', 'Leticia ', '', '', 'PACIENTE ENCAMINHADO DR. KOWALSKI, FIZ AUDIOMETRIA E OD: NORMAL E OE: COM PA NAS FREQ DE 4, 6 E 8KHZ. FALEI DOS APARELHOS, DAS TECNOLOGIAS E OFERECI S SMART OU NANO NAS TECNOLOGIAS V E IX A PREÇO DE TABELA. REFORCEI SOBRE A IMPORTANCIA DO USO. PORÉM PACIENTE NÃO QUIS LEVAR PRA CASA. VAI CONVERSAR COM A ESPOSA E VOLTA A ENTRAR EM CONTATO.\n', 0, '', '', NULL),
(649, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/10/2010\nHora: 09:00:55\nAssunto:\n---------------------------------------------------------\nData: 20/10/2010\nHora: 09:11:04\nAssunto:cida.cliente esteve na loja trouxe aprelho bernarfon neo 401 OE APARELHO MUDO. PROBLEMA.(RECEPTOR QUEIMADO)FOI FEITO A TROCA DO RECEPTOR.  FOI COLOCADO UM RECEPTOR USADO Á PEDIDO DO CLIENTE.OBS.NÃO FOI COBRADO DO CLIENTE.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 10:00:01\nFono: Tanara\nAssunto: Paciente veio conversar com o Duarte sobre aparelhos novos. Fechou 2 Eleva 22 com controle remoto por R$: 9.000,00 a vista com os aparelhos antigos. Fiz audiometria e pré-molde bilateral. Quando chegar ligaremos.\n---------------------------------------------------------\nData: 24/03/2011\nHora: 13:12:54\nFono: Tanara\nAssunto: Paciente ligou e seu aparelho tinha acabado de chegar. Virá amanhã para a adaptação. Falou que irá fazer depósito bancário de R$: 9.000,00.\n---------------------------------------------------------\nData: 25/03/2011\nHora: 11:38:38\nFono: Tanara\nAssunto: Paciente veio para a daptação. feito depósito de R$: 9.000,00. Marcado retorno em 15 dias. Entregar o programa de acompanhamento, o cartão.\n---------------------------------------------------------\nData: 07/04/2011\nHora: 13:41:35\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregues os brindes e marcado o retorno para o dia: 24/06. Entregue o cartão e o programa de acompanhamento.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 17:06:29\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 14:59:35\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 09:20:35\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto esta com o som "rachado". Eleva ITC OD 03116524. Esta na garantia.\n---------------------------------------------------------\nData: 05/10/2012\nHora: 15:06:16\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Vem buscar na segunda.\n---------------------------------------------------------\nData: 08/10/2012\nHora: 08:38:38\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Estava na garantia.\n---------------------------------------------------------\n15/08/07 COMPROU 01 APARELHO BERNAFON NEO 401 OE\nR$ 5.000,00 60 PILHAS 10 GRATIS.Troca de faceplate do aparelho unitron 400,00 reias\nDIA: 24/03/2011 COMPRA ELEVA 22 PILHA 312\nOD/OE 03116524\nNF: 354581 DATA: 23/03/2011 ATÉ 23/03/2013\nR$: 9.000,00 A V', 0, '', '', '2007-08-15'),
