(651, 'ACAF - TAIÓ', 'Leticia ', '', '', '05/08/09: TESTE C/ PICO FORTE PP CP OD (R$2300,00 CADA)\n---------------------------------------------------------\nData: 13/08/2009\nGracielle: foi ao retorno acompanhada do filho. Ficou com aparelho apenas da OD. Refere que fica mais atrapalhado com aparelho na OE junto. Retornará em um mês para pagamento parcela e acompanhamento.\n---------------------------------------------------------\nData: 09/09/09\nThais: pc pagou a 1ª/3 parcelas - R$500,00.\n---------------------------------------------------------\n12/08/2009\nCOMPRA CLASSICA PPCP (095H13871) - OD\nENT. R$ 800,00 + 3x R$500,00 VALOR TOTAL R$2.300,00\n2 ANOS DE GARANTIA', 0, '', '', '2009-08-12'),
(652, 'PACIENTE HÉRICO INDICOU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 02/05/2012\nHora: 11:03:42\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou.\n---------------------------------------------------------\nData: 07/05/2012\nHora: 08:31:53\nFono: Tanara\nAssunto: O filho veio buscar o aparelho ok.\n---------------------------------------------------------\nData: 14/11/2012\nHora: 14:26:25\nJOICE: PA, DEI CARTELA DE PILHAS MAIS CÍLICA E CERUSTOP, PACIENTE ESTAVA COM A METADE DA OLIVA DENTRO DO CONDUTO, MANDEI PROCURAR ORL PARA FAZERA RETIRADA.\nDIA: 20/10/2011 COMPRA AUDÉO SMART III BILATERAL PILHA 312\nOD: 1120X1YDR\nOE: 1120X0TUL\nNF: 384.143 DATA: 30/09/2011\nR$: 6.500,00 ENT. 1.000,00 (20/10) 1.000,00 (10/12) 1.000,00 (20/02) MAIS 10X DE 350,00 1 DIA 20/11 NO CHEQUE.\n01 ANO DE GARANTIA.\n', 0, '', '', '2011-10-20'),
(653, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 23/08/2012\nHora: 10:26:39\nFono: Tanara\nAssunto: Paciente veio com sua mãe Maria josé do Nascimento (jáusa aparelho) para fazer tampão de silicone bilateral com a cor transparente. Relatou que tem perda de audição. Fiz uma audiometria e tem perda mista na OE e normal na OD. Levou para casa para testar um Audéo S Smart IX na OE. Passei o valor de R$: 10.000,00 em 10x sem juros. Ou R$: 8.000,00 a vista autorizado pelo Duarte. Paciente mora em S.P. Paciente vai conversar com o marido e vem amanhã a tarde.\n---------------------------------------------------------\nData: 24/09/2012\nHora: 08:51:29\nFono: Tanara\nAssunto: Paciente veio buscar o molde ok.\nDIA: 23/08/2012 FEZ TAMPÃO DE SILICONE BILATERAL E TESTE COM AUDÉO SMART IX NA OE.', 0, '', '', NULL),
(654, '', 'Leticia ', '', '', '', 0, '', '', NULL),
(655, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 05/04/2011\nHora: 13:32:36\nFono: Tanara\nAssunto: Paciente do centro veio para o desgaste do molde. Jaimar desgastou ok. Tem um aparelho bi-cros na OD.\n---------------------------------------------------------\nData: 19/07/2011\nHora: 13:37:05\nFono: Tanara\nAssunto: Paciente veio para deixar os aparelhos pois esta com a sapata de audio quebrada. Deixei em teste 2 Audéo Smart IX Duarte passou o preço de R$: 11.000,00 cada. Virá na quinta dia: 21/07 para fazer teste com I-com\n---------------------------------------------------------\nData: 21/07/2011\nHora: 13:57:43\nFono: Tanara\nAssunto: Paciente veio para fazer o gerenciador de microfonia e testar o I-com. Falou que esta muito feliz os com aparelhos pois esta escutando muito bem de uma maneira natural. Levou o I-com para casa também e quando chegar os aparelhos delas ligaremos e vamos negociar. Duarte falou que se comprar os 2 aparelhos ganha o I-com.\n---------------------------------------------------------\nData: 02/08/2011\nHora: 14:53:10\nFono: Tanara\nAssunto: Paciente retirou os aparelhos feito troca da sapata de audio do solo. Pagou R$: 450,00 reais 6 meses de garantia. Fixou ainda com os Audéo Smart IX bilateral. Falou que vai na médico na semana que vem e voltará pra fechar a venda pois esta adorando os aparelhos.\n---------------------------------------------------------\nData: 24/08/2011\nHora: 13:15:46\nFono: Tanara\nAssunto: Paciente veio para regular os aaprelhos antigos, porém o computador não estava funcionando. Virá dia: 29/08 e falou que o Dr. Syriaco é somente dia: 22/09.\n---------------------------------------------------------\nData: 26/08/2011\nHora: 11:21:56\nFono: Tanara\nAssunto: Paciente veio para regular os aparelhos ok. Expliquei como usa o I-com e levou para casa de teste.\n---------------------------------------------------------\nData: 05/01/2012\nHora: 09:39:38\nFono: Tanara\nAssunto: Paciente veio relatando que a sapata esta frouxa. Apertei ok.\n---------------------------------------------------------\nData: 22/05/2012\nHora: 11:44:46\nFono: Tanara\nAssunto: Paciente veio relatando que o ouvido esta machucando. Fiz novo pré-molde para reposição. Molde de silicone invisível simples sem ventilação.\n---------------------------------------------------------\nData: 22/10/2012\nHora: 11:54:23\nFono: Tanara\nAssunto: Paciente veio para deixar para o conserto a sapata de audio que esta frouxa no aparelho. Vai para S.P. e se tiver custo S.P. vai ligar.\n---------------------------------------------------------\nData: 07/11/2012\nHora: 13:47:11\nMirella: Seiu filho veio trocar a oliva do aasi, pois sua mãe reclamou de apitos constantes, Duarte trocou as olivas e enviou uma cartela de pilha 312.\n---------------------------------------------------------\nUSA APARELHO BI-CROSS\nDIA: 19/07/2011 TESTE COM AUDÉO SMART IX BILATERAL.', 0, '', '', '2011-07-19'),
