(660, '', '0', '', '', '20/11/2013 - COMPROU 2 APARELHOS NAIDA S CRT III NS: 1303X0WV8/ 1303X0WUC COM 01 ANO DE GARANTIA E PAA. VALOR R$ 7.500,00 À VISTA.\n-----------------------------\n14/10/2014 - Zana.\nPcte compareceu para regulagem, estava mto baixo,\nDisse q já veio pra revisão e ajuste anteriormente.\nEntrega PA. Acaba garantia em novembro deste ano.\n------------------------', 0, '', '', NULL),
