(662, 'JORNAL', '0', '', 'APARELHO 0939X0HK6 TROCADO POR 0821X19Y2', '---------------------------------------------------------\nData: 07/02/2011\nHora: 13:28:56\nFono: Tanara\nAssunto: Duarte fez atendimento domiciliar. Vendeu 2 Audeo IX bilateral por R$: 20.000,00 mais o relógio. Deu um cheque de R$: 10.000,00. Paciente virá amanhã para fazer audiometria e uma nova regulagem.\n---------------------------------------------------------\nData: 08/02/2011\nHora: 13:31:29\nFono: Tanara\nAssunto: Paciente veio com sua esposa Iraci e seu neto. Feito audiometria e regulagem ok. Paciente adorou os aparelhos, feito adaptação com o relógio e pagou mais R$: 10.000,00. Duarte irá fazer os atendimento domiciliar.\n---------------------------------------------------------\nData: 11/02/2011\nHora: 17:30:15\nFono: Tanara\nAssunto: Duarte fez visita domiciliar e levou o kit manutenção com pilhas. Feito a 1 visita.\n---------------------------------------------------------\nData: 16/08/2011\nMichelle: Duartetrouxe o aparelho pois esta com a caixa quebrada modelo audéo od 0939x0hk6(os audiozoom 1847)\n---------------------------------------------------------\nData: 26/08/2011\nHora: 14:17:45\nFono: Tanara\nAssunto: Aparelho chegou da fábrica. Passei para o Duarte.\n---------------------------------------------------------\nData: 20/10/2011\nHora: 11:11:36\nFono: Tanara\nAssunto: Duarte deu o aparelho para mandar para S.P. Esta na garantia Audéo IX OE 0939X0HK6. Aparelho Mudo.\n---------------------------------------------------------\nData: 14/11/2011\nHora: 15:05:26\nMichelle: Paciente retirou aparelho\n---------------------------------------------------------\nData: 29/05/2012\nHora: 09:23:20\nFono: Tanara\nAssunto: O aparelho esta indo para S.P, esta mudo. Audéo IX OE 0939X0HK6. Esta na garantia.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 13:47:42\nFono: Tanara\nAssunto: Aparelho voltou de S.P. Entreguei para o Duarte.\n---------------------------------------------------------\nData: 13/09/2012\nHora: 15:23:20\nAssunto:cida. paciente esteve na loja (1 protetor de cera /5 cartelascde pilha 312. programa de acompanhamento.\n---------------------------------------------------------\nData: 15/01/2013\nHora: 11:09:08\nAssunto: fran: retirada de pré-molde para teste de AASI Naida. Duarte vai na casa do paciente para testar.\n---------------------------------------------------------\nData: 15/01/2013\nHora: 16:12:19\nAssunto: fran - abertura de os para aasi oe - baixa amplificação.\n---------------------------------------------------------\nData: 23/01/2013\nHora: 17:30:15\nAssunto: FRAN: liguei para avisar que aasi chegou. quer ver se Duarte leva o assi na sua casa.\n---------------------------------------------------------\nENVIADOS BRINDES DO PROG. DE ACOMPANHAMENTO POR SEDEX - 1 CX DE PILHA + 1 CX DE DESUMIDIFICADOR + 1 CERUSTOP\nDIA: 07/02/2011 VENDA AUDEO IX BILATERAL PILHA 312\nOD: 0939X0HK6 RECEPTOR\nOE: 0939X0HK5\nR$: 20.000,00 ENT. 10.000,00\n03 ANOS DE GARANTIA.\nNF: 292.441 DATA: 11/12/2009', 0, '', '', '2011-02-07'),
(663, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/12/2010\nHora: 10:49:40\nFono: Tanara\nAssunto: Quando a paciente chegar mostrar a declaração que o Sr. Pedro para a paciente pois somos representante da Phonak.\n---------------------------------------------------------\nData: 22/12/2010\nHora: 09:03:38\nFono: Tanara\nAssunto: Ligado para a paciente para vir buscar a caixa CRT bilateral. Paciente veio buscar as caixas. Feito a primeira visita, entregue os brindes e marcado o retorno para dia: 09/03/2011 para a 2 visita.\n---------------------------------------------------------\nData: 29/12/2010\nHora: 14:57:10\nFono: Tanara\nAssunto: Paciente veio relatando que seu aparelho esta saindo da orelha bilateral. Vamos fazer uma nova caixa com um conduto mais longo possível.\n---------------------------------------------------------\nData: 14/01/2011\nHora: 17:36:52\nFono: Tanara\nAssunto: Os Micro-Moldes já chegaram da fábrica. Liguei e avisei a paciente.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 13:51:28\nFono: Tanara\nAssunto: Paciente veio buscar os Micro-Moldes e a declaração ok.\n---------------------------------------------------------\nData: 09/03/2011\nHora: 13:24:55\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Feito regulagem deixado na aclimatização 4 e troca da oliva por micro-caixa. ok falou que ficou bem melhor mais alto.\n---------------------------------------------------------\nData: 17/03/2011\nHora: 14:58:53\nFono: Tanara\nAssunto: Paciente veio relatando que os ruídos são mais altos que a fala. Feito regulagem e marquei retorno para dia: 24/03.\n---------------------------------------------------------\nData: 24/03/2011\nHora: 13:10:04\nFono: Tanara\nAssunto: Paciente veio relatando que o som esta abafado. Feito regulagem e virá amanhã pois quer a regulagem anterior.\n---------------------------------------------------------\nData: 25/03/2011\nHora: 12:03:00\nFono: Tanara\nAssunto: Paciente veio e deixamos a regulagem que estava. Marcado um retorno dia: 18/04. Quer saber se o Duarte dará o Voiss pra ela.\n---------------------------------------------------------\nData: 02/05/2011\nHora: 12:34:56\nFono: Tanara\nAssunto: Paciente veio buscar a nota fiscal com a Michelly e falou que o MP3 não estava funcionando direito com i-com. Porém ela não trouxe o MP3 para verificar o problema. Expliquei que precisa trazer.\n---------------------------------------------------------\nData: 15/10/2012\nHora: 16:12:44\nFono: Tanara\nAssunto: Paciente veio relatando que a base do protetor de cera caiu no aparelho da OD. vai para S.P. na garantia. Emprestei 2 Audéo S Smart IX bilateral. Deixou os 2 para revisão. Audéo Smart IX OD 1041H07PH OE 1041H07PG.\n---------------------------------------------------------\nData: 25/10/2012\nHora: 14:07:11\nFono: Tanara\nAssunto: Liguei e avisie que os aparelhos já chegaram de S.P. Vem na segunda dia: 29/10/2012 para conversar com o Duarte a respeito da compra de aparelhos novos.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 11:08:10\nFono: Tanara\nAssunto: Paciente veio falando que adorou os aparelhos, mas não tem condições agora de comprar. Duarte fez por R$: 10.000,00 a vista a diferença. Vai esperar um pouco mais. Retirou os dela.\n---------------------------------------------------------\nData: 05/03/2013\nHora: 17:55:00\nFRAN - PACTE VEIO INTERESSADA NO LYRIC OU NANO. EM TESTE COM O LYRIC. HOJE EU RETIREI AS MEDIDAS (OD 8MM XP / OE 7MM XP) E VAI VIR NA 6ª PARA COLOCAR OS APARELHOS. VAI TENTAR PELA FUSEX.\nPaciente não conseguiu usar Lyric na OD devido a garnde sensibilidade. Retirei da orelha esquerda e conversamos sobre o Nano. Duarte fez orçamento de Nano por R$17000,00 ou R$14000,00 se der os aparelhos usados como parte do pagamento. \nDIA: 06/12/2010 COMPROU AUDÉO SMART IX BILATERAL PILHA 312     \nOD: 1041H07PH\nOE: 1041H07PG\nR$: 16.000,00 ENT. 7.000,00 MAIS 10X DE 700,00 + 1X DE 2.000,00\nNF: DATA:\nI-COM: 1025F2HDV\nMY PILOT: 1025F2036 ', 0, '', '', '2010-12-06'),
(664, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/12/2011\nThaisa: Paciente veio para programa de acompánhamento, estava marcado para dia 10/01, porém já estava sem pilhas, fiz a entrega dos brindes e deixei marcada a 3º visita para 24/04/12. Paciente refere otalgia,fiz meatoscopia e aconselhei consultar com otorrino.\n---------------------------------------------------------\nData: 06/01/2012\nHora: 13:35:28\nFono: Tanara\nAssunto: Paciente veio relatando que os aaprelhos não estão bons. Verifiquei que a oliva esta ao contrário. Thaisa atendeu da última vez. Feito troca das olivas e ficou tudo bem.\n---------------------------------------------------------\nData: 10/10/2012\nHora: 16:45:20\nFono: Tanara\nAssunto: Paciente veio para o retorno da 4 visita. Entregue os brindes e deixou os aparelhos para a revisão e limpeza. Audéo Smart III bilateral OD 1120X271G OE 1120X1YD8. Marcado para abril o retorno.\n---------------------------------------------------------\nData: 19/10/2012\nHora: 11:39:44\nFono: Tanara\nAssunto: Liguei e avisei que os aparelhos já chegaram de S.P. Vem na segunda retirar.\n---------------------------------------------------------\nData: 22/10/2012\nHora: 17:29:19\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos. Vem na quarta para fazer audiometria.\n---------------------------------------------------------\nData: 27/02/2013\nHora: 16:13:58\njoice: PACIENTE VEIO OM QUEIXA DE QUE AASI DA ORELHA DIREITA NÃO ESTAVA FINCIONANDO NA MEATOSCOPIA PERCEBI LÍQUIDO TRANSPARELTE O MESMO TINHA ENTUPIDO RECEPTOR. COLQUEI RECEPTOR NOVO TAMANHO 2 EXPLIQUE SE ISSO VIER ACONTECER OUTRA VEZ ELA DEVERÁ NOS PROCURAR, PORÉM PACIENTE ACHA QUE APARELHO ESTA RUIM DEPOIS DE UMA REVISÃO QUE FOI MNDADO PARA SP SEGUNGO INFORMAÇÕES COLIDA DA MESMA, POIS NÃO FOI ANOTADO AUI NO APLICATIVO ESSA OS E NEM SEU DADOS.\nPaciente compareceu para PA. Entregue brindes, Paciente relatou que aasi OD não percebe que esta ligado. Escutei etudo ok. Fiz meatoscopia na OD e verifiquei grande presença de líquido na OM, talvez peruração de tímpano. Encaminhei para ORL. Na OE esta tudo OK.\nDIA: 10/10/2011 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1120X271G\nOE: 1120X1YD8\nNF:379.577 DATA: 31/08/2011\nA NORA PASSOU PELA FRENTE\nR$: 7.000,00 ENT. 3.500,00 MAIS 10X DE 350,00 NO CHEQUE\n01 ANO DE GARANTIA.', 0, '', '', '2011-10-10'),
(665, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 17/11/2011\nHora: 14:00:16\nFono: tanara\nAssunto: Paciente veio coma  filha Cintya colocar o fio de naylon.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 14:11:41\nAssunto: Suzan - Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:25:48\nAssunto: Suzan - Ligar mais tarde.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 16:45:51\nAssunto: Suzan - Sra. Ruth diz que esta doente, pediu para ligar semana que vem se estiver melhor ela vem no Open. Não recebeu carta do Open. Endereço confirmado.\n---------------------------------------------------------\nData: 12/06/2012\nHora: 14:56:55\nAssunto: Suzan - Cintia (filha) diz que Sra. Ruth esta com problemas de saúde e não esta saindo de casa. Provavelmente não vira ao Open.\nUSA APARELHO INTRA DA DANAVOX COMPRA SOMENTE PILHA', 0, '', '', NULL),
(666, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 11/01/2012\nHora: 12:18:03\nFono: Tanara\nAssunto: Paciente veio com seu filho Flávio. O filho já conhecia o Duarte e negociou em R$: 10.000,00 bilateral à vista. Paciente já tinha a audiometria e fiz teste com Naída V SP bilateral. Fechou a venda dando um cheque que seria a entrada no valor de R$: 5.000,00 e os outros 5.000,00 no final de janeiro. Paciente vai viajar e voltará dia: 27/01/2012 para a 1 visita.\n---------------------------------------------------------\nData: 09/05/2012\nHora: 10:30:38\nFono: Tanara\nAssunto: Paciente veio com seu filho Flávio para o retorno. Feito a troca das caixinhas coloridas e buscou os moldes da cor da pele. Marquei o retorno dentro de 15 dias.\n---------------------------------------------------------\nData: 06/09/2012\nHora: 11:34:10\nAssunto:cida. liguei para o pacinte para remarcar a consulta para loja do centro.\n---------------------------------------------------------\nData: 19/11/2012\nHora: 08:15:32\nMirella: Dia 23/5 Paciente adquiriu um  Iview por R$ 550,00 parcelou em 4X no cartão de crédito, porém em alguns dias ele devolveu o aasi, e o Duarte informou que só devolveria o dinheiro depois de ter recebido as 4 parcelas, Desta forma o seu filho ligou dia  13/11/2012 questionando o pgto pois já tinha expirado os 4 meses do prazo de pagamento, como o Duarte estava viajando só conversei com ele hoje, e o mesmo me informou que irá efetuar devolver o pagto, porém no valor de R$ 525,00  devido ao desconto das taxas do cartão de crédito parcelado.\n---------------------------------------------------------\nData: 07/12/2012\nHora: 10:19:03\nAssunto: Francine. S. Ruy teve acompanhado de seu filho Flavio. Flavio fez algumas queixas sobre os aparelhos de seu pai. Fiquei de conversar com Duarte. Marcou para próxima semana. Levou 1 cartela de pilhas.\n---------------------------------------------------------\n', 0, '', '', '2012-01-12'),
(667, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/11/2011\nHora: 08:39:56\nMichelle: Paciente deixou aparelho pois o mesmo esta mudo com som ruim e sem a tampa do trimpot MODELO  SOLO T +411 DSC 091X11957 / 08BX16647(os audiozoom 2127)\n---------------------------------------------------------\nData: 24/11/2011\nHora: 11:30:04\nFono: Tanara\nAssunto: Paciente veio para autorizar o conserto dos aparelhos. Total R$: 1.248,00, sendo R$: 624,00 cada.\n---------------------------------------------------------\nData: 19/12/2011\nHora: 14:39:04\nFono: Tanara\nAssunto: Liguei para a filha cristiane e avisei que os aparelhos já chegaram. Passará o recado.\n---------------------------------------------------------\nData: 21/12/2011\nHora: 16:39:13\nMichelle: Paciente retirou aparelho pagou 800,00 e faltou 448,00 para pagar no dia 06/01 feito troca da caixa +microfone+amplificador  6 meses de garantia\n---------------------------------------------------------\nData: 23/10/2012\nHora: 09:16:57\nFono: Tanara\nAssunto: Paciente veio trocar a manguerinha e falei de fazer molde novo. Feito pré-molde para a confecção de molde de silicone meia conhca escavada sem ventilação OE. R$: 80,00. Vem buscar na sexta dia: 26/10/2012. Falei de aparelho novo, R$: 3.500,00 Naída III em 10x sem juros, mas não tem condições. Michelle: Paciente deu entrada de molde R$:20,00 falta 60,00\n---------------------------------------------------------\nData: 29/10/2012\nHora: 10:09:30\nFono: Tanara\nAssunto: Paciente veio buscar o molde e pagou R$: 60,00.\nPaciente veio para fazer orçamento de conserto de aasi e comprou Naida V SP. Fiz R$3100,00 - Entrada de R$500,00 + 13 X de R$200,00. Dei 3 anos de pilhas gratis.\npaciente efetuou pagamento da 4ª parcela do aparelho e ganhou 12 pilhas e 20 pastilhas para limpeza de molde.\nPaciente retirou doze pilhas 13.\nPACIENTE EFETUOU PAGAMENTO DA 5ª PARCELA.\nUSA APARELHO PHONAK \nMODELO  SOLO T +411 DSC - 091X11957 / 08BX16647                                                     11/04/2013 - COMPROU NAIDA V SP - Nº 1121X0TR0 - PILHA 13. VALOR: R$3100,00 - ENTRADA R$500,00 + 13 X R$200,00. GARANTIA ATÉ 11/04/2014 - 3 ANOS PROG. DE ACOMPANHAMENTO.', 0, '', '', '2013-04-11'),
