(669, 'HU', 'Leticia ', '', '', '---------------------------------------------------------\nData: 19/01/2011\nHora: 08:20:26\nFono: Tanara\nAssunto: Paciente veio com seu marido Nelson. Escutaram na rádio a entrevista. Feito uma audiometria e a paciente apresenta perda profunda nos sons médios e agudos. Tem deficiencia visual. Colocamos Naída V bilateral. Levou para teste domiciliar e vem amanhã buscar os moldes e uma declaração para a família.\n---------------------------------------------------------\nData: 20/01/2011\nHora: 16:20:58\nFono: Tanara\nAssunto: Paciente veio com seu marido Nelson buscar a declaração que irá levar para a família e buscou os moldes. Esta se adaptando muito bem. Passei valores de R$: 8.778,00 cada em até 10x sem juros ou a vista 10%.\n---------------------------------------------------------\nData: 01/02/2011\nHora: 09:57:16\nFono: Tanara\nAssunto: Paciente veio com o marido Nelson para devolver os aparelhos. Falou que Sandra adorou os aparelhos escutou bem mas pelo valor ainda não é possível comprar. Vai tentar mais tarde com a familia e arrecadar dinheiro para comprar o melhor pra ela. Vai entrar em contato.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 15:31:36\nAssunto: Suzan - Confirmado endereço para mandar carta do open com o esposo.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 14:23:45\nAssunto: Suzan - Sr. Nelson pediu para ligar na quinta feira para ver um horario para o open. Estava muito ocupado com mudanças.\n---------------------------------------------------------\nData: 28/03/2013\nHora: 09:25:17\n\nDIA: 19/01/2011 TESTE COM APARELHOS \nUSA APARELHO PHONAK NF: 381.550 14/09/2011 ATÉ 14/09/2012\nMODELO NAÍDA III UP OE: 1122X0T54 / OD: 1120X0PAX\nDIA: 29/05/2012 ESPOSO DIZ QUE PACIENTE GANHOU APARELHO DO HU.', 0, '', '', '2011-01-19'),
(670, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 09/06/2011\nHora: 13:38:53\nFono: Tanara\nAssunto: Paciente veio com sua filha Sueli encaminhada pelo Dr. Kowalski para teste com aparelhos. Veio com a audiometria e falei dos preços. Devido as condições financeiras passei o valor de Una por R$: 2.800,00 cada. Ficou de ver com os filhos e ligará.\n---------------------------------------------------------\nData: 28/03/2013\nHora: 09:27:51\nDIA: 09/06/2011 TESTE COM APARELHOS', 0, '', '', '2011-06-09'),
