(672, '', 'Leticia ', '', '', 'PACIENTE VEIO ENCAMINHADA PELO DR. KOWALSKI PARA FAZER AUDIO E TESTE. AUDIOMETRIA: OD: P.A. PROFUNDA (AUSENCIA TOTAL DE RESPOSTA) / OE: NORMAL. OFERECI SISTEMA CROSS. PASSEI r$9000,00. ACHOU MUITO CARO, MESMO COM PROMOÇÃO E DESCONTO NÃO TEM CONDIÇÕES. NÃO QUIS NEM TESTAR. PACIENTE É RECEM CASADA, CASALSINHO NOVO, QUE MORA EM GOV. CELSO RAMOS. \nTESTE /C APARELHO - PERDA PROFUNDA UNILATERAL - SISTEMA CROSS', 0, '', '', NULL),
