(675, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/01/2013\nHora: 13:45:40\nAssunto: FRAN - PACIENTE VEIO OBTER INFORMAÇÕES PARA COMPRA DE AASI NOVO. TESTE DE AUDEO S SMART IX BILATERAL. PASSEI VALORES DE TABELA. NÃO HOUVE NEGOCIAÇÃO INICIAL. PACIENTE FICOU MUITO SATIAFEITO COM O APAELHO, MAS ESTA ACHANDO CARO E ESTA INTERESSADO NO S SMART III, DEVIDO O VALOR.\n---------------------------------------------------------\nPACIENTE COMPROU APARELHO EM OUTRO LUGAR, NO CENTRO, REFERINDO QUE AMOU O NOSSO APARELHO, QUE A QUALIDADE É EXCEPCIONAL, PORÉM ACHOU BEMMM MAIS BARATO E PREFERIU COMPRAR UM INFERIOR\n03/01/2013 - TESTE COM AUDEO S SMART BILATERAL ATÉ DIA 21/01/2013', 0, '', '', '2013-01-03'),
(676, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 19/04/2011\nHora: 13:15:32\nFono: Tanara\nAssunto: Paciente veio com seu filho Vanderlei para fazer audiometria e teste com aparelhos. Feito teste com Audéo Mini III bilateral. Paciente levou para casa e vem na segunda depois da páscoa. Passei os valores e vai pensar sobre a melhor meneira de pagar, R$: 8.200,00 em 4x sem juros ou 1 mais 9x de 900,00 ou a vista R$: 7.400,00. A tarde o filho ligou e falou que seu pai esta ouvindo bem e vem pagar na segunda.\n---------------------------------------------------------\nData: 25/04/2011\nHora: 12:44:11\nFono: Tanara\nAssunto: Paciente veio com seu filho Vanderlei. Falou que esta se adaptando bem e vai pagar em 1 mais 3x sem juros. Aumentei um pouco a aclimatização e falei para vir na semana que vem. Vai trazer os cheques dia: 27/04.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 12:45:44\nFono: Tanara\nAssunto: O filho já veio trazer os cheques, sendo 1 mais 3x de R$: 2.050,00. Duarte terminou de atender. Falei para trazer o pai na semana que vem sem falta. Paciente esta com 2 Audéo Mini V. Trocar pelo Mini III.\n---------------------------------------------------------\nData: 04/05/2011\nHora: 13:01:54\nFono: Tanara\nAssunto: Paciente veio para a 1 visita. Entregue os brindes e feito a troca dos aparelhos ok. Aumentei para o nivel 3 a aclimatização. Paciente esta ouvindo muito bem sentindo bastante diferença quando tira os aaprelhos.\n---------------------------------------------------------\nData: 07/06/2011\nHora: 13:32:17\nFono: Tanara\nAssunto: Paciente veio com seu filho relatando que o aparelho da OD não esta funcionando. Era protetor de cera que estava entupido. Expliquei como faz a troca e passei para a aclimatização nivel 4 ok. Paciente esta bem adaptado.\n---------------------------------------------------------\nData: 26/07/2011\nHora: 13:24:29\nFono: Tanara\nAssunto: Paciente veio com seu filho Vanderlei para fazer a 3 visita. Paciente diz que esta gostando de usar porém relata brincando que nao terá muito tempo de vida e tanto faz se ouve ou nao. Sente ainda dificuldade para colocar. Feito pré-molde bilateral para fazer a micro-caixa. Ligaremos quando chegar.\n---------------------------------------------------------\nData: 17/08/2011\nHora: 13:50:36\nFono: Tanara\nAssunto: Paciente veio para buscar as micro-caixas, porém não se acostumou falou que o som da voz não é boa. Fiz regulagem e não deu certo. Deixamos a adaptação aberta.\n---------------------------------------------------------\nData: 30/04/2012\nHora: 11:42:26\nFono: Tanara\nAssunto: O filho vanderlei deixou os aparelhos na garantia. Audéo Mini III OD 1048X11RW OE 1048X11RV.\n---------------------------------------------------------\nData: 10/05/2012\nHora: 16:39:31\nFono: Tanara\nAssunto: Liguei e falei com o filho Vanderlei que os aparelhos já chegaram. Virá buscar amanhã e vai devolver os de empréstimo.\n---------------------------------------------------------\nData: 11/05/2012\nHora: 08:38:23\nFono: Tanara\nAssunto: O filho veio retirar os aparelhos e devolveu os de empréstimo.\nDIA: 26/04/2011 COMPROU AUDÉO MINI III BILATERAL PILHA 10\nOD: 1048X11RW\nOE: 1048X11RV\nNF: 349.988 DATA: 16/02/2011\nR$: 8.200,00 ENT. DE 2.050,00 MAIS 3X DE 2.050,00 NO CHEQUE\n01 ANO DE GARANTIA.', 0, '', '', '2011-04-26'),
(677, '', 'Leticia ', '', '', 'COMPROU AP. BELTONI OPERA PLUS R$1.610,00\nDATA COMPRA 04/01/2000', 0, '', '', NULL),
(678, '', 'Leticia ', '', '', '------------------------------------------------------\nData: 07/05/2009\nGracielle: veio acompanhada do marido fazer orçamento de novos aparelhos auditivos. Recebeu mala direta Dia das Mães. Tem par de Targa 3 ganhos na Otovida há 3 anos atrás, que nunca usou. Moldes sempre machucaram. Teste de VA. Gostou dos aparelhos de adaptação aberta. Levaram orçamento para apresentar na Saúde Caixa. Par de MicroAmbia 100 dAZ: R$ 8400,00 (30% desconto cada).\n---------------------------------------------------------\nData: 19/05/2009\nGracielle: Caixa autorizou a compra. R$8400,00. Pagaram 80% e pc pagou os 20% restantes. Levou par de MicroPower III, mas foi tirado CF do MicroAmbia por conta do orçamento.\n---------------------------------------------------------\nData: 18/5/2010\nHora: 17:10:19\nMichelle:Paciente deixou aparelho R/0838X10XM para fazer  revisão e limpeza (os audiozoom 134).\n---------------------------------------------------------\nData: 02/06/2010\nDébora: Ap. veio da fábrica. Feito troca de módulo.\n---------------------------------------------------------\nData: 9/6/2010\nHora: 15:16:01\nMichelle:Paciente retirou  aparelho R/0838X10XM feito  revisão e limpeza (os audiozoom 134).\n---------------------------------------------------------\nData: 9/6/2010\nHora: 15:16:42\nMichelle:Paciente deixou aparelho 0837x10xr para fazer  revisão e limpeza (os audiozoom 1206).\n---------------------------------------------------------\nData: 30/06/2010\nDébora: Retornou à clínica para buscar aparelho.\n---------------------------------------------------------\nData: 21/01/2011\nHora: 17:18:52\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho da OD estava machucando por ser um conduto estreito. Troquei a oliva por aberta e pequena ficou ok.\n---------------------------------------------------------\nData: 24/01/2011\nHora: 13:26:04\nFono: Tanara\nAssunto: Paciente veio relatando que estava apitando OD. Fiz o gerenciador de microfonia e coloquei uma oliva aberta numero 5 ok.\n---------------------------------------------------------\nData: 15/03/2011\nHora: 13:18:06\nFono: Tanara\nAssunto: Paciente veio relatando que a oliva estava machucando e o aparelho da OD estava baixo. Troquei de oliva, fiz regulagem ok.\n---------------------------------------------------------\nData: 22/09/2011\nHora: 09:20:38\nFono: Tanara\nAssunto: Paciente veio e levou para teste 2 Audéo Smart III. Virá na terça. Passei o valor do Smart IX.\n---------------------------------------------------------\nData: 17/11/2011\nHora: 08:35:06\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para o conserto pois o som esta intermitente. Micro-Power III Argosy OD 0838X10XR. Duarte autorizou mandar para S.P terá um custo de R$: 480,00. Depois vai ser quanto o pagamento.\n---------------------------------------------------------\nData: 02/12/2011\nHora: 09:59:31\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho ok. Apesar do custo de R$: 480,00 paciente não pagou nada. Autorizado pelo Duarte. Próxima vez terá custo.\n---------------------------------------------------------\nData: 27/12/2011\nThaisa: Veio para verificar aparelho OE. Estava fraco, verifiquei cerustop e oliva. Ficou ok.\n---------------------------------------------------------\nData: 09/01/2012\nHora: 14:58:24\nFono: Tanara\nAssunto: (Thaisa Atendeu) Paciente veio regular o aparelho esta baixo ok.\n---------------------------------------------------------\nData: 21/03/2013\nHora: 16:15:06\nFRANCINE - PACIENTE VEIO REGULAR O APARELHO. BAIXEI O GANHO GERAL EM 2 DB E MELHOREI INTELIGIBILIDADE DE FALA. FALEI DO LYRIC E MOTIVEI A PACIENTE A TESTAR APARELHOS NOVOS.\nfeita regulagem no aparelho. melhorei inteligibilidade de fala. paciente refere q esta sentindo uma pressao na cabeça, e sente isso até sem o aparelho. Falei para consultar com médico e fazer os exames!!\nDIA: 19/05/2009 COMPROU MICRO-POWER III BILATERAL PILHA 312\nOD: 0838X10XR\nOE: 0838X10XM\n02 ANOS DE GARANTIA     48 PILHAS POR APARELHO\nR$: 8.400,00 À VISTA (CONVÊNIO CAIXA)\nNF: 38173 DATA: 19/03/2009', 0, '', '', '2009-05-19'),
(679, 'dr. bruce', 'Leticia ', '', '', '---------------------------------------------------------\nData: 26/05/2010\nHora: 14:26:22\nMichelle:Paciente trouxe aparelho para fazer revisão e limpeza win 102 095019 com molde pilha e caixa (os audiozoom 1143).\n---------------------------------------------------------\nData: 27/05/2010\nHora: 17:37:28\nMichelle:Paciente retirou aparelho feito revisão e limpeza win 102 095019 com molde pilha e caixa (os audiozoom 1143)R$135,00.\n---------------------------------------------------------\nData: 25/05/2012\nHora: 16:46:55\nAssunto: Suzan - Confirmado endereço para mandar OPEN.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 14:27:34\nAssunto: Suzan - Sr. Silvio não esta. Falei com empregada. Ligar na semana que vem.\n---------------------------------------------------------\nData: 12/06/2012\nHora: 15:15:42\nAssunto: Suzan - Confirmada presença para o Open. 18/06 as 17:30.\n26/02/2008  PILHA 13\nComprou ap. Bernafon Win 102 n  095019  Valor total R$ 5.000,00 Entrada R$ 1.000,00 + 10x R$ 200,00 + 1 de 2.000,00  Entregue um desumidificador', 0, '', '', '2008-02-26'),
