(682, 'internet', 'Leticia ', '', '', '---------------------------------------------------------\nData: 01/11/2012\nHora: 14:22:45\nMirella: 01/11/2012 Compra Audéo Yes IX r$ 4.100,00 (R$ 1.100,00 entr. + 2X R$ 250,00 + 5X R$ 500,00, parcelas no cheque entrada no dinheiro, aasi n° 0950H08C3.\n---------------------------------------------------------\nDIA: 15/03/2012 COMPROU AUDÉO YES III OE PILHA 312\nOE: 1121X1C05 R$: 4.100,00 ENT. DE R$: 300,00 MAIS 10X DE R$: 380,00 NO CHEQUE\nNF: 387.097 DATA: 25/10/2011\n01/11/2012 Compra Audéo Yes IX r$ 4.100,00 (R$ 1.100,00 entr. + 2X R$ 250,00 + 5X R$ 500,00.', 0, '', '', '2012-03-15'),
(683, 'hu', 'Leticia ', '', '', '---------------------------------------------------------\nData: 05/08/2011\nHora: 13:21:09\nFono: Tanara\nAssunto: Paciente veio com seu marido marcelo e os dois filhos para fazer teste e orçamento de aparelhos auditivos. Usa um aparelho retro na OE que ganhou do HU, mas não ouve muito bem. Veio com a audiometria feita no COF. Coloquei 2 audéos Smart III. Gostou bastante e levou para casa para testar. Testei também o I-com e adorou a novidade. Voltará na terça as 15:00 hs da tarde. Passei os valores do Smart III e V.\n---------------------------------------------------------\nData: 09/08/2011\nHora: 13:08:35\nFono: Tanara\nAssunto: Paceinte veio relatando que gostou dos aparelhos mas agora vai ver a possibilidade de comprar. Ligará.\n---------------------------------------------------------\nData: 18/05/2012\nHora: 14:39:01\nAssunto: Suzan - Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:29:25\nAssunto: Suzan - Falei com empregada , não esta em casa.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:32:18\nAssunto: Suzan- Simone disse que vai trazer uma pessoa para ver aparelhos no dia do open. Pediu para ligar no final da semana pq vai confirmar com essa pessoa.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 14:32:56\nAssunto: SUZAN - Confirmado presença no Open. Dia 19/06 as 16:00hrs.\n---------------------------------------------------------\nData: 21/11/2012\nHora: 16:31:05\nBruna: Veio para visita de 6 meses. Tudo OK com os aparelhos, troquei olivas. Entregue produtos. Próxima visita dia 25/04/13 ás 15h. OK\n---------------------------------------------------------\nTroquei Oliva. Tudo OK.\nDIA: 23/04/2012 COMPROU AUDÉO SMART III BILATERAL PILHA 312\nOD: 1146X112N\nOE: 1146X0MMC\nNF: 400.523 DATA: 31/01/2012 \nR$: 9.000,00 À VISTA DEPÓSITO CF: 3295\n01 ANO DE GARANTIA \nI-COM', 0, '', '', '2012-04-23'),
(684, 'otovida', 'Leticia ', '', '', '---------------------------------------------------------\nData: 24/12/2009\nDébora: Deixou 02 ap. SOLO T+ 311 OD: 084X15292 / OE: 084X15293 para revisão da garantia.\n---------------------------------------------------------\nData: 12/1/2010\nAPARELHO SOLO T+ 311 OD: 084X15292 / OE: 084X15293 - (2 ANOS DE GARANTIA - 30.05.08 ATÉ 30.05.2010) NF 25532 - PILHA 13.\n---------------------------------------------------------\nData: 14/1/2010\nDébora: Ap. veio da fábrica. Feito troca de cj módulo e bobina.\n---------------------------------------------------------\nData: 2/3/2010\nHora: 16:18:29\nAssunto:30/01/2010 entrada do ap. R$2.000,00.\nASSUNTO:02/02/2010 PAGOU A 2ª PARCELA R$ 2.000,00\n---------------------------------------------------------\nData: 15/10/2010\nDébora: Paciente esteve na clínica. Feito pré-molde para confecção de micro-molde. Enviado pra fábrica.\n---------------------------------------------------------\nData: 11/01/2011\nHora: 14:04:03\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Entregue os brindes e marcado o retorno dia: 29/06/2011. Liguei para a Débora e falou que não será possível fazer o micro-molde pois o conduto da paciente é muito curto, portanto ficará com as olivas. Falou que sai da orelha, coloquei um fio para maior retenção.\n---------------------------------------------------------\nData: 29/06/2011\nHora: 16:37:50\nFono: Tanara\nAssunto: Paciente veio relatando que não da mais continuar usando os aparelhos do jeito que esta. Fiz uma nova pré-moldagem e os aparelhos vão para a fábrica na garantia. Expliquei que dessa vez vamos fazer na garantia. Ligaremos quando chegar os aparelhos. Audéo III bilateral OD 0933X0FPQ OE 0936X0T57.\n---------------------------------------------------------\nData: 11/07/2011\nHora: 16:50:49\nFono: Tanara\nAssunto: Liguei e falei com a mãe que os aparelhos já chegaram da fábrica. Virá buscar.\n---------------------------------------------------------\nData: 15/07/2011\nHora: 14:03:42\nFono: Tanara\nAssunto: Pacienteveio buscar os aparelhos. Feito uma regulagem e ficou ótimo. Paciente saio bem satisfeita. Tudo na garantia. Vai fazer uma nova audiometria em setembro e vai trazer em dezembo na sua 8 visita para fazer uma regulagem.\n---------------------------------------------------------\nData: 23/12/2011\nThaisa: Paciente veio para a 8º visita do programa de acompanhamento, entregue os brindes e feita regulagem na OD. Ok\n---------------------------------------------------------\nData: 15/01/2013\nHora: 11:04:01\nAssunto: Fran - ultima visita prog. de acompanhamento. Fiz nova regulagem OD. AASI fraco para PA, porém ainda tem ganho. Ofereci aasi novo, mas não quer nem ouvir falar em gastar mais dinheiro com aparelho auditivo.\n---------------------------------------------------------\nDIA: 29/12/09 COMPROU AUDÉO III BILATERAL PILHA 312\nOD: 0933X0FP0 RECEPTOR 0\nOE: 0938X0T57\nR$: 6.000,00 ENT. R$: 2.000,00 MAIS 2X DE R$: 2.000,00\n01 ANO DE GARANTIA \nNF: 293269 DATA: 18/12/2009', 0, '', '', '2009-12-29'),
(685, 'INDICAÇÃO DA KELLY IRMÃ DO DUARTE', 'Leticia ', '', '', '---------------------------------------------------------\nData: 11/01/2012\nHora: 11:45:59\nFono: Tanara\nAssunto: Paciente veio com sua filha Dione indicada pela Kelly (irmã do Duarte). Já tinha a audiometria e colocamos em teste 2 Audéo Smart III. Paciente gostou bastante e Duarte negociou em R$: 7.500,00, sendo R$: 2.500,00 de entrada mais 10x de 500,00 no cheque. Entreguei o kit de venda e Virá para o retorno de venda dia: 13/01/2012.\n---------------------------------------------------------\nData: 13/01/2012\nHora: 11:48:34\nFono: Tanara\nAssunto: Paciente veio para o retorno. Esta colocando sozinha o aparelho. Aumentei para o nível 2 da aclimatização e marquei o retorno dia: 25/01/2012 pra a 1 visita.\n---------------------------------------------------------\nData: 12/12/2012\nHora: 08:17:35\nFrancine: 4ª visita prog de acompanhamento. Tudo OK. Dei 6 cartelas de pilha, 1 cerustop e 2 pastilhas.\n---------------------------------------------------------\nDIA: 11/01/2012 COMPRA DO AUDÉO SMART III BILATERAL PILHA 312\nOD: 1138X0V88\nOE: 1139X0L1P\nNF: 396.782 DATA: 29/12/2012\nR$: 7.500,00 ENT. 2.500,00 MAIS 10X DE 500,00 NO CHEQUE\n01 ANO DE GARANTIA.', 0, '', '', '2012-01-11');
