(686, 'fachada da audiozoom', 'Leticia ', '', '', 'Data: 30/07/2009\nKELLEN:PCTE ESTEVE NA CLINICA COMPROU 6 PILHAS 675 POWER''ONE!\n---------------------------------------------------------\nData: 27/11/2009\nDÃ©bora: Paciente pagou R$1000,00 referente a segunda parcela do aparelho.\n---------------------------------------------------------\nData: 5/1/2010\nDÃ©bora: Paciente pagou R$1000,00 referente a terceira parcela.\n---------------------------------------------------------\nData: 1/2/2010\nDÃ©bora: Paciente pagou R$1000,00 referente a quarta parcela.\n---------------------------------------------------------\nData: 02/03/2010\nHora: 14:49:08\nMichelle: veio na loja e pagou a 5Â° parcela no valor:1000,00.\n---------------------------------------------------------\nData: 14/05/2010\nDÃ©bora: Retornou Ã  clÃ­nica para buscar aparelho.\n---------------------------------------------------------\nData: 06/07/2011\nHora: 13:56:29\nFono: Tanara\nAssunto: Paciente veio com um aparelho que comprou em 2009 Mini P 5. Falou que nÃ£o usa pois nÃ£o escuta bem com ele. Ficou para a revisÃ£o e testei um Naida UP. Paciente gostou bastante e levou para a casa de teste. VoltarÃ¡ na sexta.\n---------------------------------------------------------\nData: 08/07/2011\nHora: 11:22:10\nFono: Tanara\nAssunto: Paciente veio e falou que adorou o aparelho e quer muito comprar mas agora nÃ£o vai poder pois sua mÃ£e esta doente. Vaie sperar um pouco. Retirou o aparelho da revisÃ£o e limpeza e falou que ficou bem melhor. Marcamos uma audiometria para o dia: 20/07.\nDIA: 26/10/2009 COMPROU MINI P5 OE PILHA 312\nOE: 0844X1R8M\nR$: 5.852,00 ENT. 1.000,00 MAIS 4X DE R$: 1.000,00 MAIS 1X DE R$: 852,00 \nNF: 035146 DATA: 30/12/2008\n02 ANOS DE GARANTIA.', 0, '', '', '2009-10-26'),
(687, 'Dr. Kowalski', 'Leticia ', '', '', '28/11/2012 - Veio para audiometria encaminhada pelo Dr. Kowalski - Perda Neurossenssorial de grau leve a moderadamente severo bilateralmente. Não quis testar AASI, vai encminhar pelo SUS. OK', 0, '', '', NULL),
(688, 'fga. cláudia simões rivero', 'Leticia ', '', '', '---------------------------------------------------------\nData: 07/12/2011\nHora: 09:56:23\nFono: Tanara\nAssunto: Paciente veio\n---------------------------------------------------------\nData: 27/12/2011\nThaisa: paciente veio para regulagem. Minimizei os sons de fundo, pois estavam prejudicando a compreensão da fala. Virá amanhã para conectar o Icom no seu novo celular. Ok\n---------------------------------------------------------\nData: 20/01/2012\nHora: 11:54:30\nFono: Tanara\nAssunto: Paciente veio para fazer a conecção do celular com I-com ok.\n---------------------------------------------------------\nData: 21/11/2012\nHora: 13:54:11\nMirella: Pct consultou com Duarte PA,\nPaciente retirou brindes 48 pilhas 313, 1 cx desumidificadora, 1 cerustop.\nDIA: 23/11/2011 COMPROU AUDÉO SMART V BILATERAL PILHA 312\nOD: 1107X1F5P NF: 387.188 DATA: 23/05/2011\nOE: 1123X10A0 NF: 387.097 DATA: 25/10/2011\nR$: 12.000,00 À VISTA MAIS I-COM\n02 ANOS DE GARANTIA', 0, '', '', '2011-11-23'),
(689, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 24/02/2010\nTEVE NA LOJA PARA FAZER MOLDE 16/05/2005\nPACIENTE DA CAROL\n---------------------------------------------------------\nData: 24/02/2010\nDébora: Esteve na clínica e deixou 02 ap. OD- 0837H14X6- revisão da garantia. / OE- 0844H11NU- ap. mudo.\n---------------------------------------------------------\nData: 04/03/2010\nDébora: Ap. veio da fábrica. Feito revisão e limpeza.\n---------------------------------------------------------\nData: 5/3/2010\nDébora: Paciente esteve na clínica para buscar aparelho.\n---------------------------------------------------------\nData: 12/04/2011\nHora: 09:20:08\nFono: Tanara\nAssunto: Paciente veio para fazer novo molde da OE e deixar o aparelho da OD para revisão e limpeza na garantia que vai até 29/04/2011. Naída III SP OD 0837H14X6. Vai pra fábrica ligaremos quando chegar.\n---------------------------------------------------------\nData: 13/04/2011\nHora: 17:02:24\nMichelle: Paciente retirou molde pago 32,50, pois esse mês era seu aniversário e ganhou desconto.\n---------------------------------------------------------\nData: 26/04/2011\nHora: 10:23:50\nFono: Tanara\nAssunto: Paciente veio com seu pai para retirar o aparelho e deixou o lado esquerdo para a revisão e limpeza. Esta na garantia. Diz que o molde novo da orelha esquerda esta apitando devido a ventilação de 3 mm. Feito novamente um novo pré-molde para a confecção de concha escavada de silicone rosa com 1 mm de ventilação. Vem buscar sexta.\n---------------------------------------------------------\nData: 06/05/2011\nHora: 11:40:59\nFono: Tanara\nAssunto: Liguei e falei com pai que o aparelho já chegoude S.P. Esta na garantia. Virá hoje ou na segunda. A tarde paciente veio com seu pai com a audiometria e foi feita uma nova regulagem com os 2 aparelhos ok. Buscou o molde da OE e ficou ótimo. A perda pior e falei do Naída UP.\n---------------------------------------------------------\nData: 02/07/2012\nBruna: Veio para fechar a compra do Jabra + ICOM. R$ 2.000,00 á vista c/ cheque para 30 dias. Fiz adaptação e ficou ótimo. OK\n---------------------------------------------------------\nData: 08/10/2012\nHora: 14:50:10\nAssunto: CIDA PACIENTE ESTEVE NA LOJA PARA FAZER MOLDE OE/OD\n---------------------------------------------------------\nData: 08/10/2012\nHora: 15:49:24\nFono: Tanara\nAssunto: Paciente veio com seu pai para fazer moldes de silicone rosado concha escavada bilateral sem ventilação. Vai pagar R$: 150,00. Falei do naída S CRT III por R$: 5.000,00 cada. Vai conversar com os irmãos e quem sabe vem com ele e o Duarte faz um pacote.\n---------------------------------------------------------\nPACIENTE VEIO COM QUEIXA Q AASI ESTÁ FUNCIONANDO INTEMITENTE, COM SOM ABAFADO. TIREI O FILTRO DO ANGULO E MELHOROU, FICOU NORMAL. VAI OBSEVAR, SE CONTINUAR COM A QUEIXA VAI TRAZER O APARELHO PARA FAZER ORÇAMENTO DE CONSERTO.\nNAÍDA III SP PILHA 13 \nOD: 0837H14X6\nOE: 0844H11NU\nNF: 267.106 DATA: 29/04/2009 \nDIA: 02/07/2012 COMPROU \nI-COM 1137F0MNF NF: 390.869 DATA: 23/11/2011\nJABRA 0HXA0CW68 NF: 300.439 DATA: 25/02/2010', 0, '', '', NULL),
(690, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 25/04/2012\nHora: 10:27:\nCIDA: Pct efetuou o pagamento da 2ªparcela, R$ 1.000,00.\n---------------------------------------------------------\nData: 29/06/2012\nHora: 09:23:22\nMirella: Pct efetuou o pgto da 4ª parcela do assi. R$ 1.000,00.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio até a loja pois AASI da OE estava MUDO, enviado para SP para OS (0044544). OK\n---------------------------------------------------------\nData: 13/07/2012\nHora: 16:38:27\nAssunto: Suzan - Sra. Suely veio buscar o aparelho, sem custo esta na garantia.\n---------------------------------------------------------\nData: 13/09/2012\nHora: 15:25:41\nAssunto:cida. paciente esteve na loja e pagou a 7º parcela do aparelho auditivo.valor 1.000,00 reais dinheiro.\n---------------------------------------------------------\nData: 22/03/2013\nHora: 10:38:56\nAssunto: Suzan - Deixou aparelho para conserto. Esta na garantia. OS: 2851. PHONAK VERSATA ART\n---------------------------------------------------------\nPaciente pegou aparelho que foi para SP e foi feita regulagem. Ficou tudo OK.\nPaciente retirou brindes 18 pilhas 312.\nDIA:25/06/2008 COMPROU MAXX 11 BILATERAL PILHA 10 \nOD: 313408 \nOE: 313508\nR$: 5.000,00 À VISTA \n02 ANOS DE GARANTIA.\nEntregue 30 pilhas 27/11/08 entregue 30 pilhas\nDeu ap. C15 antigo como parte do pagamento.\n', 0, '', '', '2008-06-25'),
(691, 'WIDEX', 'Leticia ', '', '', 'USUARIO DE AASI L32 WIDEX', 0, '', '', NULL),
(692, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 27/04/2009\nDébora: Fez molde silicone invisível duplo OE. R$60,00.\n---------------------------------------------------------\nData: 22/07/2009\nTHAIS: CADASTRO ATUALIZADO. PACIENTE NAO QUIS MARCAR AVALIAÇÃO.\n---------------------------------------------------------\nData: 02/01/2012\nThaisa: Teste com 2 Audeos Smart V - 1107X1F5X / 1107X1F62. retorno marcado para dia 09 - 14:30\n---------------------------------------------------------\nData: 06/01/2012\nHora: 13:45:52\nFono: Tanara\nAssunto: Paciente veio com o genro Francisco para fechar a venda. R$: 3.800,00 a vista em cheque. Marquei dia: 10/01 para buscar o aparelho definitivo. Feito o contrato.\n---------------------------------------------------------\nData: 10/01/2012\nHora: 30:10:12\nFono: Tanara\nAssunto: Paciente veio para buscar o aparelho definitivo. Feito regulagem e entregue o kit de venda. Marcado a 1 visita dentro de 15 dias. Paciente esta bem satisfeita com o aparelho. Venda da Thaisa.\n---------------------------------------------------------\nData: 23/01/2012\nHora: 13:49:52\nFono: Tanara\nAssunto: Paciente veio relatando que o aparelho não esta funcionando. Era protetor de cera. Expliquei como faz a troca ok.\n---------------------------------------------------------\nData: 23/08/2012\nHora: 10:46:14\nFono: Tanara\nAssunto: Paciente veio para o programa de acompanhamento. Entregues os brindes ok. falei novamente de colcoar aparelho da OD. Agora não tem condições.\n---------------------------------------------------------\nData: 13/12/2012\nHora: 10:34:44\nFrancine: Programa de acompanhamento - Pilha esta durando 4 dias. Entregue os brindes ok. Falei em levar mais um aparelho, refere não ter condições.\n Adiantado Programa de acompanhamento pois a paciente está em São Paulo, e a filha veio buscar pois irá visitar a mãe. Entregues os brindes. Não trouxeram o livrinho - anotar na próxima visita. Filha da pciente relatou que pilha dura de 3 a 4 dias e que o cerustop é trocado a cada troca de pilha. Falei para trazer a D. Maria aqui em Julho (quando ela estiver na cidade) para ver o que está acontecendo.', 0, '', '', '2012-01-09'),
(693, '', 'Leticia ', '', '', '', 0, '', '', NULL),
(694, '', 'Leticia ', '', '', 'Data: 01/06/2009\nKELLEN:pacte comprou 30 pilhas 10 power`one 75,00 reais CHEQUE p/ DIA:30/06/09\n---------------------------------------------------------\nData: 27/8/2010\nHora: 14:03:35\nMichelle:Paciente deixou aparelho,para revisão e limpeza (os audiozoom 1290).\n---------------------------------------------------------\nData: 27/8/2010\nHora: 17:10:53\nMichelle: Paciente retirou aparelho. Feito revisão e limpeza. Pago R$100,00.\n---------------------------------------------------------\nData: 13/06/2012\nHora: 15:49:50\nAssunto: Suzan - Confirmado presença para o Open. 18/06 as 10:00\n---------------------------------------------------------\n---------------------------------------------------------\nData: 18/06/2012\nHora: 17:22:54\nAssunto: Suzan - Sra. Maria Madalena não pode comparecer ao Open.\n---------------------------------------------------------\nData: 17/10/2012\nHora: 09:28:04\nFono: Tanara\nAssunto: Suzan - Sra. Maria Madalena deixou aparelho para conserto (microfonia) Bernafom Intra.  OS: 2705. Levou para teste Audéo Smart III por R$: 4.500,00. Vai pensar. Duarte que conversou com a paciente.\n01/10/2007    COMPRA 1 APARELHO SYMBIO 400 OE - BERNAFON \nCOM UM ANO DE PILHA JA ENTREGUES 72 PILHAS 10\nR$ 3.000,00\n24/09/2013  COMPROU CASSIA 312 PETITE  P13I2920L R$ 4.100,00 1 ANO DE GARANTIA - PILHAS 312.', 0, '', '', '2007-10-01'),
(695, 'fgo. daniel', 'Leticia ', '', '', '---------------------------------------------------------\nData: 10/12/2010\nHora: 08:51:06\nAssunto: cliente esteve na loja foi feito troca do protetor de cera do aparelho auitivo.\n---------------------------------------------------------\nData: 29/04/2011\nHora: 12:33:27\nFono: Tanara\nAssunto: Ana Maria veio comprar pilhas para o paciente. Comprou 3 cartelas de pilhas phonak 10 no cartão R$: 54,00.\n---------------------------------------------------------\nAPARELHO AUDITIVO PHONAK SAVIA 11 CIC/MC BILATERAL PILHA 10\nOD/OE: 06076076\nNF: 237375 DATA: 10/06/2008 ATÉ 10/06/2011                                                                   02/12/2013 - COMPROU AUDEO S SMART V PARA OE NS: 302X02Y8 COM DOIS ANOS DE GARANTIA ', 0, '', '', '2012-01-01'),
(696, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/12/2010\nHora: 15:58:41\nFono: Tanara\nAssunto: Paciente veio com Bete para fazer um teste com aparelhos. Feito primeiramente uma audiometria e levou o aparelho para teste. Audéo Yes III bilateral. R$: 3.900,00 cada. Segunda virá com o resultado.\n---------------------------------------------------------\nData: 23/12/2010\nHora: 08:02:35\nFono: Tanara\nAssunto: Liguei e conversei com o Joaquim no qual falou que a Dona Maria esta ouvindo mas ainda tem dificuldade. Virá na segunda para aumento da aclimatização.\n---------------------------------------------------------\nData: 27/12/2010\nHora: 10:31:33\nFono: Tanara\nAssunto: Paciente veio devolver os aparelhos, gostou bastante mas vai tentar ganhar pelo plano. Voltará a entrar em contato.\n---------------------------------------------------------\nData: 29/05/2012\nHora: 15:41:07\nAssunto: Suzan - Falei com filho da paciente passou seu endereço para mandar carta do open.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 14:27:28\nAssunto: Suzan - Falei com Filho Joaquim. Disse que encaminhou carta do Open para a paciente em Lages. Ligar amanha para Sr. Joaquim para marcar horario para Sra. Maria.\n---------------------------------------------------------\nData: 12/06/2012\nHora: 15:18:07\nAssunto: Suzan - Sr. Joaquim disse que Paciente não podera comparecer ao Open. Mora em Lages.\nDIA: 22/12/2010 TESTE COM AUDÉO YES III BILATERAL', 0, '', '', '2010-12-22'),
(697, '', 'Leticia ', '', '', 'Paciente veio para fazer teste com aparelhos. Já é usuária TELEX e perdeu o seu AASI da OE. Fiz audiometria e coloquei par de audeo s smart III. Valor R$9000,00 em 10x ou negociei R$7500,00 a vista. Levou para testar até dia 5/7 - sexta.\nPaciente comprou AASI Audeo S Smart III. Mandei fazer caixa C-Shell. Pagou a vista R$7500,00. Dei 6 pilhas 312 até o primeiro Prog. de acompanhamento. OK.\nVEIO PARA PRIMEIRA VISITA, DEI KIT DE MANUTENÇÃO MAIS 18 PILHAS 312 E CERUSTOP, FICAR DE AVISAR QUANDO CAIXA PERSONALIZADA CHEGAR.\nPaciente veio para colocar o receptor com caixa C-Schell que mandei fazer. Adorou. OK\n10/07/2013 - COMPROU AUDEO S SMART III - OD: 1301X173L / OE: 1303X0MGF - PILHA 312 - RECEPTOR POWER COM CAIXA C-SHELL. NF:466.507 - 25/03/2013. GARANTIA ATE 10/07/2014. 3 ANOS DE PROGRAMA DE ACOMPANHAMENTO. CF AZ: 7578', 0, '', '', '2013-07-10'),
(698, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 28/10/2011\nHora: 08:45:29\nFono: Tanara\nAssunto: Paciente veio com sua filha Juceanita para fazer teste e orçamento de aparelhos. A filha mora perto da Audiozoom. Fez orçamento na Micro-som. Já tinha audio do Centro Auditivo BBZ. Feito teste com Audéo Yes III bilateral e paciente gostou. Duarte negociou os 2 por R$: 7.600,00 em 12x, sendo uma entrada mais 11x de 633,00. Levou para casa e vem na segunda fechar a venda.\n---------------------------------------------------------\nData: 31/10/2011\nHora: 08:47:57\nFono: Tanara\nAssunto: Paciente veio com sua filha e fechou a venda deu uma entrada no débito de 633,00 e 2 cheques (Dezembro e Janeiro). Na semana que vem dará mais 9 cheques de 633,00. Feito contrato e virá dia: 04/11 para o retorno extra.\n---------------------------------------------------------\nData: 04/11/2011\nHora: 08:49:24\nFono: Tanara\nAssunto: Paciente veio para o retorno extra tudo ok. Passei para o nível 2 da aclimatização e marcamos a 1 visita para dia: 14/11.\n---------------------------------------------------------\nData: 27/12/2011\nThaisa: Paciente veio para verificar aparelho. Aumentei um nível de experiência, antecipei o programa de acompanhamento para dia 16/01/12, pois a mesma irá viajar dia 31.\n---------------------------------------------------------\nData: 16/01/2012\nHora: 09:25:38\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregue os brindes e deixou o aparelho da OD para o conserto na garantia, esta mudo. Vai para S.P. Audéo Yes III OD 1121X1AYL.\n---------------------------------------------------------\nData: 27/04/2012\nHora: 09:52:51\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregues os brindes ok. Marcado a 4 visita em outubro.\n---------------------------------------------------------\nData: 23/10/2012\nHora: 09:42:00\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Entregues os brindes e marcado a 5 visita dia: 30/04/2013 as 09:00 h. Deixou os aparelhos para a revisão e limpeza na garantia. Audéo Yes III OD 1121X1AYL OE 1119X1AA0.\n---------------------------------------------------------\nData: 29/10/2012\nHora: 10:13:14\nFono: Tanara\nAssunto: Liguei para a paciente avisando que os aparelhos já chagaram de S.P. Vem essa semana retirar.\n---------------------------------------------------------\nData: 30/10/2012\nHora: 13:38:23\nFono: Tanara\nAssunto: Paciente veio retirar os aparelhos na garantia.\n---------------------------------------------------------\nDIA: 31/10/2011 COMPROU AUDÉO YES III BILATERAL PILHA 312\nOD: 1121X1AYL RECEPTOR 0\nOE: 1119X1AA0\nNF: 387.097 DATA: 25/10/2011\nR$: 7.600,00 ENT. 633,00 MAIS 11X DE 633,00 NO CHEQUE\n01 ANO DE GARANTIA', 0, '', '', '2011-10-31'),
(699, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 06/01/2011\nHora: 16:12:48\nFono: Tanara\nAssunto: Paciente veio com seu filho Flávio encaminhado por Palhoça. Feito audiometria e teste com Audeo Yes III bilateral. Paciente gostou e fechou a venda de R$: 7.750,00, sendo 1.000,00 de entrada mais 9x de 750,00 em carne. Virá amanhã para dar a entrada.\n---------------------------------------------------------\nData: 12/01/2011\nHora: 16:59:56\nFono: Tanara\nAssunto: Mário ligou e falou que vem buscar uma declaração que vai levar para a empresa onde trabalha pois vai tentar um empréstimo para pagar os aparelhos. A tarde a paciente veio e buscou a declaração.\n---------------------------------------------------------\nData: 17/01/2011\nHora: 14:55:03\nFono: Tanara\nAssunto: Liguei para o filho Márcio ele falou que entregou para empresa e assim que tiver uma resposta me ligará. Vamos aguardar.\n---------------------------------------------------------\nData: 03/08/2011\nHora: 17:53:50\nFono: Tanara\nAssunto: Paciente veio com seu filho Flávio para comprar o aparelho. Vendido o Solo 311 por R$: 2.800,00, sendo uma entrada de R$: 1.200,00 no cartão de débito mais 8x de R$: 200,00 no carnê. Feito pré-molde da OE para a confecção de molde de acrílico invisível simples com 1 de ventilação.\n---------------------------------------------------------\nData: 04/08/2011\nHora: 17:55:49\nFono: Tanara\nAssunto: Paciente veio com seu filho Mário para buscar o molde. Expliquei para o filho como faz para colocar e tirar o aparelho. Vem dia: 09/08 para o retorno. Vamos entregar a silica.\nDIA: 03/08/2011 COMPRA SOLO 311  PILHA 13\nOE:\nR$: 2.800,00 ENT. 1.200,00 NO DÉBITO MAIS 8X DE 200,00 NO CARNÊ.\n01 ANO DE GARANTIA.', 0, '', '', NULL),
(700, '', 'Leticia ', '', '', 'Paciente veio para fazer orçamento de aasi. Fiz audiometria e acusou perda severa a profunda bilateral. Paciente só usa INTRA. Oferevi Cassia ITC UP por R$4500,00 cada ou a vista com 10% de desconto. Vai retornar para fecjar o pedido.\nPACIENTE VEIO NA LOJA PARA FECHAR COMPRA DE CASSIA ITC UP - BILATERAL. VAI DAR R$4000,00 DE ENTRADA DIA 10/07/13 E O RESTANTE EM 10 VEZES DE 450,00. TOTAL R$8500,00.\nPACIENTE VEIO PAGAR R$4000,00 DE ENTRADA DA COMPRA DO AASI E VAI PAGAR O RESTANTE COM VALOR A VISTA QUANDO O APARELHO CHEGAR (R$4000,00). MANDEI FAZER CASSIA ITC 312 UZ COM POTENCIA UP.\nPACIENTE ACERTOU O VALOR TOTAL DO APARELHO. PAGOU R$8000,00 A VISTA. ESTAMOS HÁ APROXIMADAMENTE UM MES TENTANDO FAZER OS AJUSTES CERTOS. PACIENTE NÃO CONSEGUE FALAR AO TELEFONE E QUEIXA DE MICROFONIA E QUE O APARELHO FICOU MUITO GRANDE. MANDEI PARA A FÁBRICA PARA TENTAR DIMINUIR O TAMANHO DO APARELHO, TIRAR O CONTROLE DE VOLUME, POIS NÃO É USADO, COLOCAR EASYPHONE E TIRAR A VENTILAÇÃO. QUANDO CHEGAR REGULAR NOVAMENTE E AJUSTAR O EASYPHONE. CONVERSEI COM A JULINA MORALLES, DA PHONAK, A ACHAMOS MELHOR PASSAR PARA POTENCIA SP PARA DIMINUIR OS APARELHOS E MELHORAR A REGULAGEM.\n', 0, '', '', NULL),
(701, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 03/11/2011\nHora: 11:50:34\nMichelle: Paciente deixou aparelho para orçamento um esta mudo e outro com som destorcido MODELO SOLO T 22 L 0409568 / R 04098568(os audiozoom 2164)\n---------------------------------------------------------\nData: 04/11/2011\nHora: 09:41:55\nFono: Tanara\nAssunto: Liguei e passei o valor do conserto. R$: 728,00, sendo R$: 364,00 cada. Paciente não autorizou e quer um orçamento por escrito. Vai pagar R$: 21,00.\n---------------------------------------------------------\nData: 04/11/2011\nHora: 16:22:48\nMichelle: Paciente retirou aparelho pagou 21,00\n---------------------------------------------------------\nData: 18/05/2012\nHora: 14:21:30\nAssunto: Suzan - Falei com esposo. Confirmado endereço do cadastro para enviar open.\n---------------------------------------------------------\nData: 09/07/2012\nHora: 14:47:36\nAssunto:duarte não autorizou o orçamento.\n', 0, '', '', NULL),
(702, 'lista telefônica', 'Leticia ', '', '', '---------------------------------------------------------\nData: 18/10/2011\nHora: 13:40:38\nFono: Tanara\nAssunto: Paciente veio para fazer teste com aparelhos. Já fez pesquisa e quer um menor que existe. Fiz teste com Audéo Mini III OE. Gostou e por enquanto vai comprar apenas 1 aparelho. Falei que podemos colocar a cor preta que combina com o cabelo. Passei o valor de R$: 4.500,00 em 10x.\n---------------------------------------------------------\nData: 25/10/2011\nHora: 09:18:37\nFono: Tanara\nAssunto: Paciente fechou a venda mas pelo preço da tabela R$: 4.100,00 em 10x de 410,00 no cheque. Virá dia 08/11 para a 1 visita.\n---------------------------------------------------------\nData: 17/01/2012\nHora: 13:33:18\nFono: Tanara\nAssunto: Paciente veio para a 1 e 2 visita. Entregue os brindes e marquei para maio a 3 visita. Não esquecer de entregar o livrinho do programa de acompanhamento.\n---------------------------------------------------------\nData: 24/10/2012\nHora: 08:34:49\nFono: Tanara\nAssunto: Paciente veio para a 4 visita. Entregues os brindes e deixou o aparelho para a revisão e limpeza na garantia. Audéo Mini III OE 1101X1699.\n---------------------------------------------------------\nData: 31/10/2012\nHora: 15:14:05\nFono: Tanara\nAssunto: O aparelho chegou de S.P. Avisei a paciente e vem buscar amanhã.\nDIA: 03/11/2011 COMPROU AUDÉO MINI III OE PILHA 10\nOE: 1101X1699\nNF: 363.56 DATA: 24/05/2011\nR$: 4.100,00 ENT. 410,00 MAIS 9X DE 410,00 NO CHEQUE\n01 ANO DE GARANTIA.', 0, '', '', '2011-11-03'),
