(704, 'fga. graci que vendeu', 'Leticia ', '', '', '---------------------------------------------------------\nData: 10/11/2011\nHora: 11:33:52\nFono: Tanara\nAssunto: Paciente veio com seu pai Manoel para fazer uma revisão. Deixou o aparelho na garantia. Naída III SP 0909X1FUJ. Graciele que vendeu. Paciente é de Tijucas. Virá depois para fazer audio. Entreguei 6 cartelas de pilhas. Próximo retorno em março de 2012.\n---------------------------------------------------------\nData: 24/11/2011\nHora: 14:28:39\nFono: Tanara\nAssunto: Liguei e avisei no trabalho que o aparelho já chegou da fábrica.\n---------------------------------------------------------\nData: 05/12/2011\nHora: 10:07:47\nMichelle:Pai retirou aparelho sem canhoto pois o mesmo foi extraviado Manoel Burg CPF: 436168609-20\n---------------------------------------------------------\nData: 03/09/2012\nHora: 14:04:14\nAssunto:cida.motorista veio retirar o molde (silicone concha escavada)cortesia.\n', 0, '', '', '2010-03-04'),
