(707, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/07/2009\nTHAIS: CADASTRO ATUALIZADO. VAI LIGAR PARA MARCAR AVALIAÇÃO.\n---------------------------------------------------------\nData: 01/04/2010\nDébora: Paciente esteve na clínica com a queixa de que seu aparelho estava com o som abafado. Foi feito revisão, limpeza e troca da base do protetor de cera. R$180,00.\n---------------------------------------------------------\nData: 17/8/2010\n12/12/2005 COMPROU APARELHO BERNAFON  FLAIR 321 OE - PILHA  312 / Nº 03-1604 \nVALOR TOTAL R$ 2.000,00 ENTRADA  R$ 700.00 + 1X  R$ 700.00 + 1X R$ 600.00\n---------------------------------------------------------\nData: 22/05/2012\nHora: 14:43:19\nAssunto: Suzan - Confirmado endereço para mandar carta do OPEN. E cliente pediu para mardar por e-mail tbm.\n---------------------------------------------------------\nData: 05/06/2012\nHora: 15:10:37\nAssunto: Suzan - Não atende.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 16:30:1\nAssunto: Suzan - Sr. Mario esta viajando. Ligar na segunda-feira dia 11/06 para ver se vem no Open.\n---------------------------------------------------------\nData: 11/06/2012\nHora: 15:21:23\nAssunto: Suzan - Sr. Mario disse que se não for viajar vem para o Open.\nDIA: 17/08/2010 COMPROU ELEVA 22 OE E MICRO-POWER IX OD PILHA 312\nOE: L08104582 \nOD: 0709H142A\nR$: 5.000,00 À VISTA \nNF: 324363 DATA: 18/08/2010\nR$: 3.000,00 À VISTA \nNF: 210246 DATA: 18/07/07\n02 ANOS DE GARANTIA\nCOMPROU VERSATA VALOR R$3.000,00 01 ANO DE GARANTIA.', 0, '', '', '2010-08-17'),
(708, 'Dr. Kowalski', 'Leticia ', '', '', '---------------------------------------------------------\nData: 08/05/2012\nHora: 11:30:50\nFono: Tanara\nAssunto: Paciente veio encaminhado pelo Dr. Kowalski para fazer audiometria e teste com aparelhos. Porém paciente só tem perda nos agudos na OE. Coloquei o audéo IX e passei o valor de R$: 9.000,00 parcelado ou a vista desconto. Levou para casa e voltará na sexta dia: 11/05/2012.\n---------------------------------------------------------\nData: 10/05/2012\nHora: 10:10:48\nFono: Tanara\nAssunto: Liguei e perguntei do aparelho esta gostando, porém esta machucando um pouco. Virá amanhã para o retorno de teste.\n---------------------------------------------------------\nData: 13/09/2012\nHora: 11:13:24\nAssunto: Suzan - Confirmado endereço para mandar carta do Open. Sr. Mario não esta utilizando aparelho.\nDIA: 08/05/2012 FEZ TESTE COM AUDÉO SMART IX OE', 0, '', '', '2012-05-08'),
