(710, 'Dr. Kowalski', 'Leticia ', '', '', '---------------------------------------------------------\nData: 23/02/2011\nHora: 11:21:00\nFono: Tanara\nAssunto: Paciente veio com sua esposa Maria do Carmo para comprar aparelhos. Veio encaminhado pelo Dr: Kowalski para fazer audiometria e teste com aparelhos. Feito teste com Audéo Smart V bilateral e paciente gostou e fechou a venda. Entregue tudo, até nota fiscal. Virá na quarta para o retorno.\n---------------------------------------------------------\nData: 24/02/2011\nHora: 11:54:44\nFono: Tanara\nAssunto: Paciente veio para tirar dúvidas.Fiz pré-molde bilateral para a confecção de micro-molde, pois relatou que esta tendo muita dificuldade para colocar os aparelhos. Falta trazer mais 7 cheques de R$: 1.544,00.\n---------------------------------------------------------\nData: 02/03/2011\nHora: 13:08:27\nFono: Tanara\nAssunto: Paciente veio para o retorno e já fiz a 1 visita. Entreguei o kit de manutenção e pilhas para 3 meses. Deu mais 7 cheques que ficou faltando ok. Quando chegar a caixinha ligaremos.\n---------------------------------------------------------\nData: 10/03/2011\nHora: 09:02:36\nFono: Tanara\nAssunto: Liguei e falei que a caixinha já chegou. Vem amanhã.\n---------------------------------------------------------\nData: 14/03/2011\nHora: 15:35:27\nFono: Tanara\nAssunto: Paciente veio para a adaptação das caixinhas, porém não gostou falando que o som ficou muito diferente, mesmo com regulagem. Deixamos as olivas. Aumentei a aclimatização para o nível 4 e marcado retorno na próxima semana.\n---------------------------------------------------------\nData: 21/03/2011\nHora: 11:40:54\nFono: Tanara\nAssunto: Paciente veio relatando que ficou bem melhor os aparelhos, porém a OD estava com som fraco. Expliquei que o protetor de cera estava entupido entreguei 2 kit de cerustop. Falou também que a OE estava com som muito agudo. Diminui o som dos agudos e deixei na aclimatização 3. Diz que ficou muito bom e que melhorou bastante.\n---------------------------------------------------------\nData: 04/04/2011\nHora: 13:41:52\nFono: Tanara\nAssunto: Paciente veio para o retorno. Feito regulagem apenas na OD que diz que o som esta fraco e nem percebe diferença com e sem. Fiz aumento de ganho geral, aumento de saída máxima ok.\n---------------------------------------------------------\nData: 11/04/2011\nHora: 13:19:02\nFono: Tanara\nAssunto: Paciente voltou falando que esta bem melhor ok. Virá quando completar 3 meses que será em maio.\n---------------------------------------------------------\nData: 10/06/2011\nHora: 12:46:19\nFono: Tanara\nAssunto: Paciente veio para a 2 visita. Entregue os brindes e falou que esta ouvindo bem porém na OD não. Veirifiquei que o aparelho estava descarregando, dando estralos. Troquei de aparelho coloquei um novo. ok.\n---------------------------------------------------------\nData: 14/06/2011\nHora: 13:55:49\nFono: Tanara\nAssunto: Paciente veio para um retorno extra. Falou que esta bom mas queria testar novamente a caixinha. Ligarei para a adaptação.\n---------------------------------------------------------\nData: 01/07/2011\nHora: 13:37:52\nFono: Tanara\nAssunto: Paciente veio para colocarmos a micro-caixa, porém não se adaptou.\n---------------------------------------------------------\nData: 23/08/2011\nHora: 13:48:39\nFono: Tanara\nAssunto: Paciente veio para a 3 visita. Entregue os brindes e feito um campo livre no qual precisa dar mais ganho na OD. Feito aumento de ganho geral e marcado o retorno par dia: 23/02/2012 as 10:00 horas. Será a 4 visita e os aparelhos irão para S.P.\n---------------------------------------------------------\nData: 29/06/2012\nBruna: Veio pois AASI da OE estava mudo, troquei cerustop e ficou OK, aumentei 2pts do ganho geral. OK\n---------------------------------------------------------\nData: 24/08/2012\nHora: 09:23:40\nFono: Tanara\nAssunto: Paciente veio para a 4 visita, entregues os brindes e troquei o protetor de cera. Expliquei novamente que deve ser trocado pelo menos 1 vez por Mês. Feito audiometria e campo livre.\n---------------------------------------------------------\nData: 16/01/2013\nHora: 14:54:57\nAssunto: fran: paciente deixou aasis para revisão de 2 anos de garantia.\n---------------------------------------------------------\nData: 07/02/2013\nHora: 17:39:19\nAssunto: Suzan - Veio buscar aparelho. OS: 2771.obs. paciente não trouxe o canhoto quem fez o atendimento foi o duarte.\n---------------------------------------------------------\nData: 22/02/2013\nHora: 09:30:42\nJOICE: PROGRAMA DE ACOMPANHAMENTO, ABAIXEI GANHO GERAL E DEI PILHA 312 MAIS PASTILHAS DESUMIDIFICARA.\nDIA: 23/02/2011 COMPRA AUDEO SMART V BILATERAL PILHA 312\nOD: 1041X0H7F NF: 342.544 DATA: 21/12/2010 RECEPTOR 2\nOE: 1052X04AP NF: 349.988 DATA: 16/02/2011\nR$: 15.440,00 ENT: 1.544,00 MAIS 9X DE 1.544,00 NO CHEQUE\n02 ANOS DE GARANTIA.', 0, '', '', '2011-02-23'),
(711, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 22/07/2009\nTHAIS: CADASTRO ATUALIZADO. MARCOU AVALIAÇÃO PARA O DIA 28/07/09.\n---------------------------------------------------------\nData: 30/07/2009\nGracielle: fiz atendimento. Comprou par de Naída III UP Jr. com Daniel no início do ano. Mostrei acessórios e MicroPower. Estava sem dinheiro, mas virá comprar kit limpeza Phonak.\n---------------------------------------------------------\nData: 23/06/2010\nDébora: Liguei e deixei recado com a Maria, pois a paciente não atende o telefone.\n---------------------------------------------------------\nData: 23/06/2010\nDébora: Paciente esteve na clínica com a carta da phonak e pegou uma cartela de pilha 675. Fez teste com icom.\nUSA PAR DE NAÍDA III UP', 0, '', '', NULL),
(712, '', 'Leticia ', '', '', '---------------------------------------------------------\nData: 20/04/2012\nHora: 13:20:23\nFono: Tanara\nAssunto: Paciente veio com sua neta Bruna para fazer Audio e teste com aparelhos. Quer o aparelho mais barato, pois o seu marido não vai pagar mais de R$: 3.000,00 por aparelho. Fez pesquisa na Widex R$: 3.000,00 cada. Levou para casa o Audéo IX bilateral.\n-------------------------------------------------------------\nData: 25/04/2012\nHora: 13:57:39\nFono: Tanara\nAssunto: Paciente voltou com a neta Bruna e negociou R$: 5.000,00 em 10x de 500,00 no cheque. Duarte autorizou a venda. COMPROU 2 APARELHOS AUDITIVOS AUDEO, COMPROU AUDEO SAMRT III MAS O DUARTE COLOCOU AUDEO IX NORMAL PELO PREÇO DE R$ 5.000,00 2 APARELHOS EM 10 PARCELAS DE R$ 500,00 1º CHEQUE PARA 12 DE MAIO 2012.\n', 0, '', '', NULL),
(713, '', 'Leticia ', '', '01/09/2014-PACIENTE COMPROU CERTENA P \nVALOR R$2.000,00 1+9X NO CARNE.\n01 DE GARANTIA S/ PILHA.', '---------------------------------------------------------\nData: 22/07/2009\nTHAIS: CADASTRO ATUALIZADO. FICOU DE LIGAR PARA MARCAR AVALIAÇÃO.\n---------------------------------------------------------\nData: 18/11/2010\nDébora: Paciente esteve na clínica e deixou 02 Ap. Phonak Naída III SP nº OD- 0949X0TM4 / 0949X0TMH para revisão e limpeza da garantia. Emprestamos 02 ap. Naída III SP.\n---------------------------------------------------------\nData: 25/11/2010\nThaisa: Paciente esteve na clínica e retirou os aparelhos.\n---------------------------------------------------------\nData: 21/02/2011\nHora: 13:35:53\nFono: Tanara\nAssunto: Paciente veio relatando que não escuta bem com os aparelhos e esta machucando a orelha. Deixei em teste 2 Audéos Smart IX e fiquei com os aparelhos para Jaimar trocar os micro-tubos. Voltará na quarta e vamos ver com o Duarte o que podemos fazer para trocar de aparelhos.\n---------------------------------------------------------\nData: 04/03/2011\nHora: 12:17:17\nFono: Tanara\nAssunto: Paciente veio buscar os aparelhos e falei que podemos fazer a diferença em até 8.000,00 na troca pelos aparelhos dela. Falou que vai falar com a irmã.\n---------------------------------------------------------\nData: 02/05/2011\nHora: 12:44:10\nFono: Tanara\nAssunto: Paciente veio para deixar os aparelhos para a revisão e Limpeza. Emprestei um para ela não ficar sem. Aparelhos na garantia. falar dos aparelhos novos.\n---------------------------------------------------------\nData: 11/05/2011\nHora: 16:35:21\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá amanhã.\n---------------------------------------------------------\nData: 12/05/2011\nHora: 13:00:47\nFono: Tanara\nAssunto: Paciente veio buscar o aparelho. Diz que não estava escutando nada. Feito uma audiometria e uma nova regulagem. Feito troca também do micro-tubo por manguerinha. Falou que agora sim icou ótimo. Deixou o outro aparelho da orelha OD para fazer uma revisão e limpeza na garantia. Vai pra S.P.\n---------------------------------------------------------\nData: 24/05/2011\nHora: 15:02:00\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho chegou da fábrica. Vem amanhã.\n---------------------------------------------------------\nData: 26/06/2011\nHora: 12:22:32\nFono: Tanara\nAssunto: Paciente veio retirar o aparelho e feito a 4 visita. Entregue os brindes e foi trocada a adaptação aberta do naída por molde de 3 a ventilação. Paciente diz que agora ficou muito bom, escutando bem melhor.\n---------------------------------------------------------\nData: 28/05/2012\nHora: 11:07:36\nFono: Tanara\nAssunto: Paciente veio deixar o aparelho para a revisão e limpeza na garantia. Naída III SP OD 0949X0TMH. Esta na garantia.\n---------------------------------------------------------\nData: 04/06/2012\nHora: 14:08:26\nFono: Tanara\nAssunto: Deixei recado que o aparelho já chegou.\n---------------------------------------------------------\nData: 08/06/2012\nHora: 09:42:17\nMirella: Pct veio buscar aasi e trouxe o outro para revisão "garantia" ( Phonak Naida III SP oe 0949X0TMH)\n---------------------------------------------------------\nData: 20/06/2012\nHora: 14:41:56\nFono: Tanara\nAssunto: Liguei e avisei que o aparelho já chegou. Virá buscar.\n---------------------------------------------------------\nData: 26/06/2012\nHora: 10:42:36\nAssunto:paciente veio retirar o aparelho phonak naida III Nª0949XOTMH.GARANTIA\nDIA: 26/05/2010 COMPROU NAÍDA III SP BILATERAL PILHA 13\nOD: 0949X0TMH \nOE: 0949X0TM4\nNF: 300.541 DATA: 25/02/2010\nR$: 10.000,00 À VISTA\n02 ANOS DE GARANTIA.\n', 0, '', '', '2010-05-26'),
