(715, '', 'Leticia ', '', 'OPEN MêS DOS PAIS 03 ANOS DE GARANTIA PHONAK', 'paciente veio para teste de aparelho, quer comprar através da FUSEX, porém insisti para que realizasse o teste.\nTeste com par de Audéo S Smart III valor R$10.000,00 \nPaciente retorna sexta feira para entrega do aparelho.\nPaciente comprou aparelhos através do BB, pagamento à vista.\nNF: 543.759   DTNF: 30/05/2014', 0, 'NEUROSSENSORIAL DE GRAU LEVE À PROFUNDO', 'NEUROSSENSORIAL DE GRAU LEVE À PROFUNDO', '2014-07-29'),
