(718, '', 'Leticia ', '', '', 'DIA: 08/06/2011 TESTE COM AUDÉO SMART III BILATERAL.\n---------------------------------------------------------\nData: 08/06/2011\nHora: 13:22:13\nFono: Tanara\nAssunto: Paciente veio para testar aparelho. Trouxe audiometria e feito teste com Audéo Smart III bilateral. Passei valores e não quis levar os aparelhos. Falou que esta fazendo pesquisa evai pensar. Esse paciente foi também na Bruna fazer orçamento.\n---------------------------------------------------------', 0, '', '', '2011-06-08'),
(719, 'fgo. daniel', 'Leticia ', '', '', '---------------------------------------------------------\nData: 23/07/2009\nTHAIS. CADSTRO ATUALIZADO. DEIXEI RECADO COM A ESPOSA.\n---------------------------------------------------------\nData: 07/04/2010\n22/02/2010 Comprou ap. Phonak Audeo V OD nº 0947X0GJ8     pilha 312\nValor total R$ 5.559,00 à vista\n---------------------------------------------------------\nData: 24/11/2010\nThaisa- Paciente deixou os 2 aparelhos para revisão da garantia\n---------------------------------------------------------\nData: 03/12/2010\nDébora: Paciente esteve na clínica e retirou aparelhos.\n---------------------------------------------------------\nData: 05/04/2011\nHora: 13:28:09\nFono: Tanara\nAssunto: Paciente veio para a 4 visita 1 ano de uso. Entregues os brindes. Falou que os aparelhos estavam baixos. Verifiquei protetor de cera entupido. Expliquei que deve ser trocado sempre que precisar ok. Aparelhos funcionando muito bem. Marcado o retorno em julho.\n---------------------------------------------------------\nData: 21/03/2013\nHora: 13:46:38\nFRANCINE - CONTATO TELEFONICO - AVISEI A ESPOSA QUE O AASI JÁ CHEGOU. VAI AVISAR O MARIDO.\nFeita ultima visita. Tudo Ok com aasis. Ofereci promoção de 20% para renovar o P.A. porém não quer saber de comprar aparelho tão cedo.\nDIA: 08/04/2010 COMPROU AUDÉO YES IX BILATERAL PILHA 312\nOD: 0952H03C5\nOE: 0952H03CH\nR$: 11.500,00\n03 ANOS DE GARANTIA \nNF: 305204 DATA: 05/04/2010\nI-COM: 0928F2JR3', 0, '', '', '2010-04-08'),
