uscar.\n---------------------------------------------------------\nData: 10/01/2012\nHora: 15:25:27\nFono: Tanara\nAssunto: Liguei e deixei recado com a esposa Ivete que o aparelho já chegou. Falou que assim que tiver dinheiro vem retirar. Falta pagar R$: 280,00.\n---------------------------------------------------------\nData: 25/01/2012\nHora: 10:14:13\nMichelle: Paciente retirou aparelho feito troca do amplificador+ assistencia técnica pago 280,00 retirou sem canhoto Ivete da Silva Santos\n---------------------------------------------------------', 0, '', '', NULL),
