(766, '', '0', '', '', '06/10/2014 - Zana\nPcte compareceu para testar, quis fazer teste domiciliar. Já fez teste em outras empresas, Otoclin, Telex e Microson, e achou o preço alto e tbm disse que em alguns lugares não gostou do atendimento.\nPassadas todas instruções sobre o caso e orientações.\nSaiu para teste com Audeo S Smart III, passei o valor de R$ 7.400,00 o par, sendo que podemos baixar até 7.000,00. Gostou bastante. \nFilha Ivete acompanhou o atendimento. Pcte bastante humilde.\nPossibilidade de fazer financiamento pelo BB.\n---------------------------\n14/10/2014 - Zana\nPcte compareceu para ajuste, estava achando ainda mto baixo, não sentindo mta diferença com e sem aparelho.\nAumentei ganho geral e saída e passei para 90%. Mexi em ajustes automáticos para corte de ruído.\nFicou de voltar em 1 semana para devolver, pois vai viajar e no retorno da viagem vai decidir a compra. \n---------------------------------\n', 0, '', '', NULL),
(768, '', '0', '', '', '08/10/2014 - Zana\nPcte compareceu para fazer molde OD - concha escavada em sil. Usa unilateral há mtos anos e não quer usar na orelha oposta. Cliente da Vitasons, mas não está mais satisfeito e qdo decidir comprar outro AASI irá nos procurar.\nVem adaptar dentro de 5 dias.\n-------------------------\n10.10.2014- Zana\nPcte veio retirar molde, aparentemente td ok, gostou bastante, disse que ficou bastante firme o vedado.\n------------------------------------', 0, '', '', NULL),
(769, '', '0', '', '', '13/10/2014 - Zana.\nPcte veio testar com Bruna, é pai de uma amiga dela...  tem perda unilateral, e saiu para teste domiciliar com Audeo S Smat IX - OE.\nSaiu com 70%. Difícil aceitação e mto vaidoso.\n------------------------------\n14/10/214- Zana\nVeio para regulagem, aumentamos ganho geral e passei para 90%.\nPassadas orientações sobre ruído. Mexi em ajustes automáticos.\n--------------------------\n16/10/2014- Zana\nPcte retornou para ajuste, achou que estava mto alto, pp as frequencias agudas. Refiz teste de microfonia, mexi na saída e agudos e ajustes automáticos. Se sentiu mto bem. Vai fazer uma viagem e dentro de 10 dias vem fechar a compra.\n---------------------------------------', 0, '', '', NULL),
(767, '', '0', '', 'paciente  retirou o aparelho oticon modelo vigo p  nº21695335 (sem conserto)', '', 0, '', '', NULL),
(770, '', '0', '', 'TAMPÃO', '15/10/2014 - Zana\nPcte compareceu para tampão em AO, escolheu cor verde.\nEstá em pós operatório, indicação do tampão Dra Fernanda Fasolo.\nVem buscar na sexta-f dia 17/10.\n------------------------------------', 0, '', '', NULL),
(771, '', '0', '', '', '16/10/2014- Zana \nPcte compareceu para A + T indicada pelo Dr Kowalski. Tem perda moderada, mas pcte  só quis orientações, não quis testar antes do retorno médico. Passei orientações de modelos, uso e manuseio. Indiquei a partir de 3 mil reais.\nEnviamos audio via fax para análise do Dr e, estamos no aguardo do retorno da pcte.\nNeta Beatriz acompanhou o atendimento.\n-------------------------', 0, '', '', NULL),
