--
-- Acionadores `ntic_os`
--
DROP TRIGGER IF EXISTS `tg_OS`;
DELIMITER //
CREATE TRIGGER `tg_OS` BEFORE UPDATE ON `ntic_os`
 FOR EACH ROW IF NEW.SITUACAO = 'Em analise' THEN

	SET	NEW.DTANALISE = now();

ELSEIF NEW.SITUACAO = 'Contatando' THEN

	SET NEW.DTCONTATO = now();

ELSEIF NEW.SITUACAO = 'Em andamento' THEN
	
    SET NEW.DTANDAMENTO = now();
    
ELSEIF NEW.SITUACAO = 'Concluida' THEN

	SET NEW.DTCONCLUSAO = now();

ELSEIF NEW.SITUACAO = 'Recusada' THEN

	SET NEW.DTFECHAMENTO = now();

ELSEIF NEW.SITUACAO = 'Finalizada' THEN

	SET NEW.DTFECHAMENTO = now();
    
ELSEIF NEW.SITUACAO = 'Aprovada' THEN

	SET NEW.DTAPROVADA = now();
    
END IF
//
DELIMITER ;

